INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('17219f29b89b4f2d9254e65301e8a1c0', '6373fec6e4d84db5ae7c64f6230502ce', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Free Loader Double Red IPA', 0, 0, 0, 0, '', 'Free Loader Double Red IPA was \"double-brewed\". [How''s that for a catchy term that those BiG brewers can''t TouCH. I love it, LoVe it, LOVE it.] The first batch of red IPA was mashed, sparged, and transferred to the kettle. The second batch of red IPA was mashed, sparged and transferred to the kettle using the sweet wort from batch one as its mash \"water\". Hmmm...using \"beer\" to make beer. Hence the name FREE LOADER. This Double Red IPA is just that--big, red, hoppy.');
