INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('17590cb735a14c87937f29289645edf5', 'cfca1af4f3824c479d6ef72e06b1b2f2', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Cherry Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('175aafd91e774b4bb2058b7a19960125', 'bfcb5792acea46178da58ab8e844869f', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Sprecher Pub Ale', 4, 0, 0, 0, '', 'Seven varieties of malted barley are combined to give this English-style ale its complex flavor and deep, brown color. A select British yeast culture adds a subtle fruitiness and a blend of choice hops gives this non-bitter ale a soft finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('17675f6f0e394b21a477b9bc2c40b516', 'e8801a3d8e1d48b993d7146c1ea4f00e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Genuine Lager', 5, 0, 0, 0, '', 'Originally introduced in 1992, Genuine Lager has evolved into a truly definitive Canadian Lager. Balancing a blend of quality aromatic and bittering hops with its medium body, Genuine Lager is a smooth, refreshing and easy-drinking beer with a subtle hop aroma and a hint of malty sweetness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('177497c5c9be4d17a9fd5a861883307d', '28ac277a9f864ef6b63a2d7ff32405d7', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Old Town Nut Brown', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('17758de602b54731b1a4596c5aed3650', '13e46693ec384f9183b40ee3a0560780', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Strawberry', 0, 0, 0, 0, '', 'Strawberry Harvest Lager is a wheat beer made with real Louisiana strawberries.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1782d5b336294d7493fa02eec5fe440f', 'f590cfabc78c4d6daaa1804eebe185c1', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', '1837', 7, 0, 0, 0, '', '1837 is a blonde beer that is slightly cloudy. It contains 7% alcohol and is refermented in the bottle. Following the brewing tradition of the great abbey beers, it is made with a blend of Quebec-grown raw wheat, lightly roasted barley and a hint of spices. It is a truly refreshing beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('178431e133b5480a9d11bbc3ef57b716', '11db376808e64df8bbcb94b3b4440a9d', 'b7ee8858a0b549ddb2361e1ed313f6e1', '2747adf8980546318186100ea198dbcb', 'Viszolay Belgian', 7, 0, 0, 0, '', 'Viszolay is a distinctly continental ale with a hint of the southwest. Belgian malt, Bavarian and Czech hops, and a secret blend of German and Belgian yeast strains provide this beer, inspired by the Trappistâ€™s Dubbel style ale, with a strong traditional base, while a hint of New Mexico wildflower honey infuses it with that ethereal quality that we New Mexicans simply call, â€œenchantingâ€. Like the Trappist ales from which it sprung, Viszolay is light and refreshing. The hopâ€™s subtle notes are overpowered by complex fruity flavors derived from the Belgian yeast, leaving Viszolay a very drinkable (yet rather potent) addition to the Santa Fe Brewing Companyâ€™s family of beers.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('17864342d77940a08bdf6c04baaaaaec', '048f9156b40a469781e7e19d6321d6b5', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Samuel Adams Boston Lager', 4, 0, 0, 0, '', 'Samuel Adams Boston LagerÂ® is the best example of the fundamental characteristics of a great beer, offering a full, rich flavor that is both balanced and complex. It is brewed using a decoction mash, a time consuming, traditional four vessel brewing process discarded by many contemporary brewers. This process brings forth a rich sweetness from the malt that makes it well worth the effort. Samuel Adams Boston LagerÂ® also uses only the finest of ingredients including two row barley, as well as German Noble aroma hops. The exclusive use of two row barley not only imparts a full, smooth body but also gives the beer a wide spectrum of malt flavor ranging from slightly sweet to caramel to slightly roasted. The Noble hops varieties, Hallertau Mittelfruh and Tettnang Tettnanger, add a wide range of floral, piney and citrus notes, which are present from the aroma, through the flavor, to the lingering smooth finish. We take great pride in the Noble hops used in our beers. They are hand selected by Jim Koch and our other brewers from the world''s oldest hops growing area. Among the world''s most expensive, they cost twenty times as much as other hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1787d9c606e84407aa773cee5d2bb578', '3b1cefedca8e475c9e620feb0df34abe', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Blind Salamander Pale Ale', 0, 0, 0, 0, '', 'Blind Salamander Pale Ale is the first of a series of Rahr beers\r\ncalled Rare Breed. These beers are dedicated to improving the lot of\r\nendangered Texas species. Rahr is making donations from these proceeds\r\nto the Texas Parks & Wildlife Foundation to help with the recovery\r\nof these species. \r\n\r\nThe Texas Blind Salamander is a rare cave dwelling troglobite amphibian native to San\r\nMarcos, specifically the San Marcos Pool in the Edwards Aquifer. It has\r\nbright red external gills for absorbing oxygen from the water. Its\r\nmature length is 5 cm and its diet varies by what flows into its cave,\r\nincluding shrimp, snails and amphipods. \r\n\r\nBlind Salamander Pale Ale is a blend of the finest pale malts and East Kent\r\nGoldings hops. The fine balance of these toasted caramel malts and\r\nearthy hops makes Blind Salamander an easy drinking and satisfying ale.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('17a00814c4ad4ee3811e73152793a1b0', 'd26d5c24741740f89a8385fa0c199558', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '0efc79b43f194933857739c6141a570b', 'Heather Ale', 5, 0, 0, 0, '', '2003 Silver medal winner herb and spice catagory Great American Beer Fest, made without hops, 100% heather flowers giving it a flowery aroma, subtle sweetness, and crisp, clean finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('17be9585f9fb4ffe8eea8661a6561f3f', '7bd3c9e042314a65aa752dbd60807b0e', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Arctic Panzer Wolf', 9, 0, 0, 0, '', 'A dry and stupendously hopped medium bodied Imperial IPA brewed with Canadian two-row malt, dextrose sugar and lots of American hops. Arctic Panzer Wolf has superior aromas of marmalade, white wine, pine and apricot all mixed with an intense American hop bitterness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('17ec49c4a4c942e18417e145425ac629', 'd45c85fe110c4911b17c5203df2246f2', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Prima Pils', 5, 0, 0, 0, '', 'Heaps of hops give this pale lager a bracing, herbal bite over layers of soft and smooth malt flavor. This refreshing combination of tastes makes Prima a classy quencher in the tradition of the great pilsners of Europe. Dry and delightful, this is an elegant beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('180b5de4c29d477093a4bd5a5703ae1c', '387f03355e29436597aee9e25a247c44', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'La Roja', 7, 0, 0, 0, '', 'An artisan amber ale brewed in the Flanders tradition.  Deep amber with earthy caramel, spice, and sour fruit notes developed through natural barrel aging.  Unfiltered, unpasteurized and blended from barrels ranging in age from two to ten months.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1812d3f70d0f4bcdbca6e296ff52016b', '2a58f7cedbe94fd9830ddb857dea9157', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Alaskan White Ale', 5, 0, 0, 0, '', 'Alaskan White Ale has a soft, slightly sweet base with the unique spice aroma of coriander and crisp, citrus finish of orange peel. A light and effervescent body combined with the smooth palate creates a complex and delicate beer that is deliciously refreshing in any season.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('18133f3cfa6342b495f22f53b6043caa', 'bef9879a815742129bf0170786802743', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'K-9 Cruiser Winter Ale', 6, 0, 0, 0, '', 'The psycho in the pack... K-9 Cruiser is a dark, sweet and malty winter warmer that will captivate any adventurous craft brew drinker. A true Flying Dog original, K-9 Cruiser is the perfect brew to warm you up in those cold winter months.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('18143b78953847fa906d31238beaf8a6', '343412b7c5de4ce5ac21dc63166abbdf', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Captain''s Reserve Imperial IPA', 9, 0, 0, 0, '', 'This beer is a salute to the ingenuity and creativity of the American craft brewers. A uniquely American style of beer, the Double or Imperial IPA, has become the calling card of many craft brewers who aren''t afraid to push the limits of what hops can add to a beer. This beer is big and hoppy - not for the faint of heart! Be prepared to experience sensory overload as you savor this Imperial IPA.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1819108a479842d3838e19e84f5e4bcd', 'df98eedf513f4f8a89341ee7e82e8ae6', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Heineken', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('181cd4e37a1b4b7ea31bd99993d8a8b5', '29e8f8978b92426283fed1fcf7dcb14b', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Hocus Pocus', 4, 0, 0, 0, '', 'Our take on a classic summer ale.  A toast to weeds, rays, and summer haze.  A light, crisp ale for mowing lawns, hitting lazy fly balls, and communing with nature, Hocus Pocus is offered up as a summer sacrifice to clodless days.\r\n\r\nIts malty sweetness finishes tart and crisp and is best apprediated with a wedge of orange.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1823d645748246d8bd7793a661a1c3ba', '52fd48365c874388bb19a4b1bb094b10', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Clipper Gold Hefeweizen', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('18249d313e524fb2b226784f02374c79', 'c5d43a6604a143b19cd221ba1979e3c7', '98b7246d5e1b4592b15adced83ab36d0', 'a6d4156030bc4d21a9825b11049e8425', 'Old Jubilation Ale', 8, 30, 0, 7, '', 'A winter strong ale with mahogany hue, a hint of hazelnuts and a finish reminiscent of mocha and toffee. No spices, just a perfect blend of five specialty malts.');
