INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('194df77a26b74e2aa96006f6da00ad47', '924f4d2594fe47a0a732a9e14bc24ad6', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Lawnmower', 4, 0, 0, 0, '', 'Lawnmower is our intro for those who need a little help jumping feet first into the crazy world that is Dogfish Head beer.\r\n\r\nIt''s a starter beer, but it''s not dumbed down. Lawnmower is made with quality ingredients and is a great thirst quencher - perfect to enjoy after a day in the sun mowing the lawn (or anything else that gets you hot and bothered)!\r\n\r\nDraft-Only, Limited Distribution');
