INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('198f9c7de8da46d8976617bb2b3df25b', 'be7d66fc42624f0484cd29faf5c3b4d9', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Celebration Ale', 6, 0, 0, 0, '', 'From the Sierra Nevada Brewing Co. website:\r\nThe long, cold nights of winter are a little brighter with Celebration® Ale. Wonderfully robust and rich, Celebration® Ale is dry-hopped for a lively, intense aroma. Brewed especially for the holidays, it is perfect for a festive gathering or for a quiet evening at home. \r\n\r\n');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1994ce87053f44c9bb031f900d54fcbb', '6e8b38e283cb4f87a958f00dbad901cb', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', '(512) Whiskey Barrel Aged Double Pecan Porter', 8, 0, 0, 0, '', 'Our first barrel project is in kegs and on itâ€™s way to beer bars around Austin. This is a bigger, bolder version of our mainstay Pecan Porter, with a richer finish. Two months on recently emptied Jack Daniels select barrels imparted a wonderful vanilla character from the oak and a pleasant amount of whiskey nose and flavor. All in all, Iâ€™m really proud of the hard work and effort put into this beer. Our first attempt at brewing it and our first attempt at managing barrels has paid off for everyone! Seek out this beer, but donâ€™t put it off. There is a very limited number of kegs available and it might go fastâ€¦');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('19a5186c54684a57b1861dda2593ad57', '3b1cefedca8e475c9e620feb0df34abe', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Rahr''s Red', 4, 0, 0, 0, '', 'Rahr''s Red is a delicious, medium-bodied red lager. Notes of caramel with a sound malt character. Not too hoppy, very smooth.');
