INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('19d7050c2dba4efe99c91b094c30a161', '4f78fc1b160d4be4b7aca6ee2e601a22', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Old 55 Pale Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('19d9d2c3ed6b4e65adc8550705b6b160', '7137c9cb29c54115b553ab53272b7bc0', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Mama''s Little Yella Pils', 5, 0, 0, 0, '', 'Mamaâ€™s Little Yella Pils - Our upcoming new canned good is a small-batch version of the beer that made Pilsen, Czechoslovakia famous. Mamaâ€™s is made with hearty amounts of pale malt, German specialty malts, and a blend of traditional (Saaz) and 21st century Bavarian hops. Our first canned lager, itâ€™s also fermented at cool temperatures with a German yeast.\r\n\r\nThis tasteful reality Czech is the perfect antidote for the watered-down versions of pilsner clogging Americaâ€™s shelves. And Mamaâ€™s gentle hopping (about 35 IBUs) and low ABV (just 5.3%) mean weâ€™re finally honoring consumer requests for a delicious but less-challenging beer. (Hey, we like a good low-dose session beer, too.) Look for our Gold Metal Winner on US shelves in March.\r\n\r\nSadly, the Feds rejected our â€œTake Two and Call Us in the Morningâ€ line on the can.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('19da31bff32c47edab58829f2abd7f54', '731b7a49baee4cccbe5db6c8e212c421', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Trifecta Belgian Style Tripel', 8, 0, 0, 0, '', 'There are hundreds of Trappist Monasteries in the world, many of them make fruitcake. This beer is not made by Monks nor does it resemble fruitcake. Furthermore, Truckee has no Trappist Monastery and that, my friend, is why we at FiftyFifty bring you Trifecta. This is one of FiftyFifty''s seasonal ales, and is a high alcohol Belgian style beer. Brewed with inspiration from Belgian Trappist Ales, Trifecta also includes locally grown Purple Sage Honey. With a complex spiciness tempered by the sweeter notes from the sage honey, flavors of spicy sage, alcohol, and mild malt sweetness are apparent, and sage and clove like aromas predominate. Coming in at over 8%, this beer is deceptively strong.');
