INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1a24021e892c4fe58aded2195fe71b09', 'bc73d3ab58f0435cbaec51be271475a2', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Anvil Ale', 4, 0, 0, 0, '', 'English style best bitter. It is a traditional English pub ale that is easy drinking, often referred to as a \"session beer\". It is medium-bodied and copper colored with a noticeable malt flavor up front that finishes with a hop bitterness and floral hop flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1a3acc4d562e434e972400d16c4823ab', 'ca206e17588140c9bcebe48e78865b89', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Ichabod''s Midnight Ride', 6, 0, 0, 0, '', 'This Belgian style pumpkin ale was inspired by the legendary midnight ride of Ichabod Crane. It is a Belgian style ale complimented by a light touch of pumpkin and spice. Fresh toasted pumpkins are added in the mash with the grains adding a touch of the season to the brew. The complex fruitiness and dryness of the yeast is enhanced by the addition of sugars during fermantation. The beer is lightly spiced with pumpkin spice, all spice, and brown sugar. The pale and toasted malts used, provide a pie crust taste and smell in the beer as the higher alcohol''s produced round out the finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1a69d0b2a43a48c5bd384843aa861f05', 'e02524749f0c42a5b88aa5dd6f17dac3', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Celebrator', 6, 0, 0, 0, '', 'Profoundly dark, rich elixir with a complex fruitiness of roasted malt and whole hop flowers. Semi-dry finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1aaef11592664edca06b34e8daa3ca04', 'eabf4f40165c48bd87da961394316153', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Otter Creek Russian Imperial Stout', 10, 0, 0, 0, '', 'The style was first brewed in England for the Russian Czar and it is the king of stouts. Plenty of big malt flavors- chocolate and roasted- and high alcohol with lower carbonation and mild hops. \r\nWe brewed this beer with double the malts and four times the hops of regular stouts!\r\n\r\nOtter Creek Russian Imperial Stout clocks in around 10% ABV- a beer to be savored responsibly. True to style, this beer will last for years so you may want to stock up on a few bottles for your cellar while it''s available.\r\n\r\nRussian Imperial Stouts pair well with creamy cheeses such as camembert (we recommend Vermont-made!), decadent chocolate desserts, or a hearty meal.');
