INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('062efb6b628c43c3ad725e767d892d21', '048f9156b40a469781e7e19d6321d6b5', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'cd3a63e3b16a44a89a64d0625aea2911', 'Samuel Adams Cranberry Lambic', 5, 0, 0, 0, '', 'Samuel Adams Cranberry Lambic is a fruit beer that draws its flavor not just from the cranberries it is brewed with, but also from the unique fermentation character imparted by the rare wild yeast strain. The result is a flavor rich in fruitiness and reminiscent of cranberries and bananas, cloves and nutmeg. The yeast fermentation also will create a slight sourness on the sides of the palate, a signature of the original Lambic style which, with the subtle cereal note from the wheat malt, remind its drinker that, as fruity a beer as this is, it is still a beer.');
