INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('087c53b0124c4efeaa336c72e2505ee7', 'f4b481b5e94045ef96e5f836e2ff6a7b', '98b7246d5e1b4592b15adced83ab36d0', 'd4e5211c1aa74e4592bc9899fd3659c7', 'Herb Superb', 6, 0, 0, 0, '', 'This India Pale Ale is brewed with English Maris Otter pale malt and Chocolate malt, giving it a dark color and is generously hopped with English Fuggles hops. Named for mug club member and brewery supporter Herb Caldwell.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0894ff854448412fa8e97a595b7e72aa', 'f743f04357824c41994f695c5034da14', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Rugged Trail Ale', 4, 0, 0, 0, '', 'Designed as our session beer, Rugged Trail Nut Brown Ale is bronze in color with a velvety smooth taste and subtle chocolate note. Rugged Trailâ€™s lower alcohol content and subtle hoppiness make it the perfect beer to enjoy during the day and into the night.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('089dabdb6a714693b37c859df788d530', '048f9156b40a469781e7e19d6321d6b5', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Samuel Adams Chocolate Bock', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('08a73a22dd1d4c48875303e987ca0c50', 'e8801a3d8e1d48b993d7146c1ea4f00e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Genuine Honey Lager', 5, 0, 0, 0, '', 'Genuine Honey Lager was introduced in 2005 in response to consumer demand for honey lagers. Labatt Genuine Honey uses genuine, all-natural, 100% Canadian honey to give consumers a softer, smoother taste. This naturally-aged lager is brewed to the same uncompromising standards applied to every Labatt beer. Genuine Honey Lager is the real thing!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('08b18a1a2b814ebbb512410653af3558', 'bb6220aafe344d69b0c5257b8677cc8a', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'D. Carnegie and Company Porter', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('08ba4be949374826b0c6c7e460239d0c', 'acab7f058e4240c48cc2af1c33bc4aff', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Liberty Nut Brown Ale', 0, 0, 0, 0, '', 'Styled after an English classic, this beer is brewed with American flair. Hearty brown in color and full-bodied, this beer has a distinct chocolate-malt finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('08bc5d29d1b14f279e19e060ba374dd9', '6745721021c14f36a490b65474f9933a', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Dundee Pale Ale', 5, 0, 0, 0, '', 'Behold the hop. A flower, but too unsightly to be used for decoration. The ugly duckling of the flower family. \r\n\r\nOh, but the secret it holds. Soak it in some water with the right companions and it surrenders its bouquet to use a corny flower metaphor. That unique hop flavor is the difference between a fine pale ale and more ordinary beers. \r\n\r\nDundee Pale Ale understands the secret of the hop flowerâ€”the power to turn an ordinary beer into something extraordinary. \r\n\r\nAnd the power to make you indescribably hoppy. \r\n\r\nA wonderfully balanced true pale ale. Cascade, Tomahawk, and Amarillo hops create a citrusy aroma with a smooth, crisp finish. A subdued malt character nicely complements the hop complexity and produces an orangey amber hue.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('08c0acb692f446f09ff97e26b7d2d2e2', 'b05b68c9de6249ffbd301582608fef6b', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Wipeout IPA', 7, 0, 0, 0, '', 'This one is dedicated to everyone who has gotten up at the butt crack of dawn, headed towards the shores and found it 4-6 feet and offshore only to find 30 of your \"buddies\" have already claimed the peak. As you paddle out, a swell arrives from nowhere signaling your turn to go. The surf Gods are shinning on you today. You turn, stroke like mad for the wave. Standing up you are alone and blammo you Wipeout....blowing the only chance of a right hander all to yourself. You know who you are. We''ve all been there too. It''s inside each and every one of us.\r\n\r\nWelcome to the waters of Wipeout IPA, a massively hopped India Pale Ale with enough substance and body to overcome even the worst and most tragic of on the water spills. We brew Wipeout IPA for everyone- especially those hardy souls who brave the cold winter water and monster sets produced by an amazing northwest swell. \r\n\r\nOnly a tidal wave of hops can overcome the surging tide of malt that is required to produce a beer of this shape. We invite you to drop in, hang on and kick out the backside. That is, unless you enjoy wiping out and all the glory that goes with it.\r\n\r\nMalts- Two Row, Wheat, Carapils and English Crystal Malts\r\nHops- Amarillo, Centennial and Simcoe \r\nYeast- White Labs California Ale\r\n\r\nOriginal Gravity- 1.064\r\nTerminal Gravity- 1.008\r\n7.0% ABV\r\n\r\nDraft- Available in Southern California and Arizona 22 Oz Bottles and Cases- At Port Brewing San Marcos and Pizza Port Carlsbad, San Clemente and Solana Beach and wherever better beers are sold.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('08d5bd6f0acd47af900adbcc5a8258eb', '243b8f4ff3b74c7dba16bd88933ee0cd', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Pipe Organ Pale Ale', 4, 0, 0, 0, '', 'When the British introduced draught pale ale to America, the Pipe Organ Pale Ale is what they had intended. It is truly British in character. Brewed with pale ale malt and a touch of caramel malt, it has a light copper color and subtle body. The maltiness is carefully balanced with only the best English hops - East Kent Goldings. Although this beer has a fair amount of hops, the caramel maltiness perfectly balances its profile.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('08f6b59c2fd74d25b01f6754c08e1f57', '55e794d5c07f4b51ac25f814827950bd', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'cd3a63e3b16a44a89a64d0625aea2911', 'Timmermans Kriek', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0917a855ab024822b7a6335eb24ce7f7', '06f1c8a9bb74470981730c2969378ee8', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Imperial Russian Stout', 10, 0, 0, 0, '', 'Brewed in the authentic historical style of an Imperial Russian Stout, this ale is massive. Intensely aromatic (notes of anise, lack currants, coffee, roastiness and alcohol) and heavy on the palate, this brew goes where few can --- and fewer dare even try. The style originated from Czarist Russia''s demand for ever thicker English stouts. Expect our version of this mysterious brew to pour like Siberian crude and taste even heavier!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('093ada2e5c004bf9bc844e9ced426d74', 'd642c636377f4655b2e15ee43f65dfb8', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Chazz Cat Rye', 4, 0, 0, 0, '', '');
