INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0964a746917d4d4ba5ca9914ee47af7c', '2081be0970544945b8d8405a2eec41c7', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Taddy Porter', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('09900ea8730e4b1c9808dfbff1c316cf', 'f5a6d81438b449b79e3e664be914d727', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Blackstone Stout', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('09991fa242854d1693aef89d5af56ce1', 'ca206e17588140c9bcebe48e78865b89', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Daddy Fat Sacs Imperial IPA', 7, 0, 0, 0, '', 'The one and only IPA that doesn''t leave your pallet with a bitter after taste. This beer took years of practice to get down and when we finally got it right, we knew it. The beer is made with three malts in considerable additions that leave it with a more malty and sweet taste. There are five different hop additions that were carefully planed out to impart just enough bitterness to give it the body and depth that it needed without leaving you with the astringent and bitter aftertaste. We then added a plethora of English flavor and aroma hops that round out the floral and citrus esters. With the beer being so well balanced between bitter and sweet, we than added \"big sacks\" of bittering hops to the conditioning vessel to impart all the wonderful citrus and floral notes deep into the beer while leaving the bittering aspects of the hop behind. The result was a beer that makes you want to nose dive right in complimented by the well balanced taste of this wonderful brew.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('09ca1c25eecb4e2a9203449873120e2e', '3d561c917afa4b269d50be1d34e2a774', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Alpenhof Baltic Porter', 0, 0, 0, 0, '', '');
