INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0a2109d65961464ebcfd6c61537810c7', '9006e9a1d946411ba058aca07339f326', 'b7ee8858a0b549ddb2361e1ed313f6e1', '2747adf8980546318186100ea198dbcb', 'Resurrection', 7, 0, 0, 0, '', 'During the fermentation of the first batch of this Abbey-style dubbel, the yeast \"died\" and was \"resurrected\" by brewer Chris Cashell. Made with five types of barley malt and lots of sugar, this beer is quite flavorful, without being too sweet.');
