INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0b7ccec8687843e0a47a85c32f7006b5', '29e8f8978b92426283fed1fcf7dcb14b', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Circus Boy', 5, 0, 0, 0, '', 'THE Hefeweizen.  Unfiltered and unfettered, Circus Boy is a unique and refreshing American-style Hefeweizen.  Is he a who? Or a what? Or perhaps some of both? \r\n\r\nBrewed with organic lemongrass.');
