INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0c1c214c082749858fab0f1400ea489f', '53171405c0a44fc5a7f781a7527c054e', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Standing Stone Saison', 0, 0, 0, 0, '', 'A Belgian \"seasonal\" ale brewed during winter for the spring and summer months.  This is a crisp, refreshing beer with hints of spice and fruit.');
