INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0c3340566f5b41889b19e110413746e1', '35b6541f343948159453d67551229eee', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Serpents Stout', 10, 0, 0, 0, '', 'The history of the bible and religion is indeed the struggle of good vs. evil. Our Serpentâ€™s Stout recognizes the evil of the dark side that we all struggle with. This is a massively thick and opaque beer that begs the saints to join the sinners in their path to a black existence. 10.5% ABV and available in 750 ml bottles and on draft at select locations.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0c3c0a653126428da2e2c6cdf446b33f', '7f067367245b4282867d1717c3519923', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'cd3a63e3b16a44a89a64d0625aea2911', 'Classic Gueuze', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0c5fea30beba4f42a1c4172374bd94cd', '924f4d2594fe47a0a732a9e14bc24ad6', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Palo Santo Marron', 12, 0, 0, 0, '', 'Palo Santo Marron (Holy Tree Brown)\r\n\r\nAn unfiltered, unfettered, unprecedented brown ale aged in handmade wooden brewing vessels. The caramel and vanilla complexity unique to this beer comes from the exotic Paraguayan Palo Santo wood from which these tanks were crafted. Palo Santo means \"holy tree\" and it''s wood has been used in South American wine-making communities. \r\n\r\nThis beer is a 12% abv, highly roasty, and malty brown ale aged on the Palo Santo wood.  It was a huge hit at our Rehoboth Beach brewpub when first released in November of 2006, so it''s coming back... into full production!\r\n\r\n At 10,000 gallons each, these are the largest wooden brewing vessels built in America since before Prohibition.\r\n\r\nClick below to watch \"Take Time,\" the short film we released with the first full-production batch of Palo Santo Marron in February 2008.\r\n\r\nIt''s all very exciting. We have wood. Now you do too.');
