INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0e3fa93c5110422c8c17255c2f41bbac', 'bef9879a815742129bf0170786802743', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'In-Heat Wheat', 4, 0, 0, 0, '', 'In-Heat Wheat Hefeweizen\r\nShe taunts and teases... In-Heat Wheat is our German-style Hefeweizen. She is a full flavor beer, perfect for the more adventurous craft beer drinker. The addition of malted white wheat gives this brew its smooth, full mouthfeel. A proprietary yeast creates intriguing flavors of bananas and cloves.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0e44f6f8a7a04ec4b38846130f65fd4d', 'c5d43a6604a143b19cd221ba1979e3c7', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'DuganA IPA', 8, 0, 0, 0, '', 'Lupulin Rapture Incarnate! As fervent Â devotees of hops, we found ourselves on a quest to create a transcendental IPA capable of quenching our voracious lupulin desires. Our mantra became \"unity of bitterness, hop flavor and aroma.\" Enlightened, duganA IPA was born: A brutally bitter, dank, piney and resinous ale designed for those seeking a divine hop experience.');
