INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0ea0a37a9bde4c1ea9fe72b6a11a9f71', '8500bd208607465e9985b4afcd2b2530', '98b7246d5e1b4592b15adced83ab36d0', '0b415ebb506c40848abff3554116e055', 'Brilliant Barstool', 5, 0, 0, 0, '', 'A true English session ale brewed in the pale ale style using ye olde techniques of yesteryear. Specially crafted to inspire you and your thirstiest mates barstool conversations. Light copper in colour. This pint is quite malty with just enough East Kent hops for a nice, earthy hoppiness. Naturally cask conditioned, this may be served a little cold for a true Brit but is a \r\ncomplimentary double nod to one of the 1st beer styles. Cheers mate!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0ea0abe728484e13a3868a83948ae9a9', '7d1f0597c5004271bd948776dc707e0b', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Mermaids Red Ale', 0, 0, 0, 0, '', 'A well balanced, medium-to full bodied beer, red in color and very flavorful. The red color and slight caramel-roasted flavor comes from generous amounts of caramel malts and a touch of chocolate malts. Well hopped to balance the malty sweetness, and dry-hopped with cascade for a full hop flavor and aroma.');
