INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0fa1cc3960604fb2a0ba414422646088', '16d6017aa4c44e608d09a925b9c956cf', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Goofy Foot Summer Wheat', 4, 0, 0, 0, '', 'This beer is lighter style and dry to the palate and with the distinct flavor of wheat makes for a perfect thirst-quenching beer. It is the ideal drink for beer drinker who appreciates tradition and personality in their beer, but also seeks a lighter, refreshing style, perfect for the summer months.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0fa81c7618a14f338aece0ed17ed2a58', 'bc73d3ab58f0435cbaec51be271475a2', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Vienna Red Lager', 5, 0, 0, 0, '', 'This amber Austrian lager has a distinct bready malt aroma and flavor, followed by a crisp, clean finish typical of lager styles. The nose also shows plenty of the spicy hop aroma contributed by the use of Saaz hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0fe260754d1a45ef97c34d4fba277fb2', '52f3cefa14f54331ba262b22f476f52c', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Golden Treasure', 4, 0, 0, 0, '', 'For those who enjoy a clean, crisp, refreshing beer this medium copper colored brew is perfect. With its low level of hop bitterness and slightly sweet flavor it is one of our lightest ales. We use the lightest grains with Kent Goldings and Liberty hops. This beer is an excellent choice for the not so brave.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0fe7495ba10740b5a96bddd54c6bd515', '591bfe5c4b0e4d5080899337cfc7a22b', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Acme California Pale Ale', 5, 0, 0, 0, '', 'This easy-drinking Pale Ale revives the name of one of the early icons of California brewing. Clean-tasting and pleasantly malty, Acme Pale is brewed with Yakima Valley hops, American two-row malt and British specialty malts for depth.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0ff7d5901e544e0c8c475c17a5eb67c4', '20f5693ca80c4c74a422a9dfa988e9a6', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Chamomellow', 0, 0, 0, 0, '', 'Chamomellow is an herbal golden ale infused with chamomile, which provides an enticing floral aroma. Chamomile is one of the oldest garden herbs used by ancient Egyptians and other cultures to battle illness, promote calm and relieve anxiety, hence the name Chamomellow. Dedicated to Caleb McLoughlin, a revolutionary brewer who created this elixir at Rogues Issaquah Brewhouse and won a Gold medal in the Herbs & Spice category at the 2003 Great American Beer Festival.\r\n\r\nChamemollow is created from Northwest Harrington and Klages, and Maier Munich Malts (18% speciality grains, .19 lbs grain per bottle). Kent Golding and Cascade hops, and infused with Chamomile. Available in a limited edition 22-ounce bottles (originally as Test Batch 1 - Gold Medal Series), and on draft at Rogues six Public Houses.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0ffa16919e6d47949bb232ade65e8df2', '74edc26599b04f5a944a8b5acbd629ba', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Drop Top Amber Ale', 5, 0, 0, 0, '', '\"A rich, flavorful Amber that''s smooth and easy to drink. Drop Top is fermented by an American Ale yeast to produce beer with a clean flavor and fruity aroma. The velvet texture is from using Honey malt and a touch of milk sugar. The Alchemy bittering hops provide soft bitterness. Simcoe, a newly developed hop variety, adds unique hop flavor and aroma. 2004 GABF Gold Medal Award Winner\"\r\n-Widmer Brothers Brewing Company');
