INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('107be0e55e484ef3b23ca4c3ccf2215a', '13e46693ec384f9183b40ee3a0560780', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '83bfc8344f4747d99b55eb2d1ade76f3', 'Honey Rye Ale', 0, 0, 0, 0, '', 'This beer is not very bitter which allows the flavors of the rye and honey to come through. The result is a full bodied, sweet, and malty beer.');
