INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('10802393eb954b0ab58832608002305a', 'ddc962506c724ae5bab8745e272d5570', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Sly Rye Porter', 5, 0, 0, 0, '', 'A rich, chocolaty English Porter with a clean finish. We use the finest floor-malted Maris Otter malts from England, the same malts used for the best single-malt scotch. A portion of malted rye gives a spicy, slightly dry finish.\r\n\r\nFood Pairings: The rich, chocolate notes pair well with the carmelized surface of steaks, pork tenderloins and lamb, but save this beer for dessert if youâ€™re having chocolate or crÃ¨me brulÃ©e.\r\n\r\nOG: 14.40 Plato\r\nFG: 3.8 Plato\r\nIBUs: 28\r\nSRM: 29\r\n5.7% abv');
