INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('10954c787d6548dba0b223fa6c85ad4b', '343412b7c5de4ce5ac21dc63166abbdf', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Sun Block - Belgian Style Witte', 0, 0, 0, 0, '', 'This beer was created as a summer thirst quencher, because we all know how hot and humid it can get in New York during the summer. We brewed this beer using both coriander and orange peel in the boil to increase both the aroma and flavor of this beer. Make sure you donâ€™t get burned this summer, drink your Sun Block.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('10a66069fe654ccfbc1c3d9594158d10', '20f5693ca80c4c74a422a9dfa988e9a6', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Hoppy Frog', 6, 0, 0, 0, '', 'A Northwest Style IPA. Nice Balance of Malt and Hops, not too extreme in either direction. 2 Ingredients: Maris Otter Malt, Amarillo Hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('10bc13b1a71f4b28bba78df5dffc3ac7', 'f590cfabc78c4d6daaa1804eebe185c1', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'La Fin Du Monde', 9, 0, 0, 0, '', 'La Fin du Monde has a brilliant golden color with vigorously effervescent foam.\r\nIt is midly yeasty with a complex palate of malt, fruit and spice notes followed by a smooth, dry finish.');
