INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('131fdd4b941e4caaaf1463ce54a5b5e9', '586b36c006c048efb522f39ed80bc6bd', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'SunRay Wheat Beer', 4, 0, 0, 0, '', 'The Sunray Wheat is a German-style unfiltered wheat beer brewed with a touch of local Georgia Coast Tupelo honey from the Savannah Bee Company.\r\n\r\nIts inviting banana and sweet clove like aroma gives way to a pleasant, clean finish with a hint of tartness.\r\n\r\nThis beer is available in the Terrapin â€œAll The Hitsâ€ Variety 12-pack as well as in individual 6-packs.');
