INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1349df2ecb814afb88e5a0d98110d0cb', 'b45a32490e6048c2864670f6b4609284', 'bf3112301857461f82c7633c0a695896', '98950448f00e4eb7b81ed9628258d643', 'Alt', 5, 0, 0, 0, '', 'Alt, German for \"old,\" is a traditional medium-bodied ale in which we use an array of the finest German malts & a generous smount of noble hops to produce a crisp, clean and refreshing \"bier.\"');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1358a2c2ca5347b094f8cabfedcd5586', 'ecb25aa2f6d2465eb596ce3e892332bf', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Double Eagle Brown Ale', 0, 0, 0, 0, '', '');
