INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('01d89d2676444f96ac7302f2d8c77cfb', 'c99ca2f0ebc14372b3bbf7bb4c6a5d66', '22710fa91bbf4454b94555720f6a33dd', '84bca21ce52244db83158e4971bd7866', 'Rickard''s Red Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('01d9df81193f420b818116ec243ce0c0', 'd8c82baf6cf6470ea9c3a89a27f33cb9', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Pugsley''s Signature Series XXXX IPA', 9, 0, 0, 0, '', 'XXXX IPA is a non-traditional American IPA with a brilliant copper color and the classic citrus nose of Cascade hops. This beer demonstrates a unique balance of malt-inspired, delicate red grapefruit sweetness and lingering hop dryness. The OG and final ABV provide the structure and body to balance the harmony of distinct flavours. Cascade, Warrior, Summit and Glacier Hops are used for bittering and Cascade Hops are added for dry hopping after fermentation. This hop blend is well balanced with Malted Wheat, Pale Ale, Crystal, and Caramalt Malts. To fully enjoy all the flavours, this ale is best drunk at 55 degrees Fahrenheit. This beer pairs well with Cajun dishes, blackened fish, and BBQ. XXXX draws its name from the British brewing convention of using Xâ€™s to denote style. 70 BUâ€™s, 1.092 OG, 9.25% ABV.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('01e0cd65c3d44ca89915138c3e1f937c', 'f6b4fa787e0a43418b88dcf6cf75b5ab', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Kilt Lifter  Scottish-Style Ale', 6, 0, 0, 0, '', 'Our award-winning Flagship ale is now in bottles!! This is an ale made in the tradition of the great strong ales of Scotland. Amber colored, malty sweet with underlying note of smokiness. \r\n\r\nAlcohol content approximately 6.0% by volume (ALWAYS ON TAP!!)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('01e4a3d16c6b4cd994670afe5fd6222f', '6373fec6e4d84db5ae7c64f6230502ce', 'b7ee8858a0b549ddb2361e1ed313f6e1', '055775d81abb4aa0a4bde8bf8bcaff92', 'The Viking Belgian-style Dark Strong Ale', 12, 0, 0, 0, '', 'SPECIAL COMMEMORATIVE BEER\r\n\r\nTo commemorate the life of a huge-hearted and long-time friend from the homebrewing community, Midnight Sun Brewing Company brewed a very special beer in honor of David Yanoshek, who was fondly known as â€œYanoâ€. \r\n\r\nThis big strong beer celebrates the abundant life of an incredible man with an enormous yet ever engaging laugh. Yano pursued life with a Viking spirit, endless love and boundless energy for family, friends, scoutsâ€¦and beer. \r\n\r\nA big strong beer for a big strong guy, The Viking Belgian-style Dark Strong Ale boasts a beautiful balance of character and complexity. Dark roasted malts, Belgian yeast, star anise and sweet-ripened raisins come together in an amazing ale that can be enjoyed now and cellared for later celebrations. \r\n\r\nAs you lock horns with this commemorative ale, toast to Yano. With his incredibly stoic spirit and his irrepressible laugh, Yano was the gentle giant who will forever touch our lives. PrÃ¶st! \r\n\r\nAll proceeds from sales of this beer will be donated to the Yanoshek family.\r\n\r\nAvailability: \r\nAK - 22-oz bottles (limited release begins 09/12/2008)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('01ecb9d6b3f34e08be2cf8805db59dd6', 'b6bf8680d5ee440c804c52c7b2f85bc7', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Rescue IPA', 0, 0, 0, 0, '', 'Hopped four separate times with pure Centennial hops for one of the hoppiest brews around. With a nice dry finish, Rescue IPA is our Mug Club''s favorite.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('01ff7b0460bc4048842787957e42f79c', '8788e692080745fb8e823bb61ca74a1e', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Baracktoberfest', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('020033c78a1842a490465e340bae22cf', 'c4d469ac8e7b4ecb9e6826e3c3089498', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Palm Speciale', 5, 0, 0, 0, '', 'Since 250 years Palm, a top-fermented amber beer, is brewed in the Belgian province of Brabant.  It has a soft, full and fruity taste.  It is only available in the Benelux.  In France it is known as \"Palm Belgique\" with 6% alcohol percent.');
