INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('024b1e864a7942e7ad8de8bae7f96e5f', '00ab074e7e55454b82e1b576f3385c21', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Big Buck Beer', 5, 0, 0, 0, '', 'A standard American-style beer and our flagship brand.  A small amount of corn is added to the grist to give the brew a smooth character.  Features a rich, golden color and a light malt character balanced with a mild dose of hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0257cae8a51f48289ad77ad303b83471', '119dbae0ea2c4d32908e89e9338f99fd', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Huckleberry Ale', 3, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('026341d2cb40467a880bac29c5ec3db3', '5d67eae726e743a8b01e413716761c64', '98b7246d5e1b4592b15adced83ab36d0', '0a4bb7119e2f41faa7b40acf63b2e0c6', 'Arthur''s Mild Ale', 3, 0, 0, 0, '', 'A British-style mild ale. Milds are a common ale type in England where session ales are lower in alcohol but not low on flavor. Ours has a strong malt backbone and is very quaffable.');
