INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('02acd6d1fd9c4725a9e981d06d0bcfda', '894593f13916499cb1c6f6f3a5fb3e69', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Pliny the Younger', 11, 0, 0, 0, '', 'Pliny the Younger was Pliny the Elder''s nephew, in the case of this beer, the \"Younger\" is a triple IPA. Pliny the Younger is hopped three times more than our standard IPA, and is dry hopped four different times.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('02c1a8743e3043d09b3b94c3d5e9a2cb', '83d11717c32e4192a014e92e810eb993', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Cambridge Amber', 4, 0, 0, 0, '', 'Well balanced, medium-bodied, with a deep amber-red color, this beer''s complex palate covers all the bases. A malty caramel sweetness is followed by notes of chocolate and a dry, slightly roasty finish, complemented by a touch of fruity, spicy hops.');
