INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('02db2fe4b5f7418e9a5edb962b5117a5', 'abe493cb583c405abfc022406c34cee4', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Pyramid Amber Weizen', 5, 0, 0, 0, '', 'Brewed by the original Wheat Beer Pioneers, Amber Weizen is left unfiltered for extra flavor and aroma. \r\n\r\nRich amber in color, Pyramid Amber Weizen features three different kinds of caramel barley malts and nugget hops resulting in an exceptionally smooth and well-balanced beer that follows in the tradition of our flagship style, Pyramid Hefe Weizen.');
