INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('02eec0c2a9b241b5a2ae5e8a5dd5ed32', '6373fec6e4d84db5ae7c64f6230502ce', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Descent Imperial Abbey Ale', 8, 0, 0, 0, '', 'Beer Description:\r\nThis deep amber Imperial Abbey Ale melds malt and earth, spice and fruit to create a wonderful vehicle to wind down the day. Belgian yeast contributes flavor notes that accent the raisins and grains of paradise used in the brewing process. With strength and stamina, DESCENT is deliberately impetuous in its mission.');
