INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('04243ab03dd04e5ca941f7262b202e37', '6d6e7ed036ce4d8c88c86678c9a13da1', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Allagash White', 5, 0, 0, 0, '', 'Our interpretation of a traditional Belgian wheat beer, Allagash White is unique and truly refreshing. Brewed with a generous portion of wheat and our own special blend of spices, this beer is light and slightly cloudy in appearance, with a spicy aroma. Overall, it is a beer that is very drinkable and smooth any time of the year.\r\n\r\n\r\n\r\nAvailable in: 12 oz and 750 ml bottles, 15.5 and 5.17 gal kegs\r\nABV: 5.0%\r\nOriginal Gravity: 1048\r\nRecommended Serving Temp: 34Â°F to 50Â°F');
