INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('044021ec3e774ff7979112ab7b46cccb', 'f4b481b5e94045ef96e5f836e2ff6a7b', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Barrel Aged Synapse ESB', 6, 0, 0, 0, '', 'Extra Special Bitter, or ESB, were the benchmark beers for British brewers to serve to their special customers. Brewed with British pale and crystal malt, this reddish copper beer finishes with a subtle dose of English Fuggles hops.');
