INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('045f79014bbc49fca031d68c12a26465', '7d1f0597c5004271bd948776dc707e0b', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Islandweizen', 0, 0, 0, 0, '', 'The Coronado ''Islandweizen'' is our version of an American-styled Hefeweizen or unfiltered wheat beer. It''s lightly hopped with Nobel Tettnang and Saaz hops to create a great full-bodied beer. This refreshing beer can be enjoyed with a slice of lemon.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0475be2a268145a2ab748dc31801f0cc', '64f0f210822c4f6d98fe94b6154d9ed0', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Four Alarm Alt', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('047737e1b09c4696a1e0973a4652578c', 'f1babdc560cf42e09c3862df6aa17805', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Gull Classic', 5, 0, 0, 0, '', '\"Aass Classic\" is a classical \"lager\" The beer is slightly darker in color than our Genuine Pilsner. It is of course produced in accordance with the \"Purity law\". \r\n\r\nThe malted barely is produced in the Scadinavian countries. It is a combination of pilsner-, bayer- and caramelmalt. We use the famous Sazer and Hallertau hops, and the water is as pure as the Norwegian nature. \r\n\r\nThe Classic is largered at cool temperatures, and it is allowed to mature for approximately 3 months before bottling. \r\n\r\nThe beer is sold in caracteristic nice looking green bottel containing 11.2 fl. oz or 330 ml.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('0484286c158d4bd08d5a14fd65406869', 'acf063f8cf0f4153a5712adbdb24c686', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('049015fc99274e1eb70e8da61e907896', 'b4724c113f634dd7a21151d616392a60', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Salvator', 7, 0, 0, 0, '', 'Paulaner Salvator, with its strong, typically malty flavour, is what you could call the \"original\" Paulaner. The bottom-fermented \"Doppelbock\" beer combines the finest hops and dark barley malt. The Paulaner monks used to drink Salvator as a food substitute during Lent. The most famous master brewer was Frater Barnabas, who took over the Paulaner monastery brewery in 1773. His original recipe remains practically unchanged to this day. In order to preserve the original, Paulaner registered the name \"Salvator\" with the patent office in 1896.\r\n\r\nSalvator:\r\n18.3% original wort; 7.9% alcohol; 70.6 kcal/100 ml');
