INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('04f6474593944c1484d91fe4a2e695c5', 'df3cc6f9b0e34daea76b844af935a87c', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Twisted Kilt Scotch Ale', 5, 0, 0, 0, '', 'Caramelized sugars lend a unique flavor and aroma to this lightly hopped, malty smooth, Scottish Export Ale.');
