INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('050e751785f9496194259bc56b8591c4', '8a0066befe3b4c94a0da0a9f5b639f6e', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Scotch Ale', 6, 0, 0, 0, '', 'Exceptionally smooth and thoroughly robust, Weyerbacher Scotch Ale has a deep delicious flavor that will warm you down to your wee little bones. Malty and roasty on the palate, and with distinctive caramel notes, this beer will satisfy the desires of any malty beer aficionado. \r\n\r\nWeyerbacher Scotch Ale is our interpretation of a beer style originating from Scotland, where the chilly damp weather calls for a hearty beer. Lacking the preservative powers of hops, scotch ales were brewed with high alcohol content to prevent spoilage. And at 8.7% ABV (alcohol by volume) Weyerbacher Scotch Ale definitely contains a warming belt.\r\n\r\nWe brew Weyerbacher Scotch Ale mostly in the cooler months of the year. Check out the Upcoming Events and Beers page for the next time it will be at a beer store near you.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('05165bb07cef40be927c9f595dba4da1', 'e8801a3d8e1d48b993d7146c1ea4f00e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Labatt Extra Dry', 5, 0, 0, 0, '', 'Labatt Extra Dry was the first national launch of a dry beer in Canada. Labatt Extra Dry is mashed longer than regular beers to leave less carbohydrate in the finished product, giving a lighter flavour with little aftertaste.');
