INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('05eeba7051bc40cc9c16e7c9804a492e', 'acab7f058e4240c48cc2af1c33bc4aff', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Liberty Pale Ale', 0, 0, 0, 0, '', 'This copper-colored ale has an intense bitterness and a floral hop aroma. Hops added during aging contribute to its distinct dryness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('05f2d9c99df04c98ba20e3a9b3761982', '731b7a49baee4cccbe5db6c8e212c421', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Rockslide IPA', 6, 0, 0, 0, '', 'If being in one of the coldest places in the US isn''t extreme enough, the contents of this beer may very well redefine your commitment to the pursuit of hops. Rockslide IPA is brewed in the ''West Coast'' style with aggressive amounts of American hops such as Amarillo, Centennial and Summit hops. You are greeted with a full frontal assault of citrus/grapefruit/pine hop character, followed up with malt to balance the mouthfeel. This beer is all about hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('05f722df1ad4475abf0b9a6a89c83b97', '810ee287c4dc4461aa29d7fee46fcf13', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Winter Ale', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('05ffb235f85d499793e2191596164e3b', '282d2200cabb4923a97daab4af52f023', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', '4 Seasons IPA', 8, 0, 0, 0, '', 'India Pale Ale is a wonderful example of marriage.  Bitter Hops and Boasting Barley come together to make one of the most sought after ales of the Craft Beer masses. Bottle Conditioned and Refermented.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('13fcf81fb5124d179edd43ca45826592', 'e8e6530d1c584680bade96ca2817a37f', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Winter Fest Beer', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('140dabbbddbe4528993ed152d28103a0', '0f7510696e5741af8d2b022828c386ae', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Kasteel Blonde', 11, 0, 0, 0, '', 'Slightly dangerous beer - tastes like an 8% blonde, delivers like nothing else. A little tart around the edges, due to the higher alcohol content, but otherwise a pleasant strong pils taste : not too much hop on the palate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('14100c54c695432aa8ffb6302675ad51', 'b45a32490e6048c2864670f6b4609284', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Abijah Rowe IPA', 6, 0, 0, 0, '', 'Traditional English India Pale Ale brewed with all English malt & hopped with a blend of English & American hops. High in strength, bitterness & aroma.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1439613d8478450b9d3bd210d289b194', '66c50bffcdcd4bb7b80ef27966940cf1', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'River Horse Lager', 5, 0, 0, 0, '', 'We mill the choicest two row barley malt in our 100 year old mill room for this all natural, unfiltered Lager. Lightly hopped, fermented slowly. River Horse Lager gets plenty of quality time with us before we pass it on to you.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('14429b78a24044de8fafaf2ba53bc2f5', 'c3f06ce635ee4eefbc33e6c206a31f44', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Union Barrel Works Pale Ale', 0, 0, 0, 0, '', 'A translucent amber-red ale with a moderately high IBU of 36. Bittering hops include Kent Golding and Cascade. A generous amount of Kent Golding is used in the dry hopping to further enhance the aroma.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('145194fa19ec4167aef9ea8e73f4e37a', '2ced7efcdb8c47e99356505adaa609b8', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Pale', 0, 0, 0, 0, '', '');
