INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('145de6808e2d4173bc74506311861980', 'df3cc6f9b0e34daea76b844af935a87c', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Labrador Lager', 6, 0, 0, 0, '', 'A Traditional German Lager brewed with all German grain & yeast. Very drinkable.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1464213114f845a295708f4ca7eed7ab', '5f280fa883124fac82d2c6c769d0e45e', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Hop Master''s Abbey Belgian-style Double IPA', 8, 0, 0, 0, '', 'American hops and Belgian abbey beer flavors intermingle to create a spicy and assertive beer style all their own. Citrusy character from select hops dominate this assertive Double I.P.A., complimented by a unique Belgian flavor to add complexity and ultimate beer satisfaction. The result is a flavor combination thatâ€™s a whirlwind of taste sensations.');
