INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('14f066ad012b4e2283dc7042ebd11071', '1a9e4f4f52454556b71ad5a28b6674b2', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Trade Winds Tripel', 8, 0, 0, 0, '', 'Our Summer seasonal, Trade Winds Tripel is a Belgian-style Golden Ale with a Southeast Asian twist. Instead of using candi sugar (typical for such a beer), we use rice in the mash to lighten the body and increase the gravity, and spice with Thai Basil. The result is an aromatic, digestible and complex beer made for a lazy summer evening.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('152577ffab844e67a090ea4c3a4c9d48', '25411aeab0f84ca7a6fba8e98ec6de1d', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Daas Organic Witte', 5, 0, 0, 0, '', 'The Daas Organic Witte is very well received by women beer drinkers; it is a naturally cloudy Belgian wheat beer. Its fruity blend of subtle citrus (baked oranges) and spice (coriander) flavors compliment its crispy dry and bitter hop finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('152c0c1ac8d84083954fef68bbcbebe4', 'ecbfbc639150435191d6af029ff71bd7', '22710fa91bbf4454b94555720f6a33dd', '84bca21ce52244db83158e4971bd7866', 'Celtic Rose', 5, 0, 0, 0, '', 'Our version of the traditional Irish Amber Ale. This beer combines the richness of German and Austrian malts with the delicate and spicy British hops for a taste worthy of the Red Rose City.');
