INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('15d71be56dad477995914fb97b65a582', '35b6541f343948159453d67551229eee', 'e64b30f392b4437b82ec46e764453ac1', 'f0821cb45038450ea4d7fad8e5af7cf8', 'The Angel''s Share - Bourbon Barrel Aged', 12, 0, 0, 0, '', 'own in Kentucky and across the pond in Scotland, distillers who age their whiskeys for many years refer to the evaporation of the spirits from their barrels as \"The Angel''s Share.\" We couldnâ€™t agree more. Each time a barrel is filled, a measure of liquid seeps into the oak and is lost for good.\r\n\r\nThis striking Strong Ale is brewed with copious amounts of Caramel malt to emphasize the vanilla and oak flavors found in freshly emptied bourbon or brandy barrels. The beer spends a year in oak before it is packaged for release. The beer is 12.5% ABV and is available in 375ml and 750ml bottles and on draft at inspired locations.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('15db6e8ee4ae431e8046a8a16823c588', '825a3a23466f40d5908f7a6ebd636de2', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Altruistic American Ale', 0, 0, 0, 0, '', '');
