INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1672b4780eb14a0d9167d3227b3b15de', '2b826ba7692948dd881f973d746d2b58', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Skinny Dip', 4, 0, 0, 0, '', 'Ever tried a Skinny Dip? You wouldn''t be alone. Featured by both Men''s Journal and the Today Show as a favorite summer brew, this full-bodied, highly drinkable beer makes a splash every summer in our Seasonal line-up. Cascade hops frolic with a hint of lime leaf, giving the beer complexity that''s surprisingly refreshing.');
