INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('169c6c70601f4b23acc2a58430218921', '0c00953514b0476693ba04311e03db7d', 'bf3112301857461f82c7633c0a695896', '470eefadc34742e680972815eaf47815', 'Oktoberfest', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('169db2339e1b4eda8586144f8e1c0bdc', 'b65808eb74e74797ad9375fc1a220b9b', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Smuttynose Finestkind IPA', 5, 0, 0, 0, '', 'Portsmouth is a colonial era seaport town, so it goes to follow that sooner or later we''d brew an India Pale Ale as a tribute to those big, hoppy 19th century ales that made the long sea voyage from England''s temperate shores, ''round the Cape of Good Hope, to the sultry climes of the faraway East Indies.\r\n\r\nBut there''s another reason we brewed this beer, one that''s closer to our home and hearts. Hopheads. \r\n\r\nTen years ago we brewed our first batch of Shoals Pale Ale, our American interpretation of the traditional British ESB (Extra Special Bitter) style. At the time, it was widely considered to be darned hoppy. However, a funny thing happened over the last decade - our Shoals Pale Ale didn''t change; beer lovers did, and we started to hear more and more: â€œWhy don''t you guys make a really hoppy beer?â€\r\n\r\nYou could say, then, that Smuttynose IPA is a physical salute to the glory of the American hop grower. The citrusy hop flavor coming from a mixture of Simcoe and Santiams is pleasantly balanced by a smooth bitterness from the Amarillo hops. The beer itself is light bodied and crisp with a golden color that will throw a slight haze, as we bottle it unfiltered. At 65 IBU''s, this is definitely not a training-wheels IPA, but is meant for hop lovers looking to satisfy their craving in a way that''s not easy to find. We think theyâ€™ll be quite pleased.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('16ad0704b9a94777a7aa7adc199eff66', '41e6981906da452f81ca52289fc44dd0', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Ranger Red', 0, 0, 0, 0, '', '');
