INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('16b1551d3fc54d0a98151c9d5086258c', 'bef3198dea9243d09ed8b09b5f8cdf53', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Piels Draft', 4, 0, 0, 0, '', 'It took â€œThe Beer Drinkerâ€™s Beerâ€ to introduce a real draft in a canâ€”and you can still taste that milestone in brewing history today with every can of Piels. Our Draft Style delivers unsurpassed flavor and character like it was drawn straight from the tap!');
