INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('16b86c5755034da9927043f27a17fd2b', 'ddf86b22ce3149be9fff402436ad70d0', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'St. Bernardus Witbier', 5, 0, 0, 0, '', 'This traditional Witbier (Wheat beer) has been developed in cooperation with Master Brewer Pierre Celis, the Godfather of Hoegaarden and Celis White. \r\n\r\nThis beer as well has a second fermentation in the bottle, giving this beer its specific taste (5.5% alcohol content).');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('16bb72e2cec949ea94c56085d64654b7', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Michelob Light', 4, 0, 0, 0, '', '\"Michelob Light is a full-flavored and rich-tasting light lager offering a malty sweetness and aromatic hop profile\"');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('16bdec792cc244bfbe2eaf5b1e5fce56', '70b7bbf10ef4416da5715c8b7da19879', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Fall Festivus Ale', 4, 0, 0, 0, 'thumb-festivus.png', 'Our Fall release is a harvest Ale with a lighter amber color and a beige head with good retention. There is a good balance of earthy malt and a blend of floral and pine hops in the nose. Biscuit notes mixing with caramel sweetness.do their job to complement the rest of the flavors.This is an enjoyable seasonal for sure!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('16c02885d2024ef28c108fa571ace8f8', '3a09f973aa9a4b6bbfd27b54374bc96e', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Im Paled Ale', 6, 0, 0, 0, '', 'A complex and artistically balanced multi-layered IPA (India Pale Ale) with an intense finish of cascade hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('16c99c456eb14f5197f83b999db650e6', '115ae1850bda42b880b7ffa53d6fd13c', '98b7246d5e1b4592b15adced83ab36d0', 'dde08a23bc764388a0571b10d486b6e7', 'Double Chocolate Stout', 5, 0, 0, 0, '', 'A rich, creamy stout with roasted chocolate flavors. A perfect dessert beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('16dab3c440134002ac053cf7ad813bf9', '9ee99dc929de419196bbe5b9243bec26', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Haywards 5000', 7, 0, 0, 0, '', 'Country of origin:  India \r\nBeer type:  Lager  \r\nAlcohol content by volume: < 7.5% by volume  \r\nCarbohydrates: - \r\nTaste:  full bodied malty flavour  \r\nMalts:  Indian malts, 6 row barley  \r\nHops:  German hop extract (CO2) & Indian hop palate  \r\nColour:  Golden yellow  \r\nAvailability:  India - all seasons, South East Asia, Middle East and Europ \r\nFermentation process: Bottom-fermented  \r\nServing temperature:  7 - 9 Â°C  \r\nPackaging:  650 ml and 330 ml Indian standard glass amber bottle ; 500 ml Non returnable bottles ; 500 ml cans and 330 ml cans ( in select markets) \r\n \r\nhttp://www.sabmiller.in/brands_haywards_5000.html');
