INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1b592dd679a740ebaa330f19aae108b9', '82deeffdc0bc4a93b168e5a4a9473675', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Hefe Weissbier', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1b795aab9e0d4b56870bc23187840869', '5f280fa883124fac82d2c6c769d0e45e', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Hop Dam Triple IPA', 10, 0, 0, 0, '', 'Some say â€œbigger is better!â€. At Hoppinâ€™ Frog, we built a massive hop dam to handle the enormous amount of hops added to this colossal American Triple I.P.A. An intense experience of citrus and piney hop character is complimented by layers of rich malt flavor. Behold our new standard for hoppy beers.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1b8e50dbf07440a098e9b5dc19b4f4af', '5d67eae726e743a8b01e413716761c64', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Spring Creek Lager', 5, 0, 0, 0, '', 'A Vienna-style lager with a smooth malt palate and a dry finish. ABV 5.2%');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1b91e2d4a00d400e95396cb28c6809aa', '7552cdfbefbd429e909c960272802c28', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Chinook Amber', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1ba61c129f5644d0881e6e350e0ee24d', '924f4d2594fe47a0a732a9e14bc24ad6', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'Raison D''Extra', 20, 0, 0, 0, '', 'A bigger, bolder version of our Raison D''Etre.\r\n\r\nThis is a bulbous, brown ale brewed with a bunch of malt, brown sugar and raisins.\r\n\r\nIn case you care... the average 12 oz. serving has approximately 425 calories.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1bb9b8c7fcb84d1ab6572eefa02cb895', '2a58f7cedbe94fd9830ddb857dea9157', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Alaskan IPA', 6, 0, 0, 0, '', 'India Pale Ales are characterized by intense hop flavor and aroma accompanied by higher alcohol content. This style possesses medium maltiness and body while also being crisp and dry. Citrus flavors and aromas are moderate to very strong.\r\n\r\nAlaskan IPA is honey gold in color with a fruity, citrus aroma. An enticing blend of hops and our dry hopping process, in which hops are added directly to tanks during fermentation, give this brew a very intense, complex aromatic character with a refreshing hop finish.\r\n\r\nAlaskan IPA is made from glacier-fed water and a generous blend of the finest quality European and Pacific Northwest hop varieties and premium two-row and specialty malts. Our water originates in the 1,500-square-mile Juneau Ice Field and from more than 90 inches of rainfall each year.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1bb9fc8f13314214abdd61e625584835', '591bfe5c4b0e4d5080899337cfc7a22b', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Acme California IPA', 6, 0, 0, 0, '', 'Acme IPA is profoundly hoppy, finished with over a pound of fresh whole hops per barrel. The result of this generous hopping is a beer that is deliciously dry, and eminently drinkable in spite of its apparent strength.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1bcc242307d84251ba8c7ae584f881ea', 'c0a1c4528b7443e1bd86f92f75f4ab0d', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Oatmeal Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1bf8ae62e018412e96e3ce7afd3f2a0d', 'f773b893039e4b3894d2dc8e61a8beae', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Rocky''s Revenge', 6, 0, 0, 0, '', 'Deep in the darkest depths of Rock Lake prowls a great saurian known today as Rocky.  The legend of Rocky is old.  The ancient inhabitants of Aztalan warned of the beast by building a giant serpent mound at the lakeâ€™s edge.  The early residents of Lake Mills were forewarned of a guardian placed in the lake to protect its sacred stone tepees.  And history tells of numerous encounters with Rocky, who became a source of great worry and fear.  Although not seen for over a century, divers still experience a feeling of dread and being watched.  Enjoy Rockyâ€™s Revenge, our offering to this legendary protector of Tyranena.\r\n\r\nRockyâ€™s Revenge is an American brown ale with a portion aged in bourbon barrels.  Each bourbon barrel will contribute its own unique character to this rich, satisfying ale.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1c007e07e0b547e88cf2d2a782f4c9e4', '32629f72e41245c7b98912e872917b62', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Java Stout', 7, 0, 0, 0, '', 'The satisfying elements of both stout and coffee come together in this full-bodied treat. A marriage of Sumatra''s best with rich chocolate and roasted malt provides for a truly enlightening beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1c111239b16945689a3cdece0bd69311', '5f280fa883124fac82d2c6c769d0e45e', 'b7ee8858a0b549ddb2361e1ed313f6e1', '3a8d4356f46746979884c04ffd896fbe', 'Gulden Fraug Belgian Ale', 10, 0, 0, 0, '', 'Smooth malt flavors of this golden Belgian-style abbey ale are complimented by traditional imported ingredients. A slightly spicy and complex flavor makes this European celebration-style beer unique and refreshing');
