INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1c52f02eb70146c9972cf9625d2b038d', 'fbd55e8202a24c03a5a4748b4d56d835', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'JoBoy''s IPA', 6, 0, 0, 0, '', 'This is our offering to the hop heads! A decidedly hoppy, bitter, and moderately strong American IPA. We use a generous amount of whole leaf Cascade, Centennial and Citra hops to showcase the freshness and earthy flavors that only hops can provide.');
