INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1d7a86fb095741369916fd6f39741ed7', '70b7bbf10ef4416da5715c8b7da19879', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Circket Hill American Ale', 0, 0, 0, 0, '', 'Our American Ale is a favorite everywhere - an amber ale with a wonderful balance of caramel sweetness and hop flavor. The aroma has a slight note of citrus and rock candy. There is not an imported Ale on the market that tastes this fresh!');
