INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1e04162cd7224e73ac58a2c54b1012f2', '94b2e7e841504f858034cf078e80a792', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Mokah Imperial Blended Stout', 11, 0, 0, 0, '', 'When empirical and creative impulses collide, the result is often timeless. The classic utility-art aesthetic of the coffee maker is an example of design and engineering working in concert. \r\n\r\nIt is through similar cooperation that the simple bitter cocoa bean is transformed into a sweet treat. As scientists, our brewers utilize their materials to exacting standards. As artists, they couldnâ€™t resist the temptation to combine two of our highly acclaimed Blackwater Series Imperial Stouts: Jahva and Choklat. Alone each is perfect, but together as Mokah they are an inimitable expression of two of the worldâ€™s most sought after flavors. Enjoy Mokah stout with â€“ or as â€“ your favorite dessert!\r\n11.0% abv â€¢ 27Âº plato â€¢ Imperial Stout Brewed with Coffee & Chocolate â€¢ 22 oz / 1/6 keg\r\n2-row pale malt â€¢ 2-row barley â€¢ caramel, chocolate & black malts â€¢ roasted barley barley flakes â€¢ Jamaican roasted coffee â€¢ bittersweet Belgian chocolate â€¢ chinook, willamette, cascade & columbus hops');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1e15a3c10f5d44489598c93be73b8d25', '47a3de1b57274a59b0ff59c5d112c6d5', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Saranac Extra Special Bitter', 5, 0, 0, 0, '', 'Bitters are popular pub beers in England and are closely related to the more well known pales ales. Saranac Extra Special Bitter has a rich, malty taste balanced by the pleasant bitterness of Williamette Hops. The finish is dry with a hint of the Foral English Fuggle and Spicy Saaz hop. Enjoy!');
