INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1e5085fffb2e4a28ac4b43ed6698a177', '226bc87deeea4f1fb202a68ed4c2ac81', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Fallenbock', 7, 0, 0, 0, '', 'History states that the first Oktoberfest was on October 12, 1810: For the commemoration of the marriage between Crown Prince Ludwig and Princess Therese of Saxe-Hildburghausen. Keeping up with Erie Brewingâ€™s German brewing influence, our brewer creates Fallenbock, a classic Oktoberfest lager that is a harmonious marriage of classic malts and hops that has a wonderful clean and crisp flavor to celebrate Autumn and Oktoberfest.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1e550f5be5d74cfdb62939ade13e4782', '318e9662a5324fc7803ed867cdb32538', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Rat City IPA', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1eff4ce4528a4434bc5c001a24b42e0e', '2fb4a6449fac4707870515de99b10bb4', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Burning Bird Pale Ale', 4, 0, 0, 0, '', 'The Burning Bird is our representation of the Phoenix, our cityâ€™s namesake, a mythical bird which lived 500 years, consumed itself by fire, then was reborn from its ashes. Like the phoenix of old, this pale ale is reborn from the time when fabulous hoppy brews were more than mere myths.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1f04db0d09e94453bfbe0482618df90a', '06f1c8a9bb74470981730c2969378ee8', 'b7ee8858a0b549ddb2361e1ed313f6e1', '09d8eece1bb941ca8df9621a1c6dd025', 'Vertical Epic 10.10.10', 9, 0, 0, 0, 'stone-verticalepic101010.jpg', 'Fermented with the legendary Ardennes strain of Belgian yeast, 10.10.10 is a Belgian Strong Pale Ale brewed with pale malt and triticale (a cross of wheat and rye), hopped with German Perle hops, and steeped with chamomile during the whirlpool stage. In secondary fermentation, we added a juice blend of Muscat, Gewurztraminer, and Sauvignon Blanc grape varieties.');
