INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1e8f25d29b0247f283ca62daf8ecc940', 'f1babdc560cf42e09c3862df6aa17805', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'JuleÃ¸l', 5, 0, 0, 0, '', 'The Norwegian JuleÃ¸l can be traced back more that 1000 years. The \"Gulatinglov\", one of the first Norwegian laws written in the 9th century, has a chapter on brewing beer for the midwinter celebration in January. The festivities were held to celebrate the Norse Gods; Odin, FrÃ¸y and Njord as well as the \"return\" of the sun.\r\nFurthermore, the tradition was adopted by the Vikings that brought Christianity to the country between 1000 and 1100. They moved the tradition to December in connection with the birth of Jesus. \r\nIn those days a farmer that did not set aside the best crop to produce the beer could lose his house to the king and the church. The law has been changed, but we promise you that we still use the very best of malt, yeast, hops, and pure Norwegian water to produce our Christmas beer.\r\n\r\nAass JuleÃ¸l has won most of the Norwegian JuleÃ¸l taste test conducted over time. For those of you that know what \"lutefisk\" is, Aass JuleÃ¸l is the perfect choice of beverage to this traditional Norwegian dish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1ea3ae5117dc4bc68d1370ebd217260c', '1a9e4f4f52454556b71ad5a28b6674b2', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Saison De Lente', 6, 0, 0, 0, '', 'Our Spring Saison is light blonde in color with a fresh hoppiness and a wild and rustic Brettanomyces character. Lighter in color and alcohol than our Saison Rue, yet equally complex in its own way. Perfect for warmer weather and Spring celebrations.');
