INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1edede5af66749ea9595bc18bb4cd4dc', '3c1a29f6db284abda8d558a43582ba35', '98b7246d5e1b4592b15adced83ab36d0', '1c20aafad8964ed4a7626ef53934000a', 'NÃ¸gne Ã˜ Bitter', 4, 0, 0, 0, '', 'A light session ale, with an assertive hop aroma of E K Golding.  Great beer to pair with lots of different food - a good allround.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1f2be70343fc444fb527a1df3da15e67', '6487c70165aa48038841d23c930e1a80', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Crosstown Pale Ale', 5, 0, 0, 0, '', 'This beer bridges east and west with a lane dedicated to riders who aren''t afraid to get dirty. Three kinds of organic caramel malts and a 24 pound whirlpool hop bomb keep things interesting while the wheels go round and round. Cheers to narrow knobbies, kazoos, and more cowbell!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1f52ea29d058433284b48d126b4581f9', '586b36c006c048efb522f39ed80bc6bd', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '45f372212a6948b7ba624c5c474c4b9b', 'Terrapin Golden Ale', 5, 0, 0, 0, '', 'Terrapin Beer Company was started by two guys who love big, bold beers. We are known for using a ton of flavorful ingredients and for pushing the envelope with the brews we create.\r\n\r\nWe have also been known to take pleasure in hiking, biking, kayaking, and just plain having fun in the great outdoors. When we get hot and sweaty even hopheads like us want nothing more than to enjoy a beer that is crisp and refreshing.\r\n\r\nWhich is why we created the perfect session beer â€“ the Terrapin Golden Ale.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1f7cd04836894f8b87321fc4c1a0a3fb', 'f743f04357824c41994f695c5034da14', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Scratch #6 2007', 5, 0, 0, 0, '', 'Old world brewing techniques combine with Noble hops for Scratch #6-2007.\r\nThis Export Lager features a single stage decoctionâ€”a first for TrÃ¶egs Brewery. After combining barley and water we transfer a portion of the mash to the brew kettle for a quick boil. The heated mash is then returned to the mash kettle and the brewing process continues. This process deepens the malt character and adds a subtle toffee backbone to this delicious lager.\r\n\r\nWeâ€™ve added Magnum hops for bittering and Czech Saaz hops for aroma to create a classic European Noble hop flavor. \r\n\r\nScratch #6-2007 is unfiltered, so there will be a slight haze to the beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1f8a9e63b38c4d42b79e0281e0c44252', 'cdafaf89b3d14193a41c9a2be4b2b29d', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Twilight Ale', 5, 0, 0, 0, '', 'Stretching the longer summer days into Twilight!  There is something magical about the time of day that falls between light and dark, the high-desert summer day fading into a warm evening with brilliant skies.\r\n\r\nTwilight Ale is a lighter, but full flavored ale with a balanced malt profile and a harmonious blend of four hops.  A final dry hopping of bold Amarillos creates the distinctive finishing touch.  Twilight is best enjoyed when chilled and consumed outdoors.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1f940489ef2849878f828c9f234152a0', 'c1f15aa32e9d4e74a8b8181783ee357d', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'MoJo India Pale Ale', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('1f9dae79cc7049408d0f600900b5dbc5', 'b2f2a876df4b4a0685b89d50828c8ff7', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Ugly American', 7, 0, 0, 0, '', 'THE UGLY AMERICAN is a perfectly enjoyable classic Belgian Trippel corrupted almost beyond recognition with a completely inappropriate amount of US hops. Only in America can such excessive excesses be fully appreciated, celebrated, and enjoyed...and for now, only at East End Brewing! To make this one a little more cellar-able, and a lot more portable, it''s going into the bottle.');
