INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2012bb29ab5a46ddadd368e80b1beb5c', '04ddc6e0bc4b4a7eb1140b3b1c7286be', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Richbrau India Pale Ale', 6, 0, 0, 0, '', 'A hops showcase in aroma, flavor and bitterness. We used the delightful Amarillo hop as the most prominent choice.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('202de05d7335490182cb37b3ba997e37', 'de1ae8c58b2b4803964d368be6d90dd7', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Mud Puppy Porter', 0, 0, 0, 0, '', 'A robust, yet surprisingly refreshing porter, Mud Puppy is a favorite of dark beer lovers. Characterized by a thick, rocky head and luscious chocolate-like nose, the malty profile is balanced by liberal hopping for its style.');
