INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('225240ad1ed14cd1b422d716d60571c0', 'f773b893039e4b3894d2dc8e61a8beae', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Stone Teepee Pale Ale', 5, 0, 0, 0, '', 'The legend of Tyranena began 3,000 years ago, with a group of pyramids and effigy mounds constructed in a remote valley formed by a vast, slow-moving glacier.  \r\n\r\nToday, these ancient \"stone tepees\" lie 60 feet below the surface of Rock Lake in Jefferson County, Wisconsin.  No one is certain how or why they were built, but many have speculated on their origin, purpose and the people who built them.  \r\n\r\nWe invite you to develop your own theories on the legend and mystery of Tyranena while enjoying a Stone Tepee Pale Ale.\r\n\r\n Stone Tepee Pale Ale is brewed in the tradition of an American pale ale.  This beer celebrates the American hop, with its characteristic bitterness, flavor and aroma.');
