INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('22add98d88c1414fa34a7dca47d66153', 'b65808eb74e74797ad9375fc1a220b9b', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Robust Porter', 5, 0, 0, 0, '', 'This hearty, mahogany colored ale is brewed to evoke the dark, full-bodied ales that were a favorite of dockworkers and warehousemen (hence the name â€œPorterâ€) in 19th century London. It is a good bet that when Dickensâ€™ Mr. Pickwick sat down for a pint, we would have been drinking an ale much like our Robust Porter.This is a smooth and very drinkable beer, characterized by its well-balanced malt and hops, plus subtle notes of coffee and chocolate.');
