INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('22d1041f93e64b7baeef26648209a7aa', '3d80398428f9495ebe0f9b1acf0a6295', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Climax Barleywine-Style Ale', 10, 0, 0, 0, '', 'Brewed for our 10th Anniversary, the Barleywine is a bottle conditioned ale that''s meant to be laid down and enjoyed for years to come. Up front it has a hop nose and hop flavor on the tongue that fades into malty overtones with flavors of vanilla that go into chocolate. As it has aged, we''ve noticed flavors of dates and raisins as well.');
