INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2345af9f83da4ba080490df758c78617', '65ab7a9116df4270a74ea9cca5f41e5d', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Princess of Darkness Porter', 0, 0, 0, 0, '', '');
