INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('261572d3d5ac4792a41bb913a9fa0b40', 'f6b4fa787e0a43418b88dcf6cf75b5ab', 'bf3112301857461f82c7633c0a695896', '98950448f00e4eb7b81ed9628258d643', 'Alt Ball and Chain', 5, 0, 0, 0, '', 'This beer was brewed in honor of our brewer Melissa''s wedding to fellow brewer Derek Osbourne of B.J.''s in Chandler. The Alt Ball and Chain is a German Altbier. These beers are generally full-bodied with sweet malt flavor. The crispness, dry finish, and moderate hop aroma make an alt a great beer for summertime enjoyment. Our Alt has been lagering in our cellar for two weeks and contains 5.2% abv.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('261bc39b0ae64b4ab0444606e9f2d895', 'f590cfabc78c4d6daaa1804eebe185c1', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Blanche de Chambly', 5, 0, 0, 0, '', '(White of Chambly) was the first bottle\r\nrefermented ale produced by Unibroue. It is\r\nbrewed from a blend of pale barley malt,\r\nwheat malt and unmalted wheat, to which\r\nwe blend selected spices and hops.\r\n \r\nBlanche de Chambly is only partially filtered,\r\nretaining its natural cloud of yeast that is\r\ncharacteristic of the original white ales\r\nbrewed during the Middle Ages.\r\n\r\nWe recommend this remarkably refreshing');
