INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('271f54fb8f1c4bed8906dfca052b60d7', 'd5b27251496640ba84e3b912888dd0fa', '98b7246d5e1b4592b15adced83ab36d0', '0a4bb7119e2f41faa7b40acf63b2e0c6', 'Dark Ale', 4, 0, 0, 0, '', 'A dark brew full of promise. Coopers Dark Ale is a journey in taste, starting fresh and creamy, and finishing with a lingering coffee flavour. \r\n\r\nConditioned and naturally brewed using the top fermentation method, Coopers ''Dark'' is made using roasted and chocolate malts, giving it a rich dark colour and unique flavour. \r\n\r\nCoopers Dark Ale has no additives and no preservatives.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2726b64fd82d4a63abb897e7d30ad807', '5c808928a2054b038822e1bd27748f96', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Christoffel Blond', 6, 0, 0, 0, '', 'Born as â€œChristoffel Bierâ€ this was the first beer brewed by Christoffel. After the introduction of Christoffel Robertus, this beer was named Blond refering to the colour of the beer.  Blond is a low-fermenting beer with 6% alc.vol.\r\n\r\nBlond has a full body, a very balanced taste and a beautiful bitterness due to a generous addition of fresh hop during the brewing-process. The aroma is fruity and Blond has a fresh taste with a pleasant, hoppy finish.');
