INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('27acce338708441d8f5ad7bc7e3b00dc', '6c7ee6a97d974d23b4033858ffa948ad', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Wahoo Wheat Beer', 4, 0, 0, 0, '', 'Ballast Point Wahoo Wheat Beer is created using the same ingredients that were once used in Belgium. Flaked unmalted wheat, oats and malted barley comprise the grain. The unmalted wheat has a high protein content, which causes the beer to be hazy, thus giving it a cloudy, or \"white\" appearance. A special yeast gives a refreshing tangy flavor that is different from both the sour Weiss beers of Berlin or the banana and clovey Weizens of Bavaria. The mild hopping allows the unique malts to show through and does not conflict with the subtleties of the citrus spicing. This unique citrus character is created by adding a blend of curacao (bitter orange), sweet orange and coriander to the boil. White beers are light and refreshing, yet provide a complex reminder that interesting high quality beer does not have to be bitter and dark. Ballast Point Wahoo Wheat Beer is the perfect beer for sunny San Diego.');
