INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('27f9de6c60434ddd8884ccfeda34c8d4', '44a1728e210343b6b170b1613e173e4a', '22710fa91bbf4454b94555720f6a33dd', '84bca21ce52244db83158e4971bd7866', 'Irish Red Ale', 5, 0, 0, 0, '', 'Just in time for St. Patrickâ€™s day, this Irish style red ale definitely has a big malt profile.  This beer is the antithesis of our Amber Waves ale.  It has a low hop bitterness and aroma, this allows the caramel malt flavors to dominate.  It has a medium body, and is very easy going down.');
