INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2f2255c26ef64727b7c49fa416e863d7', 'a5197ed517514f8fa66e3ad03627c21a', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Ipswich Porter', 5, 0, 0, 0, '', 'Named due to it''s popularity with London railroad porters, it''s known for its dark, rich, and roasty notes.');
