INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2f3df600d70b476bb2350ab548316a77', 'c6597412758a4086a9d6d0e04e75e71e', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Rowhouse Red', 5, 0, 0, 0, '', 'From our city of neighborhoods we offer you this \"BiÃ©re de Mars,\" or ruby farmhouse ale. In true Philadelphia fashion, we meld American and European ingredients into a complex ale with flavors of toasted malt and rye. Rowhouse Red is the perfect accompaniment for some quality time in the backyard garden (or on the front stoop) of your urban farmhouse.');
