INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('29fcb40289244965af8c12c67d441ce4', '6373fec6e4d84db5ae7c64f6230502ce', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Anchor Witbier with Brettanomyces', 6, 0, 0, 0, '', 'This Belgian witbier begins with equal parts malted wheat and pale barley to create its traditional cloudy white appearance. The addition of Brettanomyces gives ANCHOR its trademark \"green apple\" or \"horse blanket\" aroma and lends tartness to the flavor and finish. At over 6% ABV, this ANCHOR''s got a bit of more kick than most wits.');
