INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2a2d7f313f7c48ad878d8c896a5fb593', '5d67eae726e743a8b01e413716761c64', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Slab Cabin IPA', 5, 0, 0, 0, '', 'A classic American IPA with lots of floral punch and assertive hop presence. Hopped with Nugget, Palisade and Amarillo colored to a reddish hue thanks to Munich and Aromatic malts');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2a406d9d43ba46d5958daeffd7ce6dd8', '975a06569d444c38a7c7b3cd9ee4a2b0', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Nine Men Ale', 4, 0, 0, 0, '', '\"Nine Man\" is a golden ale, brewed from English pale and crystal malts, and with torrified wheat.  It is bittered with Cascade and Cluster hops and finished with Cascade hops.  \"Nine Man Ale\" was first brewed as a summer seasonal beer in 1996.   It was kegged the first season but not bottled until the opening of the baseball season in April 1997.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2a4cb4e1aead4622985d8cc7dab29023', '975a06569d444c38a7c7b3cd9ee4a2b0', '98b7246d5e1b4592b15adced83ab36d0', 'd4e5211c1aa74e4592bc9899fd3659c7', 'Backyard India Pale Ale', 6, 0, 0, 0, '', '\"Back Yard\" is a golden India Pale Ale. Historically, ale shipped to India in the 19th Century was brewed to higher gravities so that it could mature during the long sea voyage. English brewers also hopped these ales heavily to protect them from spoiling. The term \"India pale Ale\" or \"I.P.A.\" is still used by brewers to denote a super-premium, hoppy pale ale style. Backyard IPA is no exception. English pale barley malt is predominant in this beer with just a small amount of crystal malt. It is well bittered with Cluster and Cascade hops and finished with a mix of local hop and larger amounts of Fuggle hop.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2a5b028eed0f455a8ec709193c0b1fef', '65ab7a9116df4270a74ea9cca5f41e5d', '98b7246d5e1b4592b15adced83ab36d0', '0a4bb7119e2f41faa7b40acf63b2e0c6', 'Moll Dubh Irish Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2a6bd4e8d7e54e42b9f45adf2a6937f0', '4f59d5e4604c4ea2ba6af9921ea40dc0', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Heat Seeker Hefe', 4, 0, 0, 0, '', 'A Bavarian style Hefeweizen, a cloudy brew with slight hints of bannana and clove.  Light and refreshing.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2a801c2627e54c94b1edfbe30e63a9e4', '6acda429e8a942cd8719dea5625fa98b', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Whiskey Stout', 0, 0, 0, 0, '', '');
