INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2a8edc7246c848508e71600367ef6b40', 'f5c370154895454ab3d84b654e2ebea5', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '45f372212a6948b7ba624c5c474c4b9b', 'Wexford Irish Cream Ale', 5, 0, 0, 0, '', 'Based on a traditional Irish recipe from county Wexford that dates back to 1810, we use only the best ingredients to ensure that our Wexford Ale has a smooth mellow creaminess we believe you will enjoy.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2a97f887d9f04e11befee9e57edb8b48', '3b1cefedca8e475c9e620feb0df34abe', '4fcd53c380e347edb1ca81489b03f902', '2a6b815eb1624f47b33d1c5a753e5bd6', 'Ugly Pug', 4, 0, 0, 0, '', 'Ugly Pug is a schwarzbier, or black lager. But the real story is its name. Fritz saw his mother-in-lawâ€™s pug, Oscar, lounging in a chair and he (Fritz) shouted, â€œWhat an ugly pug!â€ Everyone laughed. Yourâ€™re right â€“ they were drinking a test batch that night.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2ac08a72a2f5496bba738efdd7b25b71', 'd4e20b5d3792460ca0b0c48e02bc5eef', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Thompson Pale Ale', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2acdda428aa241d9a2472bf77715e521', 'a91755e44a3447aa9306d67ce72b1454', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Red Oak Amber Lager', 0, 0, 0, 0, '', 'Red Oak Amber is a Munich Urtyp (Old Style) Lager. We begin the brewing process with custom kilned imported Munich Malt.  Red Oak is then hopped with Spalt Noble Hops imported from Bavaria, the oldest hop growing region in the world.  Before fermentation we add a yeast strain from Weihenstephen, the oldest brewery in the world, founded before 1040 AD. Weeks of aging gives Red Oak the smooth taste it is known for.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2ad49c1001cc4516ab0d2445a7ac2950', '7ad8825aff794387ace4aa354ef49b64', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Divine Reserve 9', 11, 0, 0, 0, '', 'Important: let this beer warm to at least 50Â° before enjoying.  This beer is black with some ruby highlights.  The nose is full of pumpkin pie spices and some alcohol.  There are notes of nutmeg, caraway and vanilla.  The taste starts with chocolate malt with a hint of spice and rolls into a warm spicy alcohol taste which has the effect of creating the balance that usually comes from the hop bitter.  There is some hop bitter on the finish, but not much.  Overall, this beer finishes relatively dry for such a big beer.  As it warms, the spices move forward in the taste and the chocolate moves to the finish.  The pumpkin provides a pleasant undertone and a nice mouthfeel.  The spices will probably fade some over time; they mellowed considerably while still in the fermenter.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2ad7fefa951a4535843a4531e0a4e463', '06f1c8a9bb74470981730c2969378ee8', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Imperial Stout 2003', 9, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2ae446248fe6497cb19460a4a301a9c1', '32629f72e41245c7b98912e872917b62', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Batch 8000', 9, 0, 0, 0, '', 'Batch 8,000 is part of our commemorative series celebrating our progress with special brews. Our 8,000th batch is a special recipe to be brewed only once. It is wheat ale spiced with Coriander, Orange Peel, and Paradise Seed. Best consumed fresh.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2ae88e98598d46a18e6afe003b9d9593', '2c96e8e0e5a24d17a67491f9ec2ec686', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Racer X', 7, 0, 0, 0, '', 'This bold winter ale follows English brewing traditions, but with our California twist. Bold hops, but balanced ... It''s a double IPA!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2b07ee05831c4ceba6901decac9965b1', 'b452dfcf8ed940cf8d6a6a662bf7c675', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Big Sound Scotch Ale', 8, 0, 0, 0, '', 'Big Sound Scotch Ale is dedicated to our good buddy Gino, the most punk rock bagpiper you''ll ever meet, and the rest of the men and women of Tampa Bay Pipes and Drums. Brown in color, Big Sound has huge notes of dark sweet toffee with underlying mild notes of coffee in the aroma. The flavor starts with a slight note of cherry and then opens into a Goliath of a malt character with notes of dark sweet toffee, slight hints of coffee and mild notes of toasted bread in the finish. Big Sound Scotch Ale pairs well with Haggis, Highland Games, Huge Heads and Enormous Pillows and of course Bagpipe music.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2b1140d0f7894b3aa0f54e04aaffe423', '85d4c6c47664428ebdb5a1246a9a7c8e', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Gold Nectar', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2b2111900d6e446881c7198a44642d2c', 'b29f86d848034ffab3b2939c0b92eed0', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'El NiÃ±o IPA', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2b2d242af31d4ae193f69ea4e311b332', '65c02b64831c412bbd80a7d2e5780d32', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Penn Pilsner', 4, 0, 0, 0, '', 'Our flagship brand! An amber Vienna-style lager beer that is smooth, mellow and full bodied, with delicate hop aroma. Uses two-row barley malt and caramel-roasted malt. Based on founder Tom Pastorius'' favorite German bier.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2b3b9efc72194a3ba6bd6b66a4b49db1', '0503089b24664e50bbbc6e120966f93e', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Apricot', 0, 0, 0, 0, '', '');
