INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2bee62f2fc46439687d47c18fa71c668', '28ac277a9f864ef6b63a2d7ff32405d7', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Dubble Fantasy', 5, 0, 0, 0, '', 'Abbey ale with hints of bubble gum flavor.');
