INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2c18720d5c014d71824fabda6688ee3f', '3c1a29f6db284abda8d558a43582ba35', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'God Jul - Winter Ale', 8, 0, 0, 0, '', 'A dark ale brewed specially for the Christmas season, with a rich, complex taste of caramel. This is a strong, dark and rather sweet Christmas Beer â€“ just the way we think a Christmas beer should be.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2c1c20aa4d2341be95d1eb7e35907777', '108a26f09ce942a9a22091824a6cc9e8', 'b7ee8858a0b549ddb2361e1ed313f6e1', '2747adf8980546318186100ea198dbcb', 'Chimay PremiÃ¨re (Chimay Red)', 7, 0, 0, 0, '', 'First sold in 75 cl (25.4 fl.oz.) bottles, it is noted for its coppery colour which makes it particularly attractive.\r\n\r\nTopped with a creamy head, it gives off a light, fruity apricot aroma produced by the fermentation. The taste perceived in the mouth is a balance confirming the fruity nuances noticed in the fragrance. \r\n\r\nIts taste, which imparts a silky sensation to the tongue, is made refreshing by a light touch of bitterness. To the palate, the taster perceives a pleasant astringency which complements the flavour qualities of this beer very harmoniously.\r\n\r\nThis top fermented Trappist beer, refermented in the bottle, is not pasteurised.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2c233fa3ecf849fd916399e1ae867a63', '8d00850620d14a638c75e5979a64ffed', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Hands Off Maibock', 8, 0, 0, 0, '', 'A springtime favorite, this traditional German Maibock (my-bock) is golden in color with a rich maltiness and a long, spicy finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2c4353e4875a47efb0f21ae8d02ee9c3', '3b1cefedca8e475c9e620feb0df34abe', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Rahr''s Summertime Wheat', 5, 0, 0, 0, '', 'There is nothing more refreshing than a cold SUMMERTIME WHEAT at the end of a hot Texas day. This refreshing, lightly hopped ale has unique banana and clove-like characteristics. It is unfiltered so the yeast character comes through with a light but full body.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2c57f3ae970e4afbb51329d1811d47e0', '6533462e9e774e57b9f5732311d0b734', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Anniversary Maibock', 7, 0, 0, 0, '', 'The Maibock style was traditionally produced in the winter and released in early May to celebrate the coming of Spring. This malty lager is deep golden in color and medium in body. The finish holds a bold sweetness that is balanced by a subtle hop flavor and aroma. \r\n\r\nWe will be releasing this beer every spring in celebration of our Anniversary.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2c700ce46efd4ee182495603755f2d43', '78700d13d7c84834a0330a6b31b5bfc5', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'SunRye', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2c80f6cd83de428ebd9ffca34046082f', 'eabf4f40165c48bd87da961394316153', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Otter Creek Imperial India Pale Ale', 11, 0, 0, 0, '', 'Originally brewed for thirsty British troops stationed on the subcontinent of India, India Pale Ales had to withstand the sea voyage around Africa. Brewers need to take full advantage of two preservatives at the time: hops and alcohol. They increased their hopping rates, doubled  their malt useage to increase alcohol content, and dry-hopped the brew before it set out on its voyage.\r\nOur Imperial IPA carries on this tradition- and then some!  The fruity and citrusy hop aroma intermingles perfectly with an assertive malty backbone.  Our brewers added a generous supply of hops to this brew throughout the entire process to provide an enormous hop flavor and balance the elevated alcohol content.\r\n\r\nThis beer is 11% alcohol by volume, and 135 IBU!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2c85343c6e594a0aa7eb7d877124cb20', '5d67eae726e743a8b01e413716761c64', '4fcd53c380e347edb1ca81489b03f902', '2a6b815eb1624f47b33d1c5a753e5bd6', 'Zeno Black Lager', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2c86c330eb9744a1931ef947267be122', '143a97198936464e9a93286fbdb3a8ac', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Double White', 6, 0, 0, 0, '', 'What do brewmasters do in their free time? If you''re Phil Markowski, the obsesseive brewmaster of Southampton, you brew at home, of course! Phil turned his fascination with Belgian-style white ales into a quest to master one of the most challenging beers to brew. Using rustic ingredients like un-malted wheat, Phil experimented over his stove until he felt it was perfect. Take one taste and you''ll agree, Phil got it \"white.\"');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2c8b06db8ae943bd9ad38e5082e6f292', '6ee3779d2b1345e0b7b5edf8f63caabc', '98b7246d5e1b4592b15adced83ab36d0', 'f53645d05b19429d8e74046a3ccf0b8e', 'Bitter American', 3, 0, 0, 0, '', 'An American session beer. Loaded with hop character and a malty presence, but lower in alcohol.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2ca9df66d9c743d3952b520ac221bdcc', '7349bcabdc4d490fb09aaeaf1bc0a017', 'bf3112301857461f82c7633c0a695896', '470eefadc34742e680972815eaf47815', 'Aventinus Weizenstarkbier / Doppel Weizen Bock', 8, 0, 0, 0, '', 'Dark-ruby, almost black-colored and streaked with fine top-fermenting yeast, this beer has a compact and persistent head. This is a very intense wheat doppelbock with a complex spicy chocolate-like arome with a hint of banana and raisins. On the palate, you experience a soft touch and on the tongue it is very rich and complex, though fresh with a hint of caramel. It finishes in a rich soft and lightly bitter impression.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2cc204e880e840fe8f0ad47aba7aea46', '72f88f94f30245af820cd491fa57a5c8', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Pleasanton Pale', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2cc64fcd0136412289ea513f5a6a83dd', '9ee99dc929de419196bbe5b9243bec26', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Foster''s Lager Beer', 4, 0, 0, 0, '', 'Foster''sÂ® Lager is a uniquely Australian beer, brewed with the finest sun-dried malted barley, the purest water, and Foster''sÂ® own specially bred ''Pride of Ringwood'' hops imported directly from Australia to give the beer an authentic flavor. Foster''sÂ® Lager Beer has always been at the forefront of brewing technology and the Foster''sÂ® Lager brewed today is the result of over a century of attention of the brewing art. Quality has been the strength of Foster''sÂ® since its earliest days and remains a paramount concern at every stage of the beer''s journey from brewery to consumer. Foster''sÂ® crisp, clean flavour won it immediate international acclaim when it was first brewed in Melbourne in 1888. Today, more than one hundred years later, it is still recognized as one of the world''s best beers.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2ce9c1c345424807ae2ff5b37ee558c8', 'c5c06218ca054e59ba43b505613a8710', '98b7246d5e1b4592b15adced83ab36d0', '0b415ebb506c40848abff3554116e055', 'Foster''s Premium Ale', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2ceff33228d14097b98527ddd9288ba2', '8a0066befe3b4c94a0da0a9f5b639f6e', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Merry Monks', 9, 0, 0, 0, '', 'Merry Monks'' Ale is a Belgian style Abby Trippel without limitation.  This style was created by Trappist Monks in Belgium over 500 years ago. To be true to the style, Merry Monks'' Ale is bottle conditioned. This means we add a bit of sugar and yeast just prior to bottling. This imparts a special effervescence to the beer, a creamier carbonation, and also extends the shelf life. The on-going fermentation inside the bottle will change the character of the beer as it ages, and you''ll find it becomes dryer with age. You may want to lay down a few bottles for future evaluation. We suggest storing at cellar temperatures -around 55 degrees F- and away from light.\r\n\r\nWhen you try this beer you''re in for a unique treat. The special effervescence and creaminess are immediately apparent when pouring. The Pilsner malts combined with the Belgian yeast strains  yield a remarkable and complex flavor- perhaps you''ll note subtle hints of fruit or spice. The flavor is nicely balanced and the finish moderate to dry , begging for the next sip.\r\n\r\nYou might ask why we go through all this trouble and expense for just a beer, but one taste and you''ll know the Merry Monks'' Ale (9.3% ABV) will more than complement any meal it accompanies. Enjoyed best around 48 degrees F, it also makes a fine after-dinner drink.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2d0a1ca18c3941e49f4e4f86783465b4', '8d00850620d14a638c75e5979a64ffed', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Smoked Porter', 6, 0, 0, 0, '', 'A big, RICH dark ale with a complex combination of beechwood smoked malts, chocolate, coffee and caramel flavors rounding out the beers smooth creamy body.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2d5eefe6590a4b83a5f12934f1b47e06', 'f5b9ebafbed64d7d8dbc9643e9eef7a9', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Firemans #4', 5, 0, 0, 0, '', 'Smooth blend of malt, citrus and fruit');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2d87ea5d29ec4a23840f2f94bf499621', '9c3ee95b24104dfd9b624cf02a81b1df', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'b54082ab47e6498e9eebc1f15232fd53', 'Nut Cracker Ale', 5, 0, 0, 0, '', 'Nutcracker Ale is Boulevardâ€™s holiday gift for real beer lovers. This hearty, warming brew is a classic winter ale, deep amber in color, with hints of molasses balanced by the â€œspicinessâ€ of freshly harvested Chinook hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2da35a2c2a304f8eb003514ba558ae76', 'a805a63f7b954195acd10f76338e720f', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Brown Bear Ale', 0, 0, 0, 0, '', '');
