INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2da7851d030549888a11e4ddc886c7f2', '730a553b16c5415eae40f875e6f851a6', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Winter Ale', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2da93534444b413c8cbef8d2e59ae6e8', '9afdf27a7c57483bbe140f42040aae13', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Maple City Gold', 7, 0, 0, 0, '', 'No, there is no maple flavor here, just a great beer with a good name.  LaPorte, Indiana is known as the \"Maple City\" because of its trees.  This German style Oktoberfest lager beer has a golden copper color and intense malty flavor.  We make this beer 4 times a year, but it is hard to find because it goes so fast.  Give it a try and you may find it worthy of the gold.... or at least another round');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2dbac61983ad4ec6838f211ba3b1005c', '94b2e7e841504f858034cf078e80a792', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', '422 Pale Wheat Ale', 5, 0, 0, 0, '', 'Pour 422 Pale Wheat Ale into a pint glass, give it a long whiff and youâ€™ll realize that this isnâ€™t your average pale golden wheat. Preserved in its unfiltered state, 422 is a fantastic session ale in which flavors of wheat, barley and hops commingle to a refreshing and zesty conclusion. Hints of orange and sweet malts waft to the fore as a touch of bitterness contributes to a smooth finish. 422 is brewed as a tribute to preserving our precious planet and itâ€™s environment. It is responsibly packaged with over 80% recycled consumer products and is completely recyclable. Enjoy 422 all year as to take one stride closer to a eco-friendly life.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2dc89faf266546e0a1c2b8914255d5ab', '6533462e9e774e57b9f5732311d0b734', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Wildflower Honey Wheat', 0, 0, 0, 0, '', 'This American wheat beer is infused with 20% wildflower honey resulting in a light, semi-sweet refreshing beverage.  This beer represents the next evolution of Sophieâ€™s Sparkling Ale as we have added the wheat base, essentially combining two of our most popular beers. This will be brewed in Camp Hill and distributed in limited quantity to Harrisburg and Gettysburg.');
