INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2e37c7b42d4e4a8da69717bba8665694', '3f9364c3e02848ccb9c89a876ee7a9c3', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Marzen', 5, 0, 0, 0, '', 'The name says it all, you want German this is it.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2e41a260295f4a49bc3a6f8d17d3eab9', '048f9156b40a469781e7e19d6321d6b5', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Samuel Adams Winter Lager', 5, 0, 0, 0, '', 'Bold and rich, with a touch of holiday spice\r\nThe first thing one notices in a Samuel Adams® Winter Lager is its color: the deep brown of winter. Then comes the magical aroma which promises something special on the tongue. The warm aroma of cinnamon and ginger which blends with the roasty sweetness of the malted barley and hint of citrus from the orange peel. And after that first sip the promise is fulfilled. On the palate Samuel Adams® Winter Lager is rich and full bodied, robust and warming, a wonderful way to enjoy the cold evenings that come with this season.');
