INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('2e8eddfa8b414543a3dee3e929f8cf65', '27f2fd76054546ab995143f1705971b9', 'b7ee8858a0b549ddb2361e1ed313f6e1', '2747adf8980546318186100ea198dbcb', 'Belgian Abbey Dubbel', 7, 0, 0, 0, '', 'This Belgian-style Abbey Dubbel is an exceptionally complex beer with many interwoven flavors. This classic-style Abbey beer features an immense head with a fruity nose and a generous body. Malty in the middle, the beer features a clean, almondy dry finish and a slight alcohol warmth. More like a wine than a beerâ€”it has a lot of the qualities of a fine Burgundy.\r\n\r\nBeer writer Michael Jackson has praised the Flying Fish Dubbel as \"a wonderful example of the style.\"');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('30be712f69e444c998a146d85c5cf8f7', 'bfcb5792acea46178da58ab8e844869f', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Special Amber', 5, 0, 0, 0, '', 'A delicate balance of toasted malt and fresh hops give this medium-bodied German-style lager an intriguing, complex malt flavor. A creamy head, deep golden color and an impressive hop bouquet make this a very special beer.');
