INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('30dd586c703e406ca15e69145f720d38', 'be7d66fc42624f0484cd29faf5c3b4d9', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Torpedo Extra IPA', 7, 0, 0, 0, '', 'Sierra Nevada Torpedo Ale is a big American IPA; bold, assertive and full of flavor and aromas highlighting the complex citrus, pine and herbal character of whole-cone American hops.\r\n\r\nNamed after the torpedo-shaped hopback employed in its making, is an IPA made with Chinook, Cascade and Centennial hops.');
