INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('319845fe866e4eb08b83f2aade04e00a', '87d07c49cac34e51844cd51fd3ec0ad9', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Hatuey Beer', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('31a6203534f34ea7aa935b16be1f3034', 'e8801a3d8e1d48b993d7146c1ea4f00e', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Labatt Bleue Dry', 6, 0, 0, 0, '', 'Labatt Bleue Dry, the second addition to the Bleue family, is brewed with the same care and attention to detail as Labatt Bleue. Labatt Bleue Dry is mashed longer than regular beers to leave less carbohydrate (sugar) in the finished beer, giving a clean, crisp finish. Using select aromatic hops and a blend of the finest quality North American barley malts, this lager is clean-flavoured with no aftertaste.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('31bb80f527bf462d9810a1eb73333776', '4469952f19d14afd96ac154757804935', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Red Raspberry', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('31c6850a1bb242eab28b8a61cebbbaaf', '6373fec6e4d84db5ae7c64f6230502ce', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Trickster Belgian-style Pumpkin Ale', 7, 0, 0, 0, '', 'OK, what do you get when we toss pale malted barley, pumpkin and spices into a stainless steel cauldron then stir in some magic? Uh, Trickster! The â€œmagicâ€ is actually mischievous Belgian yeast at play with cardamom, nutmeg and coriander. This spooky cool brew will make your glass glow bright despite the gloominess of the season. \r\n\r\nDesigned to conjure up a little fun during the darkening days of autumn, Trickster is a frivolous concoction of earthy pumpkin, comforting malt, and lively spices. This makes Trickster the brew to accompany your post-winterizing duties, family fall dinners, ghost stories, U-boast-iT stories, and â€œsupposedly hauntedâ€ garage parties. \r\n\r\nBut the flavor range of Trickster also pairs well with citrusy and spicy cuisine. Try a glowing glass with your favorite dishes that incorporate nutmeg, cardamom or corianderâ€”like Thai curries, Swedish meatballs, gingerbread, roasted pumpkin soup. Add Trickster to soups and sauces, batters and doughs, glasses and mugs.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('31dccb0124904339a2935123065df988', 'f27b473310954a3ebc29d3ddbde38313', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Harborfields HefeWeizen', 4, 0, 0, 0, '', 'Sometimes it''s good to keep it simple. \r\n\r\nHarborfields HefeWeizen is modeled after the German classic, but meant to be available fresh (like you would enjoy if you were in Germany). Shipping over long distances is not always a friend to beer. \r\n\r\nNamed for the Centerport-Greenlawn area of Long Island that is home to the Blind Bat Brewery, Harborfields Hefeweizen goes great with fish, chicken, or a summer salad. Some even like it with brunch! (Please enjoy your waffles responsibly.)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('32743223d67e40b4869c5c05551837f7', 'e7c41aa1122b4d3780bb693212685d69', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Crooked Door', 5, 0, 0, 0, '', 'The American hop Cascade is used to give this brew its classic American Aroma. Pale and Crystal malt from the U.S. are used to give this beer a medium body and high hop flavor. This beer goes down easily and opens the door to a world of microbrewed beers.');
