INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3569d34f087c47deaa87292fddea6251', '0b76f7536caf49a8a9a437cd7daaca28', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Olde Orchard Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('358a5622596e4e798e8c8a949309bdf8', 'be7d66fc42624f0484cd29faf5c3b4d9', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Summerfest', 5, 0, 0, 0, '', 'From the Sierra Nevada Brewing Co. website:\r\nOur Summerfest® is a refreshing, pilsner-style lager. Its incredible smoothness comes from an extra-long lagering period. Lighter in body than our ales but just as complex in character, Summerfest® quenches your thirst with big aroma and a tangy hop bite. \r\n\r\nGOLD MEDAL WINNER\r\nCalifornia State Fair (European Light Lagers: 1999)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('35904c4de19549b1b38932c630b5123e', '641566e7dfc4492b816400ba5e1254f7', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Cattail Peak', 4, 0, 0, 0, '', 'An invigorating wheat beer with 100% organic grains, a hint of rye and the tang and hue of organic hibiscus, this refreshing brew is as cool as the breeze that blows down from Mount Mitchell to Cattail Peak. Enjoy this delicious creation when the hottest summer day demands the best of the Blue Ridge.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('35b53e5a129d4a16a8158bfd1ae5aecb', '8a0066befe3b4c94a0da0a9f5b639f6e', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Muse Farmhouse Ale', 6, 0, 0, 0, '', 'Muse, a Farmhouse Ale,  is brewed \"somewhat\" in the tradition of the style, but it has Weyerbacher fingerprints all over it! Made with Pale malt, a little carapils, raw wheat and raw oats, this warm weather seasonal is dry and ever so slightly tart on the pallet from the wheat and oats. At 6.2% abv, its a bit higher than your strictly traditional farmhouse, but not out of the realm, really. The wheat and oats makes the mouthfeel silky and light at the same time.  They also bring some cloudiness to the brew, but don''t be afraid!  Hopped with Styrian Goldings and finished with Saaz, this beer has a noticable hoppy dryness which makes it a fine thirst quencher, something the original Farmhouse Ales were intended to be, served to workers out in the fields on hot summer days as a restorative.\r\nFermented with Forbidden Fruit yeast, at a very high temperature (78F), the spiciness developed is entirely from this traditional yeast strain, not from any kettle additions. Unfiltered, to enjoy this natural beauty, and imagine yourself out in the flat fields of Belgium! Cheers!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('35de203f30b447eb982cde0cbfee5b91', '630c3de09c66485693b0e916f92b282f', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Hefe-Weizen', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('35e2d43dacda4634a227972944efd45e', '470deed21c4a4e57b1eb4378dad85a76', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Superstition Pale Ale', 5, 0, 0, 0, '', 'If you are searching for a light, refreshing pale ale, your search is over!  Superstition Pale Ale is named after the Superstition Mountains which are just east of Phoenix.  This American pale ale is brewed using mountain pure water, select domestic grain, yeast and hops from the Pacific Northwest.  Superstition is copper in color with a clean, malty fullness and finishes with pronounced hop bitterness.  Perfect for enjoying on a warm Arizona day.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('35e55cf436c6420d9e35d56d2c92650a', '600830134d904757a2e04ee2545a9033', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Stout', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('35f6eaa1013b4576bd89aba8a6e7be87', '13e46693ec384f9183b40ee3a0560780', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Fall Fest', 0, 0, 0, 0, '', 'Abita Fall Fest is an Octoberfest lager available September-November. It is brewed with German Hersbrucker hops and pale, crystal and chocolate malts.\r\n\r\nThe result is a full-bodied, malty beer with a strong hop character and a beautiful amber color.\r\n\r\nCelebrate the season with Abita Fall Fest and your favorite German food');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('35fdc3c8aab2460fb370899bc2f6113b', 'a5effd5e4c7d4f1b9878f82c00bec95b', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'East India IPA', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('361bbb572f46463db36061d75c4a8908', 'd26d5c24741740f89a8385fa0c199558', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Lewmeister Oktoberfest', 5, 0, 0, 0, '', 'Amber, full-bodied lager made in the traditional style with German hops. Brewed in early August and put on tap with a keg of the previous years batch by October of each year. This beer is brewed in memory of \"Lewis\", the owners beer-drinking long-haired Dachsund, who passed away at 17-1/2 on 8/17/99.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('36200ceb0dfe4f22aadda228ac0b3531', '924f4d2594fe47a0a732a9e14bc24ad6', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Red & White', 10, 0, 0, 0, '', 'A big, belgian-style Wit brewed with coriander and orange peel and fermented with Pinot Noir juice. After fermentation a fraction of the batch is aged in Oregon Pinot Noir barrels, and another fraction is aged on oak staves. The beer is blended together before packaging.\r\n\r\nThis has been one of our most popular Limited Edition beers at both our Rehoboth Beach, DE brewpub and at festivals. It successfully marries the refreshing citrusy qualities of a Belgian-style white beer with the robust complexity of a bold red wine.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3622ff3287d745d8b73081e9624763fa', 'd9df3ae7fdaa49d48d20d4c99ae4916e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Wheaten Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3636c6be7d8848a9a3c846373d3cdcda', 'f27b473310954a3ebc29d3ddbde38313', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Old Walt Smoked Wit', 5, 0, 0, 0, '', 'A smoked wit, you say? \r\nYup. \r\n\r\nResearching smoked beers led me to a world of smoked wheat beers, particularly a smoked wheat beer popular in Poland about 100 years ago. (I''ll list that one as one of the Blind Bat beers when I''m happy with the test batches and am ready to offer it to the public.) I didn''t find anything about smoked wit beers, but decided to experiment a bit (a wit is a wheat beer). I like it, and hope you will too. \r\n\r\nPictured on the label is Long Island''s old Walt Whitman, enjoying a smoke and a book in what is purported to be his favorite spot in his native West Hills. Long Island''s springtime is awakening all around him.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('363c141a53894ace93d9c8d6df1d3695', '33c1d19a71cf49058cc24d8b0cd0b75f', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Rye Porter', 0, 0, 0, 0, '', 'This dark, full bodied ale has a hint of rye accompanied by chocolate malt. The perfect brew for relaxed sipping!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('364d44210c17480ba2a673e3389f4dac', '6ea327965a6241cb946db896e35449cc', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'India Pale Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('368617a936a44cd98eb63e394cffcf59', '6373fec6e4d84db5ae7c64f6230502ce', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Obliteration III', 7, 0, 0, 0, '', 'With passion and purpose, we present this series of hop-centric beers. Using different hop varieties and brewing techniques, we aim to capture bold, distinct hop characteristics in aroma, flavor and finish. While we explore the\r\nworld of hops, we invite you to learn along with us: these beers offer an incredible opportunity to experience the diversity of hops while engaging the palate and obliterating the senses.\r\n\r\nObliteration III is yet another dynamic Double IPA. Its aroma is pungent with fragrant notes of citrus, spice, pine and alcohol. A sturdy malt platform provides the perfect stage for showcasing these high alpha-acid hops, creating flavors and textures that entice then intrigue. Obliteration III finishes with poignant bitterness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('36ab8dbd2b7442c3a76739e01f1042d3', '3d80398428f9495ebe0f9b1acf0a6295', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Climax Doppel Bock', 8, 0, 0, 0, '', 'Traditionally brewed by Monks to sustain them while they fasted during lent; the Doppel Bock is a big-bodied and flavorful beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('36b40dec70e34f70a82962bd0ef81ffe', 'b67c5d7317f84d76a2a3874cf45661bb', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Superior Stout', 5, 0, 0, 0, '', 'All the good stuff and just a little bit more. Michigan Brewing Company is proud to offer this thick and creamy stout with all the roasted, coffee-like flavor you can handle. Need we say more?');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('36b56afe02ea4f408aea44b235687871', 'a80536799be04ad3b3db00f8dbd95335', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Anglers Ale', 0, 0, 0, 0, '', '');
