INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('36f06aca74be4f0293d23416d75182f6', 'c459aa07e56546b4afca944ba48f6320', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Nickelbier', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('370726bde55c4c7aaae7531992962267', '6487c70165aa48038841d23c930e1a80', 'e64b30f392b4437b82ec46e764453ac1', 'f0821cb45038450ea4d7fad8e5af7cf8', 'Deluxe Organic Ale', 6, 0, 0, 0, '', '\"Strong like bull but sweet like your momma. This unique beer is a trifecta of bold flavors. Hops, malt and alcohol bully the taste buds on the organic playground while the monitor blows the whistle!\"');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('370788eee1294301b3481785396bbad7', '060e4e118f9c43c0b5faaae75acc9917', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Lager', 0, 0, 0, 0, '', '');
