INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('371b1849df7f48f2a3b413bf4c28aa29', 'fc05398cb1624567b596fedc8e64a6d8', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'The Bitter End Pale Ale', 5, 0, 0, 0, '', 'Very drinkable light golden ale.  Extremely refreshing hop finish');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('373699afcf19468c90388fb2c61f7e5f', 'f743f04357824c41994f695c5034da14', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'b54082ab47e6498e9eebc1f15232fd53', 'Scratch #16 2008', 6, 0, 0, 0, '', 'Scratch #16-2008 combines the bitterness of two aroma hops, the lush sweetness of honey and malt and an earthly yeast taste creating a Winter Warmer designed to ward off the coldest days.\r\n\r\nThe dark, rich amber color comes from a combination of molasses and crystal malts; the Thames Valley brings a distinct earthly flavor; white the blend of hops creates fruity (Amarillo) and piney (Cluster) bitterness.\r\n\r\nThe Winter Warmer ends with a slight warming sensation from the elevated alcohol content.  Enjoy this one throughout the winter months.  Cheers.');
