INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('374ae14f26c5459dad1a50ebfd94b66d', 'fd2cd4c2ec3e4c59b7917eba87951c39', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Centennial IPA', 7, 0, 0, 0, '', 'Selected as a benchmark for the Beer Judge Certification Program used in all American based beer judgings. Centennial IPA has quickly become the IPA of choice. Pour yourself a pint of this complex flavorful ale and bask in the frothy head''s floral bouquet. Relish the immense citrus accents, achieved by the abundance of dry hopping. This ale''s sweet, malty undertones balance the hop character with a finish that never turns too bitter.');
