INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('38cf28ca03764d969ce6ab8d72018863', '8500bd208607465e9985b4afcd2b2530', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Nokdechiloff', 12, 0, 0, 0, '', 'This winter warmer will knock the chill away until summer. It used as much malt as our brew house can handle and armloads of fresh hops and lovingly laid in our fermentor for four months. Massively malty and balanced with burly bitterness it is truly the king of beers, approaching wine in strength. A definitive one to have when youâ€™re only having one. Adoringly served in brandy snifters to preserve precious properties.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('38cf99a5d26a43d89cc1bfe3ba3ff5fe', 'e7c41aa1122b4d3780bb693212685d69', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Nagelweiss', 5, 0, 0, 0, '', 'This German style wheat beer contains about 50% malted wheat and is balanced with Hallertau hops. This beer finishes low in gravity so the final taste is light on the palette and extremely drinkable. This is sure to be a favorite with first time and long time wheat beer drinkers.');
