INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('390b618442e846abb5aa94781e2f52d8', '41219ea95bc742daa4e9d99bbb781f50', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Skullsplitter Ale', 8, 0, 0, 0, '', 'Skull Splitter is our strongest ale: which is named after Thorfinn Einarsson who was the 7th Viking Earl of Orkney. Sophisticated, satiny smooth with a deceptively light character, it is a tribute to our colourful forbear.\r\n\r\nOn the nose, this strong beer has a fruity malt character, with hints of dark fruit, spicy hop, dates and figs.\r\n\r\nOn the palate, rich and complex with sweet toasted malt, molasses, fresh and dried fruit and hints of warming spices.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('390c42bd28e44a5bbc8c457161e6947e', 'bfcb5792acea46178da58ab8e844869f', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Sprecher Maibock', 6, 0, 0, 0, '', 'Pale malt flavors are balanced with a rich hop character and a light fruit bouquet in this seasonal spring lager. Traditional dry-hopping and extended aging give this blonde bock a distinctive flowery aroma and a potent kick.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('390db5fddc814041b83a4ec64f431e12', '32629f72e41245c7b98912e872917b62', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Pale Ale', 5, 0, 0, 0, '', 'A refreshing, blond colored pale ale. Bell''s pale ale is made almost exclusively from pale malt. It expresses a spicy floral hop aroma and taste.');
