INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('39c255a8f8784cc4adf0f1532d7bd13b', '32629f72e41245c7b98912e872917b62', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Consecrator Doppelbock Beer', 8, 0, 0, 0, '', 'A traditional dopplebock fermented with a Bohemian lager yeast. Reddish brown in color, with a mild hop profile, Consecrator is a well balanced, full bodied beer with hints of caramel and molasses in its smooth, malty finish.');
