INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3a0890cd338a487ca696c7992ae5689f', 'd512b647253049e09ac27ae59e22f29d', 'bf3112301857461f82c7633c0a695896', '470eefadc34742e680972815eaf47815', 'Eisenbahn Weizenbock', 8, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3a0d7445bd3d49d0918722ec5b9d3231', 'db2ec8868ac049959975ee3322bc38a9', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Tokyo', 12, 0, 0, 0, '', 'The irony of existentialism, the parody of being and the inherent contradictions of post-modernism, all so delicately conveyed by the blocky, pixelated arcade action have all been painstakingly recreated in this bottles contents.\r\n\r\nThis imperial stout is brewed with copious amounts of speciality malts, jasmine and cranberries. After fermentation we then dry-hop this killer stout with a bucketload of our favourite hops before carefully ageing the beer on French toasted oak chips.\r\n\r\nIt is all about moderation. Everything in moderation, including moderation itself. What logically follows is that you must, from time, have excess. This beer is for those times.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3a1b6a8071b74b9e91e96ba31ca4ac36', 'fd12ce374404453985d33b6d506b1d2c', 'b7ee8858a0b549ddb2361e1ed313f6e1', '055775d81abb4aa0a4bde8bf8bcaff92', 'Biscotti', 7, 0, 0, 0, '', 'We drew inspiration from Steveâ€™s Grandmotherâ€™s holiday biscotti recipe to create this one of a kind brew. By utilizing an array of malts, oats, wheat, pure local honey, light European hops and delicately spicing with Grains of Paradise, Madagascar vanilla beans, whole star anise, all brought together with traditional Belgian yeast, the result is a cloudy, deep copper colored, complex experience. This delight to the senses should be served in a 12 ounce footed glass and allowed to warm to 50 degrees to fully gather the malt and spice spectrum.');
