INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3a5c9bb7d91e400c9be11d5da5991507', '2081be0970544945b8d8405a2eec41c7', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'b54082ab47e6498e9eebc1f15232fd53', 'Winter Welcome 2008-2009', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3a5dbf6d87d742b0b7d33fd00f197af3', '6e8b38e283cb4f87a958f00dbad901cb', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', '(512) Pale', 5, 0, 0, 0, '', 'With Organic 2-row malted barley, (512) Pale is a copper colored American Pale Ale that balances earthy hop bitterness and hop flavor with a rich malty body.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3a82c1e7cac14e7190d222daea05e1f9', '00ab074e7e55454b82e1b576f3385c21', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Raspberry Wheat', 4, 0, 0, 0, '', 'An American wheat beer made with malted barley and malted wheat.  Lightly flavored with pure fruit to impart a subtle raspberry nose, a delicate fruit flavor and a slight pink hue.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3a86b42b37214521b9f6370a5b9b9abd', '3ae9f1cc386c46a29f36798ccc043764', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Three Guy Off The Scale Barley Wine', 15, 0, 0, 0, '', 'A barley wine style ale brewed to 15% alc with hints of raisin, chocolate, carmel, sherry, cherry, and alcohol, just to name a few and this beer will only get better with age.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3a8ddffb7a654623b22537f44995c7dd', '35b6541f343948159453d67551229eee', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Avant Garde', 7, 0, 0, 0, '', 'From the French word â€œGardeâ€ meaning something worth keeping, this Biere de Garde styled Farmhouse Ale is a most delicious companion to a loaf of freshly baked bread from the oven. Grab a seat on the porch, some soft cheese and a tree ripened apple from your grandmotherâ€™s old orchard. Relax and watch the evening arrive as the afternoon sun is consumed by the illuminating moon over the gardens. We brewed Avant Garde for you, our friends and families. Hereâ€™s to things worth guarding over.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3a9bde8b828b408cbbe0ccbfa11a8a24', 'cfded527d66b4b538e5bb319817bfc70', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Harp Lager', 5, 0, 0, 0, '', 'The best selling premium irish import lager in the world today.  This rich, golden pilsner style lager, with a smooth, refreshing hoppy taste, is brewed the irish way, using only the finest barley and pure spring water from the Cooley Mountains of Dundalk, Ireland.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3ab977277aee48abbc796ad50c3ed342', 'bef3198dea9243d09ed8b09b5f8cdf53', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Pabst Blue Ribbon Light', 4, 0, 0, 0, '', 'PBR is not just any beer- so you would expect the history to be a bit unusual, and it is. Pabst was originally called \"Select,\" but people started asking for that \"Blue Ribbon\" beer in 1882 when we started tying silk ribbons to the bottles. We officially added the words \"Blue Ribbon\" to the bottle in 1895.\r\n\r\nPabst was the first brewery to put beer in cans back in 1935. This was Blue Ribbon beer but it was called \"Export\" when sold in the can. Our first cans had a picture of a can opener on the side with instructions on how to open the can of beer, with the can opener.\r\n\r\nToday, this classic American brew has been adopted by a whole new generation of PBR drinkers. Currently, PBR is one of the fastest growing domestic beer brands. When you''re this good, quality always comes through-PBR ME ASAP!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3af195e9f1ad4d6b907e4bf71d3af311', '3606209ff382499a98637e8bfeaa9388', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Piraat 10.5%', 10, 0, 0, 0, '', '\"Piraat is a ''living'' beer, which means that after the primary fermentation in the keg, the beer also continues to evolve during the secondary fermentation in the bottle or in the keg after packaging. This is a world-class amber colored beer. American beer connoisseurs give it 98 out of 100. No other beer scores better. The flavor is so complex and so rich that every swallow conjures up new associations. Note the spicy light sweetness, which is richly balanced with the robust bitterness of the hops. It is an adventure of a beer, a treat.\"');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3af3e681aa6f434f97d5f43218366518', '65ab7a9116df4270a74ea9cca5f41e5d', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'J&S; Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3affd3665a9a4fee90b0bd362a0a1de8', 'e36fab1869c74ca0a9a0970da2b17d9f', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Coal Porter', 0, 0, 0, 0, '', 'As you look out over Vancouver''s Coal Harbour, relax with this creamy delight. Don''t let the colour fool you - this porter is rich but not overpowering with a head that lingers all the way down the glass. Just about anything goes with our Coal Porter, and you don''t have to belong to \"High Society\" to enjoy a glass with oysters.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3b01431550544ff9a96df3872f953ce1', '924f4d2594fe47a0a732a9e14bc24ad6', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '0efc79b43f194933857739c6141a570b', 'Chateau Jiahu', 9, 0, 0, 0, '', '9000 year old Chateau Jiahu stands apart as the most ancient, chemically-attested alcoholic beverage in the world. Its recreation is based on painstaking excavation by Chinese archaeologists of Jiahuin the Yellow River basin, state-of-the-art microanalysis of pottery residues by American laboratories, and the inspired \"Neolithic\" brewing of Dogfish Head Craft Brewery. Chateau Jiahu, then as now, opens a window into the world of our ancestors.');
