INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3b13d0c6e4b04e0da9489d7e8fc4a228', '4f59d5e4604c4ea2ba6af9921ea40dc0', '98b7246d5e1b4592b15adced83ab36d0', '1c20aafad8964ed4a7626ef53934000a', 'Spitfire Best Bitter', 4, 0, 0, 0, '', 'An English style ale, copper in color with subtle English malt hints balanced nicely with fresh Washington grown Yakima Valley hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3b160acdb2a04998ae68e4cad54fce72', '924f4d2594fe47a0a732a9e14bc24ad6', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Black & Blue', 10, 0, 0, 0, '', 'A belgian-style Strong ale fermented with blackberries and blueberries.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3b16872eeba94ddbb33505a478ace334', '1282ae91d4714281a1b5ec321ca571c4', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'St. Bridget''s Porter', 5, 0, 0, 0, '', 'St. Bridget, a legendary Irish saint, created a sensation by turning her bathwater into beer. What better way to celebrate her worthy miracle than with our zymurgistic tribute to her feat: St. Bridgetâ€™s Porter. St. Bridgetâ€™s is a smooth and elegant brown porter. Brimming with coffee and chocolate characteristics from dark barley malts, St. Bridgetâ€™s is carefully hopped to provide the perfect complement to its malty robustness. This beer is a â€œmust haveâ€ beer for all porter lovers.\r\n\r\nPrepare yourself for a religious experience');
