INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3baed9118da74a2baddc6edd04800b2c', '6373fec6e4d84db5ae7c64f6230502ce', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Mercury - Belgian Style Small Beer', 6, 0, 0, 0, '', 'Messenger of the gods, Mercury symbolizes commerce, travel, thievery, wit and wealth. MERCURY cleverly stole its essence from mistress lover VENUS. Second runnings of the voluptuous quadrupel created this small yet fascinating beer. Indian coriander acknowledges the traveler; a distinct Belgian yeast contributes wit & charm.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3bbc796477e84775932abc5e407c963c', '20f5693ca80c4c74a422a9dfa988e9a6', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Ãœber Pilsner', 5, 0, 0, 0, '', 'A German style Pilsner, pale gold in color, medium bodied with a malty aroma and a crisp hop bitterness (100% Sterling hops). Uber Pils is brewed with three Great Western and two Weyermann malts, Czech Pils Yeast and Free Range Coastal Waters. UberFest Pils is available in the classic Rogue 22-ounce bottle and kegs, from late autumn through early spring. No Chemicals, Additives, or Preservatives');
