INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3bd4522d0aff482cbe234eb27358e965', '470deed21c4a4e57b1eb4378dad85a76', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Horny Toad IPA', 7, 0, 0, 0, '', 'If you like big, bold, pronounced hop character, then this beer is for you.  One taste and youâ€™ll find yourself right smack in the middle of Hop Head Heaven!  But this beer has more to offer than just hops.  We use tons of the finest malted barley available to balance out this beer.  The result of our efforts is a beer with a magnitude of hop aroma and bite, yet perfectly balanced with a clean, crisp malty flavor.  WARNING: This beer is not intended for the masses that prefer a mild domestic beer,  Itâ€™s big, bold characteristics and 7.1% a.b.v. are not intended for the weak.');
