INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3be1bef2f8424e358fa0a4fa5dad0465', 'bc73d3ab58f0435cbaec51be271475a2', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Pig Iron Porter', 0, 0, 0, 0, '', 'Historically, porter had its heyday in 18th century London, where it was the beer of the working class. It doesn''t take much to work up a thirst for this flavorful beer. The distinct roasted and chocolate notes are well balanced by a slight bitterness.');
