INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3c36b27759ee4cd99a9bc9e167c05204', '27f2fd76054546ab995143f1705971b9', '98b7246d5e1b4592b15adced83ab36d0', 'f53645d05b19429d8e74046a3ccf0b8e', 'ESB Ale', 5, 0, 0, 0, '', 'This ESB is a classic British extra special bitter made fresh with an American slant. A beautiful copper color with an amber head, this classic style features five different malts, including imported English malts, and three hop varieties. The rich malty start features caramel notes that develop into a smooth, pleasurable hop finish.');
