INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3c6806494dc3441bacdebce0529cc382', 'f773b893039e4b3894d2dc8e61a8beae', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Three Beaches Honey Blonde Ale', 0, 0, 0, 0, '', 'Nothing beats a day at the beach...  the sun, the sand and, of course, the scenery. Here in Lake Mills, the three beaches of Rock Lake have drawn young and old for generations... to laugh, to play, to frolic, to just escape stresses of life for a time. Three Beaches Honey Blonde is like a day at the beach... light, bleached blonde, gleefully effervescent, free from bitterness and sure to improve your attitude. When you need a little attitude adjustment, spend a day at the beach with Three Beaches Honey Blonde... and you won''t even have to wash the sand out of your suit!\r\n\r\nThree Beaches Honey Blonde is our Wisconsin version of the American Blonde Ale. This beer is light-bodied with a sweet touch of honey and a mild citrus accent.');
