INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3cada136b4e243c2bce0624de78fd5e6', '3c1a29f6db284abda8d558a43582ba35', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'NÃ¸gne Ã˜ Imperial Stout', 9, 0, 0, 0, '', 'We think the russian tsar would have liked his stout this way. A dark, rich ale in which a generous sweetness with roasted malt bitterness.  Serving temp.10Â°C/50Â°F. Great with vanilla ice cream or dark chocolate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3cb7a9e804ce4816a29d937a93a240c2', '06e9be46ac49495ea31f5060bde4ac76', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Red', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3cf4769b45604597b15c0c999b9905d4', '8be478aaefc14c988bbd984ecccaf677', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Yuengling Porter', 4, 0, 0, 0, '', 'Yuengling Dark Brewed Porter is an original specialty beer that has been brewed expressly for tavern owners and family trade since 1829. We are proud to be recognized as one of the largest porter producers in the US. An authentic craft-style beer, our Porter calls for a generous portion of caramel and dark roasted malts, which deliver a rich full-bodied flavor and creamy taste with slight tones of chocolate evident in every sip. It pours dark, topped with a thick foamy head, and imparts a faint malty aroma. This smooth and robust Porter has a unique character that complements any meal from steak or seafood to chocolate desserts. Yuengling Dark Brewed Porter is enjoyed by even the most discerning consumer for its flawless taste and unwavering quality.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3cf5e342dd8e45708dc2612257b3aa6e', '496d4053c5244b3a8465b4b90d457544', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Dark', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3cfddd5d6554426f8e4c742a2cca6510', '457b2dbd441b4eee9e5881835ad40b94', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Misfit Red', 5, 0, 0, 0, '', 'This medium bodied amber ale has a smooth, malt character with a hint of roasted (dark) malt flavor. This beer has just enough hops to balance and goes well with many foods.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3d040586777b44d6bdf166e56aea86b3', '243b8f4ff3b74c7dba16bd88933ee0cd', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Blast Furnace Oatmeal Stout', 4, 0, 0, 0, '', 'Stouts have typically been a staple beverage in the UK.  There are many variations of stouts available. You can find dry stouts, milk stouts, Imperial stouts, American stouts, and even stouts made with oats.\r\n\r\nAt the Church Brew Works we have crafted delicious Toasted Oatmeal Stout.  The oats were blended with the best barley malt we have â€“ and we didnâ€™t stop there.  To give this beer a wonderful roasted flavor, we added unmalted, very darkly roasted barley.  The roasted barley is mixed with a generous portion of chocolate colored malt giving the Blast Furnace Stout a beautiful ruby hue.\r\n\r\nWe used our finest hops unsparingly to create a delicately balanced bitterness with a rich roastiness and fresh hop aroma. The Fuggles and East Kent Goldings hops were added with heavy hands at two different times.  This unbridled addition grants a full hop flavor to our heavenly drink.\r\n\r\nA typical oatmeal stout is a bit lower in alcohol than most other stouts as does the Blast Furnace Stout.  Ours, though not typical, does have a welcome medium body.  As you drink this beer, notice the rich, creamy brown head.  Drink it slowly and savor the flavors.  We donâ€™t think you will be disappointed.  Beer is not just for breakfast anymore.');
