INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3d6cba5711814dc7a928a049b599eced', '1f8e7c84720248fb9a99ac9f53bce489', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber Plus', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3d7ee93b0fc44208899c1df9ae161200', 'b05b68c9de6249ffbd301582608fef6b', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Hop 15 Ale', 10, 0, 0, 0, '', 'First brewed in 2002 to celebrate the 15th Anniversary of the Pizza Port in Solana Beach, Hop 15 was imagined and designed by Tomme Arthur and Jeff Bagby. It was to be a celebration of 15 years of \"Good Beer Brings Good Cheer.\" So there are 15 different hop varieties that are added to the beer every 15 minutes. Over the years, Hop 15 has racked up numerous accolades. It has won two silver medals at the Great American Beer Festival. It also was named Alpha King in 2004 and received a first place award at the Bistro Double IPA beer festival in Hayward, CA. Hop 15 remains won of the stickiest most resinous beers we have ever tasted and for that, we are thankful it is on tap at our brewery each and every day.\r\n\r\nMalts- Two Row and English Light Crystal\r\nHops- We use 15 Different Varieties on a strictly don''t ask don''t tell policy\r\nYeast- White Labs California Ale and Proprietary Yeast Strains\r\n\r\nOriginal Gravity- 1.086\r\nTerminal Gravity- 1.014\r\n9.7 % ABV\r\n\r\nDraft- Available in Southern California 22 Oz Bottles and Cases- At Port Brewing San Marcos and Pizza Port Carlsbad, San Clemente and Solana Beach and wherever better beers are sold.');
