INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3d953d68e83c4cd4b1d517a65b576554', '6373fec6e4d84db5ae7c64f6230502ce', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'RUMBAH Double Rum Bock', 10, 0, 0, 0, '', 'Beer Description:\r\nThis double bock provides smooth sailin'' in rough seas. The fact that this luscious lager was aged in rum barrels creates the illusion that the open sea is a safe place. And while riding out these waves of grain, you may fall victim to the dangers of pirates, rum, bock. OK...maybe the beach is a bit over-rated.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3d960011620e4dfc81e998f78e1e7b7d', '188bc6729fb34c68894d1145443b628b', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Shawnee Amber Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3d9720bf1b30455a87be7ed833d1455d', '6487c70165aa48038841d23c930e1a80', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'HUB Lager', 5, 0, 0, 0, '', 'Our Czech style pilsner is all malt all the time-no choicest rice or corn syrup here! Whole flower Czech Saaz hops balance the delicate honey flavor of our organic Canadian grown pilsner malt creating a golden beer with depth of character.');
