INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3df373c5076042d5835f032145e0497b', 'bef3198dea9243d09ed8b09b5f8cdf53', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Lone Star', 4, 0, 0, 0, '', 'The National Beer of Texas\r\n\"Lone Star beer uses the finest hops from the Pacific Northwest with hearty grains from the Central and Northern Plains. The GABF recognized Lone Star as a high quality American Cream Lager by awarding it with a silver medal. Malted barley and corn extract combine to provide Lone Star with nature''s finest ingredients for brewing. Lone Star''s ingredients give this beer its full natural flavor. The choicest hops lend complexity and aroma to this beer, and its proprietary mashing regimen creates the perfect balance of alcohol, body, and character.\"\r\nRegional to Texas. It is brewed under license by Miller Brewing Co., Fort Worth, TX.');
