INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3f271864957640f08293bec5f1aacc27', '11db376808e64df8bbcb94b3b4440a9d', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'State Pen Porter', 6, 0, 0, 0, '', 'A trademark beer of the Santa Fe Brewing Companyâ€™s master brewer, Ty Levis, the State Pen Porter has every reason to be one of his favorites. It is flavorful, swimming with notes of nuts and chocolate; it is drinkable, so drinkable that it is almost as if pint after pint were drinking itself.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3f2b79f868fc4a108103fa1f05436dcb', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Budweiser Select', 4, 0, 0, 0, '', 'Bud Select is a new beer offering a bold taste with a full and distinct flavor that finishes clean. Budweiser Select was developed using two-row and roasted specialty malts for a rich color. It offers excellent drinkability and a taste that does not linger.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3f309012d2284b0d9e0f4efb4c70e16e', 'f743f04357824c41994f695c5034da14', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Scratch #21 2009 - Artisan Ale', 7, 0, 0, 0, '', 'Scratch #21-2009 is an exercise in deconstruction and minimalism. This Belgian Ale has distinct roots in The Mad Elf minus some key components.\r\n \r\nThe cherries? Gone.\r\nThe honey? Gone.\r\nThe chocolate malt? Gone.\r\n\r\nWait, this sounds familiar. It almost sounds like a naked version of The Mad Elf.\r\n \r\nComing in just under 8% ABV, this unfiltered golden beauty shows off the pronounced yeast flavor that made The Mad Elf famous as well as a touch of alcohol and some mellow malt flavors.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3f40f24aa9d64bebab0e827f9722bc43', '91f2a107c04b48769e7a777660cf9e7c', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Scharer''s Lager', 5, 0, 0, 0, '', 'A traditional German-style lager, fermented at 7-9Â°C and lagered at 4Â°C for 4-6 weeks. The storage produces a soft, natural carbonation. Full-bodied with high bitterness and hop flavour and a dry finish. Hoppy aromatic nose. Available on draught or in 780 mL champagne-style bottles. Can be difficult to acquire.');
