INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3facbfa0b676413da201bbaf24f9227e', 'c4007a8cd9ff47faafbe243795fd3ffe', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Abbey IPA', 7, 0, 0, 0, '', 'Belgian IPA, West Coast hops meet belgian yeast. Spicy, fruity and citrusy notes combine for an interesting fusion brew.');
