INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3fd902b56f644ae6b239f8fac00952a5', '65c02b64831c412bbd80a7d2e5780d32', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Penn Oktoberfest', 4, 0, 0, 0, '', 'A rich, deep golden-colored lager fest bier that is exceptionally smooth and mellow. Uses two-row malted barley and a combination of roasted malts. Highly rated by the National Tasting Institute.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('3fe42dcebe5b4c49b33c947e3e35c1c9', '94b2e7e841504f858034cf078e80a792', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Phin & Matt''s Extroidinary Ale', 5, 0, 0, 0, '', 'After sampling a wide array of great beers, the duo hit upon an idea.  \"I''ve got it!\" exclaimed Matt, \"we''ll use vast amounts of whole hops, the finest malt, and put a little love in each batch.\"  \"Eureka!\" shouted Phin.  And thus became a beer so fresh and tasty they had to put their names on it.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('400193587a4c4a75a2dacff4c83d737d', '7eb26853c6ae4f8382558a236d3edd58', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Partly Sunny', 5, 0, 0, 0, '', 'Partly Sunny is hazy-straw colored wheat beer with coriander, and generous amounts of lemon zest. It''s a light refreshing beer with a subtle spicy start and a smooth citrus finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('400684b4303647d3b9b58a162a36da94', '894593f13916499cb1c6f6f3a5fb3e69', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Parking Violation', 5, 0, 0, 0, '', 'Wouldn''t it suck to have a job where nobody likes you? And, regardless of your name, people always call you Rita, as in \"Lovely Rita?\" Sometimes people just shorten it to the simpler \"meter maid.\" The funny thing about that is the Webster dictionary defines a \"meter maid\" as \"a female member of a police department who is assigned to write tickets for parking violations.\" You have to wonder how the male \"meter maids\" feel about that! Parking Violation is an American style pale ale using lots of American hops, lots of quarters, and several trips back and forth to the parking lot. So, remember to drink responsibly and feed your meter.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4045cd2f4ec9477aa8e4e8bd3a72ad0d', '048f9156b40a469781e7e19d6321d6b5', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Samuel Adams White Ale', 0, 0, 0, 0, '', 'Spicy yet smooth. Brewed with 10 exotic spices.\r\nThis beer''s roots are in Belgium, and the classic Wit biers produced by Belgium''s brewers. The style gets its name from the white, milky appearance of this unfiltered wheat ale. The brewers of Samuel AdamsÂ® beer, taking inspiration from the Belgians, have created a classic of their own. On the malt side, we use malted two row Pale barley, malted wheat, and Munich malt to give this beer a crisp, malty, cereal finish and smooth mouth feel. The hops used are Noble Tettnang Tettnanger hops. At the end of the kettle boil, we add a proprietary spice blend to give Samuel AdamsÂ® White Ale a unique and complex flavor, without being overpowering or cloying. The spice blend includes orange and lemon peel, dried plum, grains of paradise, coriander, anise, hibiscus, rose hips, tamarind, and vanilla. It is this special blend of spices that gives Samuel AdamsÂ® White Ale its unique character, complexity and refreshing drinkability. The beer is coarse filtered, leaving a white haze from the malt proteins. Our proprietary top fermenting ale yeast ferments the beer, imparting its signature character - bright and slightly fruity.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4082879fd5264983b421cb4c96574da6', 'a9584f0278e545c4810c2d7bfe3a5c8b', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Two Guns Pilsner', 5, 0, 0, 0, '', 'A Czech style Pilsner, Two Guns is golden in color with a soft malt character derived from Bohemian barley and just enough spicy bitterness to make another tasted desirable.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4090bd89417046fab7edcd89ad2ba729', '47a3de1b57274a59b0ff59c5d112c6d5', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Saranac Caramel Porter', 5, 0, 0, 0, '', 'Saranac Caramel Porter is a Robust, flavorful porter Reminiscent of a by-gone era. True to brewing tradition, we''ve used dark caramel malt, as well as Fuggles and East Kent Goldings hops for smooth, yet slightly bitter, roasted flavor, look for hints of the real caramel used in brewing this delicious beer!');
