INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4160881e59c746a49d16bac71b6dcea5', 'ecbfbc639150435191d6af029ff71bd7', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Lancaster Winter Warmer', 8, 0, 0, 0, '', 'Our classic Olde Ale redefines the term \"full-bodied\" with its deliverance of complex and firm malt flavor. A fine blend of British and American hops provides an even bitterness as this beer finishes with a warming alcohol flavor.');
