INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('41c9685d4e15425c9c58a665ef752ea6', 'cdafaf89b3d14193a41c9a2be4b2b29d', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Bachelor ESB', 5, 0, 0, 0, '', 'Standing alone, distant from the Three Sisters mountains nestled to the north, Bachelor Butte was originally called \"Brother Jonathan\" and then simply \"The Bachelor\" before becoming widely known today as Mt. Bachelor.');
