INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4260323b51654435bcd035d31df23a29', 'd363d7dc902f40a996ff127d2617c980', '98b7246d5e1b4592b15adced83ab36d0', '722a236919264104b2bb85a0e24f9744', 'Scottish Ale', 3, 0, 0, 0, '', 'Malty and hoppy, we at Belhaven love the classic Scottish Ale and we''ve been brewing it longer than any of the other beers we produce. Delivering a sweet, smooth and creamy finish, Scottish Ale has a stunning ruby colour in the glass. Magic.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4263ec82261e4bf29ad3df6d0fa4eaf1', '452d2a79e90843b089590730923838fa', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Stella Artois', 5, 0, 0, 0, '', 'Stella Artois was first brewed as a Christmas beer in leuven. It was named Stella from the star of Christmas, and Artois after Sebastian Artois, founder of the brewery. It''s brewed to perfection using the original Stella Artois yeast and the celebrated Saaz hops. It''s the optimum premium lager, with it''s full flavour and clean crisp taste.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('42683f6afbee4bf6bc9b2eafc59c163f', 'a5197ed517514f8fa66e3ad03627c21a', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Ipswich Oatmeal Stout', 7, 0, 0, 0, '', 'Deep, rich, and malty with hints of chocolate and coffee. It''s what espresso would be if it had the gumption to be beer. We use three different hop additions, specially selected crystal malts, roasted barley, and oatmeal to give it a soft and silky mouth feel. Makes a great dessert. Or meal.');
