INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4308a0cadf154615b62e63083c08812a', '20f5693ca80c4c74a422a9dfa988e9a6', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Oregon Golden Ale', 0, 0, 0, 0, '', 'Oregon Golden Ale is the original Rogue brew dating back to 1988 and the days of the old Ashland brewpub location (which was destroyed by a flood several years ago). Deep golden in color with a rich malty aroma. Delicately smooth and crisp flavor and an herbal finish. Oregon Golden Ale is created from Northwest Harrington and Klages, and Maier Munich Malts (18% speciality grains, .19 lbs grain per bottle). Kent Golding and Cascade hops. Oregon Golden Ale is available in a 22-ounce bottle (the 12-ounce 6-pack was phased out in early 2005), and on draft.');
