INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('438636393f6041b782c73743a68a877d', '78700d13d7c84834a0330a6b31b5bfc5', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Black Hook Porter', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('43896d00700d464ea1be8340518b9a4c', '6373fec6e4d84db5ae7c64f6230502ce', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Arctic Rhino Coffee Porter', 5, 0, 0, 0, '', 'Inspired by local artist & roaster Michael Allen''s eccentricly-named blend of coffee beans, Midnight Sun''s brewers designed a beer recipe and infusion process that perfectly captures the alluring aroma, satisfying flavor and curious legend of Allen''s Arctic Rhino Coffee. \r\n\r\nArctic Rhino Coffee Porter combines two quintessential Pacific Northwest favorites: coffee and ale. The result is wonderfully romantic and robust--a duel-fueled porter that melds charismatic dark malt with freshly roasted coffee beans. The (un)rest is up to you.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4390b6a8db6641c5a0c74f763eed52f8', '2dc4ecd978944c7f87c9f8fdef8b798e', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Loose Cannon Hop3 Ale', 7, 0, 0, 0, '', 'Loose Cannon Hop3 Ale - called Hop 3 (hop cubed) ale to reflect the enormous amount of hops in this beer: over 3 pounds per barrel! Also the beer is hopped 3 ways - in the kettle, in the hop back, and dry hopped. Winner of the Overall Best of Show Award in the Maryland State Governor''s Cup 2005 Competition and voted the #1 IPA by Mahaffeyâ€™s Pub. We are very excited about this new product and have decided to make this beer available year round!');
