INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('44d5c2ffa2284245bfad9000aa1f407e', 'fc43d14270a54c9db030c1ffae3c1e71', '98b7246d5e1b4592b15adced83ab36d0', '1c20aafad8964ed4a7626ef53934000a', 'Tribute Premium Cornish Ale', 4, 0, 0, 0, '', 'A Supreme Champion Ale of Cornwall as\r\nvoted by CAMRA*, and the South West''s Favourite cask beer**, Tribute is a popular\r\nfavourite with locals and visitors to Cornwall, as well as being a much sought after guest ale throughout the rest of the UK. It is brewed using specially grown Cornish Gold Malt and is a perfect accompaniment to chicken, gammon or fish. The ideal alternative to a fine white wine.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('44d757dbdbcf4398bc76839638020bd6', '4f59d5e4604c4ea2ba6af9921ea40dc0', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'First Flight Amber Ale', 4, 0, 0, 0, '', 'Our first beer brewed right here at Flyers.  This ale has brownish red hues with a mild maltiness balanced by an herbal hop character without being bitter.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('44d89e36cf4b42c98344ec00ee29f086', '416ea173551e49e3a04d39a6a66394a9', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'The Captains Porter', 6, 0, 0, 0, '', 'Our porter is a full bodied, semi-sweet dark ale, with distinct notes of caramel and chocolate. A touch of English grown Fuggles gives balance to the complex malty sweetness. Brewed in the loving memory of our Brew master''s grandfather, the Captain.');
