INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('457b365221d44369a31fe25879f0b655', 'e7af68d03e024d5e81ddc79948a1bd26', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Tumbleweed IPA', 5, 0, 0, 0, '', 'A GOLD MEDAL WINNER at the Great American Beer Festival, beating out 98 other IPA''s and chosen as the best IPA in the country! It''s amber color and incredible hoppy aroma will keep you coming back for more. R-U-HOPPY?');
