INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('45b31657feea471c8208d3b204f5fc03', '498f96a6317944739b07d0ae1870762b', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Saison Athene', 0, 0, 0, 0, '', 'A bottle conditioned Saison with a spicy and moderately hoppy profile true to the traditions of the farmhouse ales of Wallonia.\r\n\r\n A spiced saison with chamomile, rosemary and black pepper.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('45b42381e0154d59802107dfd539d3d9', 'ec4141f64a894cc6b7ca999be18af4cf', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Wheat Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('45c57f8a3e254665bbd834169be3b3df', '2e35a41312ab4c219425cac5d30434f3', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Powder Hound Winter Ale', 0, 0, 0, 0, '', 'Two words describe Montana winters... Cold, dark, and snowy. And we wouldn''t have it any other way, because it''s the only time of year for Powder Hound, our Northern Rockies Winter Ale. Rich malt taste and an avalanche of hops will make you want to say these three words- \"I''ll have another Powder Hound!\"  \r\n\r\nSince Powder Hound is our own creation, it does not fit neatly into a style. Some folks would call it an \"Old Ale\" and others might call it a \"Winter Warmer\". Regardless of what you call it, Powder Hound satisfies, with the fine, hand-selected British hops fully complementing the smooth malt notes. After a day on the snow, enjoy a Powder Hound Winter Ale. Available November through March.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('45db77adbc5d4ba39f13a2970b82c869', '5b469c9b89ad4622a522130b05c99f04', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Kilt Kicker Wee Heavy', 7, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('45df83902ba9421886e266e3de459ea5', 'df98eedf513f4f8a89341ee7e82e8ae6', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Premium Light Lager Beer', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('45dfab81f6e8492c869e65117b5b82d4', '1a9e4f4f52454556b71ad5a28b6674b2', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'd01c4741043a4547ae78c9f205ee8728', 'Partridge In A Pear Tree', 12, 0, 0, 0, '', 'Our holiday beer is a Belgian-style Dark Strong Ale, brewed with our brewery-made dark candi sugar, Munich and Vienna malts. Dark brown in color, fruity and complex with a rich malt backbone. This is a simple yet immensely complex beer meant to be savored and shared with friends and family.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('45e57d11a1024b77994349e5031d1cbf', '7137c9cb29c54115b553ab53272b7bc0', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Dale''s Pale Ale', 6, 0, 0, 0, '', 'Dale''s Pale Ale is our flagship beer and America''s first hand-canned craft beer. It''s an assertive but deftly balanced beer (somewhere between an American pale ale and an India Pale Ale) brewed with hefty amounts of European malts and American hops.\r\n\r\nIt features a merengue-like head, a copper color, and a hoppy nose, thanks to a big post-boil addition of Centennial hops. To complement its hoppy first impression, Dale''s also sports a rich middle of malts and hops, and a bracing finish. Dale''s is 6.5% alcohol by volume, and features 65 International Bittering Units.\r\n\r\nWe think of it as the perfect, everyday beer for hopheads like us. Dale''s Pale Ale''s rich flavor has helped us make many new fans, and its numerous honors have helped us kick huge holes in the misconceptions regarding cans.');
