INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('461c3ffc2ab54e8d8b5a5f4f5b50276d', '29e8f8978b92426283fed1fcf7dcb14b', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Single Chair Ale', 5, 0, 0, 0, '', 'A Commemmorative Brew Single Chair celebrating the uniqueness of the Mad River Glen Cooperative Ski Area in Vermont. \r\n\r\nMedium bodied & ideally balanced for all tastes, Single Chair Ale''s tempting light golden color, heady aroma & smooth liquid go down effortlessly and often!');
