INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4647b50df6334e9da34fa14ea97b7ff7', 'bde34f02faa14be5ac1b1c030316e6cf', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Paradise Porter', 4, 0, 0, 0, '', 'This medium bodied porter has notes of roasted and chocolate malts, making it a perfect balance of sweet and bitter.  Generous hops give this brew a dry finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('465bfe01bd364d0caab6424e91f94030', 'c65343e9857c49ebb841bba0081b83da', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Tilburg''s Dutch Brown Ale', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4663d50a029344b59cd0a60641cd102f', 'e36fab1869c74ca0a9a0970da2b17d9f', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Blitzen Christmas Ale', 8, 0, 0, 0, '', 'A strong, fruity, belgian-style trippel 8.5% alc./vol.\r\n\r\nOur aptly named Christmas Ale is based on the strong beers traditionally brewed by Belgium''s trappist monasteries. Trippel is typically at least 8% alc./vol. and has a light golden colour. Because of its high strength this beer has an intensely fruity palate. Up front it has a honeyish sweetness but the finish is dry and champagne-like. Most weary Christmas shoppers would be well advised to benefit from the warmth and ''ho-ho-ho factor'' that only a beer of the Biltzen''s calibre can provide.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('46671c44990f41ee8cc7493155e66f2f', '8ce368ec5649491d81d46a5438d244da', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Pecan Street Lager', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('466ba42619a74f6b858c36bfd034831a', '947619f1f42248e7b9bf1aa88fc91e97', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Hard Woods Pale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('466c27a76bad4d06b8408358807906d8', 'e7c41aa1122b4d3780bb693212685d69', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Dubbel Dragon', 7, 0, 0, 0, '', 'This Dubbel style Belgian beer is created in the great Belgian tradition. Pale Malt, Caramel and Special B Malts impart a unique sweetness to this beer. The traditional Belgian yeast fully ferments the Belgian Candi Sugar to give a satisfying taste that is twice what a Belgian pale delivers.');
