INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4677f16010c44fc1960e4504fb6bdcc5', '70b7bbf10ef4416da5715c8b7da19879', 'e315bd61d4f94ab3a67b28feec8a5343', '86d03d2fdda8496ab073c29533460078', 'Cricket''s Nocturne', 4, 19, 0, 0, 'nocturne2.jpg', 'Cricket''s Nocturne: a dark lager that combines a mild crispness with subtle toasty, chocolate notes to make it the perfect thirst quencher on days when there''s a chill in the air. It;s a great accompaniment to hearty winter meals, or dessert by the fireside.');
