INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4766b9ef491042afacd587614ff5ea62', '5bafddb45bee47eda6da50325994331d', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Valley Brewing Apricot Ale', 4, 0, 0, 0, '', 'Apricot Ale is a fruit beer produced using 100% Apricot fruit extract. The beer has a hint of Apricot in the nose and a sweet clean and refreshing finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4778b3f945bd4e7d8d750b87d7040232', '41850dda0ffe494aa21397a0ed521569', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Speedway Stout', 12, 0, 0, 0, '', 'A HUGE Imperial Stout that weighs in at an impressive 12% ABV! As if that''s not enough, we added pounds of coffee for a little extra kick. Our special-edition Brewer''s Reserve Speedway Stout, which is aged in Bourbon barrels, has been rated the #1 BEST BEER IN THE WORLD at ratebeer.com. It was also featured on CNBC''s \"Squawk Box\" in a segment on the best dark beers in America.');
