INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('489c078c8f274196afd1ffd3d982d72d', '493a96917cef45929c4a0bce5e3ac9a1', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Hop Hed Red Ale', 6, 0, 0, 0, '', 'Resinous hop character and bitterness balance the rich carmel malt base. We took it a step further and Amarillo dry-hopped the brew to 45 ibu''s, creating refreshing and savory hop flavors and aromas. Is it red IPA? That''s your call.');
