INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4910568d466e4f89817e34db5a2aa1c5', '470deed21c4a4e57b1eb4378dad85a76', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Heffevonom Bavarian Wheat', 0, 0, 0, 0, '', 'A truly delicious beer, Heffevenom is a medium bodied, lightly hopped wheat beer brewed in the true Bavarian tradition.  Our brewers combine mountain pure water, select wheat and domestic malted grain, hops and yeast to create a highly refreshing ale with a pronounced banana and clove bouquet. Perfect with a slice of lemon as garnish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('49185c31588f49c691ff2660ef425c55', '6eeef1af404f41f88719ccfee7e42666', 'e64b30f392b4437b82ec46e764453ac1', 'f0821cb45038450ea4d7fad8e5af7cf8', 'Old BullDog Extra Special', 5, 0, 0, 0, '', 'A hearty extra special beer or basically a pale ale on steroids.  A dark amber beer with a rich blend of  malts.  The base malt is full kilned pale 2-row barley and is combined with full tasting crystal malt.  This beer has a great heavy late hop addition of East Kent Goldings (that cost us our lunch money for weeks...). ALWAYS AVAILABLE or at least we try.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('491c2b562fa34532bd9c991c952b04c0', '04241a8bf653472398b9a0f38c857ab2', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Amber', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('493dd313d47d417f93ab512a716da64f', '29e8f8978b92426283fed1fcf7dcb14b', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', '#9', 4, 0, 0, 0, '', 'Not quite pale ale.  A beer cloaked in secrecy.  An ale whose mysterious unusual palate will swirl across your tongue and ask more questions than it answers.\r\n\r\nA sort of dry, crisp, fruity, refreshing, not-quite pale ale.  #9 is really impossible to describe because there''s never been anything else quite like it.  Our secret ingredient introduces a most unusual aroma which is balanced with residual sweetness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('495215ed864b4abfa9db6fb196b525d2', '387f03355e29436597aee9e25a247c44', 'b7ee8858a0b549ddb2361e1ed313f6e1', '3a8d4356f46746979884c04ffd896fbe', 'Oro de Calabaza', 8, 0, 0, 0, '', 'Brewed in the Franco-Belgian tradition of strong golden ales.  Spicy and peppery with a gentle hop bouquet and the beguiling influence of wild yeast.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('49624ea7e4304a1e8351218d1f7dd9e0', '40098866e3804736a2778481567f2d25', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'SchÃ¶fferhofer Hefeweizen Hell', 5, 0, 0, 0, '', 'classic Hefeweizen, cloud because it is traditionally unfiltered, was tested and rated by the German consumer magazin \"Ã–kotest\" as \"very good\" for pureness and residues of pesticides and so on');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('497c1d797d1444a2a64915c60ff64371', '3606209ff382499a98637e8bfeaa9388', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Tikka Gold', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('49846126f20142938561e36c02120d00', '586b36c006c048efb522f39ed80bc6bd', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'The Iron Tankard', 9, 0, 0, 0, '', 'The Brew 1 â€“ March â€“ â€œThe Iron Tankardâ€ Old Stock Ale â€“ The building started as a YMCA in 1889 and had a huge iron swimming pool in the basement.\r\n\r\nFrom Spike: Iron Tankard â€œOld Stock Aleâ€ is the first of four beers in Terrapinâ€™s Georgia Theatre Sessions. It is brewed with a generous portion of crystal malts for a full body and is lightly hopped. This malt forward beer has flavors of dark dried fruit, mellow alcoholic warmth and is unfiltered for your listening pleasure.\r\n\r\nA portion of the proceeds will be donated to the Georgia Historic Trust for Historic Preservation Fund to rebuild the Georgia Theater. To make things even more interesting, there is one Golden Ticket hidden among each of the Georgia Theater Sessions brews. This means that four lucky winners will receive a lifetime pass to the new Theater.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4994d4cff8d14b049203696a9b78701f', '52a95674252c4c3780cbba8631bf2efb', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Hell', 5, 0, 0, 0, '', 'Atwater Block beers are brewed using traditional German methods to create a distinctly fresh and flavorful character. Our classic Helles (German for Pale) is a crisp lager that is sure to please.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('49a98eef9a5d473ab0a6130805e0681e', 'db6ad11ebc394d5bade9f4f025197642', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Bagpiper''s Scottish Ale', 9, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('49b1e421abd7461f83399434cdcf8665', 'cdafaf89b3d14193a41c9a2be4b2b29d', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Cinder Cone Red', 5, 0, 0, 0, '', 'Cinder Cone Red''s diverse selection of hops and barley captivates thirsty palates with its toffee-like flavor, intense citrus aroma and defined bitterness.\r\n\r\nLocated on the northern slope of Mt. Bachelor, the Cinder Cone was also known as \"Red Hill\" due to its reddish color that is revealed as the seasons change, the weather warms and the snow melts.  It''s spring. Time to get outside.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('49c6cc37d1084e91bbb0a342ae0b5b51', '6334d2db5f4c49f79f9feed47ea8061d', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Hefe Weizen', 4, 0, 0, 0, '', '');
