INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('49d77653fb58434f8f2b01d4ba2fc678', '74edc26599b04f5a944a8b5acbd629ba', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Broken Halo IPA', 6, 0, 0, 0, '', '\"Broken Halo IPA is a beer produced in the spirit of traditional IPA products shipped from the UK to India in the late 1800s. The almost excessive amounts of Cascade and Columbus hops used in Broken Halo give it notable citrus and grapefruit aromas and flavors. The beer bitterness measures high but tastes smooth due to the full-bodied, Caramel malt sweetness. The finish is juicy, clean, and short lived. A devilishly bold, heavenly smooth India Pale Ale.\"\r\n-Widmer Brothers Brewing Company');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('49f31e045c7a4485a4575a1d3daf2a7a', 'c0a1c4528b7443e1bd86f92f75f4ab0d', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Maibock', 0, 0, 0, 0, '', '');
