INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4a544c97736f462d91a8ee26736d6588', '99f4e4af97a24455a3ac3b277620c04d', '98b7246d5e1b4592b15adced83ab36d0', '0a4bb7119e2f41faa7b40acf63b2e0c6', 'Magnificent Mild', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4a571402dfc149ae84400311ee95085b', '8a0066befe3b4c94a0da0a9f5b639f6e', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Raspberry Imperial Stout', 8, 0, 0, 0, '', 'Enjoyed alone as a winter-warmer or as the perfect finish to any fine meal, our Raspberry Imperial Stout is a wonderfully full-flavored beer with just a \"kiss\" of raspberry flavor. \r\nWhen we brew this beer we add just a touch of real raspberries during the fermentation process. The result is a modest fruit flavor which enhances--- without dominating the rich, malty, stout taste.\r\n\r\nOur Raspberry Imperial Stout (8.0% ABV) is great alone or as an after-dinner accompaniment. It''s especially good with chocolate desserts. We brew it only during the winter months, so check out the Brewing Schedule on the \"What''s New\"  page for the next time it will be coming to a beer store near you.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4a650705e7864fdcb653e16aaa1002fa', '7fbcad792e784e8883357fb25affd2f4', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Dundee Scotch Ale', 6, 0, 0, 0, '', 'Our Dundee Scotch Ale begins with a traditional \r\nsweetness and finishes with a full, malty flavor. Donâ€™t be fooled by the dark colorâ€”this beer is delicious and surprisingly easy to drink.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4a6e1cf9ea7a46469defe38109a6dca7', '70d0ad6cf59849a394d87fb9c49a472b', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'BaderbrÃ¤u Pilsener', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4a6f2cffa5374dc693516d317f62742c', 'b67c5d7317f84d76a2a3874cf45661bb', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Mackinac Pale Ale', 5, 0, 0, 0, '', 'A classic American style pale ale. A well balanced, light copper colored, medium bodied ale with a distinctive hop bitterness and aroma.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4a8b5c2de0cc4347a45d81951d994fc1', '8a0066befe3b4c94a0da0a9f5b639f6e', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Heresy', 8, 0, 0, 0, '', 'This incredibly intriguing Imperial Stout is made by aging our Old Heathen in some very famous Oak barrels that were used for aging bourbon! What do we have when we are done? A stout whose very essence has been enhanced. A stout whose complexity has been increased. A stout with notes of Oak, whiskey and vanilla melding together to create a new sensation. Have we gone too far this time? We don''t think so. Heresy is a step above and a leap beyond the extraordinary. Taste it and see what everyone is talking about. 8.0% ABV');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4aa1797998c4436ab719dd266c956b2f', '3f9364c3e02848ccb9c89a876ee7a9c3', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'Pirate''s Porter', 5, 0, 0, 0, '', 'Arrr this be a dark beer with strong notes of coffee and chocolate flavors.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4aaa6d913cc8449cb9b3fef3f957ea66', '9c3ee95b24104dfd9b624cf02a81b1df', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Boulevard Dry Stout', 4, 0, 0, 0, '', 'Velvety black and perfectly opaque, our bottled Dry Stout is the somewhat livelier companion to our popular draught version of this enduring style. This surprisingly smooth, drinkable beer is a delightful harmony of smoky roasted flavors and tangy, coffee-like notes.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4ab6d1d9bd9847fcb92b39bccc66dc89', '4920bec333184ceb9322d199d5fb8a2e', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Schaumbergfest', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4ab93bc7f3be4e1586d91fd3b301a3c9', 'b4724c113f634dd7a21151d616392a60', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Hacker-Pschorr Original Oktoberfest', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4abb020a1a0f4977bcac48e6cd0d529f', '4e1b9cf2283a43139cde58205e6f27d4', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Kate The Great Russian Imperial Stout', 9, 0, 0, 0, '', 'The granddaddy of stouts.  Intended for export to the Imerial Court of Russia''s Catherine the Great.  Jet black.  Full-bodied.  Very strong.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4ac8dbefeb784850bebbfb346c4bffcc', 'afa3314de974447a9ba68b2b7f6f6873', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Little Creatures Pilsner', 4, 0, 0, 0, '', 'Czech Saaz hops are added early in the boil with a late hopping using a hybrid variety we keep to ourselves, giving light flavour and a soft bitterness. Lightly kilned pilsner malt gives the beer both itâ€™s light, slightly golden colour, and leaves a crisp clean taste on the palate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4ad68891643c4778b78737902de674a9', '52a95674252c4c3780cbba8631bf2efb', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Rost', 5, 0, 0, 0, '', 'Rost (pronounced Roast) is a German word for Amber. Our Amber gets its coppery color from Pilsner. Munich and Caramel malts. Its rich malty sweetness is perfectly balanced by a slight hop finish and creamy head.');
