INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4b6720c7b4d041519f480b3a0621bbef', '6e8b38e283cb4f87a958f00dbad901cb', 'bf3112301857461f82c7633c0a695896', '98950448f00e4eb7b81ed9628258d643', '(512) ALT', 6, 0, 0, 0, '', '(512) ALT is a German-style amber ale that is fermented cooler than typical ales and cold conditioned like a lager. ALT means â€œoldâ€ in German and refers to a beer style made using ale yeast after many German brewers had switched to newly discovered lager yeast. This ale has a very smooth, yet pronounced, hop bitterness with a malty backbone and a characteristic German yeast character. Made with 98% Organic 2-row and Munch malts and US noble hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4b76587a215646b09b0d1cfba655ed7c', 'b929f6eca93d4496bb0068697d87aa96', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Barney Flats Oatmeal Stout', 5, 0, 0, 0, '', 'With its deep, dark brown-black color, thick, full-bodied, velvety-smooth mouth feel, mocha character, and, strong yet subtle hop bite,  Barney Flats Oatmeal Stout  is one of the thickest, richest, and most complex stouts on the market today. In 1990, it became our first gold medal winner, at the Great American Beer Festival.  Barney Flats  was judged so superior to the other stouts that no other medals were even awarded in its catagory. Try it and see why Stewart Kallen described it as, \"Slippery, creamy, dark, and sweet as a Pacific May morning,\" in his book,  The 50 Greatest Beers in the World\r\n\r\nBarney Flats Oatmeal Stout Most recently won the Silver Medal at the 2004 World Beer Cup® and the Bronze Medal at the 2004 GABF , as well as several other medals . Click the blue ribbon to see the entire list.\r\n\r\nAs with all of our products, Barney Flats Oatmeal Stout is never sterile filtered nor heat pasteurized, and should be stored in refrigeration. However, to fully enjoy its rich and complex flavor, it should be served between 40° and 45°F');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4b7dd4d9fcb0474189019e754d5e899a', '88c949e73761482bbd1f2badf91ec46c', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Zwickel', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4b8437771f254a89a58e3905d4412843', 'c99ca2f0ebc14372b3bbf7bb4c6a5d66', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Molson Canadian', 5, 0, 0, 0, '', 'Molson beers are imported directly from Canada.  Crystal-clear, pure Canadian water, the finest Canadian prairie grains and select European hops give Molson a brewing heritage that dates back to 1786.\r\n\r\nMolson Canadian is Molson Brewing Company''s flagship brand.  Starting with crystal clear water, malted barley and the finest hops, Molson Canadian is slowly fermented to produce a smooth, refreshing beer with a genuine taste. Clean and clear, crisp and cold, Molson Canadian is a classic lager.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4b89bd6ba31c4e19864df0544bd2177a', '32629f72e41245c7b98912e872917b62', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Oberon Ale', 5, 0, 0, 0, '', 'An American wheat ale brewed with Saaz hops. Spicy and fruity, Oberon is the color and scent of a summer afternoon.');
