INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4b99d8dc5176410b8a0d4144e17e5775', '8b52b84027464dacbcce8587006796bd', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Winter Cheer', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4b9e4858967c4aa4a4ed492de5c45ff3', 'f6b4fa787e0a43418b88dcf6cf75b5ab', '98b7246d5e1b4592b15adced83ab36d0', 'f53645d05b19429d8e74046a3ccf0b8e', '8th Street Ale', 4, 0, 0, 0, '', 'Now In Bottles!! Our award winning 8th Street Ale is based on an English-style \"Best Bitter\" which is the most common ale served in British pubs. What makes 8th Street Ale uncommon is its mellow bitterness and its slightly sweet malt flavor. It''s aroma is derived from rare, imported Kentish hops, and lots of them.\r\nAlcohol content approximately 4.5% by volume (ALWAYS ON TAP!!)');
