INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4c8f2acc03fa41a599ec219b05afb98d', '3f9364c3e02848ccb9c89a876ee7a9c3', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Sherwood Forest IPA', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4cd6109a4f5e43b4bc1ed6b66e7ab8c5', '6e105f5645d646c890ec40b6bec9b509', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Meantime Coffee', 6, 0, 0, 0, '', 'Whilst we wouldnâ€™t recommend having this at breakfast with your bacon and eggs, our Coffee Beer is made with real coffee and has a caffeine hit to match. The natural flavours of the beans selected and hand roasted by our friends at the Union Coffee Roasters go well with the roast barley in the beer to give a silky-smooth drink with distinct chocolate and vanilla notes. \r\n\r\nOur first formulation of this beer was the first UK brewed beer to carry the Fairtrade logo, and, although we have reformulated it to create an even better blend of malt and roast coffee flavours, we can no longer get enough coffee in each bottle to qualify for Fairtrade status. However we are still using the same Faitrade Araba Bourbon beans from Rwandaâ€™s Abuhuzamugambi Bakawa Co-operative.\r\n\r\nAt the Meantime Brewing Co we love flavour, so it wasnâ€™t exactly difficult for us to see how the scents and aromas of coffee and barley would create a perfect match like just like mint and lamb, toffee and banana, peaches and cream, peanut butter and jam. Serve lightly chilled with as many chocolate truffles as your conscience allows.\r\n\r\nEach serving is equal to one cup of coffee');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4cd73551dd5c4eca80acb2c484482cfe', '3842531cdf184adf988126b606f62a5e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Smoked Helles Lager', 0, 0, 0, 0, '', 'This light german style Helles Lager was brewed with a small percentage of beechwood smoked malt. Light and delicate east drinking lager');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4cdb8c2ab62d43e19f25f1a770a344c4', '6745721021c14f36a490b65474f9933a', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'b54082ab47e6498e9eebc1f15232fd53', 'Dundee Festive Ale', 6, 0, 0, 0, '', 'So did you ever ask yourself...what exactly is there to be festive about during the holidays? Your brother in-law snoring on the air mattress? (Boy, letâ€™s hope thatâ€™s snoring.) The variety of toys with realistic sound effects? Fruit cake?\r\n\r\nDundee Festive Ale may be one of the few exceptions. One sip of the carefully matched seasonal spices and you realize that the holidays are worth paying...waiting for.\r\n\r\nOh, there may be one other thing to be festive about. Thereâ€™s a 13 to 1 chance against your brother in-lawâ€™s plane leaving on time. But at least thereâ€™s a chance.\r\n\r\nFestively hearty and full bodied with a mild nutmeg, allspice, cinnamon, and orange peel spice character and subtle crystal malt flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4d0a12a98fff484eaedf0cc9a1591769', '70d0ad6cf59849a394d87fb9c49a472b', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Hex Nut Brown Ale', 0, 0, 0, 0, '', '');
