INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4d17ea6b5dee46f5a0a4c8287c1c4fdb', '361119714b8f46bb8484b9d3a84cb34b', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Saint Peter Pale Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4d1b8b302fc3403dafeb422fccabe68f', '343412b7c5de4ce5ac21dc63166abbdf', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Golden Delicious', 0, 0, 0, 0, '', 'Thereâ€™s nothing quite likes Momâ€™s apple pieâ€¦But I am willing to bet this beer is pretty darn close.  An American Tripel, dry-hoped with Amarillo hops and aged in Apple Brandy barrels from one of this countryâ€™s oldest distilleries.  The tropical aroma of the hops and the delicate apple aroma from the barrels are a perfect match.  Straight from the Captainâ€™s cellar to yours, we hope you enjoy.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4d349410b47d4e11b02ab25fe6765eed', '6533462e9e774e57b9f5732311d0b734', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Water Gap Wheat', 4, 0, 0, 0, '', 'This light refreshing wheat beer is sure to delight. Our special yeast and blend of malted and unmalted wheat provide the haze in our unfiltered style ale. This beer is traditionally served with a lemon slice on the side. \r\nThere are many water gaps along the Appalachian Trail. These water gaps were established where large rivers cut through the Appalachian Mountain Range. The Susquehanna River creates one of the more visually appealing water gaps just north of Harrisburg in the area at the Dauphin Narrows.');
