INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4d3d0d1dbf744ce18bf688cd562c26b9', 'e7c41aa1122b4d3780bb693212685d69', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Armageddon Grand Cru', 11, 0, 0, 0, '', 'Grand Crus are traditionally known as \"The best beer that a brewery makes.\" This Belgian-style quad lives up to that name and then some. Available once a year, in May to celebrate our Anniversary.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4d4920d085b4405fbf93666450bb2d15', 'b67c5d7317f84d76a2a3874cf45661bb', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Golden Pheasant', 4, 0, 0, 0, '', 'Brightly filtered, highly carbonated, golden premium-style lager. It is lightly hopped with Polish Lublin hops. The beer will appeal to those who prefer the lighter American style beers.');
