INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4e386f09ed5c40ada7f741aec6aaa957', '7882c0abe9654e7b90d9bdb7ca18980a', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Woodchuck Granny Smith Varietal Draft Cider', 5, 0, 0, 0, '', 'It is made using 100% Granny Smith apples. This cider has a mouth-watering flavor that is tangy and tart, with just a touch of sweetness.');
