INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('50f840e7ec0d448b9fa47c79c32f9c6f', 'c4007a8cd9ff47faafbe243795fd3ffe', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Barristers Bitter', 4, 0, 0, 0, '', 'Low in alcohol but big in flavor. This beer is dry hopped like an IPA but the alcohol and bitterness have been reduced for a great session beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('50fe42c18aef41479f7b702ef9ffcb7f', '47f5674e1c6f4bc18a03d78958f76f22', '22710fa91bbf4454b94555720f6a33dd', '84bca21ce52244db83158e4971bd7866', 'Monteith''s Celtic Beer', 4, 0, 0, 0, '', 'Monteithâ€™s Celtic Beer is considered an â€˜Irish-style aleâ€™ in the heritage of beers of a burnt-red colour traditionally brewed in the Emerald Isle.\r\n\r\nMonteithâ€™s Celtic Beer has a dry roasted malt flavour characteristic of this style of brewing. This malty characteristic and crisp dryness is derived from malts of the roasted chocolate malt style. The hop character is medium to allow the chocolate malts to show through.\r\n\r\nMonteithâ€™s brewers have been able to develop traditional ale fermentation characters while allowing the interesting roasted malt notes to come through in the aroma.');
