INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('555de4157c2b4b15b64d233889e0c6f2', 'c6597412758a4086a9d6d0e04e75e71e', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Kenziger', 4, 0, 0, 0, '', 'This is a real drinkin'' beer! - a golden session ale that boasts both a European birthright and a thirst-quenching Philadelphia sensibility. Ke n zinger is refreshingly crisp and smooth, with a spirited flavor that grabs the attention of taste buds everywhere. Get some!');
