INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('56ecb52fa8094dc39da154e034e25085', '3a09f973aa9a4b6bbfd27b54374bc96e', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Old Marcus Ale', 6, 0, 0, 0, '', 'Typically Yorkshire. A strong Ale in which all English grown hop varieties are used. The grassy earthy character of Kent Goldings hops is the keynote in the aroma and finish. Try with fish and chips or a meat pie.');
