INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('58c0ec8f069b4ffe8a89f74a99982ac4', '3ae9f1cc386c46a29f36798ccc043764', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Double Crooked Tree I.P.A.', 13, 0, 0, 0, '', 'From their website:\r\n\"Have you read the description for the regular Crooked Tree yet? Well this beer is almost the same just double. We actually took the Crooked Tree recipe and doubled all of the ingredients except the water, just the way a DOUBLE should be made. Big hops balanced with tons of malt give this beer a huge body. Although this beer is as cool as \"the Fonz\"  when first purchased, it gets really mellow and smooth with some age. After a year or two stored in a cool dark place you''ll notice the heavy caramel and malt flavors are trying to sneak past the hops, theyâ€™re just not fast enough. This beer is hugely delicious so it will need your undivided attention (the chores can wait....trust us).\"');
