INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5a0ae034ed0044cb8aeabb3e84b88f27', '13e46693ec384f9183b40ee3a0560780', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'S.O.S', 0, 0, 0, 0, '', 'Save Our Shores (S.O.S) is an unfiltered weizen pils and has a brilliant golden color. A Charitable Pilsner');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5a1b57783acf432da6fb8f09962a813e', '20f5693ca80c4c74a422a9dfa988e9a6', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Honey Orange Wheat', 0, 0, 0, 0, '', 'Honey Orange Wheat is an unfiltered wheat beer and has flavors of honey and orange balanced with a nice medium-sweet malt character. It is medium bodied with no harsh bitterness and a nice honey-orange finish. It is made from Northwest Two-Row and Wheat Malts; Willamette Hops; #48 Oregon Wildflower Honey, Orange Juice, and Free Range Coastal Waters. It is currently available on draft.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5a225a9e920d43dcb4c01cc8787693a8', '603ac3b146db496bbf104e66d624d47c', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Kirin Light', 3, 0, 0, 0, '', 'From Kirin''s Site:\r\n\r\nWith just 95 calories and full-flavor, Kirin Light is one of the few great world-class Lights.\r\n\r\nYou might think Kirin Light would be a lightweight contender, content to let his sturdier siblings steal the show. But this fitness-minded newcomer won''t compromise. You won''t have to compromise either - with just 95 calories and full flavor, Kirin Light is one of the few great world-class lights.\r\n\r\nWhat makes Kirin Light great\r\nCanadian barley malt, Czech hops, rich golden color');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5a3045bfb6d04ca99b230839d258a0c5', '65ab7a9116df4270a74ea9cca5f41e5d', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Irish Stout', 0, 0, 0, 0, '', '');
