INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5a5de8a9305f478a94d0cbe63c572064', '8c6695b90e294b72b9b272b357ce755f', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Raspy Raspberry Weiss', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5a6a567ed3834239a00eb39297e49c69', '8a0066befe3b4c94a0da0a9f5b639f6e', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Blithering Idiot', 11, 0, 0, 0, '', 'At Weyerbacher, we prefer to brew things true to European style guidelines. Consequently our barley wine is  on the malty side, yet not  overly sweet. Notes of date or perhaps fig on the palate follow a pleasurably malty aroma to your taste buds. The finish is warm and fruity, and begs for the next sip.\r\n\r\nEnjoy Blithering Idiot in a brandy snifter or wine glass, preferably in front of the fire, or accompanying a literary classic. This is the finest life has to offer and should be treated as such. Moments of reflection make all the toil worthwhile, and Blithering Idiot is for moments like these. Share it with your family over the holiday dinner. Lay a few down, aging only helps a barley wine develop more class. At 11.1 % ABV (alcohol by volume) this fine ale will keep for years. Our expected maximum shelf-life is 2 to 3 years. Although it might see a decade, beyond the 3rd year most barley-wines have a tendency to decrease in complexity, so don''t wait too long');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5a95e0b5745d4d5e9c14a93d30c50fdc', '6ee3779d2b1345e0b7b5edf8f63caabc', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Double Trouble IPA', 9, 0, 0, 0, '', 'Deep, golden, rich malt flavor huge citrus, fruity grassy, ethanol sweetness aroma with a profound bitterness, yet balanced malt back bone with grapefruit, mellow citric overtones. Dry hopped three times in the fermenter. Brewed with over 65 lbs of hops for 300 gallons of beer. The beer to bring world peace and end the war. Bronze Medal - 2006 Imperial IPA Festival at the Bistro in Hayward, California.');
