INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5aae4d16c5194015a1b84d8cec1a89de', 'f590cfabc78c4d6daaa1804eebe185c1', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Seigneuriale', 7, 0, 0, 0, '', 'The copper-colored body and generous foam\r\nhead of this amber ale tantalize the eyes but\r\nit''s the complex flavor of Seigneuriale that\r\ndelivers a pleasant surprise. It is slightly\r\nsweet, malty and spicy, but a distinctive hop\r\ncharacter and notes of apricot brandy give\r\nSeigneuriale a truly unique character. \r\n\r\nWe recommending pairing it with carved ham,\r\napricot-glazed duck or squab, Thai shrimp\r\ncurry or a holiday fruit cake.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5abb06cd70fc40cf886b2098cab99a98', '7a20514d64d549d6bdcdc3cea4cedbba', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Satellite Stout', 5, 0, 0, 0, '', 'A bold roasty stout with 50lbs of organic fair trade espresso beans. A tribute to the best coffee house in town. Coffee lovers will easily embrace this delicious brew.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5acc62ce933b4ca88d877d44f56f7c4b', '9c3ee95b24104dfd9b624cf02a81b1df', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Boulevard Pale Ale', 5, 0, 0, 0, '', 'Boulevard Pale Ale is a smooth, fruity, well-balanced beer with year-round appeal. A variety of caramel malts impart a rich flavor and amber color, while liberal use of whole hops adds zest and aroma. Pale Ale is the first beer we brewed, and continues to be a perennial favorite.');
