INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b212a21e1fd4fd392027a8946ffe6d6', '226bc87deeea4f1fb202a68ed4c2ac81', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Presque Isle Pilsner', 4, 0, 0, 0, '', 'Presque Isle and the bay it creates have played many significant roles in the history of Erie and our young nation. The US Government chose this location to build a fleet of ships during the war of 1812 because it formed the only protected harbor on Lake Erie. In 1813, during the battle of Lake Erie, Commodore Oliver Hazard Perry successfully defended Lake Erie against the British with ships that were built on Presque Isle Bay, making a significant mark on the pages of history. Presque Isle Pilsner, a tribute to history is a hand crafted pilsner that is \"A noble beer for Noble People.\"');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b3aedaae2c04505a4d9b6cd98b700b5', '7ebe8d21807648188c96f5605059a97d', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Weiss', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b429bb2a4cb46d7a669ebe9e92daaab', '4c44bd3fa4c547da8c7315242ef09bbd', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Whitetail Golden Ale', 5, 0, 0, 0, '', 'Our golden American ale has a crisp body and slightly dry, hoppy finish. This is a real treat for the beer lover. Pale, wheat and torrified wheat malts are used with Northern Brewer and Mt. Hood hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b45f52c84fa4426b479b14a9416570f', '2e042df7a44e4589880e2bce2e3c5995', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b63d7fa6cf440478dce3b5bd93178a6', 'f9693c8b159e4b4ebfa972ecbaba0a6a', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Piedmont Porter', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b70df4a3f2b4785a28ef57d8069f6e4', '0e0d7fa8dd3b4924a6eeb0e06c4c6d51', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Estrella Damm', 4, 0, 0, 0, '', 'Estrella means star in Spanish and as its name suggests the brand has become a star to the people of Barcelona. It has evolved with the city reflecting its character - sophisticated and passionate yet at the same time relaxed and welcoming.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b7a476995844ae697dc70584295b25b', 'b452dfcf8ed940cf8d6a6a662bf7c675', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Jai Alai IPA', 7, 0, 0, 0, '', 'Jai Alai IPA is a monster interpretation of an American IPA. In fact, it is so big that it equals the alcohol of some double IPAs on the market. Our IPA uses 6 different hop varietals, with Simcoe hops only being used for dry hopping. The rest of the hop additions are blended at different IBU''s (International Bittering Units) in groups of three hops per addition in order to create more hop complexity. At CCB, we love hops but also feel that balance is important for IPAs. So Jai Alai features a sturday caramel malt component which helps to create balance, staving off hop astringency. Ultimately, Jai Alai is a very strong interpretation of a single American IPA. We hope that it makes Tampa Bay natives happy because this is head brewer Wayne Wamble''s favorite Cigar City beer and he''d love to share one with you!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b7d94b6dbd54474952d8f38bf16d9ef', 'bef9879a815742129bf0170786802743', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Woody Creek White', 4, 0, 0, 0, '', 'Our tribute to the town we consider to be \"Gonzo Ground Zero\"... Woody Creek White is a traditional Belgian-style Wit Beer, brewed with unique ingredients like orange peel and coriander, resulting in a refreshing and slightly citrus flavor, perfect for the \"Dog Days of Summer\".');
