INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5e18f518a5bd436b94a240c822fb2e39', '94b2e7e841504f858034cf078e80a792', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Pumking Imperial Pumpkin Ale', 9, 0, 0, 0, '', 'Pumking is an ode to PÃºca, a creature of Celtic folklore, who is both feared and respected by those who believe in it. PÃºca is said to waylay travelers throughout the night, tossing them on its back, and providing them the ride of their lives, from which they return forever changed. Brewed in the spirit of All Hallows Eve, a time of the year when spirits can make contact with the physical world and when magic is most potent. Pour Pumking into a goblet and allow itâ€™s alluring spirit to overflow. As spicy aromas present themselves, let itâ€™s deep copper color entrance you as your journey into this mystical brew has just begun. As the first drops touch your tongue a magical spell will bewitch your taste buds making it difficult to escape the Pumking.');
