INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5f735a1105794196b9dbfd9c32a1a937', '47a0919bbe304d26a040491a18892651', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Great Blue Heron Pale Ale', 0, 0, 0, 0, '', 'Much like the local icon it is named for, our version of American Pale Ale has a bold character. We add a healthy dose of hops in both the kettle and the finishing tank.');
