INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5f8a8573d784452f9b6f3aea11d8454d', '3842531cdf184adf988126b606f62a5e', '98b7246d5e1b4592b15adced83ab36d0', '0b415ebb506c40848abff3554116e055', 'West Bank Pub Ale', 4, 0, 0, 0, '', 'Most welcoming British pubs off a house ale or \"pub ale\" â€” this is ours. We use only the finest English barley, hops and yeast to create this classic English-style pale ale. It is noted for its nice malt flavor balanced with a medium hop presence. The pub ale is often referred to as our house \"session beer\" (a beer you can drink a number of and not fall off your barstool).');
