INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('61ee50ba471948f6b82eaf8d84fbc3ae', '0560596b78e94a608ef22b5781208781', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Estes Park Porter', 4, 0, 0, 0, '', 'Porters are dark ales without the roasted malt character of a stout. Our porter is a brown porter with a very smooth, balanced profile.');
