INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('62f77bcd21164e58ace9ae81bc4da038', 'fc05398cb1624567b596fedc8e64a6d8', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Domaine DuPage French Country Ale', 5, 0, 0, 0, '', 'Domaine DuPage is a rural, northern France, amber colored ale. This well balanced beer is full and sweet up front with caramel, toasty, and fruity characters. The finish has a gentle floral and spicy hop balance that cleanses the palate.');
