INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4dcfa33fcd02415a972828b941f1a1f4', '4f59d5e4604c4ea2ba6af9921ea40dc0', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Afterburner IPA', 6, 0, 0, 0, '', 'A hop lover''s delight!  Our I.P.A. is loaded with Ahtanum, Tohmahawk, Palisade, East Kent, Goldings and finished with the ever popular Cascades, balanced with generous amounts of floor malted crisp Maris Otter barley.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4dd470d88a544f31bbded5a5318eb33a', '226bc87deeea4f1fb202a68ed4c2ac81', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Drake''s Crude', 6, 0, 0, 0, '', 'In 1859 Col. Edwin L. Drake successfully drilled the first oil well in Northwest Pennsylvania. Because of the project known as \"Drake''s Folly,\" Pennsylvania was actually responsible for almost half of the world''s oil production until the 1901 oil boom in Texas. Erie Brewing Co. reflects on our regions oil history and oil rush by producing a crude oil Black, silky smooth, malt bonanza oatmeal stout.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('4de00472161a4941a0d9a38c8cb2b208', '0a7afe0e530c4ddeb6c683166623802a', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Eliot Ness Amber Lager', 6, 0, 0, 0, '', 'An amber lager with rich, fragrant malt flavors balanced by crisp, noble hops.');
