INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('501efdcddd1f466b949e54f0aef41828', 'c6597412758a4086a9d6d0e04e75e71e', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Newbold IPA', 6, 0, 0, 0, '', 'Hop shortage be damned! We love IPA''s, Philadelphia loves IPA''s, we''re going to brew an IPA. Rekindle your passion for your favorite Phi ladelphia brewery by enjoying our substantial, aromatic India Pale Ale. Newbold is aggressively hopped, with a crimson hue and depth of flavor that will satisfy the most demanding devotee of this revived style. Newbold I.P.A. tells it like it is.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('50319e3bd60d41119b3059e0e8d232e6', 'cb7bb586517d443ca77b034fa93c5624', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Buried Hatchet Stout', 8, 0, 0, 0, '', 'Jet-black in color, this monster smells of coffee and chocolate.  The taste is much of the same, with hints of creamy toffee and roasted malt.  Smooth and delicious, this medium bodied ale is all about the malts, but has enough hop bitterness to be balanced.');
