INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('515cefd4490348048987ae5d9444e462', '3ae9f1cc386c46a29f36798ccc043764', '98b7246d5e1b4592b15adced83ab36d0', 'dde08a23bc764388a0571b10d486b6e7', 'Too Cream Stout', 0, 0, 0, 0, '', 'This beer is made with milk sugar (lactose) which gives this beer a nice creamy mouth feel which mingles with hints of chocolate and roasty flavors.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5173d8877ca4409b9f710d9cca15c000', '612b7fe9cf224f46aa725de08574e4a5', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Porter', 8, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('517ad44beb8e48a5869aa327d935f161', '6533462e9e774e57b9f5732311d0b734', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Abbey Roade Belgian Ale', 6, 0, 0, 0, '', 'Abbey Roade is brewed in the tradition of the famous Belgian Abbey-style ales.  This wonderful brew is soft and sweet up front.  The complex and spicy middle palate is in most part due to the generous addition of dark Belgian candy sugar.  This semi-dry ale has notes of ripe plum and pear with a peppery finish. \r\nThe origins of the Abbey-style ale date back to the Middle Ages.  Monks residing in monasteries, called Abbeys, brewed beer as a source of nutrition during their frequent and often lengthy fasting periods.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('51a96ab504224c6d9e70992a8db683ee', 'f5c370154895454ab3d84b654e2ebea5', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Olde Suffolk', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('51b26321e98740ceaa56f64c7b1e876a', '13e46693ec384f9183b40ee3a0560780', '98b7246d5e1b4592b15adced83ab36d0', '0b415ebb506c40848abff3554116e055', 'Abbey Ale', 0, 0, 0, 0, '', 'Abbey Ale is a strong malty ale brewed in the style of the Trappist Monks. 22oz bottles only');
