INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('51d137cf1fe5457992f8ddbd2e2225da', '5cd3e0062156423a9d16d8b4be0094ce', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Georgia Brown', 5, 0, 0, 0, '', 'It''s definitely one of the finer American Brown Ales. A deep, copper colored, mild brown ale.\r\n\r\nSGB is accentuated by a slight nuttiness from its malt character. Designed to be a session beer it has a real smooth finish with a subtle hop character.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('51d8c814583b4fd1939f3d268e0e9ca0', '8a85a603f9754f4e99d70cfc7667389e', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Leinenkugel''s Summer Shandy', 4, 0, 0, 0, '', 'Get a taste of the freshest flavor under the sun - Leinenkugelâ€™s Summer Shandy. A shandy is a lemonade flavored beer, a European favorite during the warmer months. And the light, crisp flavor makes it a great summer refresher. Each batch is carefully brewed using the finest wheat, malted barley and just a hint of real Wisconsin honey. Then, our brewmasters mix in fresh lemonade and citrus flavors to create an adventurous taste thatâ€™s perfect for those lazy days of summer.');
