INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('54fca854806441ed8a7c4c0cc6959fa3', 'b05b68c9de6249ffbd301582608fef6b', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'High Tide IPA', 6, 0, 0, 0, '', 'ach and every fall, we experience a coastal experience in San Diego known as the \"Super High Tide.\" This happens later in the Fall Season when the tidal swings reach a range of about 8 feet in difference between low and high tides. When this happens, there are days when the tide just gets too high and flattens out the surf. The lineups shut down and surfers are left to wait until the High Tide recedes.\r\n\r\nWhile waiting for the tides to shift in your favor, might we suggest a High Tide IPA? Brewed only once each year to coincide with the Hop Harvest in Yakima Washington, High Tide IPA is made with 180 lbs of Fresh Hops per batch that are plucked from the vines and sent straight to our brewery. We skip the whole drying and processing stage which means the hops are ultra fresh and full of flavors we can''t normally get. Like grapes, Hops are only harvested one time each year and as such, we make what we can when we get them.');
