INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('553190d46c7a4e9dbbdc4fdfc277feb4', 'f5b9ebafbed64d7d8dbc9643e9eef7a9', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Phoenixx Double ESB', 7, 0, 0, 0, '', 'Our winter seasonal is inspired by the great ales of the UK but brewed with a distinctively American attitude. English crystal malt gives Phoenixx its subtle toffee and caramel notes, but this ale is about hops. The blend of English hops, highlighted by its namesake, Phoenix, yields a complex hop character that dominates this special brew.');
