INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('55fd1b4f2b8b4765951135d307943778', 'c3f06ce635ee4eefbc33e6c206a31f44', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Union Barrel Works Mai-Bock', 0, 0, 0, 0, '', 'A pale bock with fresh maltiness in the aroma and palate. Deep golden color with a generous amount of pure honey to smooth the high alcohol finish. Perle and Cluster hops for bittering and Sazz and Hallertau for finishing. Original gravity above 19 Plato.');
