INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b70df4a3f2b4785a28ef57d8069f6e4', '0e0d7fa8dd3b4924a6eeb0e06c4c6d51', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Estrella Damm', 4, 0, 0, 0, '', 'Estrella means star in Spanish and as its name suggests the brand has become a star to the people of Barcelona. It has evolved with the city reflecting its character - sophisticated and passionate yet at the same time relaxed and welcoming.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b7a476995844ae697dc70584295b25b', 'b452dfcf8ed940cf8d6a6a662bf7c675', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Jai Alai IPA', 7, 0, 0, 0, '', 'Jai Alai IPA is a monster interpretation of an American IPA. In fact, it is so big that it equals the alcohol of some double IPAs on the market. Our IPA uses 6 different hop varietals, with Simcoe hops only being used for dry hopping. The rest of the hop additions are blended at different IBU''s (International Bittering Units) in groups of three hops per addition in order to create more hop complexity. At CCB, we love hops but also feel that balance is important for IPAs. So Jai Alai features a sturday caramel malt component which helps to create balance, staving off hop astringency. Ultimately, Jai Alai is a very strong interpretation of a single American IPA. We hope that it makes Tampa Bay natives happy because this is head brewer Wayne Wamble''s favorite Cigar City beer and he''d love to share one with you!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5b7d94b6dbd54474952d8f38bf16d9ef', 'bef9879a815742129bf0170786802743', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Woody Creek White', 4, 0, 0, 0, '', 'Our tribute to the town we consider to be \"Gonzo Ground Zero\"... Woody Creek White is a traditional Belgian-style Wit Beer, brewed with unique ingredients like orange peel and coriander, resulting in a refreshing and slightly citrus flavor, perfect for the \"Dog Days of Summer\".');
