INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5c2c9488d1564ded85b3ef086bf6d676', '641566e7dfc4492b816400ba5e1254f7', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'b54082ab47e6498e9eebc1f15232fd53', 'Cold Mountain Winter Ale', 0, 0, 0, 0, '', 'Our ever-changing spiced winter seasonal. A tasty brew that complements all your holiday festivities. It is typically malty in body, lightly hopped, and rounded out with spices that we vary from year to year.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('5c4a3dd22f484e728c88827cfed61604', '7bd3c9e042314a65aa752dbd60807b0e', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Gumballhead', 4, 0, 0, 0, '', 'Three Floyds official summer beer highly dry hopped American wheat beer. Quite hoppy. Gumballhead is brewed from red wheat and amarillo hops. It has a medium haze, due to bottle conditioning; once the beer is bottled, extra yeast is added for a secondary fermentation. The hops give off a pronounced citrus note on the nose. Notes of bread - from the yeast - and a good malt undertone. Medium carbonation.');
