INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('6073511d008d4519bd340cc0f4693de2', '94b2e7e841504f858034cf078e80a792', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Oat Imperial Oatmeal Stout', 12, 0, 0, 0, '', 'It is beer #2 in our \"Blackwater Series\" of original Imperial Stouts. The first in the Series was \"Is\", a dark and bitter Russian Imperial Stout. \"Oat\" is the follow up; an Oatmeal Stout with major alcohol volume and tons of body to back it up. The cloying character of the oats in this brew lends itself to a chewy and almost oily mouthfeel. ABV. is off the charts at about 12.5%. Note, that this is an all malt beer fermented with our house ale strain of yeast. Judicious hopping with Columbus and Chinook produce a hoppy aroma that mingles nicely with the chocolate and de-bittered black barley from Belgium.');
