INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('61330e903e2f4218bdf50ddbc803e43f', '6373fec6e4d84db5ae7c64f6230502ce', 'b7ee8858a0b549ddb2361e1ed313f6e1', '3a8d4356f46746979884c04ffd896fbe', 'Pride', 6, 0, 0, 0, '', 'RIDE Belgian-style Strong Pale Ale boasts a glorious deep gold color and an amazing yet arrogant head. Plentiful pale malt creates beautiful, agile body. Assertive hops and Belgian yeast achieve charismatic floral and spice notes in aroma and flavor. But Prideâ€™s predominant and unique character comes from its exposure to Brettanomyces in French oak Chardonnay barrels. At once tart and refreshing yet earthy and musty, Pride is unlike most beers on earth. And itâ€™s bitter, lingering finish demands another sip. \r\n\r\nAwarded a BRONZE medal at World Beer Cup 2008, Pride has much too much to boast about.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('61386af28f3542f9ae9f23b175c8940a', '6c5faca2427b4eb6bec6749468ebfcdc', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Imperial Stout', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('614fa24820594381a0629a1da17e9390', '7ad8825aff794387ace4aa354ef49b64', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Saint Arnold Brown Ale', 5, 0, 0, 0, '', 'A beautiful, deep copper brown ale. It has a full, malty body with hints of chocolate, a touch of sweetness and a light hop flavor. A complex malt character is created by combining five different types of malts. It has a rich, creamy head with a fine lace. The light fruitiness, characteristic of ales, is derived from a proprietary yeast strain. \r\n\r\nSaint Arnold Brown Ale is best consumed at 45-50Â° Fahrenheit.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('615646c1514c46bb805122b24fe04aa2', '387f03355e29436597aee9e25a247c44', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Bam Noire', 4, 0, 0, 0, '', 'Dark, smooth, delicious.  Aromas of worn leather and cool autumn nights. Notes of sweet plum and toasted raisin, hints of coffee and cacao. Lingering tart and refreshing finish.  Only available for a few short months.  Not to be missed.');
