INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('61cacf13dc4840beb23c6d7a90b439c9', 'f743f04357824c41994f695c5034da14', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Scratch #10 2008', 10, 0, 0, 0, '', 'he third time just might be the charmâ€”Scratch #10-2008 is our third triple in the Scratch Beer series.\r\n\r\nThis grand cru has been lovingly aged since late-February, yet still unleashes the slightest hint of alcohol heat.\r\n\r\nScratch #10-2008 also has a triple flavor inspiration combining the caramel/toffee notes of dememera sugar and molasses, with citrus and licorice flavors created by the orange peel and star anise; lastly we create a peppery/spicy finish with the same trappist yeast has been used in each Scratch Beer Triple.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('61cd72620d334b6f9ef5257f9b9785c5', 'c481fdf60728475aa7c22dec1c641acf', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Honey Moon Summer Ale', 5, 0, 0, 0, '', 'The Gold Medal-winning Honey Moon Summer Ale is a classic summer ale made even better with real clover honey, fresh orange peel and both pale and white wheat malts.  Proff that brewing the perfect summer ale is a true art.');
