INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('61d93791bceb4115800b1e567fe341c3', '6533462e9e774e57b9f5732311d0b734', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Jolly Scot Scottish Ale', 5, 0, 0, 0, '', 'This flavorful sweet ale has a smooth malt finish balanced against a light hop flavor. This beer is very quaffable and has become a brewpub favorite throughout the United States. \r\n\"Jolly Scot\" was a famed local beer produced by R.H. Graupners Brewery that was located at 10th and Market â€“ one block from our brewery.');
