INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('62d5f3b80f8f4557950c3f8c4541123c', '47a3de1b57274a59b0ff59c5d112c6d5', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Roggen Bock', 5, 0, 0, 0, '', 'Brewed in the tradition of great German Bock beers with only German malts and hops, using 20% rye, malt to give it a distinctive spicy, yet smooth character. You''ll love the rich flavors and deep red color of this unique German Brew.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('62dfd531c2714355bf8bf64452b996c6', 'db2ec8868ac049959975ee3322bc38a9', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Tactical Nuclear Penguin', 32, 0, 0, 0, '', 'This is the worlds strongest ever beer, ever (yes ever).\r\n\r\nNo Penguins  were harmed in the making of this beer; some humans did get very, very cold though. It was worth it.\r\n\r\nThe Antarctic name, inducing schizophrenia, of this Å¸ber-imperial stout originates from the amount of time it spent exposed to extreme cold. This beer was initially double barrel aged for 14 months; maturing in the deep, rich oak of Scottish whisky casks. After this epic maturation the beer was then frozen, then frozen again, then frozen again.\r\n\r\nThis is an extremely strong beer, it should be enjoyed in small servings and with an air of aristocratic nonchalance. In exactly the same manner that you would enjoy a fine whisky, a Frank Zappa album or a visit from a friendly yet anxious ghost.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('62dff8883a724f5cad7a66bff675d760', '4f59d5e4604c4ea2ba6af9921ea40dc0', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Sick Duck Imperial Stout', 10, 0, 0, 0, '', 'A rich and very dark Imperial Stout that has a complex flavor profile with hints of molasses and caramel.  Brewed in July to allow time for aging, Sick Duck finishes very smooth for such a big beer.');
