INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('63957fc4a6f4447f88d4c63bd9c0ab8f', '29e8f8978b92426283fed1fcf7dcb14b', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Feast of Fools', 5, 0, 0, 0, '', 'Our Holiday Offering\r\nIn pre-christian times, the Celebration of darkness and light was marked with great halls filled with smoke & mirrors. Guilded goblets brimming with seasonal brews were lifted to lips, speaking a language no longer known. \r\nCenturies pass.\r\n\r\nThe winter wind finds its way through heavy wood doors. There is a solemn business of monks to be done. But also brewing, a season of celebration is about to begin....\r\nMore years pass.\r\nThe modern age. \r\nThe present connects the past through the brewer''s art and a new beer is born.\r\nFeast of Fools... \r\nA perfect dessert beer brewed exclusively for the holiday season.  Hand bottled, champagne corked. \r\nOur inky, rich, black stout, with the addition of raspberries.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('639683402b39412ba6355eb03145a282', '47a3de1b57274a59b0ff59c5d112c6d5', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Saranac Octoberfest', 5, 0, 0, 0, '', 'Saranac Octoberfest is a med-bodied, copper colored lager. It''s rich, malty taste is subtly balanced by Saaz and Tettnang hops. The beer is aged slowly in the tradition of the Octoberfest beers of Munich.');
