INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('641a181ce42a43e181ea87ce02f134c1', 'e36fab1869c74ca0a9a0970da2b17d9f', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Ipanema Summer White', 0, 0, 0, 0, '', '\"Tall and tan and young and lovely\"\r\n\r\nOriginating in Belgium, this is a truly bilingual brew. Known as Biere Blanche in French, Witbier in Flemish and White beer in English. Unmalted wheat and oats are used in the grist to lend this brew its smooth, light body. Coriander seed and Curacao orange peel are added to the kettle to infuse this beer with a subtle, perfumey spiciness. The result is a light wheat beer with a fruity, tart finish - the essence of summer.');
