INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('650da176ce274b61945e11a57f947743', 'c481fdf60728475aa7c22dec1c641acf', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Blue Moon Belgian White', 5, 0, 0, 0, '', 'Blue Moon Belgian White, Belgian-style wheat ale, is a refreshing, medium-bodied, unfiltered Belgian-style wheat ale spiced with fresh coriander and orange peel for a uniquely complex taste and an uncommonly smooth finish.\r\n\r\nThe name \"Belgian White\" is a reference to the cloudy white, opaque appearance of the beer. \"Belgian White\" also refers to the style of beer, which has been brewed in Belgium for about 300 years. This type of ale is brewed with malt, wheat and oats. It is unfiltered, which allows protein and yeast to remain suspended in the beer and creates the cloudy appearance. This also adds to the smoothness and full body of the beer.\r\n\r\nPutting a new twist on the lime ritual, Blue Moon is traditionally served with a slice of orange.  Blue Moon was launched in 1995.');
