INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('65750858a3c744829208d5bbd2146d7c', 'e7c41aa1122b4d3780bb693212685d69', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Dead Monk Abbey Ale', 8, 0, 0, 0, '', 'This Belgian beer is brewed in the style of the Trappist Monks. Belgian Candi Sugar, Pilsen, Aromatic and Caramunich malts are balance by E. Kent Goldings, Mt. Hood and Saaz hops to construct a \"Big Beer\". Traditional White Beer Yeast is used to make this beer have a large mouth-feel and lingering spice notes in the finish.');
