INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('65bb2699511940c6b7484db6d32f8ee7', '0560596b78e94a608ef22b5781208781', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Long''s Peak Raspberry Wheat', 4, 0, 0, 0, '', 'This is one of our most popular beers. It is a light and refreshing raspberry-flavored wheat ale.  We use pure raspberry extract to give this beer its fruity aroma and flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('65c67e680f0546aca4f7493f4cc5b425', '6745721021c14f36a490b65474f9933a', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Honey Brown', 4, 0, 0, 0, '', 'From the Brewer''s Website:\r\nThe Dundee family began with Honey Brown Lager in the early 1990''s during the height of the craft brewing resurgence. Introduced by then brewery head Jack \"JW\" Wehle, Honey Brown was a full bodied lager brewed with natural honey provided by Wixon''s Farm in the Finger Lakes town of Dundee, New York. The brand was an overwhelming success that defied definition as a style and grew to tremendous acclaim, garnering several medals at the World Beer Cup and the Great American Beer Festival.');
