INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('675f0dbfc23a425e9e4515773d7a5661', '05efd68d6f9944b59607debaedd4ca75', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('67678f5a30a4449980a53d84d3c3993d', '94b2e7e841504f858034cf078e80a792', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Southern Tier Tripel', 9, 0, 0, 0, '', 'Don''t let Tripel''s light color and delicate aroma fool you, this is one serious beer brewed with maximum effort.  First, we introduce the freshest barley to crystal filtered water.  Second, we add the best hops shipped directly from Europe.  Third, our special yeast is the catalyst for fermentations, gobbling sugar and creating alcohol as it works.  \r\n\r\nSome say that the Belgian monks who first brewed this style called it triple to denote it''s high alcohol content.  Still others believe triple''s origins lay in its triple fermentations; twice in the brewery and once in the bottle.  Whatever the answer, ours is the Tripel threat.');
