INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('6b7f24b37776448fa3f0668be88682c6', '8a85a603f9754f4e99d70cfc7667389e', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', '1888 Bock', 5, 0, 0, 0, '', 'In 1888, After enduring one of the coldest winters on record, the employees of Jacob Leinenkugel''s spring brewery crafted their first seasonal beer to celebrate the coming of spring. They blended dark and pale roasted malted barley with select hops and allowed for longer aging to create a robust beer with an exceptionally creamy head. Unchanged since 1888, You''ll find our bock''s sturdy bod and deep color perfect to draw you out of one season and the into next.');
