INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('6d0216d76e4244958c6aa24dfdfdd4bf', '0024fad54e5e46279818191654813d1b', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Stony Face Red Ale', 5, 0, 0, 0, '', 'Hoppyâ€™s gift to those who like their beers Malty. Dark Caramel and Chocolate Malts lend their deep crimson silkiness, and judicious additions of Nugget and Cascade hops give just enough bitterness for balance. Ask your serverâ€™s favorite beer and itâ€™s probably this one.');
