INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('6d3cc165cd0d45a1baf25f4f54347969', '8a0066befe3b4c94a0da0a9f5b639f6e', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Twelve', 10, 0, 0, 0, '', 'Our 12th anniversary brew is a Rye Barleywine.  Checking in at 10.2% abv, Twelve is being released in July and through the end of the year.   Made from 50% Rye Malt and 50% Barley Malt, this strong ale is extremely viscous. The rye adds a tantalizing note of flavor on the palate with a hint of tartness you''ve come to expect from Rye.  Slightly warm when its young, the beer will age very well, perhap 5 years or more.  We''re guessing that peak taste will be in the 1 to 2 year old range, with 3 and 4 not far behind.  Be sure to lay some down in your collection.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('6d512e26b7d34ce8bb57a3445e154ff3', '16d6017aa4c44e608d09a925b9c956cf', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Two Front Teeth Holiday Ale', 9, 0, 0, 0, '', 'We welcome the release of â€œTwo Front Teeth Holiday Aleâ€ a Belgian style Saison with subtle real cherry flavoring.  What a good way to drown out in-laws by enjoying a pint or two of this recent release from Spring House Brewing Company.  This is not for the faint palate; this holiday offering is coming in at 9.4% ABV!  We hope you stop by for a taste or a Growler fill but unfortunately you have to stop in for this one.  Enjoy!');
