INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('6ec4fa3180634605ba8e7a6e831bea20', 'fcd0ef039fc343adb1e01b07e25a6e70', 'b7ee8858a0b549ddb2361e1ed313f6e1', '2747adf8980546318186100ea198dbcb', 'Double Bag Ale', 7, 0, 0, 0, '', 'This malty, full-bodied double alt is also know as \"Stickebier\" - German slang for \"secret brew\". Double Bag was originally offered only in our brewery taproom as a special treat to our visitors.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('6f07aaeebaf54fc2ad5e5903890ccfdd', '7ad8825aff794387ace4aa354ef49b64', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Saint Arnold Spring Bock', 6, 0, 0, 0, '', 'An authentic, German-style Bock, celebrating the coming of spring. This strong, deeply flavored lager has been aged to create a smooth, malty taste with a hint of sweetness. A light addition of German hops balances the malt flavor. \r\n\r\nSaint Arnold Spring Bock is best consumed at 40Â° Fahrenheit.');
