INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('71f4bb62a90a46e4a83e405039de21a5', 'e8801a3d8e1d48b993d7146c1ea4f00e', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Labatt Blue Light', 4, 0, 0, 0, '', 'Labatt Blue Light was introduced in 1983 as a lower alcohol, lower calorie version of Canadaâ€™s most popular brand. Blue Light uses specially selected North American aromatic hops and the same strain of lager yeast as the one used to produce Labatt Blue. The result is a crisp, clean and delicately balanced beer, with a slight sweetness and citrus-like hop character.');
