INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('724699ede8b84a8aa6d85a0f65b96bd1', '70b7bbf10ef4416da5715c8b7da19879', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'East Coast lager', 0, 0, 0, 0, '', 'The East Coast Lager is an easy drinking â€œgoldenâ€ lager with a wonderful balance of crisp malt flavors and flowery hop finish. Built specifically with very low bitter aftertaste, the aroma is as clean as the taste.A difficult beer to brew because of the gentlenessâ€¦ this beer is magnificent!');
