INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('746c056bba824941b27f2a06e016e094', '86d517966bcc47118dd89baae427290c', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Budweiser Budvar (Czechvar)', 5, 0, 0, 0, '', 'Our Czech Premium Lager is beer for light beer lovers. The most gentle heads of the high quality Å½atec hop, virgin clear natural water and granules of selected species of Moravian barley make it the beverage of real experts. \r\n\r\nThe 700-year long tradition in production of ÄŒeskÃ© BudÄ›jovice beer and the unique, 90-day period of maturity increase its unique character. You can taste Budweiser Budvar Czech Premium Lager with all your senses. First of all you will delight your eyes with its beautiful colour and rich dense foam, then you will feel the fine aroma of the hops, in your palm you will stroke the dewy glass and, in the end, you will taste the fine to medium strong bitterness. You will remember well, our perfect lager.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('74726bc37fba4402b28c964e745083ef', 'bfcb5792acea46178da58ab8e844869f', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Sprecher Doppelbock', 7, 0, 0, 0, '', 'This dark lager was originally brewed as liquid bread to sustain Bavarian monks while fasting. Its sweet complex malt character comes from brewing with many varieties of dark roasted caramel malts and long periods of cold storage (6 months).');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('747dd3b17b72467f8715bcc4290ad7e6', '9c3ee95b24104dfd9b624cf02a81b1df', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Double Wide I.P.A.', 8, 0, 0, 0, '', 'Double-Wide I.P.A. uses Zeus and Magnum hops for both bittering and aroma, with Ahtanum hops added solely for aroma. Two additional dry hopping regimens employ Ahtanum, Centennial, and Chinook varietals. The resulting beer â€“ not surprisingly â€“ has a hop forward aroma, redolent of peach and apricot. The assertive flavor bursts forth with citrus notes of blood orange and lemon, a caramel malt backbone serves to balance the intensity of the hops. There is little restraint in the flavor of this beer; it is certainly not for the pedestrian palate.');
