INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('74f4a2cddb154b14ab18559c0c3718c9', 'ddf86b22ce3149be9fff402436ad70d0', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'St. Bernardus Tripel', 8, 0, 0, 0, '', 'This beer, with high fermentation, has a pale amber colour and a flowery, fruity taste with a harmonious balance between sweet and sour (8% alcohol content). \r\nThis beer has a thick and vivid froth and strikes by its balanced taste with a delicate bitterness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('74fdf732ce2b4cfc850704bfce512b00', '387f03355e29436597aee9e25a247c44', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Biere de Mars', 7, 0, 0, 0, '', 'A sustaining beer that is brewed to comfort in the gusty ides of March and welcome in a wealth of warmer weather.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7538bdb770b941db9079cb81c905fc54', '924f4d2594fe47a0a732a9e14bc24ad6', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Burton Baton', 10, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('75495b4f0db84791ab094a3a63c30d7e', '975a06569d444c38a7c7b3cd9ee4a2b0', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Benchwarmer Porter', 6, 0, 0, 0, '', '\"Benchwarmer\" is a very smooth Porter brewed in accordance with the original \"high gravity\" porters of early London. More than 4% chocolate malt, which is the most similar to the brown malts of the early 1700â€™s, gives \"Benchwarmer\" its dry coffee-like finish. It is fermented with the Ringwood yeast which is an excellent yeast for the brewing of porters. The widely accepted theory of how porter got its name is that it was a very popular beer among the porters who hauled produce and goods around the marketplace of early industrialized London.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7556a7b33e7849f2a2311d0727316f55', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Natural Light', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7563a7c73d8f494698b14a141d282919', '3d80398428f9495ebe0f9b1acf0a6295', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Climax IPA', 6, 0, 0, 0, '', 'This American-style, hop-driven beer starts with a citrus flavor, followed by two layers of caramel, and finishes on a hoppy note.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('756ef6b228ae4c3da2d3b9b2a2640f00', 'ecbfbc639150435191d6af029ff71bd7', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Shoo-Fly Porter', 6, 0, 0, 0, '', 'Lancaster Brewing Companyâ€™s newest release is their limited series of Shoo-Fly Porter. From the heart of Pennsylvania Dutch Country comes a delicious porter made with Lancaster County molasses, eight different malts and grains, and four different styles of hops. This beer has a deep, rich, brown color, medium to full body, and finishes with a smooth mouth feel.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('757989aff90444e0ac3434d8b3ee9276', 'f18a3e7ec2434ce58138b843994414b4', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Firestole Pale 31', 4, 0, 0, 0, '', 'One of the most award-winning American style pale ales in the country. This is the American beer style that started a revolution in taste. Weâ€™ve taken the classic British pale ale and elevated it with a wonderful dose of northwest American hops. A crisp floral hop aroma precedes a medium-bodied clean finishing ale.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('757cb4f4406e4c17a2615d53cc619dcf', '457b2dbd441b4eee9e5881835ad40b94', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Hellrazer', 6, 0, 0, 0, '', 'From the first sip this American-style India Pale Ale gets in your face with an unruly hop bitterness, big floral flavors and aroma, and just enough malt character to keep you from giving in and acting up.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('75895fec328b456daad1d61c6297c8a6', '924f4d2594fe47a0a732a9e14bc24ad6', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', '90 Minute IPA', 9, 0, 0, 0, '', 'Esquire Magazine calls our 90 Minute .IPA., \"perhaps the best I.P.A. in America.\" An Imperial I.P.A. brewed to be savored from a snifter. A big beer with a great malt backbone that stands up to the extreme hopping rate. This beer is an excellent candidate for use with Randall The Enamel Animal!');
