INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('767b6677c4154d2e97ddee9b67b1a99e', '1472d1457b7245ee9f622be1d20bf7ce', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Urthel Vlaemse Bock', 7, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('767bc26d380d4839842ea09a464398c7', '92ecbfbe736e49378d8aae2062a441c0', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Icehouse', 5, 0, 0, 0, '', 'America''s first domestic ice beer, Icehouse is traditionally brewed, fermented and, just before aging, its temperature is lowered to below freezing. This process imparts the beer''s smoothness and an alcohol content that''s slightly higher (5.5% by volume) than other regular premium beer brands. Icehouse was introduced in 1993 and has reinforced its position as the ultimate beer for wind-up and pre-game occasions. Blending humor and high-energy excitement, Icehouse marketing encourages its target consumers to take occasions to the next level with a great-tasting beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('767ec30890254c78aca453298d2932f3', '8a85a603f9754f4e99d70cfc7667389e', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Leinenkugel''s Berry Weiss', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('768be77e98b740c4be786e3b1f66c034', '87d07c49cac34e51844cd51fd3ec0ad9', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Lone Star', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7692e6288bf749ed94854202afb5c49e', '85d4c6c47664428ebdb5a1246a9a7c8e', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Black Xantus', 10, 0, 0, 0, '', 'A bourbon barrel aged Imperial Stout infused with coffee.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('76978a196b1143e6a2e2d3efc8da2fd0', 'f743f04357824c41994f695c5034da14', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'HopBack Amber Ale', 5, 0, 0, 0, '', 'TrÃ¶egs Breweryâ€™s Flagship beer, HopBack Amber Ale derives its name from a vessel in the brewhouse called a hopback. As the â€˜wortâ€™ is being transferred from the brewhouse to fermentation it passes through the hopback vessel. Packed full of fresh whole flower hops, the wort slowly circulates through this vessel extracting the essence of the aromatic hops. This vessel adds more time and more hop character that creates a fresh, spicy taste and rich caramel note that defines this signature ale.\r\n\r\nTASTING NOTES\r\nDeep amber in color under a huge creamy head. The aroma very apparent, bold and spicy with a slight floral character. Balanced with caramel malt, this well-rounded amber ale has an up-front floral spice that builds with a flush of sweetness');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('76b4b3ee834e4e08b878ea92e7523017', 'f3d463fc3f8f4481b3a87d922bae0b7d', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Border Gold Oranic Ale', 6, 0, 0, 0, '', 'According to legend, gold panned from the crystal clear Border streams of the Yarrow valley, nearby the site of the Broughton Ales brewery, was used to make the third wedding ring of Mary Queen of Scots.\r\n \r\nThis golden coloured ale is brewed with a skilful blend of organically grown hops and malt, and pure Scottish water to the exacting standards required by Soil Association Certification Ltd. of the United Kingdom.\r\n\r\nThe end result is a light golden coloured, clean tasting beer with an excellent hop aroma and aftertaste.\r\n\r\nAt 6.0% ABV a premium ale for those who know and care about what they eat and drink.\r\n\r\nBorder Gold has won several awards, the most recent being a bronze medal in the International Brewing Awards in Munich 2005.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('76bb1fa0ddb34637965895c2aac22e48', 'cdafaf89b3d14193a41c9a2be4b2b29d', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Obsidian Stout', 6, 0, 0, 0, '', 'Obsidian Stout gets is inspiration from one of the world''s largest obsidian flows at Newberry Volcano--just a few miles south of the brewery.  \"The Big Obsidian Flow,\" as they call it, covers more than 700 acres with shiny black obsidian.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('76bc6ba98cca41f882183f4b8c5dbe27', 'c0f3c4bc6d374a578874bfd84803ebc3', 'b7ee8858a0b549ddb2361e1ed313f6e1', '3a8d4356f46746979884c04ffd896fbe', 'Local 1', 9, 0, 0, 0, '', 'In Williamsburg, Brooklyn, we forge barley malt and hops from Germany, aromatic raw sugar from Mauritius and yeast from Belgium into our latest beer, Brooklyn Local 1.\r\n\r\nBehind the full golden color you''ll find an alluring aroma, a dynamic complex of flavors, Belgian flair, Brooklyn fortitude and a dusting of our special yeast. To create this beer, we use the old technique of 100% bottle re-fermentation, a practice now rare even in Europe. It gives this beer a palate of unusual depth. Enjoy it locally or globally, as an aperitif or with your favorite dishes. It is particularly nice with spicy seafood and with fine cheeses.');
