INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78b89b937b2441f3b360fe85f887e498', '83096763d28c4428a77a9c012eb94a9f', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Butthead Doppelbock', 8, 0, 0, 0, '', 'High Gravity Butt Head Doppelbock Lager is brewed with a generous amount of roasted malts producing caramel sweetness and rich mouthfeel. Why Butt Head? Try one. You''ll enjoy \"big brew\" flavor with the intensity of a \"head butting\" Bighorn Ram!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78c7f2b473f74172beee21909b85af62', 'b03a62177d0c444dbd7f2e55d259af10', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Brown Bear Brown Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78c92d50d4a2464090eb01af4492e206', '5bafddb45bee47eda6da50325994331d', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Black Cat Stout', 6, 0, 0, 0, '', 'Our Black Cat Stout is brewed using a blend of Chocolate, Carafa, Crystal and Munich malts. A small amount of wheat and oatmeal are added to give the beer body and mouth feel. Small amounts of roasted malts are added to give the beer a dry \r\ncoffee finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78e17ca6afc34021a5d90748f06f1d34', '84bfc72e927d4e9799a3a064ce2b35be', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Harpoon IPA', 5, 0, 0, 0, '', 'From their site:\r\n\r\n\"Harpoon IPA is an interpretation of the classic English style using hops and malt grown in the United States.\"\r\n\r\n...\r\n\r\n\"The high hopping of Harpoon IPA is not only noticeable in the nose but especially in the finish. The lingering bitter finish of this beer is not harsh or astringent, but crisp and pronounced. This is created, in part, by dry hopping â€“ a technique that involves adding fresh hops to the conditioning beer to provide a fresh hop aroma.\r\n\r\nThis beer is floral, medium body with an aggressive, clean hop finish.\"\r\n\r\n----\r\n\r\nThis has been my year-round favorite since moving to Boston in 2004.  It is the nectar of the gods.  Seriously, it''s a nicely balanced, hoppy IPA that isn''t overpowering.  Also, it can be consumed in huge quantities with no hangover.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78e62e814e3748039fe7b68c76d6395b', 'f50680717d064fc5b7b0274b015c2558', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Golden Wheat', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78e837d55bfd4b7c8cff8a72e40624c5', '731b7a49baee4cccbe5db6c8e212c421', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Roundabout Oatmeal Stout', 6, 0, 0, 0, '', 'Everyone has their price. For some, it''s measured in dollars per hour, for others it''s powder days. For those that have the gift of passion for the dark side, it''s measured in pints of Oatmeal Stout. Another one of FiftyFifty''s seasonals, the Roundabout Oatmeal Stout is brown to black in color and nearly opaque. It has a velvet like mouthfeel, moderate hints of dark dried fruit, espresso beans and Dark Chocolate... and just a hint of hop bitterness. The addition of Flaked Oats gives this brew its wonderful creamy texture. Roundabout Oatmeal Stout is one of a series of Stouts that FiftyFifty Brewing Co. will produce during the course of the year. Enjoy!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78ede7e8a44c4f858fc2b830a07e35d2', '722a9b25f4e842f5819b3ec1fea512e7', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Garten BrÃ¤u Fest', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78f375050ebb4878be2bbb8c380b5de4', '9ee99dc929de419196bbe5b9243bec26', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Peroni Nastro Azzurro', 5, 0, 0, 0, '', 'Peroni its unique taste which is refreshing and dry, with a clear-cut, clean character and clarity, achieved through the exclusive brewing process. This ensures that the beer has both a fresh and natural quality. \r\n\r\nPositioned as â€˜Italian style in a bottleâ€™, from presentation to pouring the brand, Peroni has struck a chord with modern urbanites looking for cosmopolitan class. \r\n\r\nhttp://www.sabmiller.in/brands_peroni.html');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78f4415e50a84946bf2febcab14cb8f8', '4e1b9cf2283a43139cde58205e6f27d4', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Bottle Rocket IPA', 6, 0, 0, 0, '', 'An explosion of hops dominate this deep golden ale. Brewed with four varieties of hops & dry hopped with three other hops, the flavor is powerful. Not a harsh bitterness, but a full hop flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78f9a928abb049f4b7b23594abd57b07', '5005ab643cd34519ae424f0326eb19a3', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '0efc79b43f194933857739c6141a570b', 'Poor Richard''s Tavern Spruce Ale', 5, 0, 0, 0, '', 'Brewed to celebrate Ben''s 300th birthday.\r\n\r\nWhether Ben Franklin ever said, \"Beer is living proof that God loves us and wants us to be happy\" is up for debate. Some say he said it, others say he didn''t. No one knows for sure. \r\n\r\nHistorical facts or fictions aside, Yards Brewing Company has recreated Poor Richard''s Tavern Spruce Aleâ„¢ to celebrate Franklin''s affinity for fine ales. Poor Richard''s Tavern Spruce Ale is based on Franklin''s original recipe, which called for spruce essence and molasses, as barley and hops were not readily available at the time.\r\n\r\nEnjoy a taste of history courtesy of Yards Brewing Company, Philadelphia''s premier brewer and bottler.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('78fb5f7d91f349beba7adf524a45ab0b', '20f5693ca80c4c74a422a9dfa988e9a6', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Morimoto Soba Ale', 0, 0, 0, 0, '', 'The Morimoto Soba Ale is part of the new Signature Series of Rogue Ales, launched in the Spring of 2003 with internationally acclaimed Chef Masaharu Morimoto--a James Beard awarded chef and one of the stars of the Food Network series, Iron Chef. \r\n\r\nSoba (also known as buckwheat) is not a type of wheat but a member of the rhubard family (a fruit, not a grain!) Soba has been a longtime staple of Japanese cuisine because of its nutritional value. Buckwheat is high in potassium, phosphorous, vitamin B (50 percent more than wheat) and protein, and its virtually fat-free. The fruits of buckwheat plant are like small beechnuts, which are milled to separate the edible groats from the dark brown hulls. The groats are then roasted and used more or less like a grain (a good example is Kasha).\r\n\r\nMorimoto Soba Ale is brewed with Roasted Buckwheat, Pale malt, Munich Malt, 13-17 Carastan Malt, and Crystal Hops. (Note, this beer contains Gluten.) The flavor is unique, toasty-nutty sensation with medium body and good hop bitterness. Morimoto Soba Ale is available in a 22 ounce silkscreened bottle and 13.2 gallon sankey kegs.\r\nTo learn more about the Chef, visit Morimotos web page.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('79078392e9414905aa25a78bd9d11002', '85d4c6c47664428ebdb5a1246a9a7c8e', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Redwood Amber', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7924c7260e6e4eceb48883a286942052', '5e176a9135c3454b97854bcf0d9661a3', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Altbier', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('794d7ef454cd4894bef3387644796a1f', 'c08b43e77f794d0f80b1928cd0f01391', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '3d5aa8ea7524462aabeda59d22d77068', 'Black Creek Porter', 0, 0, 0, 0, '', 'Porter is a dark-coloured beer developed in the 1750s. Porter has a heavier flavour and aroma and a slightly sweet taste. Its name probably originates in the belief that this strong, nourishing drink was ideal for hard-working porters and labourers. Black Creek Porter is wonderful on its own, or with salty snacks.\n\n');
