INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7996c9c8f418463483d61cca81ead313', '2c96e8e0e5a24d17a67491f9ec2ec686', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Apex', 7, 0, 0, 0, '', 'Crafted with a blend of American and English malts and aggressively hopped with Pacific Northwest hops, this beer reflects what our brewers believe to be the Apex of IPA.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('799b9a12c5104c8dbb3d83f4a12bdfde', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'cd3a63e3b16a44a89a64d0625aea2911', 'Wild Blue Blueberry Lager', 8, 0, 0, 0, '', 'Wild Blue is brewed with a blend of German hops from the Hallertau region in Bavaria and classic Aroma hops from the Willamette Valley in the Pacific Northwest. A combination of two- and six-row barley malt was also chosen specifically for this recipe. Beer lovers will also appreciate this specialty fruit-infused lager''s striking burgundy color, ripe blueberry aroma and its ability to stand up to the strongest of foods.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('79a3116d992347e18d184ad93cf841d3', 'acab7f058e4240c48cc2af1c33bc4aff', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Liberty Unfiltered Wheat Ale', 0, 0, 0, 0, '', 'This light ale is an American interpretation of a German classic. It''s not filtered and has a pleasantly tart flavor. Served with a lemon wedge.');
