INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('79f1cf2d328d4750822f6e7501e398b0', '00ab074e7e55454b82e1b576f3385c21', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Buck Naked', 3, 0, 0, 0, '', 'An American-style \"light beer\".  Formulated to appeal to those who prefer a lighter tasting brew.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a0624df049d4a9d81f840f21097c11f', '43387522a5c7466692e40ab0089414b3', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Pete''s Wicked Strawberry Blonde', 0, 0, 0, 0, '', 'Pete''s Wicked Strawberry Blonde is truly a unique beer experience. Reward yourself with our golden lager made of the finest pale and wheat malts and Cluster Hops, with a kiss of natural strawberry flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a084c558eab4370908b3c83cdcd7a3a', '728bc833c9044278b27699254743716e', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Oak Creek Amber Ale', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a0e9378f6124b4b9bdcda090353dbb0', 'b0cf8fa322dc4271ade112f28ce5788b', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'cd3a63e3b16a44a89a64d0625aea2911', 'Chapeau Framboise Lambic', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a0ef23e8e794c1d86957da19fbafdb6', 'f4b481b5e94045ef96e5f836e2ff6a7b', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'McGilligans IPA', 6, 0, 0, 0, '', 'India Pale Ales, or IPAâ€™s, were brewed for British soldiers stationed in India. These ales needed to higher in alcohol and have more hops than normal to survive the long journey, and ours is no exception. Brewed with Belgian and German malts and dry hopped with loads of Cascades, our version honors our friend who had his own grueling journey involving a boat and cold water!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a400a13430e4e75818d46c07713b8c8', '20f5693ca80c4c74a422a9dfa988e9a6', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Trafalgar IPA', 0, 0, 0, 0, '', 'Let Battle Commence... Trafalgar is a Gold Medal Award winning bottle conditioned India Pale Ale brewed to a 19th Century recipe. Listed in the Top 500 Ales in the World, Trafalgar measures 6% ABV. Brewed in the Royal Forest of Dean at Freeminer Brewery in the UK and distributed by Rogue Ales in the US.\r\n\r\nTrafalgar IPA is a true India Pale Ale, brewed to an original 19th Century recipe. IPA''s were brewed at high APV and heavily hopped to enable their preservation on the long journey to the colonies from England. This Ale is brewed from the oldest working traditional floor maltings in Warminster, Wiltshire. The hops are traditional \"Goldings\" variety grown around Ledbury, Herefordshire as they have been for centuries.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a5f516654be4389bd20f0e3de705590', '226bc87deeea4f1fb202a68ed4c2ac81', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Mad Anthony''s Ale', 5, 0, 0, 0, '', 'Anthony Wayne adopted a military career at the outset of the American Revolutionary War, where his military exploits and fiery personality quickly earned him a promotion to the rank of brigadier general and the sobriquet of \"Mad Anthony\". Erie Brewing Coâ€™s Classic American Pale Ale features a balanced malt and hop flavor, which we feel the Nutty General would approve of despite his revolutionary tendencies.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a636542574c422a8d9af59a335946e8', '3bfccf92b0934a688877be8a75cd6f7d', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Abbaye de St Amand', 7, 0, 0, 0, '', 'A unique 7% Belgian blonde ale, flavoured with juniper berries. The beer has bittersweet malt flavours, and a heady perfumed aroma of orange and juniper.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a6e43249fbe4578844d273d2a237c94', 'df4c0dc7f40441519793569d02243759', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Nut Brown', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a6ef57280e8405d8abfb6256be3291a', '12584311798345eea2fa9614f8f03c57', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Pardon Me Porter', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a74d2dbf16f4008941fdb16cd8c96d4', '924f4d2594fe47a0a732a9e14bc24ad6', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', '60 Minute IPA', 6, 0, 0, 0, '', 'Our flagship beer. A session India Pale Ale brewed with Warrior, Amarillo & ''Mystery Hop X.'' A powerful East Coast I.P.A. with a lot of citrusy hop character. THE session beer for beer geeks like us!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7a8fff4916a7448b82a2a79d80837c7a', '641566e7dfc4492b816400ba5e1254f7', '98b7246d5e1b4592b15adced83ab36d0', '1c20aafad8964ed4a7626ef53934000a', 'Black Mountain Bitter', 0, 0, 0, 0, '', 'A style of Pale Ale, Black Mountain Bitter will be lightly hopped with traditional British hop varieties to balance the malt sweetness yet encourage it to tend toward the dry side. We recently received our organic certification from Clemson University after undergoing a rigid inspection and two-month compliance process. Although this represents a big step for Highland, the idea of an all organic product is consistent with our corporate ethos and embrace of natural traditional brewing methods.');
