INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7ab1ce5d70704afeb68a61d734639e07', '7bd3c9e042314a65aa752dbd60807b0e', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Behemoth Barley Wine', 10, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7ab7095dee0f4035a6def349c796f151', '85eecf6eff4b45f2b81e07f48c413f7e', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Avenue Ale', 4, 0, 0, 0, '', '2007 Maryland Governor''s Cup Bronze Medal:\r\nA golden colored ale with crisp malt character and a slightly spicy hop aroma. We use a good amount of wheat and some German malt in this one to give it a very refreshing taste. Avenue Ale is a true session beer, so sit down and prepare for a long one.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7ac9f6771a9f4b73adddfb1b123c889f', '12584311798345eea2fa9614f8f03c57', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Black Cobra Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7acd6c74ca0f4e0fb8b5e42b272f2d7f', '83c84714477344e1b376ae0d8952afc9', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Black Bear Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7ad230ae3f824659859a8a24c802536e', 'c5bb8c84d73946c28befc136bf7963d4', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '0efc79b43f194933857739c6141a570b', 'Harpoon Winter Warmer', 5, 0, 0, 0, '', 'Winter Warmer was Harpoonâ€™s first seasonal beer.  It was designed to be enjoyed during the holiday season. \r\n\r\nWhen you bring a glass of this dark copper ale to your lips to take your first sip you will notice the aroma of cinnamon.  There is no aromatic hop added that might overpower the distinct spice scent.  The medium body of this beer is formed from caramel and pale malts.  These create enough body to support the spices without making the beer excessively rich.  Bittering hops are added to counter the sweetness of the malt and spice.  The finish of the beer is a blend of cinnamon and nutmeg.  The combination of these two spices results in a balanced, pumpkin-pie flavor. \r\n\r\nThe overall character is a smooth, medium bodied ale spiced with cinnamon and nutmeg');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7adc99d844c04d78bf31346db60834e1', 'f743f04357824c41994f695c5034da14', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Java Head Stout', 7, 0, 0, 0, '', 'We teamed up with St. Thomas Roasters of Linglestown, PA to create a special blend of espresso beans. They added Kenyan beans to the mix because of a strong citrus flavor that compliments the hops. Creating an environment akin a French press, the beans are combined with whole flower hops in the hopback, and the hot wort passes through the vessel on the way to fermentation giving Java Head a lush coffee espresso nose and hints of coffee flavor. There is a silky quality to the mouthfeel and a citrus aromas from the combination of Kenyan beans and whole flower hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7ae0da8e60964fb8b2248750a5389265', '333bb442ad5c4ab4bdbcedc34f6bab77', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Lilja''s Hop Nest Monster', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7aeb55886edf4574857a7ea0a0406cde', '591bfe5c4b0e4d5080899337cfc7a22b', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Red Seal Ale', 5, 0, 0, 0, '', 'Malt and hops are beautifully married in this full-bodied, copper-red Pale Ale. Red Seal is generously hopped for a long, spicy finish.');
