INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b298b9ad2b243a8a86243c2b25830eb', '94b2e7e841504f858034cf078e80a792', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Back Burner Imperial Barley Wine Style Ale', 10, 0, 0, 0, '', 'Long ago, British farmhouse brewers made special ales using the first runnings of the mash. These beers, now called barley wine, are brewed in the tradition of days past. At Southern Tier this long awaited brew is placed on the back burner until the start of the new year. Back Burner Barley Wine is a celebration of things to come and things remembered. Itâ€™s conceived in three small batches, using voluminous amounts of barley and hops. The process starts early in the morning and ends late into the night. We hope this rare brew reignites your spirit for another trip around the sun.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b33ba78c516446fa43eda782ba0ea40', '22620e097ef041f8981701e55fb0b5d4', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Ironhead Porter Old No. 3', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b347cff68d44126aede715c7b06947b', 'c5d43a6604a143b19cd221ba1979e3c7', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Hog Heaven Barleywine', 9, 0, 0, 0, '', 'This dangerously drinkable garnet beauty is a hop lover''s delight.  The intense dry-hop nose and the alcohol content are perfectly balanced for a caramel candy-like malt finish.  This is a serious beer for serious beer afficianados and it only gets better with age.  Cellerable for 3 years.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b48ad3884b44ff1b0666f1ae56fe806', '2e042df7a44e4589880e2bce2e3c5995', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Bavarian Weiss Beer', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b4f652dcaa7477a82bf92791b60262e', '4b0c089531be426a9c7a37b5ceba7154', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Bube''s Kiwi-Strawberry Wheat', 0, 0, 0, 0, '', 'The perfect thirst quenching summertime ale. The subtle flavor of kiwi and strawberry blend with traditional German wheat and hops. Great for a hot summer day.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b5179e40c1f40e18bfa2c5b097b8727', '5d67eae726e743a8b01e413716761c64', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Double D IPA', 8, 0, 0, 0, '', 'Hopheads rejoice!  This strong IPA takes the style to a new level.  It''s a big Imperial IPA packed with Nugget, Palisade, and Amarillo hops.  ABV  8.2%');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b5cf17cc801465eab62cfe74fbdb331', '343412b7c5de4ce5ac21dc63166abbdf', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Brown Bird Brown Ale', 4, 0, 0, 0, '', 'Named after the little birds that fly by the brewery looking for grain after the weather turns cold, this was originally to be a Fall/Winter seasonal. Clearly we underestimated the market for this smooth and malty brown ale, and we have decided to keep it for year round enjoyment.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b6b70405de94ebda44bd15d374c590f', 'c6255aa335274bdeaa472309874a0167', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Big Horn Fort Collins Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b72f7ced5e4425d8bc789a49f82f7b5', '35399ded31b84ce89e67aa5ef100e088', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Porter IV', 7, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b7494b2d0824df093aaae8e85b93fb8', '7323d51309bf4eaf91f8d87048ab90d9', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Stoudt''s Pils', 4, 0, 0, 0, '', 'Reflective of the traditional German style, Stoudt''s Pils is delicately dry with firm bitterness.  This crispness of Saaz hops and a dry malt finish make the Pilsener an excellent aperitif.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b8aaf4eb58243519cebac84736b7f77', '3544042f22eb4d39bf0bd3bff8cce711', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'cd3a63e3b16a44a89a64d0625aea2911', 'Framboise 1997', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7b8b2630dc9e4005b65c970160b5a329', 'db2ec8868ac049959975ee3322bc38a9', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '0efc79b43f194933857739c6141a570b', 'Dogma', 7, 0, 0, 0, '', 'Dogma is an innovative, enigmatic ale brewed with guarana, poppy seeds and kola nut all blended together with Scottish heather honey. A conspiracy of transcontinental ingredients infused with some devastatingly BrewDog imaginative thinking.\r\n\r\nThe flavours, intricacies and nuances of this beer are best enjoyed while musing over some obscure 17th Century philosophical meanderings, such as:\r\n\r\n\"If we disbelieve everything because we cannot certainly know all things we will do much, what as wisely as he who would not use his wings but sit still and perish because he had no wings to fly.\"\r\nJohn Locke.\r\n\r\nThis beer is not cool. You may think it is, but that is just a beautiful lie fabricated by clowns and gypsies.');
