INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7bb1007e2ace4d7b8a3505ecc70526ce', 'c0f52fdcf9a94e39a0ada8d337d89d09', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Duck-Rabbit Brown Ale', 5, 0, 0, 0, '', 'The Duck-Rabbit Brown Ale is an American brown ale brewed with loads of hops from start to finish (itâ€™s hoppy and beautifully bitter). Amarillo hops in the boil provide a spicy citrusy bitterness. Saaz dry hops in the fermentor provide a refined flowery aroma. These hops are supported by a grain bill of seven varieties of malt. Oh yeah!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7bb23c404a7649a48e4b526fef619cbb', 'ddc962506c724ae5bab8745e272d5570', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Onward Stout', 3, 0, 0, 0, '', 'The tan lace clings to the glass as you raise the pint to your lips. Close your eyes and smile as the rich espresso notes fade to a dry, roasted finish. Exceptionally smooth and satisfying. Made with English Pale malt, roasted barley, black patent malt, and flaked barley. Hopped with East Kent Goldings and Target hops, and fermented with our English ale yeast.\r\n\r\nFood Pairings: The combination of Onward Stout and oysters is a match made in heaven. It also goes well with other shellfish, grilled steaks, and believe it or not, rich chocolate desserts. Carbonade Flamande, seared beef cubes simmered in Stout for several hours, is a classic Belgian dish.\r\n\r\nOG: 11.3 Plato\r\nFG: 4.3 Plato\r\nIBUs: 35\r\nSRM: 45\r\n3.8% abv');
