INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7c3ea6fa233a4542b7b05752128ad7a4', '3be6b00a760647c7ba5d5de8c1bee825', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'cd3a63e3b16a44a89a64d0625aea2911', 'Cascade Apricot Ale', 9, 0, 0, 0, '', 'Features the intense aroma of fresh-picked, slow ripened Northwest apricots warmed by the summer sun. Based on a Belgian Tripel, this beer went through 16 months lactic fermentation and aging in French oak wine barrels.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7c560952771642b689ac8b79e5ba6251', 'ffa064924f374feab499dc79dfe05328', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Landmark Gold', 0, 0, 0, 0, '', '');
