INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7c73938d90a94df0861b9a57c15b3e2d', '97b1db2123da4e2c84c9f705bfb04f90', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Hop-Stuffed Pale Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7c785612edb94d70a65540e784e33212', 'f27b473310954a3ebc29d3ddbde38313', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Long Island Potato Stout', 3, 0, 0, 0, '', 'Brewed with real mashed Long Island Potatoes (or is it \"Potatos\"?) in the mash - hence, \"twice mashed.\" \r\n\r\nI''ll admit, my Polish, Irish, and German heritage finds the siren song of potatoes irresistible. (My French blood, not so much.) The local, Long Island agriculture booster in me needs to go for the Long Island potato above all others. \r\n\r\nWith a brewery this small (basically a home brewery with a license to sell), I can brew what \"gets\" me, with hopes that some folks will enjoy it.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7ca0d46195fe47d48dd64ef5bc105b9e', '12ccccaf670946788328ff5c04c94f4d', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Nut Brown Ale', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7cb618d1fbae4118bef58a3822112708', 'b67c5d7317f84d76a2a3874cf45661bb', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Nut Brown Ale', 5, 0, 0, 0, '', 'A mild, roasted nut and caramel flavored ale with a deep brown color. It is a medium-bodied beer with a mild to medium hop bitterness and aroma.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7cb7b553fdf546b6aeccf84a6301ce8c', 'cdafaf89b3d14193a41c9a2be4b2b29d', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Mirror Mirror', 11, 0, 0, 0, '', 'The Reserve Series romance all began with our first release of this limited-edition brew. Mirror Mirror, born of a double batch of Mirror Pond Pale Ale, is an inspired, barrel-aged barley wine layered with intriguing nuances. Explore this latest incarnation and enjoy its delicious complexity in every sip.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7cb8868250ea40648b202e1a983b8ebf', '3a393fae35ff47519dd45d04f774b266', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Achel Blond 8Â°', 8, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7cc05edc2a98430b89d76ba049b5204c', 'c425bf738fba4131a6ca7511425b6b48', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Orlio Seasonal India Pale Ale', 5, 0, 0, 0, '', 'A strong but smooth medium-bodied copper ale with a furity nose, big dry hop flavor, and assertive hop bite that rest upon a subtle but supportive background of complex malt flavors.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7cc1869ad44b48fd86287fb5e9c08c83', '924f4d2594fe47a0a732a9e14bc24ad6', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Indian Brown Ale', 7, 0, 0, 0, '', 'A cross between a Scotch Ale, an I.P.A., and an American Brown, this beer is well-hopped and malty at the same time. It is brewed with Aromatic barley and caramelized brown sugar.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7cf2c0db2e194167a7f8874d76813ea4', '586b36c006c048efb522f39ed80bc6bd', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Terrapin Rye Pale Ale', 5, 0, 0, 0, '', 'By using an exact amount of rye, a grain seldom found in other micro brewed beers, the Rye Pale Ale acquires its signature taste. Made with five varieties of hops and a generous amount of specialty malts, it offers a complex flavor and aroma that is both aggressive and well balanced â€“ a rare find among beers.\r\n\r\nThe Terrapin Rye Pale Ale was released in Athens, GA in April of 2002 at the Classic City Brew Fest. Six months later this beer which was sold only in Athens was awarded the American Pale Ale Gold Medal at the 2002 Great American Beer Festival, the most prestigious competition in North America. We hope you will agree with our peers in the brewing industry that this is truly one of the best pale ales in the country.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7cfbf356d3a14034a9275c0d77c0a9eb', '6373fec6e4d84db5ae7c64f6230502ce', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Sloth', 10, 0, 0, 0, '', 'SLOTH Belgian-style Imperial Stout is deliberately dark as hell. The pour is slow and sluggish. Its head is menacing, becoming torn and tattered Belgian lace on the sides of the glass as you cautiously consume this brewâ€”sip by insidious sip. \r\n\r\nThe aroma is sweet from heavy malt and big alcohol with notes of vanilla, coconut and whiskey from the oak. The depth & breadth of roasted malt flavors loiters on the palate while the robust finish lingers, well, forever. \r\n\r\nSLOTH...Just add couch.');
