INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7d27816bdbce4211b3925f08b876b06a', 'c5bb8c84d73946c28befc136bf7963d4', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Harpoon Ale', 5, 0, 0, 0, '', 'From Harpoon''s site:\r\n\r\n\"When first seeing Harpoon Ale in a glass, you will notice its golden caramel color. You will also see that it is not excessively carbonated. High carbonation would mask this beerâ€™s subtle flavor. The first aroma will be fruity. This is produced by the yeast and is a signature characteristic of Harpoonâ€™s proprietary yeast strain. The second perceptible aroma is from the malt, with a delicate caramel note. Upon tasting Harpoon Ale, you will find that the malty, fruity character is nicely balanced by the mild hop bitterness. It has a smooth, medium body. The finish of this beer is crisp but not dry.\r\n\r\n\r\nThe overall character of this beer is fruity, balanced, and mild.\"');
