INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7dc6e7683cd348649707cbb1c721b745', '94b2e7e841504f858034cf078e80a792', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Southern Tier IPA', 6, 0, 0, 0, '', 'IPA stands for India Pale Ale and ours is an American version of the classic style.  IPA''s namesake lies in its colonial roots.  British soldiers on their way to India drank a lot of beer, but found it would go stale on the long voyages.  Meanwhile, brewers knew that by adding more hops the beer would stay fresh.  Voila!  A new style was born and it is one we are proud to brew.  Southern Tier IPA is triple-hopped on its journey to your glass for a fully aromatic experience.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7dd70fc4e3a04569b3ac6a844744b257', 'eae9369c774844418f3c20eefa510e0a', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Premium Gold', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7dda9b1f5e224ac6a096d074d90539bc', 'f743f04357824c41994f695c5034da14', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Scratch #14 2008', 6, 0, 0, 0, '', 'Scratch #14-2008 is our interpretation of a farmhouse aleâ€”a once near-extinct winter-brewed (and summerâ€“imbibed) Belgian ale.\r\n\r\nOur celebratory brew starts with a black pepper and ginger nose. The nicely carbonated brew releases a honey-malt flavor that gives way to a tart crisp finish that masks the elevated ABV.\r\n\r\nWe use a blended yeast strain (Saison Dupont & Le Chouffe) to create the traditional peppery, spicy earthy flavors of the saison. Slight hints of ginger also come through in the finish.\r\n\r\nDrink it â€˜til the wedding bells chime!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7de3f24d70e74ce2b6df55bee9d556ad', 'acab7f058e4240c48cc2af1c33bc4aff', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Liberty Raspberry Wheat Ale', 0, 0, 0, 0, '', 'This brew combines the mild, tartness of a wheat beer with the flavor of real raspberries. The raspberry flavor is not overpowering. It has a wonderful berry aroma, and is a favorite even among those who claim to \"not like beer\".');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7df43c2a3b864ad8aa87f96597c91cec', '1a9e4f4f52454556b71ad5a28b6674b2', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Saison Rue', 8, 0, 0, 0, '', 'Saison Rue is an unfiltered, bottle conditioned, Belgian/French-style farmhouse ale. This is a beer of subtlety and complexity, with malted rye, spicy, fruity yeast notes, biscuit-like malt backbone, and a slight citrus hop character. With age, this beer will dry out and will become more complex with rustic notes of leather and earth from the contribution of a wild yeast strain. Being a Saison, Saison Rue is ambiguous unto itself as it is a different beer when fresh and when aged. We hope you enjoy it in all of its incarnations.');
