INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7e26279416354ed394b1de8e34a60336', '2dc4ecd978944c7f87c9f8fdef8b798e', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Heavy Seas Big DIPA', 10, 0, 0, 0, '', 'Big DIPA â€“ Double IPA,  is the first in the Heavy Seas Special Edition Series due to be released in mid June.  Hopped 3 times in the brewing process, Big DIPA has an earthy hop aroma.  In keeping with the Heavy Seas philosophy we''ve made a big beer with a surprising balance. The best part is that youâ€™ll hardly notice itâ€™s 10.6% ABV (est). The label artwork was created by Kurt Krol, one of our brewers who also helped to develop the recipe.');
