INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7f036422e01e4e98a9be37006a223922', 'a0ac7160e2a34b3f8b1e63862365ac0e', '98b7246d5e1b4592b15adced83ab36d0', 'f53645d05b19429d8e74046a3ccf0b8e', 'Honker''s Ale', 0, 0, 0, 0, '', 'Honkerâ€™s Ale combines a spicy hop aroma with a rich malt middle to create a perfectly balanced ale that is immensely drinkable. A smooth, drinkable English Bitter for those looking for more from their beer.');
