INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7f27549fecbb410281542cab1218c718', 'b05b68c9de6249ffbd301582608fef6b', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Old Viscosity', 10, 0, 0, 0, '', '\"Not your Dad''s Wimpy 30 Weight is how our original label used to describe this massive chewy and thick beer. Code named by our brewers-\"The Big Black Nasty,\" this is monstrous dark ale is brewed to no particular style. Thick and sludgy like oil from the crankcase of a wheat threshing combine, Old Viscosity blurs the boundaries of Porter, Stout, Old Ale and Barleywines.\r\n\r\nA blended beer that mixes old and new brewing traditions into one finished beer, Old Viscosity starts out with 80% of the packaged beer produced from a stainless steel fermentation. It then joins another 20% Barrel Aged Old Viscosity (from a previous batch) that has been aging in bourbon barrels. The blend of the two beers yields an incredibly rich and luscious ale that reveals chocolate and cocoa notes melded to silky body of burnt wood, vanilla and ash.\r\n\r\nMalts- Two Row, Wheat, Domestic and English Crystal, Carafa III and Chocolate Malts\r\nHops- German Magnum \r\nYeast- White Labs California Ale and Proprietary Yeast Strains\r\n\r\nOriginal Gravity- 1.092\r\nTerminal Gravity- 1.014\r\n10.5 % ABV\r\n\r\nDraft- Available in Southern California and Arizona 22 Oz Bottles and Cases- At Port Brewing San Marcos and Pizza Port Carlsbad, San Clemente and Solana Beach and wherever better beers are sold.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7f371a1cec714dc7a5c2e992054f0343', 'b65808eb74e74797ad9375fc1a220b9b', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Smuttynose Pumpkin Ale', 5, 0, 0, 0, '', 'Smuttynose Pumpkin Ale is our homage to the craft and heritage of Americaâ€™s brewers. Recipes calling for the use of pumpkins in beer date back to early colonial times, when brewers sought to extend their supply of costly imported malt with locally grown ingredients, such as squash and â€œpompions.â€\r\n\r\nIn that spirit, we brew our ale with the addition of pumpkin to the mash, along with traditional spices to create a delicious American original.');
