INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7f62ce85ab75432983ac3d9cc516498a', '1282ae91d4714281a1b5ec321ca571c4', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Old Ruffian', 10, 0, 0, 0, '', 'Old Ruffian is a hefty, hop-forward Barley Wine. Seemingly mellow at first sniff, with its subtle fruit aromas and complex caramel sweetness, this deep mahogany-hued ale quickly shows its true character marked by bold hop flavors and massive hop bitterness. Old Ruffianâ€™s rich, slightly creamy, caramel malt mouthfeel balances its grapefruit, pine, and floral hop flavors, working wonders on your palate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7f690b97dea94033a9a1d9f6cbda4a43', '1282ae91d4714281a1b5ec321ca571c4', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Hibernation Ale', 8, 0, 0, 0, '', 'Great Divideâ€™s award-winning Hibernation Ale is Coloradoâ€™s original strong ale â€“ it has been our winter seasonal each year since 1995. Since that time, Hibernation has become the most sought-after winter beer in Colorado. Hibernationâ€™s massive flavors are so intense that it requires over three months of aging each year. Each summer, while our brewers are still spending their weekends in flip-flops and shorts, they prepare for Julyâ€™s Hibernation brewing schedule.\r\n\r\nWe cellar Hibernation until late October, when it reaches the peak of perfection. This lengthy aging process gives Hibernation its revered malty richness, complex hop profile and hearty warming character, which is perfect right out of the bottle or cellared for longer periods of time. Hibernation is a lively treat that really beats the winter chill. This scrumptious, collectible, and imminently cellarable ale is only available for six weeks each year, from November 1 to December 15.  Hibernation Ale is the perfect gift or accompaniment to your winter festivities.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7f94199b0a3d4c3d9e51617769580d68', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Bud Light', 4, 0, 0, 0, '', 'Introduced nationally in 1982, Bud Light is brewed using a blend of domestic and imported hops as well as a combination of barley malts and rice. It contains more malt and hops by ratio of ingredients than Budweiser, which gives the brew a distinctively clean and crisp taste.');
