INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('7fe399c452a7489a94ec9c03cbc78476', '6373fec6e4d84db5ae7c64f6230502ce', '98b7246d5e1b4592b15adced83ab36d0', 'dde08a23bc764388a0571b10d486b6e7', 'Earth - Belgian Style Chocolate Milk Stout', 5, 0, 0, 0, '', 'Mother Earth is the rich fertile â€œlivingâ€ planet. Our EARTH combines pale and dark malts for essential body. Cocoa nibsâ€”decadent chocolate in its most elemental formâ€”add distinction. Lush lactose creates incredible creaminess. But Earth gains amazing ground with extensive aging on Bergenfield extra dark cocoa.');
