INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('805cadf3232b489480ea4b8551560495', '2dc4ecd978944c7f87c9f8fdef8b798e', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Heavy Seas Prosit! Imperial Oktoberfest Lager', 9, 0, 0, 0, '', 'Malt focused, made with five types of grain including Vienna and Munich malts â€“ plus a secret extra malt that we use only in our Prosit! Consider this bomber to be the burly big brother to our Clipper City MarzHon, a three year in a row winner at the Great American Beer Festival. Weâ€™ve balanced the sweetness of the malt with three kinds of hops making this one of the boldest marzen style lagers youâ€™ll ever try.\r\n\r\n5 Kinds of Malt, 3 Kinds of Hops\r\nestimated ABV 9% estimated IBU 25');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8064b8f76cdd4cfb9e5e1207090660a1', 'f743f04357824c41994f695c5034da14', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'e2617cdeed8f4eb69e01c49f84dd8000', 'Scratch #25 2009 Magical Moustache Rye', 6, 0, 0, 0, '', 'This mahogany ale packs a lingering, earthy hoppiness. The addition of more than 20% rye to the grain bill gives a creamy mouthfeel and hints of spice that compliment the bitterness of hops. Subtle fruitiness come through from the Bravo hops added during the boil, but the Cluster and Liberty varieties used in dry-hopping this beer are the true flavor drivers in this spicy ale. Dark in color and intense is flavor, Scratch 25-2009 finds true balance in a beer that could have easily gone way over the top. Enjoy.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('806f44ad3fb647e3886afdd8c9c4102a', '47a3de1b57274a59b0ff59c5d112c6d5', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Saranac Scotch Ale', 6, 0, 0, 0, '', 'This Scotch Ale is a full-bodied, malty sweet ale. True to Scottish brewing tradition, this malty flavor and deep copper brown color are a result of Scottish two row malt and roasted barley.');
