INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('80dc0df482fc489eb8c49c257bb540ae', 'cfded527d66b4b538e5bb319817bfc70', '22710fa91bbf4454b94555720f6a33dd', '7e7cea6fa47042688eb0fa7575c2729a', 'Foreign Extra Stout', 7, 0, 0, 0, 'guinness-foreignextra.png', 'Foreign Extra Stout is brewed with generous hops and roasted barley for a bittersweet balance & full-flavored, natural bite. Developed over 200 years ago for global export from Ireland, the addition of extra hops ensured this Stout would arrive to its destination in perfect condition. Today, Guinness Foreign Extra Stout is enjoyed by millions of people around the world.');
