INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('810135f2d10b4fb3ac8fbe68c18366b6', '8d00850620d14a638c75e5979a64ffed', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Fast Eddies Pale Ale', 5, 0, 0, 0, '', 'Named in honor of Ed Kiessling, the worlds greatest contractor. This American pale ale is assertively hopped and dangerously drinkable. Hopheads rejoice!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('810ccad937aa40fda2c24a56ee0dfa08', 'f743f04357824c41994f695c5034da14', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'TrÃ¶egs Splinter Beer Gold', 12, 0, 0, 0, '', 'The transformation of Scratch #3-2007 to Splinter Gold has been a slow rest in oak wine barrels dosed with brettanomyces. During a two-year aging period the horsy flavors of the brett combined with the Westmalle yeast used during primary fermentation to create a complex blend of flavors. Bone-dry and 12% abv, Splinter Gold is highly carbonated.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8118917617d7493a977fbcbe83e8a0c6', 'cdafaf89b3d14193a41c9a2be4b2b29d', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Black Butte XXI', 11, 0, 0, 0, '', 'It usually means bigger. Richer. And we can think of no better way to describe the taste of this even-bolder take on our classic, Black Butte Porter. Black Butte XX is an imperial porter with a lot more malt and hops, a wealth of coffee, cocoa nibs and aged in bourbon oak barrels. XX. It also means 20. Enjoy one during our 20th anniversary. On the flavor scale - Itâ€™s legendary.');
