INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('817e7a85fb824e95bf8ca05e08c89f2d', '6373fec6e4d84db5ae7c64f6230502ce', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Obliteration I', 8, 0, 0, 0, '', 'With passion and purpose, we present this series of hop-centric beers. Using different hop varieties and brewing techniques, we aim to capture bold, distinct hop characteristics in aroma, flavor and finish. While we explore the world of hops, we invite you to learn along with us: these beers offer an incredible opportunity to experience the diversity of hops while engaging the palate and obliterating the senses.\r\n\r\nObliteration I is a Double IPA, heavily hopped with a big malt base. Its aroma is pungent with citrus, onion, and a touch of alcohol. The sweetness of caramel malt is offset with spice and pepper flavors that lead into an overwhelmingly bitter finish.');
