INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('82121ea4838d4781ae2be38c502c534b', '782ef54426e74d7bb6f1e26e95813c8c', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Midnight Wit', 4, 0, 0, 0, '', 'Midnight Wit is a Belgian-style white ale with a medium body and spicy, citrus overtones. The texture is silky, creamy, and refreshingly delightful. Brewed with European Pilsner malt, unmalted wheat, a blend of 5 different spices and then fermented with a classic Belgian yeast strain. Our Brewmaster learned the art of brewing tantalizing and award-winning white beers during his time in Belgium and this beer shows it.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('82160428c60643d891d86d96569f1e02', '6745721021c14f36a490b65474f9933a', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Dundee Wheat Beer', 4, 0, 0, 0, '', 'Senator Joseph McCarthy. The Hollow Earth Society. Members of the Spanish Inquisition. All convinced they were blessed with the gift of clarity. And proof that clarity might be overrated. \r\n\r\nSometimes, being unclearâ€”and a little flexibleâ€”is a good thing. Like when you are looking for the perfect refreshment. Dundee Wheat Beer combines wheat and yeast into a refreshing hefeweizen-style brew. Unfiltered, so it is slightly cloudy and pleasantly unclear. \r\n\r\nSo the next time youâ€™re convinced youâ€™re right about what youâ€™ve been drinking, give a little â€œunclarityâ€ a try.\r\n\r\nAn American-style, unfiltered wheat beer. Pale straw in color with a light cloudiness from carefully selected wheat and yeast. Pleasant spicy malt aroma and a crisp hop finish.');
