INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('822c629f412f4307a24ed7b59d131ccb', '245e62fe2e37417ead2510318f1ae758', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Vintage Ale 2008', 8, 0, 0, 0, '', 'I have crafted this very special ale from the finest Challenger and Northdown hops, Maris Otter malted barley, and of course, our unique yeast, to create a truly extraordinary limited edition brew.\r\n\r\nIndividually packed and numbered, this bottle is one of only one hundred and forty-five thousand produced.');
