INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8297f69b7f5b415f8b4b2c3bdf8ca121', 'ddc962506c724ae5bab8745e272d5570', 'e64b30f392b4437b82ec46e764453ac1', 'bbcfea982aa64195bd7b1addfbc9fbe2', 'Sly Rye Porter', 5, 28, 29, 0, 'slyryeporter-big.png', 'A rich, chocolaty English Porter with a clean finish. We use the finest floor-malted Maris Otter malts from England, the same malts used for the best single-malt scotch. A portion of malted rye gives a spicy, slightly dry finish.');
