INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('82afd1e6f8fe4835a0f82af285a1be44', 'd8c82baf6cf6470ea9c3a89a27f33cb9', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Pugsley''s Signature Series Barley Wine Style Ale', 8, 0, 0, 0, '', 'Barley Wine Style Ale is a big beer made with six different malts (Pale Ale, Crystal, Caramunich, Wheat, Chocolate and Roasted Barley) and balanced with a very full hop charge of Summit, Challenger and Fuggles hops. It is a deep reddish brown color with a complex fruity nose, a very full body, and an interesting balance between grains and hops which ends with a pleasing dry taste. To fully enjoy all the flavours, this ale is best drunk at 55 degrees Fahrenheit.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('82b4eebbef334ba49f3eec0c9f872c5f', '16b1c780c4b848578ceff51ab8761bf8', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Steamboat Oatmeal Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('82b8fb25e6a14618be03147138e14a39', '41219ea95bc742daa4e9d99bbb781f50', '98b7246d5e1b4592b15adced83ab36d0', '722a236919264104b2bb85a0e24f9744', 'Dark Island', 4, 0, 0, 0, '', 'Dark Island is an iconic beer: a standard-bearer for traditional Scottish ales. In cask, this beer has twice won CAMRAâ€™s Champion Beer of Scotland.\r\nOn the nose, this dark beer offers bitter chocolate, figs, toffee and hints of fruit.\r\n\r\nOn the palate, this resolves into beautiful, silky-smooth, coffee-and-chocolate flavours, followed by figs, dates and dried fruits, with a very appealing, lingering aftertaste of fruits and hop bitterness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('82cc2aa4f81146589b775215898a7ebd', '4dc07d0ab39c437ba7e0c6088a957045', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Imperial Stout', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('82d6d0083da2462ab419462089697643', 'fdbb35eddc244a79b420e3a127823805', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Pure Hoppiness', 8, 0, 0, 0, '', 'A West Coast Double IPA\r\nSo mega-hopped it will take you to hop heaven. Weâ€™ve used hops in the boil, more hops in the giant hopback, and added to that, an incredible amount of dry-hopping for that cutting-edge â€œhop bite.â€ Once youâ€™ve tasted this unique beer, all others pale in comparison. 1.072 OG Classified IBU 8%ABV');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('82d787e08dae402aa53a222953af76ee', 'f6b4fa787e0a43418b88dcf6cf75b5ab', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Belgian Wit', 0, 0, 0, 0, '', 'Belgian Wits originated in Belgium, in the area of Brabant just east of Brussels. This are was a part of the Netherlands in the early 1800''s and was the wheat growing region. In this era, the Dutch basically controlled the spice trade, thus, coriander as well as Curacao orange peel made its way into the beer. Spices were used well before the widespread use of hops in beer. At one point there were more than thirty breweries producing a Wit, but overtime the style died off and in 1954 the last of the breweries ceased operations. One of the most famous brands of Belgian Wits is Hoegaarden (pronounced \"Who Garden\") produced by Pierre Celis back in 1966. This revived the style and by the 1980''s it was popular again!\r\n\r\nBelgian Wits are similar to a Hefeweizen with respect to the cloudiness of the beer and some phenolic (clove) and tart flavors. Wits should have white, rocky head when poured and should be almost white in appearance, hence the name. \r\n\r\nYou will smell oranges and coriander which is different than a Hefeweizen that smells of banana and clove. Our version of a Belgian Wit is called \"Hoof - Hearted Wit,\" and it is brewed to style with dried bitter and sweet orange peel and coriander seeds.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('82e1ea6eb22c461d90fb3771a551a1e9', '2e35a41312ab4c219425cac5d30434f3', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Trout Slayer', 4, 0, 0, 0, '', 'Trout Slayer is a filtered wheat ale, fermented at cool temperatures, making it a smooth drinkable session beer. Brewed with Palisade, Glacier, and Mt. Hood hops, this straw colored beer is sure to please any craft beer drinker. IBU 35 SRM 5 ABV 4.7%');
