INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('83daa4e5ef2648a58e1ac216a0291b25', 'ddf86b22ce3149be9fff402436ad70d0', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'Grotten Brown', 6, 0, 0, 0, '', 'The latest acquisition â€œGrottenbierâ€ was created by Master Brewer Pierre Celis. It is an aromatic dark beer with 6.5% alcohol content.\r\n\r\nIn the marl pits in Kanne ( Belgium) and Valkenburg (the Netherlands), deep under the ground, you can taste the Grottenbier in a constant temperature of 11Â° Celsius.\r\n\r\nAs it is the case with Champagne, the bottles are placed in a â€œpupitreâ€ with results in an additional fermentation. \r\n\r\nThis beer with a high fermentation with a second fermentation in the bottle has been pointed out as one of the best 10 present-day beers by beer guru Michael Jackson.');
