INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('84a0401e81da4afbbdc30d44867a9b56', '3b1cefedca8e475c9e620feb0df34abe', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Rahr''s Bucking Bock', 8, 0, 0, 0, '', 'Bucking Bock - it''s a traditional German Spring Bock Beer - golden in color and mildly hopped...... Kick''n in at 8% alcohol - it has a smooth malty character that will surely thaw you out after a long cold winter. Spring is here and so is Rahr''s Bucking Bock!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('84a3468749214a06b32227f5f3771ac2', 'eabf4f40165c48bd87da961394316153', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Vermont Lager', 0, 0, 0, 0, '', 'A classic European style lager. We take the time to brew this beer as a true lager should be brewed. And it''s well worth the wait! You can enjoy the drinkability of this light-gold, refreshing beer with friends at the pub or at home after a long day.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('84b2368222cc44508da8baffa79a6023', '92ecbfbe736e49378d8aae2062a441c0', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Miller Genuine Draft 64', 2, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('84d368b3448b4270b44c9a8c18bf2bf3', 'f6b4fa787e0a43418b88dcf6cf75b5ab', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Hop Knot IPA', 6, 0, 0, 0, '', 'Our Hop Knot IPA is made only from American malt and lots of American hops, which produce a big, broad-shouldered, hoppy beer backed up by a character as warm as, well, Mom and apple pieâ€¦ \r\n\r\nHop Knot IPA get its peculiar name from the weaving of four different hops added at four separate times during the brewing process. Including our cavernous hop-back, which gets so stuffed with whole leaf hops that we feel genuine guilt for its excess. Hop Knot is an ale that is to be enjoyed with friends, spicy food or any time you need a good hop fix without the harsh bitterness. We hope you enjoy this pioneering beer made in the bold spirit of Americans everywhere. \r\n\r\nAlcohol content approximately 6.0% by volume (ALWAYS ON TAP!!)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('84da9c6a457c461e9990bb303bdaf4da', 'c481fdf60728475aa7c22dec1c641acf', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Coors Extra Gold Lager', 5, 0, 0, 0, '', 'Coors'' Extra Gold Lager is a rich, full-flavored lager that has a deep golden color.  Extra Gold Lager starts with the slow aging of its roasted malts, which are then combined with its other premium ingredients and slow-brewed to produce this exceptional, refined lager.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('84f200a87e494f47b343425939d084f9', '3d80398428f9495ebe0f9b1acf0a6295', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Climax Nut Brown Ale', 5, 0, 0, 0, '', 'This style of beer is based on the English Mild, which was a combination of a stout and a lighter beer favored by coal miners in Scotland, Ireland and North England.\r\nWe''ve brought together the grains used to make both a Stout and a Pale Ale and balanced them in our Nut Brown Ale to produce a beer with a chocolate and molasses flavor and hints of caramel and coffee in the background.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('84f514d1ba034f3cb5463d964b94f36d', '203629c092734c9c81aa9447cef0332f', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Jasper Lyte', 0, 0, 0, 0, '', '');
