INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('85260172b52046168cb29639c5574ad0', '5f280fa883124fac82d2c6c769d0e45e', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Mean Manalishi Double I.P.A.', 8, 0, 0, 0, '', 'Explore the extremes of hops, and experience all of their bitterness, flavor and aroma with this Double I.P.A. An extreme, super-assertive and satisfying amount of American hop character is balanced with a toasty, caramelized, intense malt presence.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8548428e77f24dfcb52bd147497e4b83', 'fcd0ef039fc343adb1e01b07e25a6e70', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Hibernator', 6, 0, 0, 0, '', 'This robust and malty brew will take the bite from a cold winter night.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8581049668e7424a9ce154ca1db96618', '35b6541f343948159453d67551229eee', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Red Barn Ale', 6, 0, 0, 0, '', 'This Farmhouse Ale traces its roots to the small rustic breweries of Southern Belgium. The word Saison comes to us from the French language and it means Season. Lightly spiced with Organic Ginger, Orange Peels, Black Pepper and Grains of Paradise, this brew promises to quench your thirst on the hottest Southern California days or wherever your travels may take you. Available in 750 ml bottles and on draft at select inspired locations.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('858159738bde4c97b12b77dd2e78bb38', '13e46693ec384f9183b40ee3a0560780', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Satsuma Harvest Wit', 5, 0, 0, 0, '', 'Real Louisiana Satsumas, golden wheat, oats and the finest barley create Abita Satsuma Harvest Wit. Pale and cloudy, like the haze on a hot summer day, this white beer has a sweet and subtle citrus flavor with a touch of spice that is cool and refreshing. \r\n\r\nAbita Satsuma Harvest Wit is very versatile and can compliment a number of dishes. This brew pairs well with salads, fish, shrimp and lobster, as long as the dishes are not too spicy. Thai dishes, which often have citric notes in their flavor profile, would also perfectly compliment the orange flavors in Abita Satsuma Harvest Wit.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('85890b6730ce4a418fa550763c0f90d3', 'f8d4f1b2b6f747dc9ed4b4c78815a433', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Copper Head Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('85948c875a124de7bfb681cac11fc233', '5d67eae726e743a8b01e413716761c64', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Black Mo Stout', 4, 0, 0, 0, '', 'A dry Irish-style stout served via nitrogen.  Black Mo is a very smooth and creamy beer with a pleasant roasted malt character.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('85a2ae6032744f3899917bc9dcf5ae20', 'b6bf8680d5ee440c804c52c7b2f85bc7', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Navigator Golden Ale', 0, 0, 0, 0, '', 'Another one of our most popular brews. Navigator Gold has a crisp and slighly hoppy finish. It''s cold filtered and moderately carbonated.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('85bd18ffb9ea4e1ba538af5e1cf58ec8', '2a58f7cedbe94fd9830ddb857dea9157', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Alaskan ESB', 5, 0, 0, 0, '', 'Extra Special Bitter Ale. Alaskan ESB is darker and hoppier and is brewed and fermented at different temperatures than our popular Alt-style Amber. It has an exquisite copper color derived from Crystal malt and an aggressive, yet pleasant hop character.\r\n\r\nMalty with roasted overtones, Alaskan ESB has a crisp finish resulting from the use of premium Northwest hops.\r\n\r\nAlaskan ESB is made from glacier-fed water and a generous blend of the finest quality European and Pacific Northwest hop varieties and premium two-row and specialty malts. Our water originates in the 1,500 square-mile Juneau Ice Field and from the more than 90 inches of rainfall we receive each year.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('85be3241fe104523951ceed0e9e047ee', '660988d35a3c471f96199b5be5a06203', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Lake Shore Light', 0, 0, 0, 0, '', '');
