INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('85f979aeb2244a5abd028420cfce0699', '35b6541f343948159453d67551229eee', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'd01c4741043a4547ae78c9f205ee8728', 'Judgement Day', 10, 0, 0, 0, '', 'A massive beer in every sense of the word. A stronger and more contemplative version of our Lost and Found Ale. Judgment Day is the base beer for our Cuvee de Tomme. Many of the Trappist Breweries produce a version of beer which ages incredibly well for many years to come. And, since none of us knows when the end of the world is coming, we suggest you stock up with lots of Lost Abbey beers so that when the end of the world magically appears from no where, youâ€™ll have a beer or two on hand for even the stingiest of angels. Available in 750ml bottles and on draft at select inspired locations.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('860c3d7885ed42b89a97016a6fd99f35', '32629f72e41245c7b98912e872917b62', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Big Porch Ale', 5, 0, 0, 0, '', 'This beer is brewed especially for the Grand Hotel located on Mackinaw Island, Michigan.');
