INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('86278c949bbf4f9d9111e32104c5326b', '924f4d2594fe47a0a732a9e14bc24ad6', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Punkin Ale', 7, 0, 0, 0, '', 'A full-bodied brown ale with smooth hints of pumpkin and brown sugar. Perfect to warm-up with, as the season cools.');
