INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8648d72fa0074773bdff2df029f22140', 'b6bf8680d5ee440c804c52c7b2f85bc7', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Iron Arm Belgian Style Wheat', 0, 0, 0, 0, '', 'A Belgian-style summer favorite. Malted wheat, Pale, Munich and Cara Vienna malt, then moderately hopped with Saaz and a double dose of Hallertau. Served unfiltered with an orange wedge, this is fun in a glass.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('864f03ed0ea248588b921cd6af2f24ea', '558ee551293941698e4f5b894a2dd00c', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Mile Rock Amber Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('864fd416b9dd479089c896322faa5d42', '5f280fa883124fac82d2c6c769d0e45e', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Silk Porter', 6, 0, 0, 0, '', 'Dark, robust and silky-smooth, with many flavors of roasted, toasted and caramel malts. Porter is an old-world beer style, so popular that it helped start the industrial revolution. Taste the history.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('865774a591274d7d9e541b7265a9f43c', '2a4b7604c78042ca9278def847ce3b68', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Low Country Light Lager', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8660c0f700fb42d68981da0ee881c635', 'b67c5d7317f84d76a2a3874cf45661bb', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Bavarian Dark', 4, 0, 0, 0, '', 'A Russett colored brown ale with a thinner but well defined white head, grainy aromas with a touch of caramel  flavors.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('86679135002540deabac00b8ce5c3dc9', '27f2fd76054546ab995143f1705971b9', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Extra Pale Ale', 4, 0, 0, 0, '', 'An original American pale ale, our XPA highlights the subtle, sophisticated flavors and aromas of our Midwestern two-row malt and imported aromatic and Munich malts. Washington-grown Mt. Hood and Magnum hops create an extremely balanced beer with a beautiful straw color.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('866ae31947e146d3857822655d701ba1', '92ecbfbe736e49378d8aae2062a441c0', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Mickey''s Ice', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8681c482b9d8484f845e1af4a0c00253', '6373fec6e4d84db5ae7c64f6230502ce', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Obliteration IV', 8, 0, 0, 0, '', 'With passion and purpose, we present this series of hop-centric beers. Using different hop varieties and brewing techniques, we aim to capture bold, distinct hop characteristics in aroma, flavor and finish. While we explore the\r\nworld of hops, we invite you to learn along with us: these beers offer an incredible opportunity to experience the diversity of hops while engaging the palate and obliterating the senses.\r\n\r\nObliteration IV is a tremendous Double Wheat beer. Its aroma is pungent with fragrant notes of citrus, spice, pine and alcohol. An even malt-to-wheat ratio provides a sturdy yet satisfying base for showcasing these high alpha-acid hops, creating flavors and textures that entice then intrigue. An American wheat beer yeast allows Obliteration IV to finish with unadulterated hop bitterness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('868b625bf6984537a44facb01b7878be', 'f5a6d81438b449b79e3e664be914d727', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'cd3a63e3b16a44a89a64d0625aea2911', 'Gueuze-Lambic', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8690a0e8e9f548f2bedb686bea1a0c06', '294d62a7dd9b48e5a81a26a3a81dc295', '4fcd53c380e347edb1ca81489b03f902', 'ad3c649f09f448d4ab3c857c6e21457f', 'Beck''s Light', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8696fe3826da4a0fbad7a43ed2382e8a', '3be6b00a760647c7ba5d5de8c1bee825', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Old Salt IPA', 5, 0, 0, 0, '', 'Our India Pale Ale is hoppy and bitter with a nice sweet malt finish. Slow dry-hop conditioning brings out the herbal hop aromas.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('86ab48708b4c4ff5891d9b18d48bef1b', 'd33327c71a05442f9f215a3afda390ae', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Jever Pilsener', 4, 0, 0, 0, '', 'A Norther German (Friesian) Pilsener that is cattegoristic of the style. It is a little more hoppy than Czech pilseners giving it a more herb (bitter?) flavor.');
