INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('874392c7a57c4ea7bdbbd9de111fe61e', '72f88f94f30245af820cd491fa57a5c8', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Atta Boy IPA', 7, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('87825bd86e62406c8e112af29f0e8260', 'b67c5d7317f84d76a2a3874cf45661bb', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Hamtramck', 4, 0, 0, 0, '', 'Brightly filtered, highly carbonated, golden premium-style lager. It is lightly hopped with Polish Lublin hops. The beer will appeal to those who prefer the lighter American style beers.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('878b47cf31e14ad3a0be7e49e47054ef', '99e194ac7fa04ad18c653d6f25461416', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('87a0ce65c0524b31a271e174bee0102b', 'a210159f7e86409aa8d353da25eff137', '98b7246d5e1b4592b15adced83ab36d0', '1c20aafad8964ed4a7626ef53934000a', 'Adnams Explorer', 5, 0, 0, 0, '', 'A golden bitter suffused with the aromas of a grapefruit grove. The massive citrus attack will burst on your palate allowing all the flavours of the imported New World hops to deliver their fruity bitterness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('87a66861708c4de099b906e3c642bc6d', 'b24b4ed44ade4bec9772689fac16bca6', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Lighthouse Amber Lager', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('87e8f19861c64710bb7317c4fdf0a840', '37f6ce0279db4108b39bec3816f42e96', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Brotherhood Black & Tan', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('87fe564b01f347d39c6ff95e0c2882ea', '23a6b5e0f93e4872a9bb426d5ea01cd1', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Black Rye Bock', 6, 0, 0, 0, '', 'This dark lager combines the characteristics of three winter beer styles. All three of these styles traditionally come from the colder harsher areas of Europe. The styles are (1) Black Beer (aka schwartzbier) originating from the former East Germany); (2) Rye Beer which at one time was only made in hardier areas of Eastern and Baltic Europe; and (3) Bock Beer which is widely known as a higher alcohol lager of Northern Germany. Our Black Rye Bock has a distinctive bitter chocolate palate and black color reminiscent of a black beer. The spiciness from the rye malt shines through in the flavor. The high alcohol balanced with malty sweetness rounds out this cold season bock. Smooth drinking with a punch makes this lager a perfect quaffer for our Arctic winter. 6.2% alcohol by volume.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('882764a24c5a45c28ea42702c2fb2e47', 'df3cc6f9b0e34daea76b844af935a87c', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Cerberus 10 Dog Ale', 10, 0, 0, 0, '', 'This beer is made with one grain and 4 Belgian yeasts, a deceptive golden color, and a malty palate lend complexity to this Belgian Trippel Ale.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('882f2b458898465792b937d94db376e7', '06f1c8a9bb74470981730c2969378ee8', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'Stone 11th Anniversery Ale', 8, 0, 0, 0, '', 'The inspiration for making a Black IPA (or should we say \"India Black Ale/ IBA\"?) has been over a year in the making. As soon as we wrapped up the brewing of the Stone 10th Anniversary IPA, we started brainstorming ideas for the Stone 11th Anniversary Ale, and the Black IPA concept was born. This was a challenging brew to formulate and achieve what we considered the ideal flavor balance of intense up-front hops with balanced roasted malt flavors, a deep, rich flavor, and a hearty bitterness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('88374c0c22e040c5ab3dad3d039dbdb1', '7ddd4212b0414ae1a627854c3c7dd751', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Bighorn IPA', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8845ab878d1549e6ab34d259989d2282', '586b36c006c048efb522f39ed80bc6bd', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Terrapin Monk''s Revenge', 9, 0, 0, 0, '', 'This Belgian IPA has a malt bill of a Belgian Tripel and a hop bill of a Double IPA. The yeast I chose for this beer comes from one of the 7 Trappist breweries.\r\n\r\nBelieve it or not, this is the first time in my professional brewing career that I have used dextrose (corn syrup) in a Terrapin brew. True to style no doubt.\r\n\r\nâ€œMonkâ€™s Revengeâ€ (otherwise known as the â€œBig Nastyâ€) has all the flavor and aroma of a Double IPA while hidden beneath lies the malt character of a fine Belgian Tripel.\r\n\r\nI hope you enjoy my interpretation of this very fun style.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('884cf87523de4051b8c8f776a9cf6b8a', '6e8b38e283cb4f87a958f00dbad901cb', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', '(512) Wit', 5, 0, 0, 0, '', 'Made in the style of the Belgian wheat beers that are so refreshing, (512) Wit is a hazy ale spiced with coriander and domestic grapefruit peel. 50% US Organic 2-row malted barley and 50% US unmalted wheat and oats make this a light, crisp ale well suited for any occasion.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8870e533ded9499588c15d2ca77a2926', 'abc41dda032c4d238f4e735978cc54df', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Brugse Zot', 6, 0, 0, 0, '', 'Brugse Zot is a goldenblond beer with a rich froth and a fruity flavouring. The beer is brewed with four different kinds of malt and two aromatic varieties of hop which give the beer its unique taste.\r\nWith an alcochol degrees proof of 6 % Vol it is a well balanced, easy drinking beer with character.\r\nBrugse Zot is a natural beer born out of a selection of only the best ingredients. Thanks to the refermentation in the bottle, the beer has a longer natural life.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('88742e6f958743a880c2d36cf4c552f0', '5f1779dae1624f62baaef8bcd67e0d18', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Irish Stout', 0, 0, 0, 0, '', '');
