INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8a60d8b2f9d749898e17bc3c2ac992cc', '3bfccf92b0934a688877be8a75cd6f7d', 'b7ee8858a0b549ddb2361e1ed313f6e1', '3a8d4356f46746979884c04ffd896fbe', 'Abbaye de Saint-Martin Blonde', 7, 0, 0, 0, '', '11.2oz bottle.  Slightly hazy golden color with a white head. Earthy clay, light molasses, and buttered cauliflower aromas. A crisp, frothy entry leads to a dryish medium body of figs, creamy caramel, and roasted carrot flavors. This St. Martin Blonde ale finishes with dried fruit and cashew fade.\r\nAbbye St. Martin Ales are pure Belgium.');
