INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8a9d65d8a297413d964d4438f7e374ae', 'e8e6530d1c584680bade96ca2817a37f', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Prostrator Doppelbock', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8aae2aeadd4c4f39b731704d779c9a88', '16d6017aa4c44e608d09a925b9c956cf', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Seven Gates Pale Ale', 5, 0, 0, 0, '', 'The story of the Seven Gates comes from rural Pennsylvania, not far from the Spring House Brewery. According to the legend, a mental asylum for the criminally insane stood in the middle of a dense forest. Surrounding the asylum were seven concentric gates, preventing would-be escapees. One terrifying night, the asylum caught fire, test link causing the inmates to flee into the menacing forest. As the tale goes, the former asylum residents were trapped by the seven gates, and eventually succumbed to the perils of the forest. The locals swear that the tormented souls of the inmates will torture anyone brave enough to attempt passage through the Seven Gates of the forest.\r\n\r\nSpring House Brewing Co. honors the local legend by producing a terrifyingly delicious brew that is as familiar as a friendly forest, yet possesses a mysterious quality that will haunt you from the first taste. The enormous, hopped flavor and the meticulous craftsmanship that goes into each bottle will have you believing that the master brewer must be a direct descendent of the former asylum residents.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8ab575dda2674fe28acffd514a4f4434', '548f3cc09aa5447c9e6a45762e5a7397', '98b7246d5e1b4592b15adced83ab36d0', '0a4bb7119e2f41faa7b40acf63b2e0c6', 'Dark Mild', 3, 0, 0, 0, '', 'To quote Dr. John Harrison, a great influence on my brewing, \"Mild ale is the only beer with an uninterrupted history from medieval times to the present day.\" The \"mild\" means low hop bitterness, \"...which is the only essential feature of a mild ale.\" They can be light or dark in color, high or low in alcohol, dry or sweet. This is difficult for modern style wiennies to grasp. How can one style be so many things? How can I judge it good or bad?. The current Brewery Creek Dark Mild is medium brown, soft hops and about 3.5% abv. It could be a bit more estery. It is a lovely style.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8ab6ac3c40dc423d8c529dd91976b94f', '6e8b38e283cb4f87a958f00dbad901cb', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', '(512) Bruin', 7, 0, 0, 0, '', 'At once cuddly and ferocious, (512) BRUIN combines a smooth, rich maltiness and mahogany color with a solid hop backbone and stealthy 7.6% alcohol. Made with Organic 2 Row and Munich malts, plus Chocolate and Crystal malts, domestic hops, and a touch of molasses, this brew has notes of raisins, dark sugars, and cocoa, and pairs perfectly with food and the crisp fall air.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8abb1875b9a147dfab0bf4d4c92e732b', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Beach Bum Blonde Ale', 5, 0, 0, 0, '', 'Beach Bum Blonde Ale is a traditional American \r\nblonde ale with a slightly spicy hop note and balanced malty flavor.');
