INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8ac229a3c63042ab9d17299f2e2dd109', '5e90a99b63a54208b6e9a0e226fefd50', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Mudcat Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8ac5e5426f4040449098bba6bedf7a76', 'ecbfbc639150435191d6af029ff71bd7', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Lancaster Oktoberfest', 6, 0, 0, 0, '', 'This smooth brew ushers in Autumn with an invitingly tawny color complemented by an assertive maltiness. A noble crispness from German and Czech hops completes this very traditional lager-style beer, Available from August to November.\r\n\r\nAvailable at the Brewery and in bottles & cases from September - December.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8ace8478c16d41bf9b56dcb63ff2f65a', 'f773b893039e4b3894d2dc8e61a8beae', 'bf3112301857461f82c7633c0a695896', '98950448f00e4eb7b81ed9628258d643', 'Headless Man Amber Alt', 5, 0, 0, 0, '', 'The ancient peoples that inhabited Wisconsin are known for building numerous celestial stone monuments and earthen effigy mounds to serve as symbols of their culture and their beliefs.  Unfortunately, most of these structures have fallen victim to the farmer''s plow over the past 150 years.  Not far from the brewery, lying preserved on the floor of Rock Lake, are two effigy mounds - a Headless Man and a Turtle.  Legend tells us, as the Turtle can survive on both land and in water, its spirit helped guide the Headless Man into the afterlife.  May the Turtle''s spirit guide you to happiness with a Headless Man Amber Alt.\r\n\r\nThe Headless Man is brewed in the \"old way\" of a DÃ¼sseldorf-style Altbier.  A unique cold lagering process gives this amber ale its smooth taste.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8acfd7fb3dff43c587a060c590c99f00', '3c1a29f6db284abda8d558a43582ba35', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'NÃ¸gne Ã˜ Amber Ale', 6, 0, 0, 0, '', 'A rather malty brew, which we think goes very well with cheeses - even well matured blue cheeses. You can also try our Amber paired with a grilled dish. Recommended serving temperature 10Â°C/50Â°F.');
