INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8b4fc52687b24506878532be9829c22b', '81cb183e7edf438998bd8652c9b33c6f', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Broken Spoke', 5, 0, 0, 0, '', 'An American pale ale made entirely with amarillo hops.');
