INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8b63d993b3324c408d6978e7c921c634', 'ea4c78c86a144184ade4af610c94417a', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Pumpkin Ale', 5, 0, 0, 0, '', 'Our Holiday beer is made with real pumpkins, cloves, ginger, all-spice, nutmeg and cinnamon. This light copper colored winter ale will tantalize your taste buds. Pumkin pie in a glass!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8b718e4b2cef482c896d78d1c7d61c62', '641566e7dfc4492b816400ba5e1254f7', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Black Mocha Stout', 5, 0, 0, 0, '', 'Highland''s most robust beer, having a very malty body with a large, roasted chocolate flavor. It is black in color with a very clean finish and a moderate hop flavor.\r\n\r\nIBU: 25\r\nAlcohol content: 5.3% by volume\r\nHops: Chinook and Mt. Hood\r\n\r\n*Contains Wheat\r\n\r\nCalories per 12 oz. 216.81\r\nCarbs per 12 oz. 24.99');
