INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8cccc082fbd54e4baf392cb664443d52', '41219ea95bc742daa4e9d99bbb781f50', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Red MacGregor', 5, 0, 0, 0, '', 'Red Macgregor is a unique beer: delicate and sophisticated yet the robust cask conditioned version of this beer was the first Scottish beer to win the BIIA World Cask Beer Gold Medal.\r\n\r\nOn the nose, this ruby-red beer is delicate, floral and fruity, with notes of violets, cherries, toffee and caramel. \r\n\r\nOn the palate, the fruits combine with a juicy malt character and hints of toasted malt, with a biscuit malt and spicy hop finish.');
