INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8ce17c2ab8214bec883c6bb7d2654c98', 'b67c5d7317f84d76a2a3874cf45661bb', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Sebewaing Beer', 5, 0, 0, 0, '', 'A commemorative brew styled after the Sebewaing Brewing Company''s signature beer. The Sebewaing Brewing Company brewed from 1880 until 1965. This brew was commissioned for the town of Sebewaing''s 150th anniversary celebration.');
