INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8d95f385680c41be935ad0a5e94a8365', '2c6714b81fff4309bd8ba27d2a8fd29e', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'e2617cdeed8f4eb69e01c49f84dd8000', 'Bee Sting Honey Rye Ale', 6, 0, 0, 0, '', 'A smooth golden ale flavored with Pilsner malt and fresh local honey from Schaefer Shack Farms.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8da2ed1fd1dc40e2a56d84b823c036f5', 'a4cfd85d69074d5ca2b4683ae8c29649', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'German Valley Amber', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8da31f4ab34244e3b8ee828df6d092f2', 'f590cfabc78c4d6daaa1804eebe185c1', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'Trois Pistoles', 9, 0, 0, 0, '', 'Trois Pistoles has a dark brown color topped with a rich foam mousse.\r\nIts slightly sweet taste is enhanced by accents of roasted malt, cocoa, ripe fruit and dark spices with a smooth finish like an old port.\r\n\r\nBrewed with four selected malts and four\r\nexotic spices, Trois Pistoles beckons with a\r\nsubtle sweetness that makes it surprisingly\r\nsmooth and satisfying for a beer of such strength and complexity.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8da8dc0e7ca6482d841eda8738325f68', '692ae410f3654b0a9b1c94b5539f80a7', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Phuket Lager', 5, 0, 0, 0, '', 'Phuket Beer was created as a refreshing â€˜boutiqueâ€™ beer in view of the exotic island of Phuket with a much lower formula of bitterness than any other domestic rivals in Thailand.\r\n\r\nPhuket Beer is the first regional beer brewed in Thailand and is positioned to appeal to both the international markets as well as the local population. This is manifested through the label and packaging designs presented in both English and Thai languages.\r\n\r\nPhuket Beer is well positioned as a premium brand located somewhere between the local standard brands and the imported premium brands. The efforts were inspired from the feeling of being in a tropical paradise. Thai beer consumers have become more sophisticated over the years, by selecting and demanding premium and high-end beers. initial consumer target was Phuket Island''s significant tourist sector, a sector that is prone to taste and drink locally produced brands.However, strategic positioning and selected marketing of Phuket Beer has resulted in a ray of successful export markets with overwhelming response from the initial markets overseas.\r\n\r\nThe philosophy is to provide a â€˜tropical lifestyleâ€™ drinking experience in a fresh clean light tasting lager beer with 5% alcohol by volume, which is in total contrast to the other Thai beers that are very bitter with higher alcohol content.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8daa5d45e06d4c2bb9964eb349c98b01', 'd11d97eb0c8f41dc866776343d0ed558', 'b7ee8858a0b549ddb2361e1ed313f6e1', '3a8d4356f46746979884c04ffd896fbe', 'Arabier', 9, 0, 0, 0, '', 'An arabier is a pure malt beer 8Â°vol/alc brewed with flower Nugget-hops from Poperinge. It has the special dry-hopping taste and aroma, so appreciated by beer lovers all over the world. It is one of the two main beers from De Dolle Brouwers throughout the year. Aging time is limited due to the fact that hop bitterness is declining with the time. Store arabier cool and dark and serve cool at 10Â°C. Cheers!');
