INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8dd1576eb8a74eeab1c138211adfe0f0', '29e8f8978b92426283fed1fcf7dcb14b', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Roxy Rolles', 5, 0, 0, 0, '', 'A wintry amber ode to the open road.  Our wintry amber ramble of sweet carmelized malt and spicy hops is for those who make their own roads.  Dry hopped with simcoe hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8dd9b5ed238249a4a9522895892d140c', '47a3de1b57274a59b0ff59c5d112c6d5', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Saranac Single Malt', 5, 0, 0, 0, '', 'We use 100% Scottish Maris Otter Malt. Traditionally used in the distilling industry. The combination of the Scottish Malt and slow aging process produces a unique brew as distinctive as single malt whiskey with a flavor than any other beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8de635d0d23c4a689dc169614f29b8b0', 'b0ea7ae584944dd5a3b806a1de8e5718', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Stiegl GoldbrÃ¤u', 4, 0, 0, 0, '', 'This wonderfully refreshing beer specialty from Stiegl, Austriaâ€™s largest privately owned brewery is brewed in strict adherence with the 1516 purity law of only using water, malt and hops. Stiegl-GoldbrÃ¤u is an Austrian styled beer with its own distinctive Salzburg lager flavor. The 12o original gravity is unparalleled in its even taste and ability to refresh. It is mildly hopped is golden in color has a great head with a superb finish. Stiegl-GoldbrÃ¤u is considered by many connoisseurs to be the worldâ€™s finest beer.');
