INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8e099d5efc924b85ae51f1abee48f921', 'd26d5c24741740f89a8385fa0c199558', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Half in the Bagpipe', 7, 0, 0, 0, '', 'Amber in color, full-bodied strong ale with a prominent malt flavor delicately balanced with Goldings hops. Made with a hint of molasses, this beer is usually on tap for Super Bowl with a keg or two of the previous year''s batch.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8e17a1bf03b54053ae922a179b39c195', '8a0066befe3b4c94a0da0a9f5b639f6e', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Imperial Pumpkin Ale', 8, 0, 0, 0, '', 'Yes that''s right!  The mother of all Pumpkin Ales is currently in transit to our wholesalers and should be out on shelves around mid-September.  This 8.0% ABV pumpkin ale is heartier, spicier, and more \"caramelly\" and \"pumpkiny\" than its faint brethren!  \r\n  Perfect finisher on a cool autumn night, or match it up with a slice of pumpkin pie and fresh whipped cream.  \r\n  If you don''t agree this is the mother of all pumpkin ales, then you just don''t like mothers!');
