INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8ef9cc08f97745dab77cc78f18a3e76d', '20db57ff2ecf445c81511160d57e84c9', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Oaktoberfest', 0, 0, 0, 0, '', 'A fall classic, our Oaktoberfest emphasizes rich malt flavor. We use German malt and hops to give it an authentic Bavarian character. The rich, maltiness of this brew is a good match with spicy cuisine, as well as barbecue. Live Oak Oaktoberfest will certainly raise the level of enjoyment at your next fall gathering. Available September - December');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8efa5c1da1db46fb8d065f55faf8d46f', '243b8f4ff3b74c7dba16bd88933ee0cd', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Mad Brewer Maibock', 7, 0, 0, 0, '', 'A bock beer is required by German law to start at 17Â°Plato.   For those who are interested, Â°Plato is a measurement of the sugar content before fermentation.  It is a very malty lager beer with medium hop bitterness.  A maibock is a light to amber colored bock beer.  A Maibock is very similar to a Helles/pale bock.  Maibocks were originally brewed for the coming of spring, hence the name Mai (German for May).  The Mad Brewer Maibock is medium amber in color.  Though similar in color to our Pipe Organ Pale Ale, it is very different in character.  Donâ€™t let it get you though, itâ€™s a very strong beer at about 7% alcohol. It has a very clean and malty nose.  The hop bitterness is evident, but not dominant.  The Mad Brewer Maibock will finish quite full and have a delicate sweetness.');
