INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8f205451f34145779adfa802bbb70dc9', '8788e692080745fb8e823bb61ca74a1e', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Schlafly Oktoberfest', 5, 0, 0, 0, '', 'A malty, full-bodied, deep reddish-amber lager. Traditionally brewed in March for the Oktoberfest in the fall, this style is also known as MÃ¤rzen. Also available in bottles.');
