INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('8f27e9fd3cdb4570b7c392c3f5688ec3', '493a96917cef45929c4a0bce5e3ac9a1', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'West Coast IPA', 7, 0, 0, 0, '', 'This West Coast-Style India Pale Ale is extravagantly hopped, full flavored, medium bodied and copper colored. A menagerie of hops is combined throughout the brewing process to impart specific characteristics. Hops used include Simcoe for a unique fruitiness and grapefruit zest, Columbus for strong hop pungency, Centennial for pine and citrus notes, and Cascade for floral aroma.');
