INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('904371f3e3404efeb68b007abbd67a2c', 'f1babdc560cf42e09c3862df6aa17805', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Genuine Pilsner', 5, 0, 0, 0, '', 'The Aass Genuine Pilsner is a premium \"lager\" produced in accordance with the \"Purity law\". The malted barely is a pilsnermalt produced in the Sandinavian countries. We use the very best of hops known under the name as Sazer and Hallertau, and the liquid is pure Norwegian mountain water.\r\n\r\nThe pilsner is largered at cool temperatures, and it is allowed to mature for as long at 3 months before bottling. \r\n\r\nThe beer is sold in a caracteristic nice- looking green bottel containing 11.2 fl. oz or 330 ml.');
