INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('908f39287aac4f82927beef60bfc3884', 'd53519e8b3d74f55a274d75472250426', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Iron City', 4, 0, 0, 0, '', 'Iron City has been the â€˜Burghâ€™s signature beer since 1861. This premium lager has become a proud tradition of the city and its people. Just try to imagine a Pittsburgh football, baseball or hockey game without an ice cold Iron.\r\n\r\nWe still brew Iron City fresh daily â€“ but now, instead of delivering it to Pittsburgh neighborhoods in horse-drawn buggies, we deliver it to your favorite hangouts. You can get an Iron at national restaurant chains, upscale eateries, and â€“ of course â€“ your favorite local bar. You can also find it at more than 330 regional beer distributors. Because Iron City is brewed locally, it goes from the brewery to you within a matter of days. You wonâ€™t find a fresher beer anywhere in Pittsburgh!');
