INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9100fdf507194e8588dfe093d20d595d', '924f4d2594fe47a0a732a9e14bc24ad6', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Aprihop', 7, 0, 0, 0, '', 'Brewed with luscious apricots, finished with whole-leaf hops. A \"fruit beer for hop heads...\" Ale Street News');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9109e4fdb29546a0941979c926ed9bb8', 'fcd0ef039fc343adb1e01b07e25a6e70', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Traditional IPA', 5, 0, 0, 0, '', 'The first IPAs were unfiltered and featured extra hops and higher strength as a preservative for the long trip from England to the colony of India. Our Traditional IPA is naturally carbonated, dry-hopped & unfiltered like the old days.');
