INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('91abaedc04c54cb5a2c46cd20e61b64c', '8a0066befe3b4c94a0da0a9f5b639f6e', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'House Ale', 4, 0, 0, 0, '', 'House Ale, our 4.5% session ale, was first brewed in 2006.  Our goal was to brew a beer that was a little bit lower in alcohol, but did not lack for body and flavor. We''re sure you''ll agree, that''s just what we achieved with this tasty brew.  Brewed with Pale, Caramunich, and Carapils malt for flavor and body, then hopped exclusively with expensive Tettnang hops, a very delicate, delicious hops that perfectly fits this beer with just the right snap of flavor.   Available only in Pennsylvania, in our Variety Pack Case.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('91c0cebf61cf43fa95494cbed121b494', 'bce0897f514c4c66909e14f1d7a609c9', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Pale Ale', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('91d2cafb6566474ebe099dd5502d959a', '13e46693ec384f9183b40ee3a0560780', '4fcd53c380e347edb1ca81489b03f902', '4864870829d445c3bfec247cc306489c', 'Abita Amber', 0, 0, 0, 0, '', 'Abita Amber is a Munich style lager. It has a smooth, malty, slightly caramel flavor and a rich amber color.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('91e6ca7f7cf147a5a5f5aad91364f1aa', '7aa8e5a5efa54bb8a65d8646e7a6394b', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Porter', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9200a4701fcc4317889807a6dd1893bb', 'c481fdf60728475aa7c22dec1c641acf', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Coors Original', 5, 0, 0, 0, '', 'Coors beer, first introduced by Adolph Coors in April, 1874, is brewed in the Rockies for a uniquely crisp, clean and drinkable \"Mile High Taste.\"\r\n\r\nDuring World War II, Coors aided the war effort by setting aside half its beer for sale to the military.  When the service men and women returned home to states outside of Coors'' original 11-state marketing region, they spread the word about the beer''s taste and quality -- which became known as the \"Coors Mystique.\"\r\n\r\nPrior to its national expansion in the 1980s, Coors'' limited distribution left consumers in the eastern U.S. wanting a taste of the Rocky Mountains'' finest beer. President Gerald Ford was known to take several cases of Coors on his Air Force One during return trips to the White House.\r\n\r\nIn September 1893, Coors competed for the first time at the Chicago World''s Fair and won awards for brilliancy, flavor, chemical analysis and commercial flavor.  The award-winning legacy of the brew continues and in recent years Coors beer has won a number of honors at beer festivals.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9210decc043d45fda10d47c7938100fb', '21fb36d515a046c3838ba77d0d71ffc1', '98b7246d5e1b4592b15adced83ab36d0', 'd4e5211c1aa74e4592bc9899fd3659c7', 'Iron Rail IPA', 7, 0, 0, 0, '', 'English Style India Pale Ale, Maris Otter 2-row, Canadian Honey Malt and Belgian Crystal.\nCentennial, Kent Golding, and Cascade are added Five times during the process, including Dry Hopping.\n\nAroma: Earthy, Citrusy, and Resinous\nTasting/Flavor: Orangy and Sugary Apricots\nFinish: Malt Sweetness Balanced by Dry Hops');
