INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('921b5b7532034c18a418c0dcf71d8e21', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Green Valley Stone Mill Pale Ale', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9229b126e06c4450833bcb0886875d7d', 'ddc962506c724ae5bab8745e272d5570', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Pale Ale', 5, 0, 0, 0, '', 'A new version of an American classic.\r\nOur Yazoo Pale Ale bursts with spicy, citrusy hop aroma and flavor, coming from the newly discovered Amarillo hop. The wonderful hop aroma is balanced nicely with a toasty malt body, ending with a cleansing hop finish. Made with English Pale, Munich, Vienna, and Crystal malts, and generously hopped with Amarillo, Perle, and Cascade hops. Fermented with our English ale yeast.\r\n\r\nFood Pairings: The bracing bitterness of this beer can hold its own with spicy foods, while helping to cleanse the palate after rich, creamy dishes. The citrus hop flavors go exceptionally well with any dishes using cilantro, such as Mexican salsas.\r\n\r\nOG: 14.0 Plato\r\nFG: 3.3 Plato\r\nIBUs: 55\r\nSRM: 6\r\n5.8% abv');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('922d62516be746eaa355c708d00989e9', 'b67c5d7317f84d76a2a3874cf45661bb', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Celis Raspberry', 3, 0, 0, 0, '', 'An authentic Belgian fruit flavored and spiced ale with a pronounced raspberry flavor and aroma, accented by orange peel and coriander. Clear and bright golden color with a raspberry tint.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9230aff29c6a468a9eebc79b0f0351d6', '387f03355e29436597aee9e25a247c44', 'b7ee8858a0b549ddb2361e1ed313f6e1', '09d8eece1bb941ca8df9621a1c6dd025', 'LuciÃ©rnaga', 6, 0, 0, 0, '', 'An artisan pale ale brewed in the Grand Cru tradition. Enjoy its golden effervescence and gentle hop aroma. Coriander and Grains of Paradise round out the spicy palate, melting o so softly into a silken finish of hoppiness and bliss! Make any season a celebration!');
