INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('926875f69ef449f2ad314cc2dde4e459', '731b7a49baee4cccbe5db6c8e212c421', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Donner Party Porter', 6, 0, 0, 0, '', 'Sustenance to get you through those long, cold winters, the Donner Party Porter is another of FiftyFifty''s flagship beers. Reminiscent of dark chocolate, espresso, and dark dried fruits with a long complex finish, this beer is good for one of those nights where you''ve dug yourself into a snow bank because the ski trip didn''t go quite as planned. Deep brown with mahogany highlights, the hops and malt are very well balanced leaving one to contemplate the myriad of flavors as the beer warms. Moderate to slightly heavy, this beer is heaven in a glass.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9273107774294d2aadffee46987f3734', '3c1a29f6db284abda8d558a43582ba35', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Havre Stout', 4, 0, 0, 0, '', 'We usually do not make compromises, but this is probably the exception.  Norwegians are dead scared of dark beers.  This is an attempt to show that there are gentle dark ales.  As such Havre Stout is smooth and drinkable.');
