INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('929b8284f9d74e62aa7ded78022a2ff0', '108a26f09ce942a9a22091824a6cc9e8', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Chimay Triple (Chimay White)', 8, 0, 0, 0, '', 'Named Cinq Cents in 75 cl (25.4 fl.oz.) bottles, this beer with its typical golden colour, its slightly hazy appearance and its fine head is especially characterised by its aroma which results from an agreeable combination of fresh hops and yeast. \r\n\r\nThe beer''s flavour, as sensed in the mouth, comes from the smell of hops: above all it is the fruity notes of muscat and raisins that give this beer a particularly attractive aroma. \r\n\r\nThe aroma complements the touch of bitterness. There is no acidity, but an after-bitterness which melts in the mouth.\r\n\r\nThis top fermented Trappist beer, refermented in the bottle, is not pasteurised.');
