INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('93366ae37a9746288b595421e7deddb4', '9ee99dc929de419196bbe5b9243bec26', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Haywards 2000', 7, 0, 0, 0, '', 'Haywards 2000 H2K is India''s only beer with an ABV of 5.5%, whilst the rest of the beers are either less than 5% or greater than 7.5% - 8%\r\n\r\nTaste:  Rich, smooth and crisp taste \r\nMalts:  Indian malts, 6 row barley \r\nHops:  Hop extract from Germany and Indian hops palate \r\nColour:  Gold  \r\nAvailability:  Parts of India  \r\nFermentation process: Bottom-fermented  \r\nServing temperature:  7 - 9 Â°C  \r\nPackaging:  650 ml and 330 ml glass bottle and 330 ml cans  \r\n\r\nhttp://www.sabmiller.in/brands_haywards_2000.html');
