INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('943ac817cb8b46b4a8fa80102bea54dc', '81282c0636704249af5b903464f87f14', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Oliver ESB', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('943c4861b654436ba5b25d8923214fd8', '4c44bd3fa4c547da8c7315242ef09bbd', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Rock Art American Red Ale', 4, 0, 0, 0, '', 'The unofficial name for this beer is â€œSuper Glideâ€. Malty rich with a hint of spicy hops and roasted grains. This beer is one smooth ride with a clean finish! We brewed this one with American Pale, oats, flaked barley, black, chocolate, red malt, melandolin malt. American hops include Magnum, Centennial, Liberty and Crystal. Enjoy!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('945ae4bc63b649f591e656de5eaa4f59', '920ed055565548e5ac0d89449db908b0', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Highlander Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('947ddaca4ccd419ba4151abf3c0b59d5', 'cfded527d66b4b538e5bb319817bfc70', '22710fa91bbf4454b94555720f6a33dd', '7b48fefc9e4947cf8386f306dc30ce27', 'Guinness Draught', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9484de1cd45a44ceb1f3c19569ba29a5', '35b6541f343948159453d67551229eee', 'b7ee8858a0b549ddb2361e1ed313f6e1', '09d8eece1bb941ca8df9621a1c6dd025', 'Devotion', 6, 0, 0, 0, '', 'Itâ€™s an unassuming road leading to the priory. Here, off the corner of two intersecting roads, dedicated monks have been making beer for over 150 years. Itâ€™s always been a simple life â€“ the kind that requires they brew only enough to sustain the activities of their monastery. In the silence of passing seasons, they pray, they brew and retire in solitary existence behind the sheltering walls. They live a most interesting life. Most likely one we couldnâ€™t sustain.\r\n\r\nNearby, each summer, the trellised fields spring to life as rows of resinous green cones are trained toward the heavens. Rumor is some monks love these hops and being surrounded by budding yellow aromas and the leafy pungent fields inspired them. Since we arenâ€™t sensible enough to locate our brewery near hop fields, we can only offer this blond ale in celebration of our Abbey brethren and their steadfast Devotion.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('949472c149de4277b9b2823aa55d377f', '0503089b24664e50bbbc6e120966f93e', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Classic Pale Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('949609b4a2b44609883d51b70eaa1fa0', '05efd68d6f9944b59607debaedd4ca75', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Nocturn', 9, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('949bfd02ccf54826b7fc5a56c103bbf1', '548f3cc09aa5447c9e6a45762e5a7397', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Irish Stout', 0, 0, 0, 0, '', '\"Guinness\" is the prototype of all modern stouts. Many people, however, don''t realize that there are different varieties of \"Guinness\" brewed around the world. \"Draught Guinness* and \"Foreign Extra Stout\" are the two primary types brewed in Ireland. Foreign Extra is the one I have emulated. It is closer in style to the London Porters of old than to modern stout. Very dark and rich, not as dry as Draught, about 6% abv and around 60 IBUs (that''s hop bitterness). I used \"First Gold\" hops because that''s what I could get. Guinness use Nitrogen mixed with carbon dioxide to dispense their stout which adds to the creamy mouth-feel. BTW: The \"Imported\" Guinness you buy here in the US comes from Canada. It could just as well be brewed in the US but the common wisdom in the brewing world is that Americans prefer \"imported\" beers and will pay more for them.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('949e7d00e6624ce7b9260a536742b462', '8fe138cfca1a434ca239e2a92a982432', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Windy City Pilsner', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('94a7844c9a794b70b857c59518bb0fda', 'e0186d0b89e246559fbeb77e726edd51', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Celtic Cross Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('94b321e471ae4035a2d4d7b57b94184e', '7d1f0597c5004271bd948776dc707e0b', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Idiot IPA', 8, 0, 0, 0, '', 'The CBC Idiot IPA is an all natural India Pale Ale. A big beer with an 8.5% ABV and brewed with over 3 lbs of hops per barrell. Watch out, this unfiltered \"San Diego IPA\" has been known to reduce even the most intelligent to a blithering \"idiot\".');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('94ca1be91b1040388644c60b5ae577ae', '8ebc7c91e7814fc6aa6a1eeb1b53ccdd', '98b7246d5e1b4592b15adced83ab36d0', '1c20aafad8964ed4a7626ef53934000a', 'Finest Bitter', 4, 0, 0, 0, '', 'A regular winner of awards for quality and flavour, and winner of the silver medal at the International Brewing Industry Awards 2002, this refreshing yet full-bodied bitter is a favourite with beer drinkers everywhere. The rich flavours of premium malt and goldings hops are unmistakable in this well balanced, traditionally brewed bitter.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('94d18cde063a492687fbb3e9bdffbc0c', '81cb183e7edf438998bd8652c9b33c6f', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Pappy''s Porter', 5, 0, 0, 0, '', 'This dark mahogany ale has agreat and delicious malt depth, yet is balanced with supple, energizing bitterness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('94d35c5a1ee94605b3a69bff53079ec1', 'be7d66fc42624f0484cd29faf5c3b4d9', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Porter', 5, 0, 0, 0, '', 'From the Sierra Nevada Brewing Co. website:\r\nDark and rich, Sierra Nevada Porter is a delicious, medium-bodied ale with a creamy head. The Porterâ€™s smooth flavor (malty with hints of caramel) comes from a blend of deep-roasted barley malts.\r\n\r\n\r\nâ€œâ€¦there can be little doubt that this is one of the best porters being brewed anywhere in the world today.â€\r\n\r\nâ€” Christopher Finch, A Connoisseurâ€™s Guide \r\nto the Worldâ€™s Best Beer\r\n\r\nFIRST PLACE\r\nCalifornia Brewers Festival (Robust Porter: 2000)\r\nColorado State Fair (Porter: 1996)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('94d43fbb579147e08b9f567df2403ee1', '0e5f672cf17849a7adcfec8a17b932fe', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Lucky 13 Mondo Large Red Ale', 8, 0, 0, 0, '', 'Our 13th Anniversary Beer in was a Staff Favorite, So We Make it Each Year. BIG on the Amarillo Hops and Rich Dark Malts for a Round and Huge, Smoky Flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('94d68da7d31f4ddba773b8ba44569a0b', '590331e20bc34d55b99c538218c55bdd', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('94e8f034cdc844259ecd1673bea7306c', '8a0066befe3b4c94a0da0a9f5b639f6e', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Blanche', 5, 0, 0, 0, '', 'Clean, refreshing and perhaps just a bit tart, our brewers developed Weyerbacher Blanche just after their trip to Belgium during the winter of 2000.  Blanche, meaning \"white\", takes its name from the whitish haze in this pale gold brew, which is a result of the raw wheat and wheat malts used to brew this Belgian-style beer. \r\n\r\nIn 2002, Blanche was named as Best of the Mid-Atlantic/Southeast in the Belgian Specialty category at the US Beer Tasting Championships.\r\n\r\nWhite beers are well known as the principal product from Hoegaarden, a small town in a wheat-growing region east of Brussels.  Light, cloudy and smooth, Weyerbacher Blanche brings you authentic Belgian-style flavor along with microbrewed quality and freshness.\r\n\r\nBlanche is a thirst quenching beer that combines character and flavor with a moderate alcohol content.  Just try a bottle.  In the nose you''ll notice spiciness from the coriander seeds and dried curacao orange peels added during the boil.  In the mouth you''ll find a mild and refreshing ale with a hint of dryness from the wheat ingredients.  A clean finish follows with just a hint of tart spiciness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9510f132a5464864906902a870b2936e', '63457c99a5614aebaba4d3aaaca14318', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'A. LeCoq Imperial Extra Double Stout 1999', 9, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9515cc34c2f6450e9297af83f6a5d086', '47a3de1b57274a59b0ff59c5d112c6d5', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Pomegranate Wheat', 4, 0, 0, 0, '', 'This wholesome combination of unfiltered wheat beer and real pomegranate juice makes a smooth refreshing beer with all the goodness of pomegranate. Look for a light body with a slight tart finish and golden straw color.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('95232535cd6948baa4ab047c6ba497c3', 'ec4141f64a894cc6b7ca999be18af4cf', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Oatmeal Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('952e1a4909aa4eccbbf5e494ad3ac142', 'cb7bb586517d443ca77b034fa93c5624', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Pine Belt Pale Ale', 6, 0, 0, 0, '', 'A deep copper colored ale with a substantial malt backbone accented with British crystal malts with aggressive hop bitterness and substantial American hop flavor and aroma. The yeast profile is neutral.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9545e04d24d745139c0b6fc093413ed2', 'd2372ff4da2e4c4392020252c7990b4a', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Black Wych Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('954bbd6a627e4f1fba0ac1923a465e6d', '7c70d976efd54727964d3a376509823a', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Black Plague Stout', 0, 0, 0, 0, '', 'Derives its name from the historical fact that at one time in Europe beer was about the only safe liquid to drink. Black Plague is Irish style dry stout brewed only in fall and winter and only in small batches to ensure the freshness so paramount to such an intensely roasted beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9567baf6574147bd8ffdc17813984478', '318e9662a5324fc7803ed867cdb32538', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Fauntleroy Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('956b02446f304cdebbf7518335c4feb8', '3f9364c3e02848ccb9c89a876ee7a9c3', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Lost Sailor', 7, 0, 0, 0, '', 'A Hop Head''s dream beer, enough said.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('956c8673c5c14c879e4bae4452b9dd60', '641566e7dfc4492b816400ba5e1254f7', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Kashmir IPA', 5, 0, 0, 0, '', 'A brilliant, dry pale ale with an aggressive hop character balanced with a smooth finish. A bold beer best consumed with a stiff upper lip.\r\n\r\nIBU: 60\r\nAlcohol Content: 5.6% by volume\r\nHops: Stryian Goldings, Mt. Hood, Fuggles, Magnum, Willamette\r\n\r\n*Contains Wheat\r\n\r\nCalories per 12 oz 190.85\r\nCarbs per 12 oz 16.82');
