INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('95be844043ec4f19ad9b0d51ccaa235c', 'd45c85fe110c4911b17c5203df2246f2', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Whirlwind Wit', 5, 0, 0, 0, '', 'A swirling dynamo of flavor, with a steady calm of satisfaction at its heart, that''s Whirlwind Witbier. Offering a tamed tempest of flavors both spicy and sublime, this softly fermented ale greets the nose and tingles the tongue. Imported Belgian yeast charges Whirlwind with an energy all its own. It is a refreshing interpretation of the classic, Belgian ''white beer'' style.');
