INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9637a1ee997c47f6bf9edfa1f95b8c68', '5f280fa883124fac82d2c6c769d0e45e', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'b54082ab47e6498e9eebc1f15232fd53', 'Frosted Frog Christmas Ale', 8, 0, 0, 0, '', 'The essence of Christmas is captured in this very bottle you are holding. Perfectly blended spices compliment Frosted Frogâ€™s rich malt flavors, creating the ultimate Christmas experience. Celebrate the holidays as you savor this very special seasonal offering.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('96541346925a48cf985ae3e8492c93c5', '52f3cefa14f54331ba262b22f476f52c', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Pale Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('966543e2e3d0427f92bc81cd12cbce80', 'f743f04357824c41994f695c5034da14', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Scratch Beer 31 - 2010 Citra Of Brotherly Love IPA', 7, 0, 0, 0, '', 'Scratch 31, the brothers and the brewers decided to revisit one of our favorite sweet spots â€“ IPA â€“ and have some fun with hop flavors. Dubbed â€˜Citra of Brotherly Loveâ€™ in honor of Philly Beer week, Scratch #31 has generous amounts of Apollo, Cascade and Citra hops. This is our first use of Citra hops, which is known for an intense grapefruit aroma and flavor.\r\n\r\nWhile showcasing the intense Citra flavor we added additional bitterness with Apollo and Chinook hops as well. Scratch #31 went through a bed of Chinook hops in the hopback and was dry-hopped with Cascade and Citra hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('967ef328614542fda1899a7cdd9594cf', '94b2e7e841504f858034cf078e80a792', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Southern Tier Porter', 5, 0, 0, 0, '', 'Porter is our darkest beer, but not necessarily our strongest.  It is widely held that the darker the beer, the stronger the beer, but this is a summarily false.  The contribution of color comes directly from the color of malt that we use.  Some malt is oasted to achieve dark color and coffee-like flavor which in turn get transferred to the beer.\r\n\r\nOur Porter is ruchly complex with overtones of chocolate and expresso beans followed by a subtle flavor of hops.  It''s a nourishing beer without being too sweet or filling.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('96813ebe4b734cadb833cf952ad186f7', '36fbd9db40be4deaaa144de2e306764e', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', '3C Extreme', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('968a7466a61b48709703cafdb2afca1c', '40098866e3804736a2778481567f2d25', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'SchÃ¶fferhofer Hefeweizen alkoholfrei', 0, 0, 0, 0, '', 'alcohol-free Hefeweizen with the tipical taste, isotonic,');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('968c81d40fce475c8237b42354f5995e', 'fbcb4cb6bc974d9295f1f58ac6f7ac00', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Ashland Amber', 5, 0, 0, 0, '', 'A crisp, well-balanced, refreshing amber.  Simplicity is the key to this recipe.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('969493d4d853441796cede9c8463b5a9', 'ca206e17588140c9bcebe48e78865b89', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Lovitz Lager \"Watermelon Lager\"', 4, 0, 0, 0, '', 'This summertime lager is both smooth and refreshing as soon as it hits the lips. We take so much pride in it because there is truly nothing else like it on the market. We brew this American Style Lager beer with three types of malt: pilsner, pale and carafoam which enhance the head retention of this beer. We then gingerly scatter some very light floral hops at the beginning to give it some esters and sweetness that compliment the watermelon. The true magic of this beer does not occur in the brewing process but in the conditioning vessel. This is where we add the best farm fresh local watermelon and than push the beer into it, allowing it to sit and saturate for a few weeks. By the time it is complete, we are left with a unbelievably smooth tasting beer with a beautiful aroma and subtle taste of watermelon that imparts its way into this already crisp lager. Truly our customers'' favorite, this one will have you reaching for another glass soon after you put the first one down.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('969b4e92d54b4ca68d8238b02ed4b24e', 'ef801b5bc2fd42d19a5f11bad9cf8874', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Foster Child Australian Lager', 4, 0, 0, 0, '', '');
