INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('96b237f518154cb4a4255ef0b179cf51', 'c425bf738fba4131a6ca7511425b6b48', '4fcd53c380e347edb1ca81489b03f902', '2a6b815eb1624f47b33d1c5a753e5bd6', 'Orlio Seasonal Black Lager', 4, 0, 0, 0, '', 'A rich medium-bodied black lager whose sweet deep malt flavor is balanced by a moderate hop bite and roasted malt tartness that creates notes of bitter chocolate and a slight lingering sweetness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('96d1df9420794e1eb26460e886b501e8', 'db6ad11ebc394d5bade9f4f025197642', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Saint Florian''s Doppelbock', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('96d25df53e7f4161b084a4ebb1a7454f', '7e77030c61354dc6a26db9d2e0d6df6b', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', '471 IPA', 9, 0, 0, 0, '', 'Hoppy? Brother, 471 IPA redefines hoppy. 471 is a small batch, limited edition ale that was created by our Brewmaster to separate the weak from the strong. 471 is a double IPA, that combines Pale, Munich, Caramel-30, Carapils and Torrified Wheat malts, with Chinook, Centennial, Simcoe and Fuggles hops. It has a big sweet mouthfeel, followed by more hoppiness than you''ve ever had at one time. Enjoy.');
