INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('96fede090e5d4c9e88d9415defba1331', '7f9f1fc271d14150bb565dd345c4d38f', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9700dc1a1a3e426d8be22a6ac2d44cbb', '6373fec6e4d84db5ae7c64f6230502ce', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Panty Peeler Tripel', 8, 0, 0, 0, '', 'Free spirited Panty Peeler pours rambunctiously into your glass, releasing its engaging aroma. Curacao (bitter) orange peel and coriander create a beautiful yet bolder tripel by infusing color, citrus and spice. Belgian yeast adds playful character. Bottle conditioning assures a perfectly heady experience.\r\n\r\nBrewed as a Belgian tripel but with American boldness, Panty Peeler is delicious yet spirited. Originally named Extreme Polar White Bier, it got nicknamed \"Panty Peeler\" along the way. Then we translated it to French for a while: E''pluche-culotte. Now we''re back to calling it Panty Peeler and we''ve kicked up the coriander and orange peel to represent its original design.\r\n\r\nAvailability:\r\nAK - 22-oz bottles (year-round) and draft (on occasion)\r\nOR - 22-oz bottles (year-round)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('97037603dc9549b4a6b044eff5015fea', '0560596b78e94a608ef22b5781208781', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Renegade IPA', 5, 0, 0, 0, '', 'Our award-winning India Pale Ale  is a hop loverâ€™s dream. We use Galena and Cascade hops in the kettle and dry-hop with more cascade during conditioning. This copper-colored ale has a nice maltiness to balance all the hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('971ae010f3a3468594694689f489d0aa', '1c22dab930514d9690e65c79aca0472b', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'LaConner Pilsener', 0, 0, 0, 0, '', '');
