INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('98e7fdaafae14ec582f27616a63edabb', '47a3de1b57274a59b0ff59c5d112c6d5', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Saranac Summer Ale', 4, 0, 0, 0, '', 'ith more than 2,800 bodies of water in the Adirondacks, it''s not too hard to find a sunny place to relax, rest your feet and look out over the water. To celebrate summer in the Adirondacks, we''ve brewed a beer with generous amounts of wheat malt for a light, refreshing taste. Look for subtle hints of lemon.');
