INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('97c87848f8d043c9968baf2c53968b72', '6ee3779d2b1345e0b7b5edf8f63caabc', '98b7246d5e1b4592b15adced83ab36d0', 'f53645d05b19429d8e74046a3ccf0b8e', 'Potrero ESB', 5, 0, 0, 0, '', 'Traditional English E.S.B. made with English malt and hops. Fruity aroma with an imparted tart flavor brought about by replicating the water profile in England at Burton on Trent.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('97dd95a937cb42ffb708a6be3bc6d567', '99a775fe88344149af9cb46eb2920549', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '45f372212a6948b7ba624c5c474c4b9b', 'Captain Selin''s Cream', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('97e4e04629a64a68a0d583390f8d8d0b', '69b6d87839ef404bae2ac4a4a064c574', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Erdinger Weizen', 5, 0, 0, 0, '', 'The famous Bavarian specialty\r\n\r\nErdinger Weissbier ''crystal clear'' is particularly welcome as a tasty thirst-quencher for hot summer days.\r\n\r\nThis specialty wheat beer gets its ''crystal clear'' appearance from a particularly long filtration process, known in the industry as \"fine filtration\", whereby the beer becomes completely clear.\r\n\r\nThis gives Erdinger Weissbier ''crystal clear'' its sparkling and refreshing character - which also makes it the ideal wheat beer for warm summer days.\r\n\r\nBrewed in strict accordance with our own traditional recipe, Erdinger Weissbier ''crystal clear'' meets the highest quality standards and satisfies the most sophisticated palate.');
