INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('99453971d7704974be373ea9608d9b58', 'a5197ed517514f8fa66e3ad03627c21a', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Ipswich Summer', 4, 0, 0, 0, '', 'A light-bodied, unfiltered Blonde ale that retains the bold flavors typical of an Ipswich Ale, our Summer Ale is light enough for a hot summer day and can satisfy even the most scorching thirst.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9952504cae5e4ee3b515a4e7ad827ed0', '9c3ee95b24104dfd9b624cf02a81b1df', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Boulevard Unfiltered Wheat', 4, 0, 0, 0, '', 'Boulevard Unfiltered Wheat Beer is a lively, refreshing ale with a naturally citrusy flavor and distinctive cloudy appearance. This easy-drinking American-style wheat beer has become our most popular offering, and the best-selling craft beer in the Midwest.');
