INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('99721b2eb8584e3abb62a61c7b366f90', 'af55d658ed67460bb8a798eb56c85acb', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Pathfinder''s Porter', 0, 0, 0, 0, '', 'Pathfinder''s Porter is a robust, dark and hoppy ale originally brewed for street urchins of London. Our version does the job for the Glens Falls urchins of today.');
