INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('997c6deffcfd474086bda4eece88aaf6', 'b65808eb74e74797ad9375fc1a220b9b', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Big A IPA', 9, 0, 0, 0, '', 'Our Big A IPA has earned its share of praise over the last few years. In 2004 the New York Times named it its top IPA , and in 2007 Mens Journal Magazine included it on its list of 25 best beers in America. The last of each year''s edition typically leaves our warehouse around mid-May, and, as always, it doesn''t last long. \r\n\r\nStash Wojciechowski, the â€œKiller Kielbasa,â€ created this bonafide India Pale Ale recipe exclusively for the Smuttynose Big Beer Series.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('998b192602b64745aa9086db156325f2', '0ca2f5ae549749ebbca13dd87aacf085', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Organic India Pale Ale', 6, 0, 0, 0, '', 'Fish Tale Organic India Pale Ale is a medium-bodied beer with a rich golden color. The organic pale and crystal malts lay down a firm malt body. This provides the backbone for an assertive hop profile featuring organic Pacific Gem. The moment the Mighty Fish Brewers sampled this pungent and resinous New Zealand hop, they knew it would be perfect for their Organic I.P.A. The result: A Cascadian treasure.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('998c001ecd4e4a0bb2550f4e8cb689cd', 'ee0ff3804acb47bcb74ff404bce5da6b', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Super Natural IPA', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9990706910164cb3a1a40ae70136222c', 'f590cfabc78c4d6daaa1804eebe185c1', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Don De Dieu', 9, 0, 0, 0, '', 'Don de Dieu displays an appealing orange-golden hue with a stable, creamy head of foam. Its fruity, malty and yeasty flavor is quickly succeeded by a palate-warming finish of roasted nuts and spices.\r\n\r\nThis smooth, exceptionally strong triple wheat\r\nale offers a complex flavor that is slightly\r\nfruity, malty, nutty and yeasty, with a hint of \r\nunfiltered sake.');
