INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9a13cb8c14654e1094e7c493aed5107f', '6373fec6e4d84db5ae7c64f6230502ce', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Rondy Brew 2009', 4, 0, 0, 0, '', 'RondyBrew 2009 is a rendezvous of playful pale malts and feisty American hops, designed to exhilarate your winter-weary soul. This copper-colored ale delivers citrusy and refreshing hop aroma and flavor.\r\n\r\nThis yearâ€™s label features Rondyâ€™s hottest event: The Running of the Reindeer. If youâ€™re suffering from cabin fever, get out and run with the herd. But ready, set, RUN because this beer is only available for a limited time.\r\n\r\nRondyBrew adds refreshment and celebration to the festive fare and entertaining events enjoyed during Anchorageâ€™s Fur Rondy Festival.');
