INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9a901f5a42b1448da39a466346ca4322', '282d2200cabb4923a97daab4af52f023', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Wynona''s Big Brown Ale', 7, 0, 0, 0, '', 'This is named after a song that sparked the idea to make this ale. Brown ales seem to be there, but not really there, do you know what I mean? Well that won''t be the mistake with Wynona! We Voodooed out this style and added more that''s what we say. Mildly hoppy and smooth with hints of chocolate and tons of brown malt to let you know it''s there. Currently 7.3% by vol. \r\n\r\nBottle conditioned and Refermented. \r\n\r\nGet down with the brown, You''ll be Happy You Did!!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9ab7526f5f43451fbe5f957a2fcc5d63', '7eb26853c6ae4f8382558a236d3edd58', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Cascazilla', 7, 0, 0, 0, '', 'The name CascaZilla is a play on both the name of our local Cascadilla Gorge and the monster amounts of Cascade hops in this beer. This red ale gets its distinctive color from a healthy portion of caramel malt, which also lends some body and sweetness to the beer. The predominant flavor and aroma of this beer, however, is brought to you by the fresh American hops. If you haven''t done so yet, treat yourself to Ithaca Beer''s new monstrously hoppy Red Ale.');
