INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9ae9b31f6295493cbe0527a2e42fa146', '4da0a63b84814156bfb7ed054b368212', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '0efc79b43f194933857739c6141a570b', 'Ginger Tom', 4, 0, 0, 0, '', 'An old fashioned style ginger beer brewed naturally with honey, malt, lemon and fresh root ginger, leaving you with a refreshing crisp zesty flavour.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9b0125a5372644928f6cc4410aed1789', 'ec92b4740c624f948dfaab3049af3f4d', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'English Brown Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9b022b5971d8463689a4d4410209eb88', 'c8b8ea96cc144223808684146f1d6967', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', '10', 10, 0, 0, 0, '', 'Moortgat''s Maredsous 10 is an orangy-blond big sweet tripel nudging into a barley wine.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9b0eaf62be224f42bb62b1f5b2543c7a', 'be7d66fc42624f0484cd29faf5c3b4d9', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Southern Hemisphere Harvest Fresh Hop  Ale', 6, 0, 0, 0, '', 'Our newest addition to our Harvest family is Southern Hemisphere Harvest. This is the first time we know of that an American brewer has put out a beer with fresh-picked hops from the southern hemisphere. The inaugural ale will debut in late April and will feature fresh Pacific Hallertau, New Zealand Motueka and New Zealand Southern Cross hops, all from New Zealand. \r\n\r\nLike our Celebration Ale, the fresh hops in this beer are dried right after being picked then shipped immediately to Chico for brewing so that they retain their peak aromatics and flavors. To ensure the freshest hops possible, we went to the added expense of flying these hops from New Zealand to Chico so we could brew with them the week after they were picked.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9b1367fc66ed495b8dedfe9b3ad499ed', '6533462e9e774e57b9f5732311d0b734', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Susquehanna Stout', 4, 0, 0, 0, '', 'This representation of the classic Irish Dry Stout has a smooth roast flavor due to the use of specially roasted barley. The barley kernels are kilned at very high temperatures until they are dark brown to black in color. \r\nThe Susquehanna River is named after the Susquehannock Indians who settled in our area. This shallow river is over one mile wide in the Harrisburg area and flows from southern New York through Pennsylvania to the Chesapeake Bay.');
