INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9b3538f095a84b2db6269f4c795dc0b9', 'a210159f7e86409aa8d353da25eff137', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Adnams Tally Ho', 7, 0, 0, 0, '', 'The original winter warmer, Tally-Ho is actually a barley wine brewed to a nineteenth century recipe. It''s sweet; it''s heart-warming; it''s rich - but watch out, it''s got a kick like a drayman''s horse!');
