INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9c2ca578096f44db9313b2dfb1237f65', 'c5d43a6604a143b19cd221ba1979e3c7', '98b7246d5e1b4592b15adced83ab36d0', 'a6d4156030bc4d21a9825b11049e8425', 'Samael''s Oak-aged Ale', 14, 41, 12, 7, '', 'A super-caramelly, oak-aged English-style strong ale. The oak is very apparent in this rich and high gravity ale. Additional depth and complexity result in a woody and cask-like nose, with a pronounced vanilla flavor on the palate. As of 2007, the use of additional roasted malt has resulted in subtle bitternes to balance the natural sweetness.');
