INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9e9479b0c06d4b2c9a1c37e267680dc9', '94b2e7e841504f858034cf078e80a792', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Gemini Imperial Blended Ale', 10, 0, 0, 0, '', 'High in the winter sky, two parallel stick figures are visible & known as â€œthe twins,â€ or the constellation Gemini. The astronauts of the 1960s flew as teams of two in a program named after the celestial pairing. At Southern Tier, we have our own fraternal twins, Hoppe & Unearthly. Blended together & placed in this vessel, the mission of our Gemini is to travel high & take passengers on a journey far into the heavens.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9e96437848be4491861e0b465a208c3f', 'd532ca299f0049158974aa43f34ebb95', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Calumet Dark', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9e9673b332804fd9b96db7e082fd49ee', 'db8e7ee035e44b05911a313f001f3ae0', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'The Poet', 6, 0, 0, 0, '', 'The Poet has a rich, smooth malt character enveloped in tones of roast and chocolate. A soft mouth-feel brings luxurious flavors and soothing aroma. It pairs wonderfully with earthy flavors such as mushrooms and beef, while remaining the perfect accent to any chocolate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9ea28a31a1e349b78c2a24400d9ddc77', '3a09f973aa9a4b6bbfd27b54374bc96e', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Kilt Tilter', 9, 0, 0, 0, '', 'A Scottish \"90/-\" ale. Brewed only once a year, this ale is rich and full with a dryness that is beautifully balanced with a classic malt sweetness.');
