INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9ecc6d0cd8124a85accfae53bf5955cb', '32629f72e41245c7b98912e872917b62', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Two Hearted Ale', 7, 0, 0, 0, '', 'India Pale Ale style well suited for Hemingway-esque trips to the Upper Peninsula. American malts and enormous hop additions give this beer a crisp finish and incredible floral hop aroma.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9ee14cfaac354f218f9ca9bde879ae87', '68c7ccc9a53242398b14b26bf7c90e2f', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Buzz Beer', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9eeb632d8010434e9b82340fca2d425b', '13e46693ec384f9183b40ee3a0560780', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Restoration Pale Ale', 5, 0, 0, 0, '', 'Abita Restoration Pale Ale was created after the back-to-back hurricanes devastated Louisiana. With your help, the abita Brewing Company raised over $500,000 for hurricane relief. This brilliant, golden pale ale has a rich body, mild bitterness and a snappy, fresh citrus hop flavor and aroma. Cold filtered and brewed in small batches using no additives or preservatives, the Abita Company is proud to be Louisiana True.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9efac1294e5b492eb697c7b59dfbd222', '88c949e73761482bbd1f2badf91ec46c', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Edel-Pils', 0, 0, 0, 0, '', 'Our little village brewery in New Glarus, Wisconsin is proud to offer to you Edel-Pils. This \"Noble-Pilsner\" is the creation of our brewmaster. He brought special yeast from Bavaria, combined it with Wisconsin barley and the finest Bavarian and American hops. Then employing traditional brewing methods, this Pilsner is finished with a long cold rest in our cellars. \r\n\r\nExpect this bier to be creamy and full-bodied with a smooth finish. It will complement any fine meal or friendly gathering. We took our time in brewing so that you might take your time enjoying.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9f0ad605d52d4046a81829ba3b263b7e', '6e8b38e283cb4f87a958f00dbad901cb', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', '(512) Pecan Porter', 6, 0, 0, 0, '', 'Nearly black in color, (512) Pecan Porter is made with Organic US 2-row and Crystal malts along with Bairdâ€™s Chocolate and Black malts. Its full body and malty sweetness are balanced with subtle pecan aroma and flavor from locally grown pecans. Yet another true Austin original!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9f0b662b82ba4538bbe3ba5cb4be1174', 'd45c85fe110c4911b17c5203df2246f2', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Throwback Lager', 5, 0, 0, 0, '', 'Our Crisp, lighter in body, yet still full flavored brew.  Before Prohibition, thirst quenching lagers were firm and substantial, and enjoyed in huge volumes. This recipe incorporates yeast from the C. Schmidt Brewery of Philadelphia and a small portion of brewer''s corn to recreate an \"industrial\" lager of the turn of the century. \r\n\r\nReleased April 6 to celebrate Prohibition''s repeal 73 yrs. ago, Throwback Lager is a draft only release that should flow into June');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9f17339b0c8c4a0c91c057eafc77ebb5', 'c99ca2f0ebc14372b3bbf7bb4c6a5d66', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Rickard''s White Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9f2d491dfc574c87b0a7e59f28d104db', 'ea4c78c86a144184ade4af610c94417a', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Pig Pen Pilsener', 4, 0, 0, 0, '', 'Crisp Clean and refreshing Golden Lager brewed with German Malt and Hops for an authentic flavor. Pig Pen Pils is a great introduction into the world of Craft Brewed beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9f2ec2ec669e4418b0d1b5f076097d42', 'abe493cb583c405abfc022406c34cee4', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Pyramid Hefe Weizen', 5, 0, 0, 0, '', 'Brewed by the original Wheat Beer Pioneers, Pyramid Hefe Weizen is left unfiltered for extra flavor and aroma. \r\n\r\nHandcrafted with 60% malted wheat (10% more than Bavarian tradition calls for), our award-winning Hefe Weizen is unsurpassed in quality and exceptionally smooth and refreshing for the whole beer experience.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9f3065175ac342c89d65b51b4e3fb934', '8a0066befe3b4c94a0da0a9f5b639f6e', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'd01c4741043a4547ae78c9f205ee8728', 'Blasphemy', 11, 0, 0, 0, '', 'First released in March 2007,  Blasphemy is our award winning QUAD aged in bourbon barrels.  But not overaged, so we''ve picked up gentle vanilla oaky notes which complement rather than supercede the complex qualities that already make QUAD such an incredible beer.  Expected to be an annual Spring seasonal, supplies are limited.  ABV is 11.8%.');
