INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9fbc0e0d51b94fd48624e07a6791cebe', '226bc87deeea4f1fb202a68ed4c2ac81', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Sunshie Wit', 4, 0, 0, 0, '', 'Hot, Hazy summer days call for a craft beer that refreshes. Have no fear â€“ Sunshine Wit is here! Sunshine Wit is a refreshingly smart-assed ale that will satisfy, especially when the mercury is rising. Add a slice of orange for an extra blast of flavor! Sunshine Wit is a â€œwhite aleâ€ or â€œwitâ€ â€“ a hazy yellow wheat beer with a subtle citrus flavor and remarkable drinkability at 4.0% alcohol by volume. Let sunshine wit help you chill out on the hottest, humid, heat-stricken days of summer.');
