INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9fbfba9ce93a4c85829c1f9dff5cf42b', 'a9584f0278e545c4810c2d7bfe3a5c8b', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Sagebrush Stout', 6, 0, 0, 0, '', 'A dark, deeply roasted and full-bodied ale. Rich with kisses of chocolate, coffee and oats, it''s a glorious version of an American-style stout. A longtime house favorite.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('9fd080703ffd4402bc209764679ca66e', 'b929f6eca93d4496bb0068697d87aa96', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Hop Ottin IPA', 7, 0, 0, 0, '', 'Hop Ottin'' IPA is as hoppy as they come. The name means \"hard working hops,\" in Boontling, and that tells it all. Generous additions of high-alpha Pacific Northwest hops added during a vigorous boil, plus traditional dry hopping, with whole hop cones, give this ale a delicious citrus aroma, and an intense hoppy bite. This IPA is a hop lover''s dream.');
