INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a018cc6e45b8492d8de98392dc1f9647', '6745721021c14f36a490b65474f9933a', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Dundee Porter', 6, 0, 0, 0, '', 'More and more weâ€™re becoming a nation of milquetoasts. And nowhere is that more evident than in our beerâ€”puny liquids without calories, carbs, or cojones. \r\n\r\nBut it neednâ€™t be that way, my friend! Sure, we donâ€™t want to make a living shoveling coal or washing clothes on a rock. But we can recapture the more robust spirit of a time gone by.\r\n\r\nDundee Porter is a throwback to a different eraâ€”when times were tough and so were the people. They drank big beers, slapped each other on the back, and toasted the good lifeâ€”even though they only saw it from a distance. \r\n\r\nWith Dundee Porter, you can get a taste of it.\r\n\r\nBig and malty flavor from aromatic dark-roasted grains balanced by a subtle hint of hops. Deep color and rich caramel flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a03c725b8d894affa36a778245a5aa30', '4377684a6cf54d41bb0807e6334d5008', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Bittersweet Lenny R.I.P.A.', 10, 0, 0, 0, '', 'Ladies and Gentlemen, Shmaltz Brewing Co. is proud to introduce Bittersweet Lenny''s R.I.P.A. Brewed with an obscene amount of malts and hops. Shocking flavors - far beyond contemporary community standards. We cooked up the straight dope for the growing minions of our nation''s Radical Beer junkies. Judges may not be able to define \"Radical Beer,\" but you''ll damn well know it when you taste it. Bruce died, officially declared a pauper by the State of California, personally broken and financially bankrupt simply for challenging America''s moral hypocrisies with words. The memorial playbill read: \"Yes, we killed him. Because he picked on the wrong god.\" -Directed by, the Courts, the Cops, the Church... and his own self-destructive super ego. Like Noah lying naked and loaded in his tent after the apocalyptic deluge: a witness, a patron saint, a father of what was to come. Sick, Dirty, Prophetic Lenny: a scapegoat, a martyr, a supreme inspiration.');
