INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a0b66ce78274420e81aca642aebeb8ae', '6373fec6e4d84db5ae7c64f6230502ce', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Big Slick American Barleywine Ale', 11, 0, 0, 0, '', 'This kick ass American Barley Wine is all about hops â€”Nugget, Chinook, Simcoe and Centennial. And, yeah, LoTs of â€˜em. OKâ€¦thereâ€™s a substantial malt base on which these juicy Pacific NW hops lie down and do their dirty work. Maybe thatâ€™s too much infoâ€¦');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a0e1bbd7e62c439a916e95deb62aa510', 'd8e7843a06ca47b4918e47ce078caa0f', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Bad Penny', 5, 0, 0, 0, '', 'This dark brown ale is slightly sweet with a caramel and dark fruit finish. A show case of fine English malts, floor malted the old way. We use pale, chocolate, and crystal malts to produce a complex, but easy drinking dark ale. Very reminescent of northern English ales.');
