INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a52fbc1314a14ad4a0876346e4ef375d', 'c0f3c4bc6d374a578874bfd84803ebc3', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Black Chocolate Stout', 10, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a53fbdf673614f3393af8940aee53be0', '20f5693ca80c4c74a422a9dfa988e9a6', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Kells Irish Style Lager', 5, 0, 0, 0, '', 'In 1998 the McAleese Brothers, owners of Kells Irish Pubs in Portland, OR, Seattle, WA, and San Francisco, CA, wanted to make an American beer that would float Guinness. \r\n\r\nGerard and Patrick McAleese asked John Maier to create a beer with a green apple bite flavor profile. It took four batches to get it just right. John used acidulated malts imported from Europe to get the crisp, lemony/apple flavor the McAleese Brothers wanted. The bottle label reflects the McAleese family heritage, puctures the Kells Irish Pub logo, and a traditional Irish flutist. \r\n\r\nThe first Kells Irish Pub opened in Seattle in October 1983 in Post Alley, above the historic Pike Place Market. The restaurant will remind you of the Old Country with its warm, cozy atmosphere and traditional surroundings. Theres also a patio outside thats a great place to feel the breeze from the Puget Sound and the buzz from the Market. Kells has Seattles largest selection of Single Malt Scotch. \r\n\r\nThe Kells Irish Pub in Portland is a local landmark and has been named the #1 Irish Entertainment venue in America. Sit by the fire, belly up to the bar, check out the cigar room, and dont miss the St. Patricks Day Festival, the largest Irish Fest in Oregon. \r\n\r\nThe Pub in San Francisco is next to the historic North Beach neighborhood and reflects the Old World charm and hospitality the McAleese family brought with them from Ireland. \r\n\r\nKells Irish Lager has won world-wide acclaim by winning 8 medals from the World Beer Championship and a Gold Medal at the Australian International Beer Awards. \r\n\r\nKells Irish Lager is brewed with 7 ingredients: Great Western Pale, Crystal, Wheat and Acidulated Malts; Sterling Hops; Free Range COastal Water and Czech Pilsner Yeast.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a54bc4de68fa452982c5d0ac642553b7', '8439c502820948a7974ecfcd47a2a133', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Belzebuth', 13, 0, 0, 0, '', 'Beer of top fermentation, Belzebuth represents the achievement of a more than one hundred year-old know-how, the one of the Brewery Grain d''Orge. Under its copper colour, it hides a strong character for the lovers of sensations. It owes its strength to the subtle mixture of pure malts, hops and yeasts especially selected by our Master-Brewer.\r\n\r\nAt one time this beer was 15%. After the name change it was lowered to 13%.');
