INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a56cc32e1d8c4716b5b79bbdaa793445', '0ca2f5ae549749ebbca13dd87aacf085', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Organic Amber Ale', 5, 0, 0, 0, '', 'Medium-bodied with an appealing amber hue, this is the First Ale of the Republic. Its organic pale, Munich, and crystal malts create a gentle sweet character that is difficult to resist.  From organic Hallertauer hops come a zesty flavor and aroma that beautifully balance Organic Amber''s malt profile. The result: Truly delicious ale that salutes organic farmers and all the goodness they bring to our tables.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a5719caf89624ae290b32b72656f5da2', '343412b7c5de4ce5ac21dc63166abbdf', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Captain Lawrence Xtra Gold', 10, 0, 0, 0, '', 'This beer is the result of the marriage between two very distinct beer styles; the Belgian Tripel & American IPA. We have taken the best qualities from both styles and allowed them to shine through. The fruity and spicy notes from the imported Belgian yeast strain & the pungent flavors and aromas of the American grown Amarillo hops flow seamlessly together to create this flavorful ale.  Straight from the Captainâ€™s cellar to yours, we hope you enjoy.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a577f39c69e14d15b97d48aa8cb54ff2', 'f6b4fa787e0a43418b88dcf6cf75b5ab', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Oatmeal Stout', 5, 0, 0, 0, '', 'Our Oatmeal Stout is definitely a local favorite but it gets its origins from one of London''s oldest breweries. The Oatmeal Stout differs from the popular Irish stout in its more subtle roastiness and subdued dryness. The addition of flaked oats rounds out these sometimes harsh characteristics producing a velvet smooth ale. This black stout has a flavor profile unique to all of North America. Subtlety is not a strong point as it is a stout after all, rich and eminently drinkable. \r\n\r\nAlcohol content of approximately 5.0% by volume (ALWAYS ON TAP!!)');
