INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a6426d8008654ff9a09fb5cde9c0914a', 'f773b893039e4b3894d2dc8e61a8beae', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Gemuetlichkeit Oktoberfest', 5, 0, 0, 0, '', 'Gemuetlichkeit translates from German as \"the fondness of feasting, drinking and merry company.\"  This is true of most everyone in Wisconsin, especially those of us at the brewery.   Each September in the nearby city of Jefferson, Wisconsin, thousand turn out for Gemuetlichkeit Days, a celebration of the area''s German heritage.  We invite you to celebrate the spirit of Gemuetlichkeit with us.  Don your lederhÃ¶sen, kick up your heels with a polka and raise a stein of our Gemuetlichkeit Oktoberfest with a friend.  Ein Prosit!\r\n\r\nGemuetlichkeit Oktoberfest is a rich, amber lager with a malty aroma and balanced hop bitterness.  This seasonal style is served at German Oktoberfests in liter steins.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a6616b021578419a99acf79ea885d668', '20db57ff2ecf445c81511160d57e84c9', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Live Oak Pale Ale', 0, 0, 0, 0, '', 'A delicious example of the \"neo-classical\" American beer style. It has a beautiful copper color and is topped with a thick rich head. With a hint of ale fruitiness in the nose, Pale Ale starts out malty, finishes dry and has plenty of Cascade hops in between. It is sure to satisfy the most discerning ale aficionados.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a671eb0bcd1a4738a8c2de95b30672e6', '09ae092986ec4b2f90faf273d1e802e3', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Ur-Bock Hell', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a675ef0b9007405c8b56070cc467f2a5', 'd53519e8b3d74f55a274d75472250426', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Augustiner', 4, 0, 0, 0, '', 'Augustiner is a premium amber lager with a smooth, full-bodied flavor. From the rich copper color to the subtle caramel taste and clean finish, itâ€™s brewed to please the beer drinker who appreciates the best. This distinctive, well-balanced brew is quickly becoming Pittsburghâ€™s most talked-about beer. Upgrade to Augustiner!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a681ad1b355c4bafa5f74b4fda7145b3', '7d1f0597c5004271bd948776dc707e0b', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Point Loma Porter', 0, 0, 0, 0, '', 'A robust porter, very dark in color and a roasted malt flavor from chocolate malts. Its slight bitterness is rightfully balanced with a sweet smooth finish. A full-bodied beer with medium hop bitterness and aroma.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a68536d7f3964b41a415ad8d85c8d196', '722a9b25f4e842f5819b3ec1fea512e7', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Capital Wisconsin Amber', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a69226beb361486fa6b1f17c03a62ad4', '2c96e8e0e5a24d17a67491f9ec2ec686', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Big Bear Black Stout', 8, 0, 0, 0, '', 'Big Bear, as the name implies, is a hefty, black, Russian Imperial-style stout. This bold stout boasts a rich, caramel sweetness lavished by a robust, deep-roasted heartiness you can sink your teeth into. ...Big Bear''s bold flavors are produced using a blend of Belgian and English roasted barley and crystal malts. Some unique flavors come forth in the malt character. ...Louisiana sweet molasses and dark brown sugar. This dark brew is well hopped with Chinook and Cascade hops, which are somewhat, masked by the malt. This is a balanced bold brew boasting an A.V.B. of 8.1% that can creep up on you, \"so don''t get mauled\". It has a dry roasted quality that masks its'' high alchohol content, so drink responsibly. 2004 California State Fair, Silver Medal Winner; 2002 World Beer Cup, Gold Medal Winner; \r\n2002 Annual Bistro Beer Festival, Hayward, Gold Medal Winner; 2001 North American Brewers'' Award, Honorable Mention - og 1.076, ABV 8.1%, IBU 68.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a6a8bddf3b9345558e2a94cb751744e4', '8500bd208607465e9985b4afcd2b2530', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'California Dreaming', 8, 0, 0, 0, '', 'Imperial, or super IPAâ€™s were spawned out of the fascination of hops by the American consumer and are beyond Pale Ales and IPAâ€™S in terms of both hop and alcohol content. Our interpretation is orange-gold in color, lightly bitter but highly hoppy with a firm malt backbone. \r\nWeâ€™ll gladly put this head-to-head with the best that those California Hophead/Brewers have to offer.');
