INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a6cad367c3a0468cb562fa357eea3a26', '243b8f4ff3b74c7dba16bd88933ee0cd', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Millennium Trippel', 9, 0, 0, 0, '', 'A Belgian Trippel is a very special type of beer. A Belgian Trippel could be called the beer version of a Champagne. It is very light in color and highly carbonated giving an appearance similar to Champagne. The flavor is somewhat sweet and malty as well as strong.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a6ebc5cbc8ff442fb108d1bcd2e4892a', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', '22710fa91bbf4454b94555720f6a33dd', '84bca21ce52244db83158e4971bd7866', 'Michelob Irish Red', 0, 0, 0, 0, '', 'Born of Irish tradition, this all-malt ale uses kilned and toasted malts to produce its all-natural, signature red shade. A beer with exceptional balance, Irish Red displays an initial sweetness that fades to a clean, dry finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a6f8b0a354e24477ab61bb28c22fe51f', 'f590cfabc78c4d6daaa1804eebe185c1', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'Chambly Noire', 6, 0, 0, 0, '', 'The opaque blackness and beige-colored\r\nfoam mousse of Chambly Noire belie its light,\r\nrefreshing body and clean, long finish,\r\nfeaturing hints of roasted coffee beans, toast\r\nand toffee. \r\n\r\nWe recommend pairing it with grilled salmon,\r\nsteak or tuna au poivre, smoked meats,\r\ncoffee-crusted rack of lamb, or chocolate\r\nespresso flan.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a704b2144119498a9dced777f83da730', 'e8801a3d8e1d48b993d7146c1ea4f00e', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Labatt 50', 5, 0, 0, 0, '', 'John and Hugh Labatt, grandsons of founder John K. Labatt, launched Labatt 50 in 1950 to commemorate 50 years of partnership. The first light-tasting ale introduced in Canada, Labatt 50 was Canadaâ€™s best-selling beer until 1979 when, with the increasing popularity of lagers, it was surpassed by Labatt Blue. Labatt 50 is fermented using a special ale yeast, in use at Labatt since 1933. Specially-selected North American hops and a good balance of dryness, complemented by a fruity taste, provide Labatt 50 with all the distinguishing features of a true ale.');
