INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a75d26bc5dec4a858a2e87573826d54e', '4b0c089531be426a9c7a37b5ceba7154', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Bube''s Stout', 0, 0, 0, 0, '', 'This dark full bodied stout is perfect with a meal or as a meal. Rolled oats give this beer an enjoyable mouthfeel while chocolate and roasted malts lend to its distinctive flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a75d27568dae4bad934ee83c5acaba24', 'e36fab1869c74ca0a9a0970da2b17d9f', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'The Great Pumpkin Ale', 0, 0, 0, 0, '', 'A spiced ale that tastes just like pumpkin pie in a glass.\r\n\r\nThe Pumpkin Ale is a malty, copper coloured brew that''s spiced with cinnamon, cloves, nutmeg and ginger. We add 100 lbs of pumpkin directly to the mash and the resulting beer tastes just like pumpkin pie in a glass.');
