INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a8109680a6f54c36aacfc196977efb99', 'c3f22870b8204ec5ade70b8ce392176e', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Ramstein Winter Wheat', 9, 0, 0, 0, '', 'Also referred to as a Doppelbock, this is the strongest beer made by High Point. Rich creamy head with bouquet of wheat malt, black current, clove, and apple. Deep full flavors of caramel and chocolate malt balance with hops for a smooth warming character. The finish is smooth and malty leading to a subtle alcohol and dark caramel finish. The wonderful balance of this beer provides a complex profile that hides the 9.5% alcohol content. The perfect companion for a cold winter night.');
