INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a8b046ace0c04c94b084d78e5ff90506', '944cbc838d644592b1e2b5b997c0a2b2', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Odell IPA', 7, 0, 0, 0, '', 'We took the traditional IPA, originally shipped from England to India in the 1700''s, and made it bolder and more flavorful - American Style. We''ve added new varieties of highly aromatic American hops to create a distinctive bitterness profile and an incredible hop character.');
