INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a8dffedb5379474786fd605ce7e6f5e3', '7eb26853c6ae4f8382558a236d3edd58', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Flower Power India Pale Ale', 8, 0, 0, 0, '', 'Enjoy the clover honey hue and tropical nose. Simultaneously Punchy and soothing with a big body and a finish that boasts pineapple and grapefruit. Flower power is hopped and dry-hopped five different times throughout the brewing and fermentation process.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a9056462e522471eabff5649ea4ba76c', '11e7b3d23cf94b6182b28480d00d514c', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a918bb44a2d14b849ac23b879eea179a', '048f9156b40a469781e7e19d6321d6b5', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Samuel Adams Brown Ale', 5, 0, 0, 0, '', 'rk in color yet medium bodied. Rich and smooth.\r\nSamuel Adams® Brown Ale is a study in flavor, body, and style. Supported by an interesting blend of malts, it shines with a deep mahogany luster. The roasted malt blend is complex and deep as well, with notes of biscuit, nut and caramel. The hops are imported from Europe; Noble Spalt from Germany and citrusy Goldings, a traditional British ale hop selected from a single farm in East Kent. With moderate hop bitterness, a deep malt body, and a fruity ale fermentation character, Samuel Adams® Brown Ale satisfies the soul and doesn');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('a93a023638c2497d8aa653be1eff9c56', '5f280fa883124fac82d2c6c769d0e45e', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Frog''s Hollow Double Pumpkin Ale', 8, 0, 0, 0, '', 'There''s a Place just south they call Frog''s Hollow, with cauldrons afire in Fall, and they only speak in whispers of the name. There''s a brewery they say who has the secret, of spices picked just right. With a crying shout, they''ll knock it out, and hand you this Frog''s delight.');
