INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aa59f9c5224845adba63488f038f596c', '12cb074c207142d9958c176fbb740310', '98b7246d5e1b4592b15adced83ab36d0', 'd4e5211c1aa74e4592bc9899fd3659c7', 'Bird of Prey IPA', 8, 0, 0, 0, '', 'Our true English style IPA. Bready English Malt gives this beer a firm backbone to hang truckloads of East Kent Golding Hops on. Available on draft at the brewery and select â€œBeer Geek Barsâ€ Feb. March April (if it lasts that long).');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aa5df2a3599340a296a7c160e0b79e0a', 'c1f15aa32e9d4e74a8b8181783ee357d', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Flashback Anniversary Ale', 6, 0, 0, 0, '', 'Flashback Anniversary Ale is an India-Brown Ale with 6.8% ABV. This is the first beer weâ€™ve made here that uses one single hop variety (Cascade) in the recipe in five separate additions. The fresh Cascade hop aroma and flavor is perfectly balanced with the dark roasted grains, making Flashback a very unique beer. Weâ€™re calling it an India Brown Ale to help illustrate its flavor to the consumer. Itâ€™s hoppy like an IPA but dark and roasty like a Brown Ale. Put them together and voila! Flashback at its finest!');
