INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aaba5c34cc1f4552a4fc4acf0f525b12', '5bafddb45bee47eda6da50325994331d', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Hitman Gold', 5, 0, 0, 0, '', 'Hitman Gold is an American Pale Ale. The flavor is smooth but aggressively hopped with Simcoe Hops. The beer is best described as a â€œmini-IPAâ€. The beer is inspired by the famous wrestler Bret The Hitman Hart, who also is the artist who designed and drew the logo.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aad3d1a1f1b244e9b2154992f0ff8a2c', '32629f72e41245c7b98912e872917b62', '98b7246d5e1b4592b15adced83ab36d0', 'dde08a23bc764388a0571b10d486b6e7', 'Kalamazoo Stout', 6, 0, 0, 0, '', 'A full-bodied stout with plenty of roast flavor. Kalamazoo Stout is available year round, leading our vast portfolio of stouts.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aad418ab91f9494299f1661354d45cd9', '5d67eae726e743a8b01e413716761c64', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Arthur''s English Old Ale', 7, 0, 0, 0, '', 'A big malty ale brewed in the style of English Old Ales. Deep ruby in color and lightly bittered with a big malty backbone.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aaf9471f092a42daa5136d825d5dfe01', 'ddc962506c724ae5bab8745e272d5570', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Hefeweizen', 5, 0, 0, 0, '', 'An authentic example of a Bavarian Hefeweizen. â€œHefeâ€ means cloudy or yeasty and â€œweizenâ€ means wheat. This beer is made with mostly wheat and uses a true Hefeweizen yeast that gives it a fruity, banana aroma with just a hint of cloves. The tart finish makes this the perfect summer beer.\r\n\r\nFood pairings: Almost anything goes well with Hefeweizen but it especially shines when paired with salads and omelets.\r\n\r\nOG: 12.0 Plato\r\nFG: 2.3 Plato\r\nIBUs: 13\r\nSRM: 3\r\n5.0% abv');
