INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ab36d7ace1734b4ba4f41bde09451652', 'bef3198dea9243d09ed8b09b5f8cdf53', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Old Milwaukee', 4, 0, 0, 0, '', 'Old Milwaukee. A trusted, high quality beer that continually receives the highest awards and accolades from Beer experts across America. Old Milwaukee has a long history of celebrating \"Blue Collar\" sensibility. Simply said, good beer at a fair price. Old Milwaukee has always represented America''s core values: Honesty, integrity, hard work and love for your family.\r\n\r\nSpeaking of family, the Old Milwaukee Family has a beer that is right for you. Old Milwaukee when you want a full bodied, full flavor American Lager. OM Light when you are in the mood for a lighter tasting beer with fewer calories. And don''t forget OMNA, our flavorful non-alcoholic beer for those moments when you want the taste of America'' best tasting beer without the alcohol content.');
