INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('abd4062b4ccf4e6f93389cf52ed8aa43', '6745721021c14f36a490b65474f9933a', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Dundee Pale Bock Lager', 6, 0, 0, 0, '', 'Certain things seem interminable. The line at the DMV. The commencement address. Winter. \r\n\r\nBut take heart. Even the longest, darkest winter gives way to spring and a new sense of optimism that the best is just ahead. That thoughtâ€”and an itchy wool robeâ€”sustained the monks through times of fasting. Their reward? A bock beer with the power to rejuvenate the body and the soul. That, and the opportunity to exchange the wool robe for a nice burlap one. \r\n\r\nSo when youâ€™re stuck in the middle of that seemingly endless glass of mediocre beer, be optimistic. A Dundee Pale Bock awaits.\r\n\r\nA traditional German Maibock with a deep, golden color, malty-sweet aroma, and clean finish from Magnum and Czech Saaz hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('abde0a76fa0f4474b8397518e7c04b7e', '20f5693ca80c4c74a422a9dfa988e9a6', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Ten Thousand Brew Ale', 10, 0, 0, 0, '', 'Brew 10,000: One Brewer, Eighteen Years, Ten-Thousand Batches of Beer. \r\n\r\nBrew 10,000 is not so much a style of beer, rather it is a new recipe using some of the best ingredients John Maier has ever brewed with... Vienna, French Special Aroma, and Maris Otter Pale Malts; Yakima Summit and German Saphir Hops, Free-range Coastal Waters, and PacMan Yeast. \r\n\r\nBrew 10,000 was brewed only once, so its allocated and very, very limited. Its packaged in the swing-top 750-ml ceramic bottle and available only at select retailers. Note, Brew 10,000 was sold out at the brewery in early 2007, however, very limited amounts may still available in the retail trade, email Schuyler@rogue.com for a retailer near you.');
