INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('abefa95ca9ef4d20a700e1b728818a9e', '3ae9f1cc386c46a29f36798ccc043764', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Crooked Tree IPA', 6, 0, 0, 0, '', 'Inspired by West Coast I.P.A.''s, but brewed with Michigan style. The Crooked Tree is heavily dry hopped to give it a big aroma of pine and citrus. The flavors are big, yet very balanced between fresh hops and malt. Often described as \"grapefruit\" our hops give this beer an excellent fruit flavor that finishes dry, crisp, and clean. It will pour a nice deep copper color with a bit of haziness. Because of our almost patented \"Intense Transfer Methods\" our Crooked Tree has won several medals in the India Pale Ale category.');
