INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ac106f1b957b40da83f6f4b90c7ceab9', 'f773b893039e4b3894d2dc8e61a8beae', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Bitter Woman From Hell Extra IPA', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ac2121d48c1c473cb01aa874ccc3521b', 'f743f04357824c41994f695c5034da14', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Scratch #20 2009 Apollo Imperial Ale', 7, 0, 0, 0, '', 'Scratch #20 has been dubbed Apollo Imperial Ale because of our experimentation with a new hop variety.\r\n \r\nApollo hops are high alpha acid with an intense aroma. Married with other high alpha hops, with almost two pounds of hops added per barrel produced, AIA has an intense staying power in the back of the throat. After a long discussion between Chris, John and the brewers, they dubbed this hop flavor stinky grapefruit with a hint of perfume. The dark color might lead you to believe the some malt may shine through; but no, the hops are the true player in this ale.\r\n \r\nScratch #20 has a dual role, also serving at The Drafting Roomâ€™s Anniversary Ale for 2009. We brewed a bit more to serve the brewery and The Drafting Room, but get it while when you see it. Before this intense hop flavor subsides, this beer will be sold out.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ac33cb17b5ab4167b3af433e5bf1960f', '1a657e23d1b54a919f018d94f294977c', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Manchester Star Ale', 7, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ac36e475218349278b66f27b51d5c71e', '2a58f7cedbe94fd9830ddb857dea9157', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Alaskan Amber', 5, 0, 0, 0, '', 'Alt. The name of this beer style comes from the German word \"alt\" meaning \"old\". This refers to the aging that alts undergo since they ferment more slowly and at colder temperatures than most ales. Slow fermentation helps condition the flavors in Alaskan Amber, contributing to its overall balance and smoothness.\r\n\r\nRichly malty and long on the palate, with just enough hop backing to make this beautiful amber colored \"alt\" style beer notably well balanced.\r\n\r\nAlaskan Amber is made from glacier-fed water and a generous blend of the finest quality European and Pacific Northwest hop varieties and premium two-row pale and specialty malts.  Our water originates in the 1,500 square-mile Juneau Ice Field and the more than 90 inches of rainfall we receive each year.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ac46297b4ffc4f51a6c1761e180c230d', '6c7ee6a97d974d23b4033858ffa948ad', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Calico Amber Ale', 5, 0, 0, 0, '', 'The Calico Amber Ale was inspired by the beers of England. In England most of the beer is some kind of \"bitter\".  Bitter is a style that became popular in the late 1800''s. The most famous examples are brewed in Burton on Trent.  This hard water gives these beer a pleasantly dry bitter finish, hence the name \"bitter.\"  A brewery usually brews several bitters of various alcohol strengths.  The lowest in alcohol (and usually flavor) is called \"bitter\" or \"ordinary bitter.\"  A step up in alcohol and hop character gives us \"best bitter\" or \"special bitter.\"  Finally a beer is made that is full of hop aroma and flavor, has a maltiness to match, and a generous amount of alcohol is called an \"extra special bitter\" or E.S.B.\r\n\r\nAlthough inspired by the British Ales  Ballast Point Calico Amber Ale uses distinctive American hops, which give not only the crisp bitterness to balance the malt, but also a hint of floral aroma. We brew Calico Amber Ale with 100% malt and use 4 different malts to give it a rich complexity.  The blend of crystal  malts give it flavors including toffee and caramel.  A blend of American Cascade and Centennial hops provide a counterpoint to the malt.  Finally our proprietary yeast provides a fruity background and a Madeira like richness that rounds out this gold medal winning ale.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ac70712f080d448488091b91addda18a', 'b2f2a876df4b4a0685b89d50828c8ff7', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'East End Witte', 4, 0, 0, 0, '', 'A \"Belgian White\" wheat beer, gently spiced with (new!) coriander and bitter orange peel. Light bodied with hints of orange and lemon. A great beer for hot weather or for those looking for something lighter all year round.');
