INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ad61d04a9c7b4cb6846e40f82f7e878a', 'c7eff0907e1d4391915886b0d3f2b28e', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'EOS Hefeweizen', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ad636dda6ce94baeb98a1a34f6935946', '7eb26853c6ae4f8382558a236d3edd58', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Nut Brown', 4, 0, 0, 0, '', 'The rich mahogany hue of the Nut Brown is the first thing you will notice. You''ll find subtle hints of both chocolate and coffee. We delicately blend chocolate and caramel malts with four others to make this flavorful, easy drinking beer. The malt character will appeal to those looking for a moderately dark ale, but the smoothness is what will surprise all.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ad71aed708b140a6a5a0ab10721deb44', '65c02b64831c412bbd80a7d2e5780d32', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'PENNdemonium', 8, 0, 0, 0, '', 'Introduced on May 1, 2007. Available May and June. Distributed throughout our network of wholesalers in draft and 22 oz. bottles.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ad75e714306146ec9a11410d6d8fa4b7', '9b49de4e37df442ea2dc1e389896d69b', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Black Diamond Imperial Porter', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ad7aed4db7ba4d08b11febc68ef5eae4', '6373fec6e4d84db5ae7c64f6230502ce', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Imperial Chocolate Pumpkin Porter', 7, 0, 0, 0, '', 'Intriguing doses of sweet spices, dark cocoa and pumpkin transform an exceptional porter into a\r\nmesmerizing potion. Pour this tantalizing brew into a snifter and seek solace in the depths of its fascinating flavors. Cinnamon, nutmeg and cloves seem familiar but this brew is cloaked in deep, dark secrets that will forever haunt you.\r\n\r\nThis beer is like nothing you have ever experienced. It is a majestic mÃ©lange of rich, impressive flavors that meld wonderfully with the\r\nwarmth of alcohol. Will it appease or awaken your spirit?');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ad7e1001ae15440cb9a570a9ff8ce963', 'c5d43a6604a143b19cd221ba1979e3c7', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Maharaja, The', 10, 0, 0, 0, '', 'From Website:\r\nMaharaja is derived from the sanskrit words mahat, - \"great\" and rajan - \"king\". Much like its namesake, this imperial IPA is regal, intense and mighty. With hops and malts as his servants, he rules both with a heavy hand. The Maharaja flaunts his authority over a deranged amount of hops: tangy, vibrant and pungent along with an insane amount of malted barley - fashioning a dark amber hue and exquisite malt essence.\r\n\r\nThis newest Avery Dictator completes the \"Dictator Series\" joining the likes of The Kaiser & The Czar. Be aware that The Maharaja is a limited release only available for the summer. Welcome to his kingdom!\r\n\r\nAvailability:\r\n    * 22 oz. bottles\r\n    * 5.17 gallon keg\r\n    * 15.5 gallon keg\r\n    * Available March through August\r\n\r\nABV:\r\n    * 10.5% (2008)\r\n    * 9.78% (2007)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ad8e3b143a644d4aa6fab1016b8ad80e', '94b2e7e841504f858034cf078e80a792', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Unearthly Imperial India Pale Ale', 11, 0, 0, 0, '', 'At the Southern Tier Brewing Company, vigorously hopped beer is our standard and inspiration. We continue a commitment to innovation with our most aggressive offering yet. Unearthly is a manifestation of the brewerâ€™s craft; skillfully balancing art and the forces of nature to produce a divine liquid. Delicately pour a taste into a fluted glass. Smell the enchanting aromas of the hops waft forward as your first sip divulges this beerâ€™s fervent soul. To underestimate Unearthly is to trifle with the mysteries of the universe, so please consume wisely.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('adaba22d50454c9280b3aba478102425', '33f8d154b93b4a5fbd26a3d9dcdf04bd', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Gray Whale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('adb4096708584466a98718b0fb97a0e9', 'f6b4fa787e0a43418b88dcf6cf75b5ab', '4fcd53c380e347edb1ca81489b03f902', '2a6b815eb1624f47b33d1c5a753e5bd6', 'Black Betty Schwartzbier', 5, 0, 0, 0, '', 'This almost black lager originates from Germany and is most closely associated with Porter. The difference being the long maturation period (or lagering time) required to produce a true Schwartzbier. The flavor is reminiscent of treacle, coffee and toasted malt. It is not and should not be perceived as burnt or ashy like some stouts. Black Betty has 5% alc/vol and a smooth character that marks most lager beers.\r\n\r\nThe name, of course, comes from the Huddy Ledbetter song from the 1940â€™s which was made popular by the band Ram Jam and later by the Black Crows and U2, among others.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('adbe1ef78f4c4b2499d29f4779e60132', 'f4b481b5e94045ef96e5f836e2ff6a7b', 'b7ee8858a0b549ddb2361e1ed313f6e1', '055775d81abb4aa0a4bde8bf8bcaff92', 'Verchuosity', 12, 0, 0, 0, '', 'Brewmaster Steve took his Belgian Amber Ale and re-fermented it in a merlot cask with 100# of sweet Michigan cherries from Husteds Farm Market. He than moved the resulting beer into another cask with 30# of tart cherries. 5 fermentations due to wild yeast and 9 months later, we have our version of a Belgian Kriek. Named after our good friend and musician, April Verch.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('addb3db8307a4cb9b2e6648ec1276a08', '06f1c8a9bb74470981730c2969378ee8', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', '9th Anniversary IPA', 7, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('adef6fb6915e48c185a967506b46eeaf', 'c0f52fdcf9a94e39a0ada8d337d89d09', '98b7246d5e1b4592b15adced83ab36d0', 'dde08a23bc764388a0571b10d486b6e7', 'Duck-Rabbit Milk Stout', 5, 0, 0, 0, '', 'The Duck-Rabbit Milk Stout is a traditional full-bodied stout brewed with lactose (milk sugar). The subtle sweetness imparted by the lactose balances the sharpness of the highly roasted grains which give this delicious beer its black color.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ae07e039dffb4f29b6b214a5379352dc', '7a518f63b1c9454a9376282651040f0a', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Old Style', 0, 0, 0, 0, '', '');
