INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ae922cfa04304c8cb19002fc825fd5a8', '048f9156b40a469781e7e19d6321d6b5', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Samuel Adams OctoberFest', 5, 0, 0, 0, '', 'The first thing you notice when pouring a glass of this seasonal beer is the color. Samuel AdamsÂ® Octoberfest has a rich, deep golden amber hue which itself is reflective of the season. Samuel AdamsÂ® Octoberfest is a malt lover''s dream, masterfully blending together five roasts of barley to create a delicious harmony of sweet flavors including caramel and toffee. The beer is kept from being overly sweet by the elegant bitterness imparted by the German Noble hops. Samuel AdamsÂ® Octoberfest provides a wonderful transition from the lighter beers of summer to the winter''s heartier brews.');
