INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aeb2b47b7af246daa5c31f82f0e78cf7', 'b65808eb74e74797ad9375fc1a220b9b', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Old Brown Dog Ale', 5, 0, 0, 0, '', 'Old Brown Dog has been cited as a classic example of the â€œAmerican Brown Aleâ€ style of beer. Compared to a typical English Brown Ale, Old Brown Dog is fuller-bodied and more strongly hopped.\r\n\r\nOld Brown Dog has been around for many years. It was first brewed in 1988 at the Northampton Brewery. In 1989 it won a silver medal in its category (American Brown Ale) at the Great American Beer Festival in Denver.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aeb64ffcac0342c4b450c9d8ddf28a0f', '93a78839a116475a9b66baea9dcc1bfa', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Cucapa Honey Ale', 4, 0, 0, 0, '', 'A Craft Amber Ale, brewed using Honey from Northern Mexico.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aec8930ef80e4902a542f5dcbec9ac66', 'f53af8f6384749bc968e80afacff7ef7', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'e2617cdeed8f4eb69e01c49f84dd8000', 'Righteous Ale', 7, 0, 0, 0, '', 'Righteous Ale is actually a Rye Beer, brewed with a high amount of hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aecf3a376553439a84ec66534869dc87', '3b1cefedca8e475c9e620feb0df34abe', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Stormcould IPA', 6, 0, 0, 0, '', 'During a fierce storm on his voyage across the ocean, William Rahr could be heard yelling from the tall masted ship: \"Roll on old sea! And when you are done, when the storm clouds have destroyed themselves, we will still be standing and drinking!\" Today, we have created the ultimate ale for a voyage such as this: A German-Style IPA - a traditional India Pale Ale with German Influence.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('aefacc85c50e465d92caa2200c80c346', '3ae9f1cc386c46a29f36798ccc043764', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Plead the 5th Imperial Stout', 12, 0, 0, 0, '', 'It''s big and full bodied with lots of roasted malts and balanced with heavy hops to put this imperial in a league of its own.');
