INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('af333188898446d9b223d1531f2f0eb6', '8a0066befe3b4c94a0da0a9f5b639f6e', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Eleven', 11, 0, 0, 0, '', 'Our Eleventh anniversy ale, released in July 2006 only is a Triple IPA made exclusively with Phoenix hops. 11.7% abv make this Triple IPA powerful, but the Phoenix hops keep it smooth.  Phoenix is another one of those hops with low cohumulone levels, which means  when used in very large quantities (as we do in Eleven) the hops flavor is very smooth, not a hint of harshness for the enormous amounts of hops in the brew.  As with all of our Anniversay ales, this one will age fantastically and will never be made again, as each anniversary is an entirely different brew.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('af43fd6a719c4b97adf773fadedf2e4d', 'a08516e189b24ed2a4c25e79de46bfe8', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Weldspatter IPA', 7, 0, 0, 0, '', 'Weldspatter IPA is not your typical India Pale Ale. First of all, it isnâ€™t as aggressively hopped as many other American versions. Second, it isnâ€™t quite as pale. Balance is a lovely thing in beers and Weldspatter IPA achieves balance without compromising hop presence. The hop flavor and aroma abound, but the bitterness is held in check to give our IPA a pleasant malt character as well.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('af6466676d1b46b586ec98cd47674a08', '13e46693ec384f9183b40ee3a0560780', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Satsuma Wit', 0, 0, 0, 0, '', 'This Wit beer has a sweet and subtle citrus flavor with a touch of spice that is cool and refreshing.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('af64722e513248ecb4e2e68d9f47d5d7', '894593f13916499cb1c6f6f3a5fb3e69', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Beer Esteem', 5, 0, 0, 0, '', '\"If you can''t feel good about your beer... what else is worth feeling good about.\"\r\nWe call Beer Esteem a California Common because it is brewed with a lager yeast and it is fermented at warmer ale temperatures. However, Beer Esteem is distinctly different from other California Commons. With a unique hop profile, a lager yeast not typically used for the style, and a \"Russian River\" twist, Beer Esteem is anything but \"Common.\"');
