INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b04bfb27f07241bd89e8e62effeb2cf8', 'f590cfabc78c4d6daaa1804eebe185c1', 'b7ee8858a0b549ddb2361e1ed313f6e1', '055775d81abb4aa0a4bde8bf8bcaff92', 'Maudite', 8, 0, 0, 0, '', 'Maudite has a deep amber-red color with a rocky foam head and an appealing aroma of wild spices and floral hop notes.  It is spicy, vinous, and deliciously complex with a crisp hop finish.\r\n\r\n\r\nThe robust maltiness and  spiciness of our\r\namber-red ale is counterbalanced by an\r\nassertive hop finish, offering a distinctive\r\nflavor that is cognac-like in complexity.');
