INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b1595ae55106406aa1b6ad10e4a7f951', '04ddc6e0bc4b4a7eb1140b3b1c7286be', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Old Nick Pale Ale', 5, 0, 0, 0, '', 'Our pale ale is located toward the lighter side of the beer spectrum and we hope it will serve as a stepping stone into the more flavorful world of craft beer. Amber, caramel, fruity, hoppy and bitter.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b172ad38994b426aa2d9f0826139f088', '8fe138cfca1a434ca239e2a92a982432', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Red Fox Amber', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b1777c7543b944cabd73897026e3d12f', '8a85a603f9754f4e99d70cfc7667389e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Leinenkugel''s Honey Weiss', 4, 0, 0, 0, '', 'Select Pale and Wheat Malt, Cluster hops and a hint of Wisconsin honey give this unique refresher a clean, crisp, slightly sweet taste.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b18f6333a3a344b39937cff823b509ee', '7ad8825aff794387ace4aa354ef49b64', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Elissa IPA', 6, 0, 0, 0, '', 'A traditional India Pale Ale, the Elissa IPA is very hoppy with a properly balanced malty body. Elissa has huge hop additions in the kettle that give it a wonderful bitterness and is then dry-hopped in the fermenter to create the pleasant floral, hoppy nose. Our reverse osmosis water makes the bitter very soft with no harsh notes to it. The maltiness is derived from British Maris Otter malt. Its rich flavor stands up to the hops that would otherwise dominate this beer. The Elissa is an authentic version of an India Pale Ale (IPA) style.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b190930484ad49cb89eff273566dcd04', '5bdc922a53664f34a29da7bb9bb9dea6', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Orange Blossom Pilsner Â²', 11, 0, 0, 0, '', 'When you make a pot of coffee, but only use half the water, you get some pretty rich coffee. That''s the approach we took with our latest offering. OBP Squared, with half the water, has 11% alcohol by volume-twice that of original OBP.\r\n\r\nThe result is a bold, distinct taste of its own. Made with twice as much real orange blossom honey, all-natural ingredients and no refined sugar, it really is the new king bee of beers.');
