INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b1d3cc22e6544e44938b4da6044d1385', 'd5b27251496640ba84e3b912888dd0fa', '98b7246d5e1b4592b15adced83ab36d0', '0b415ebb506c40848abff3554116e055', 'Coopers Original Pale Ale', 4, 0, 0, 0, '', 'Guaranteed to turn heads, this is the beer that inspired a new generation of ale drinkers. With its fruity character, and robust flavour, Coopers Pale Ale is perfect for every occasion. \r\n\r\nNaturally fermented in the ''Burton-on-Trent'' style, a secondary fermentation creates the trademark sediment that gives ''Pale'' its fine cloudy appearance. This cloudy residue can be stirred through the beer by tipping or rolling the bottle before drinking. \r\n\r\nPale Ale has no additives or preservatives.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b1d94903f40247ad8d138b161a494292', 'b452dfcf8ed940cf8d6a6a662bf7c675', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Maduro Oatmeal Brown Ale', 5, 0, 0, 0, '', 'Maduro is a Northern English-style brown ale with some American affectations. It is unlike the typical American Brown Ale, as it doesnâ€™t have the big hop character common in American-brewed Brown Ales. And Maduro is higher in alcohol than the common English brown ale. Maduro also has oats, in the malt bill which imparts a silky body and aids in making the roasted, toasted and chocolate components mesh together in Maduro''s complex malt profile. The end result is a remarkably full flavored yet approachable and sessionable brown ale that pairs well with cigars.');
