INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b2489d10489f4d0da4a8e92b1db84249', '6373fec6e4d84db5ae7c64f6230502ce', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Cafe Amsterdam''s 10th Anniversary Gruit', 12, 0, 0, 0, '', 'SPECIAL COMMEMORATIVE BEER\r\n\r\nFormer brewer Ken Pajak teamed up with MSBC to create a very special beer to celebrate the 10 years that he and wife Shauna have owned CafÃ© Amsterdam. Since taking over this mid-town establishment, the Pajaks added a â€œbeer & wine licenseâ€ and subsequently transformed the European-style cafÃ© into a beer-centric place to grab breakfast, lunch, dinner and all beers during, around and between these fabulous meals. \r\n\r\nThe cafe''s beer menu is extensive and all-encompassing. The staff is knowledgeable and enthusiastic. And the beer pour is always rightâ€” temperature, glass, presentation. \r\n\r\nâ€œNo hops were harmed in the brewing of this beer.â€ \r\n\r\nGruit is an old styleâ€”one that incorporates spices, herbs and fruit but no hops. The latter detail makes this style very rare in modern times. CafÃ© Amsterdamâ€™s Gruit is dark, strong and interesting. This combination of pale and dark malts, sage, thyme, cinnamon, black peppercorn and fresh orange peel composes distinctive, substantial flavors that meld together wonderfully. And at 12% ABV, this cellar-friendly ale is ready to lay you down! Thoroughly enjoy this old-world beer now but stash some away for later dwelvings. \r\n\r\nAvailability: \r\nAK - 22-oz bottles (limited release begins 05/29/2009)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b254462e8cab4207bb5b0594b1f898df', '94b2e7e841504f858034cf078e80a792', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Farmer''s Tan Imperial Pale Lager', 9, 0, 0, 0, '', 'Neolithic humans evolved from nomadic hunters into a more settled agricultural society, changing life forever. The â€˜founderâ€™ crops they raised included wheat and barley. It is little surprise that the first examples of brewing appeared during this age.\r\n\r\nBrewers owe much to the epoch. Similarly, we thank our farmer friends of today for cultivating the ingredients the are responsible for the beers we now enjoy. Their laborious days spent ourdoors under the hot sun earn them respect, as well as a mark of distinction: the farmer''s tan. Yes, the inevitable red and white hallmark of hard work.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b28f7bf503364e3cbeafa8839f214c0f', 'ea4c78c86a144184ade4af610c94417a', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Steelgaarden Wit', 5, 0, 0, 0, '', 'Unfiltered Belgian Style beer is brewed with special yeast that lends a unique refreshing flavor to the beer. Brewed with Chamomile, Curacao Orange peel and Coriander to create a smooth citrus finish. Usually enjoyed with a slice of lemon.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b2a2bb8f00ab48798d7dfbb4a9709263', '0ca2f5ae549749ebbca13dd87aacf085', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', '10 Squared (10Â²)', 10, 0, 0, 0, '', 'The Mighty Fish Brewers first produced Ten Squared Anniversary Ale to celebrate Fish Brewing Companyâ€™s tenth anniversary. The ale was so good and the response to it so overwhelmingly positive that it has become the crown jewel of REEL ALEs. Ten different hops: Horizon, Chinook, Columbus, Willamette, Tradition, Northern Brewer, Santiam, Tettnanger, Cascade and Golding, in the order of their use -- give Ten Squared a unique hop character which has to be tasted to be believed. \r\n\r\nEven with 100 IBUs, this brew sports a strong malt backbone. Two-row Pale, Caramel 40, Caramel 75, Special B and Aromatic malts impart remarkable balance for such a hop monster. This is smooth ale with surprising similarities to ten year old malt whiskey. Produced for the holidays, 10 102 Anniversary Ale is usually available into late spring.');
