INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b35e6c8c2be340b289d7ab267512edcd', 'c8e97757446044d99e6d55f396152dd0', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Blackberry Ale', 5, 0, 0, 0, '', 'A great summer fruit beer, with 168 pounds of blackberry puree added to a light ale base. The blackberries add a distinct purple haze, and hopping is light to allow the berries to be the featured flavor. The ABV is 5.2% and hop bitterness is 22 BU''s.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b39137339814437f88077bc7cf04d674', 'a9584f0278e545c4810c2d7bfe3a5c8b', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Wixa Weiss', 4, 0, 0, 0, '', 'Anunfiltered wheat beer, weiss beer is a bavarian tradition. Our version is immensely refreshing and authentic, delivering the classic weiss aromas of clove and banana. A two-time Great American Beer Festival Medal winner in the German Style Wheat Ale category.');
