INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b3c39c4d16bc4a7fa7cf6971e3266e53', 'a08516e189b24ed2a4c25e79de46bfe8', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', '2x4 India Pale Ale', 7, 0, 0, 0, '', '2x4 India Pale Ale (7% ABV, 65 IBUs) sports Columbus, Nugget and Amarillo hops for a spicy, citrusy blend in both flavor and aroma.  Backed by golden pale malts and a kick from flaked rye, the hops are pleasantly robust with just the right touch of bitterness at the end.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b3e6bdba3b0e45999ed53b012976e953', '68cc8156023749cbbd1f820a627760cd', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Plaza Porter', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b3ff32f4c9594eeb9661c0a385c4d5b8', '810ee287c4dc4461aa29d7fee46fcf13', '98b7246d5e1b4592b15adced83ab36d0', '0b415ebb506c40848abff3554116e055', 'St Peter''s Organic Ale', 4, 0, 0, 0, '', 'Water is extracted from our own 300â€™ deep borehole and combined with Soil Association accredited light malted barley from Norfolk. Organic hops provide the distinctive palate. The yeast used is St. Peterâ€™s own single strand variety. The result is a delicate, clean, crisp, lightly carbonated, traditional English Ale with a full â€˜citrus hopâ€™ aftertaste. This lovely beer won the Soil Associationâ€™s top prize in 2002 and a silver medal in 2006.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b40691f1542147869ca3acae9cc162be', '315259193c0a4a079f641082dc8382d1', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Red Trolley Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b416ce52f32e44b985ea79ca2c9c9909', '8fe138cfca1a434ca239e2a92a982432', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Railroad Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b419b674c8d242f68c87bd285a10aee3', '8be478aaefc14c988bbd984ecccaf677', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Yuengling Lager', 4, 0, 0, 0, '', 'Yuengling Traditional Lager is an iconic American lager famous for its rich amber color and medium-bodied flavor. Brewed with roasted caramel malt for a subtle sweetness and a combination of cluster and cascade hops, this true original promises a well balanced taste with very distinct character. Its exceptional flavor and smooth finish is prevalently enjoyed by consumers with even the most discerning tastes. Our flagship brand, Yuengling Traditional Lager is an American favorite delivering consistent quality and refreshment that never disappoints. In fact, it''s so widely known and unique in its class, in some areas you can ask for it simply by the name \"Lager.\"');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b425583ba8e24d58a9fb0899bca2b2e4', '136a027dd9f84081b7fb6ceaef50b9cb', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Octoberfest', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b425a1ca99054679867b1fe7900def0b', '9afdf27a7c57483bbe140f42040aae13', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Belle Gunness Stout', 5, 0, 0, 0, '', 'A notorious drink that''s as dark as its'' namesakes history!!  It is named after the infamous LaPorte, Indiana serial killer herself, Belle Gunness of 1908.  This Irish-style dry stout is amazingly smooth to drink.  You will taste chocolate, coffee and roasty flavors in every sip.  Don''t be afraid of the dark.  A true dark beer lover would die to try it.  It definitely would not kill you to dig some up.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b429bc7aa1f1420d8e08aa6503280ed4', 'dd7e2623dd44483f804b66c32f9ea139', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'North Star Premium Lager', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b43852fa449a4cbd82f8043307ad8c86', 'd6f7eb851f684504ba8fa6f90511736b', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Jasparilla', 9, 0, 0, 0, '', 'Brilliantly golden, Jasperilla is a unique take on an old ale. Biscuity malt flavors meld with subtle plum and berry notes, produced by a special blend of English Old Ale and Chico yeasts. Brewed once a year, and aged for six months prior to release, the Jasperilla is smooth despite its 9% abv.\r\nJasper dressed as Hosehead from Strange Brew\r\n\r\nWe named this beer after our dog Jasper because he has brought so much joy to our lives. We got Jasper from a local dog rescue group called Mixed Breed Rescue. He has been a constant source of smiles and kept our spirits high through many late nights and long hours at the brewery.\r\n\r\nJasperilla is so good and smooth that you''ll beg like a dog for more, roll over for a belly rub, howl at the moon...you get the picture.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b43c60ee87c94df38754fa548cdde8d2', '6373fec6e4d84db5ae7c64f6230502ce', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Uranus - 100% Brettanomyces Golden Ale', 7, 0, 0, 0, '', 'Uranus, ruler of the heavens, reigns supreme with beauty and brilliance. Gloriously gold in color, URANUS Golden Ale holds title to our first 100% Brettanomyces fermentation and conditioning. Brewed by mere mortals and blessed by the beer gods, this ale deserves to be worshipped.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b444ca60c340416a96fc3916d46ccecb', '2c6714b81fff4309bd8ba27d2a8fd29e', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Hopnoxxxious', 7, 0, 0, 0, '', 'This hophead''s delight contains 7 hop additions. A malt background balances the hoppy bitterness for a complex flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b44a6c3701b9478e855196193e73478d', '47a3de1b57274a59b0ff59c5d112c6d5', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Saranac Pale Ale', 5, 0, 0, 0, '', 'A beer that would make the English jealous! This true English Pale Ale is rich and fruity, yet finishes crisp. You''ll love the copper amber color and medium body.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b459da3472a24684a9cc85e8a74212e3', 'd8c82baf6cf6470ea9c3a89a27f33cb9', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Export Ale', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b45fa1bcf99e4167981339c0487e8470', '2dc4ecd978944c7f87c9f8fdef8b798e', 'bf3112301857461f82c7633c0a695896', '470eefadc34742e680972815eaf47815', 'Hang Ten', 10, 0, 0, 0, '', 'Hang Ten is the Heavy Seas wheat beer youâ€™ve been waiting for. A classic German-style weizen bock, slightly cloudy and bursting with flavor. Hang on and surf the Heavy Seas wave! Seasonally available in July while supplies last.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b46e9512338d4a5d88f432c75eb5cbf6', '58dc74e8978844bfbd4c9e08166289b4', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Lump of Coal Dark Holiday Stout', 8, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b47568e0c73c4c67ac3a85d980ca7393', 'b63629ece8ba450ba1df25b0412004d5', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Hook & Ladder Backdraft Brown', 0, 0, 0, 0, '', 'A smooth and refreshing beer loaded with flavor. Specialty malts balanced with just the right amount of cascade hops give it a roasted taste and beautiful brown color. This drinkable brown ale easily rivals an expensive import.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b4792f16939643e49552b8b080faef3d', 'f590cfabc78c4d6daaa1804eebe185c1', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Terrible', 10, 0, 0, 0, '', 'Topped by a sumptuous head of foam, La Terrible possesses a fruity aroma enriched with notes of roasted malt and Madeira. Its long lasting flavour is both elegant and full bodied.\r\n\r\nLa Terrible is a dark brown beer on lees and is part of a collection of exotic and refined Unibroue beers brewed using 100% natural raw materials. It may be drunk as an aperitif or as an after dinner digestive. It is equally a perfect accompaniment to the above-mentioned dishes or a pleasant alternative to coffee.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b47e69482fde4901a89bac46a39c0fb1', 'c1f15aa32e9d4e74a8b8181783ee357d', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Hazed & Infused Dry-Hopped Ale', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b48b62893f8340fc9e9cee866153feac', 'f743f04357824c41994f695c5034da14', 'bf3112301857461f82c7633c0a695896', '470eefadc34742e680972815eaf47815', 'Scratch #7 2008', 7, 0, 0, 0, '', 'Red and white wheat combined with darker malts add body to this hazy, unfiltered ale.  Fermented with the same yeast as DreamWeaver Wheat replicating the pepper, clove and all-spice flavors found in our year-round beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b49259c08e504be9bb5eec94ec7a8aa9', '70b7bbf10ef4416da5715c8b7da19879', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Cricket Hill Hopnotic', 0, 0, 0, 0, '', 'No mere beverage could satisfy the thirst of the courageous and gallant soldiers who stood guardover the colonies of the British Empire. Their thirst could only be quenched by a full-bodied hearty Ale; an Ale balanced with rich flavorful hops. We are proud to offer our interpretation of this English style India Pale Ale for those who loong for the time when once your duty was complete, the taste of a fine Ale was reward enough for a job well done.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b4b1ad7c935142dd959480ad3d319b18', '7c18c21b7c9744979940898b00ac09b2', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Wassail Winter Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b4b46abb81874ecd966ab85a6b6178e3', 'acf063f8cf0f4153a5712adbdb24c686', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Wheat Beer', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b4b746fca481481d93a98cc8626dd7f6', 'ca206e17588140c9bcebe48e78865b89', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'White Horse Hefeweizen', 4, 0, 0, 0, '', 'This German inspired wheat ale is packed full of citrus flavor. We use torrified wheat, pale, and carafoam for balance, giving it a nice hazy, straw color and refreshing wheat taste. We ferment the White Horse at higher ale temps with a German style yeast that is known for producing world class wheat beers. We let the yeast take over the majority of the flavoring in our fermenters, providing the beer with banana and clove like esters. We pull some of the yeast with it to give this brew the proper style and to keep its body and character. We than age this brew with zests of citrus and a brewers spice that blends harmoniously with the esters of the yeast and balance out the sweetness of this brew. Truly a favorite in the summer time for breakfast, lunch, or dinner.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b4c6c776487f4927a2ba15a17c080713', '22b62259ccb24af5999fb49ddf5bc998', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Maisel''s Weisse Kristall', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b4ce1a36698c444d8fc14036278458ee', '930b1dc84ed34683b0e2689b069bf841', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Highway 22 Wheat', 4, 0, 0, 0, '', 'Our Light-Bodied, Pleasantly Tart, American-Style Wheat');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b4eae734c96345bb819af60d90654dff', '315e41e96219473c864499efdf540db8', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'St. Patrick''s Gold', 4, 0, 0, 0, '', 'Our smooth yet powerful wheat beer is unusually refreshing on the pallet.  Golden in colour, St. Patrick''s Gold is brewed with barley and wheat malt. Citrus peel and coriander are added to the Goldings and Saaz hops for a symphony of authentic flavour.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b51b9a1b46f645fb9bf98d3d2478f20b', '0a7afe0e530c4ddeb6c683166623802a', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Edmund Fitzgerald Porter', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b51fe3469e6342f1b4b7c8e3d14833c9', '7d033dca78b44799acb94c1eaae6725f', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Altbier', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b521e234d0b14c1c80762449828e9e6a', 'a0ac7160e2a34b3f8b1e63862365ac0e', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Bourbon County Brand Coffee Stout', 13, 0, 0, 0, '', 'Everyday Goose Island smells the wonderful coffee roasting next to our brewery at Chicago''s Intelligentsia Coffee and Tea. They put the same passion and skill into their coffee as Goose Island does with its beer. This excellent stout is made with Black Cat Espresso beans from our friends next door. You''ll like the combination.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b524d417b0924d5c9a44ce7ae297a4a9', '83096763d28c4428a77a9c012eb94a9f', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Ornery Amber Lager', 0, 0, 0, 0, '', 'Ornery Amber is brewed with a blend of the finest European hops and gently roasted malts.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b529fd80438c478a94add9cb1c44ec81', 'ecbfbc639150435191d6af029ff71bd7', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Hop Hog IPA', 7, 0, 0, 0, '', 'Our hoppiest beer to date.  This formidable India Pale Ale has a hop aroma that demands attention.  The bold, citrus hop flavor is balanced by a dry malt character that makes this refreshing ale a true classic.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b535306316f2401aab7d432a51265308', 'fc43d14270a54c9db030c1ffae3c1e71', '98b7246d5e1b4592b15adced83ab36d0', '1c20aafad8964ed4a7626ef53934000a', 'HSD Hicks Special Draught', 5, 0, 0, 0, '', 'St Austellâ€™s most legendary ale, HSD is fullbodied strong and Cornish, brimming with a kaleidoscope of flavours. Brewed with plenty of malt and lashings of English Fuggles and Golding hops, HSD is truly a classic ale of considerable depth and complexity. The real ale alternative to a well rounded premium red wine and simply superb with steaks and other red meat dishes.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b53bffa175f744c396521ef79ccb0759', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Michelob Ultra', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b554619bce8347a3aa757168775b47c2', '607a0ac3bffc443fa156f54630165a20', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Liberty Ale', 6, 0, 0, 0, '', 'San Francisco''s famouse Liberty Ale was first brewed on the 18th of April, 1975 to celebrate the 200th anniversary of Paul Revere''s historic ride. It is virtually handmade by the brewers of Anchor Steam Beer in one of the smallest and most traditional breweries in the world. Liberty Ale is made with the finest barley malt, fresh, whole hops, top fermenting yeast, pure water and the simple natural methods which reflect our exceptional respect for the ancient art of brewing. It is \"dry hopped,\" a classic ale tradition, and slowly completes its fermentation in sealed vats in our cellars. This unique process creates Liberty Ale''s distinctive bouquet and uncommonly delicate, entirely natural carbonation.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b5562f61db34484586c1f8436e106022', '6ee3779d2b1345e0b7b5edf8f63caabc', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', '21A IPA', 7, 0, 0, 0, '', 'Deep golden color. Citrus and piney hop aromas. Assertive malt backbone supporting the overwhelming bitterness. Dry hopped in the fermenter with four types of hops giving an explosive hop aroma. Many refer to this IPA as Nectar of the Gods. Judge for yourself. Now Available in Cans!');
