INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b8dec5ee4a0f442387ac7f8cbfe324a4', '607a0ac3bffc443fa156f54630165a20', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Anchor Summer Beer', 4, 0, 0, 0, '', 'Anchor Summer is the first American wheat beer in modern times. Our first brew of this light and refreshing beer was in the summer of 1984.\r\n\r\nAnchor Summer is an all-malt beer, and over 50% of its malt comes from malted wheat. It is fermented with a Triticum aestivum, AKA wheat traditional top-fermenting \"ale\" yeast because we prefer the clean flavors developed by this yeast. We believe that this style best celebrates the refreshingly light flavor of malted wheat. You may notice that the head on this beer is unusually abundant, with a consistency similar to whipped egg whites. This is due to protein contributed by the wheat.\r\n\r\nThe brewers at Anchor are proud to have revived not only rich hearty dark beers, but also this light crisp style of a modern American wheat beer.\r\n\r\nSummer getaway Wheat malt contributes to an unusual lightness and dryness to the palate, and thisâ€”combined with the distinctive flavor of the wheatâ€”makes for a perfect thirst-quenching beverage. It is the ideal drink for beer lovers who appreciate tradition and character in their beer, but also seek a lighter, refreshing style, perfect for warm weather.\r\n\r\n-http://www.anchorbrewing.com/beers/summerbeer.htm');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b8e1591170b44278bacff08cbefd66d3', 'b88df317c29e4902b64f2aeb057062ba', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Bonaventure Pale Ale', 5, 0, 0, 0, '', 'Light amber color and a mild malty background. Well-hopped featuring Cascade hops with a distinct floral finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b8ede15ca87a4c978ac1c8b502cbb706', '47a3de1b57274a59b0ff59c5d112c6d5', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Saranac Belgian White', 5, 0, 0, 0, '', 'Our Belgian Style White beer is smooth, tangy and very thirst quenching. Brewed with a delicate combination of oats, wheat and barley malt, we season it ever so lightly with hops. Then we add sprinklings of coriander and orange peel for a refreshing brew with a citrus aroma. Don''t be fooled by the cloudy appearance, that''s expected of a classic Belgian-style \"Whitbier\" or white beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('b9008b86944044f0a98c00e6ca258c70', '04ddc6e0bc4b4a7eb1140b3b1c7286be', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Santa''s Little Helper Witbier', 5, 0, 0, 0, '', 'We brewed this pleasantly aromatic wheat beer with the addition of bitter orange peel, coriander and a Belgian Abbey ale yeast strain. This beer is unfiltered and its flavor is tart but sweet and perfumey.');
