INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ba2ff89fe24c4eda9fe30d307c796646', '2b826ba7692948dd881f973d746d2b58', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Blue Paddle Pilsener', 4, 0, 0, 0, '', 'Climb on in and grab a paddle. Our first foray into lagered beers, Blue Paddle Pilsener-Lager, is a Czech style pilsener with a refreshing crispness from noble hops and a rich, malty finish. â€˜Blue Paddleâ€™ refers to the implement our warehouse managerâ€™s Grandma once used to lovingly paddle his a** when she caught him stealing sips of her beer. With more body than a traditional Belgian pils, Blue Paddle is reflective of Europeâ€™s finest pilseners.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ba3cec2331524033843fb47cf9a759d2', '0bdc5966958e4e15baf0dcb3a778ea50', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Fresh Hops Pale Ale', 5, 36, 0, 0, 'bluepoint-paleale.png', 'Blue Point Brewing''s Pale Ale has a light golden color but explodes with a rich full-flavor. This refreshing ale is top-fermented and hopped at four different stages of the brewing process. English pale malt lends complexity to this brew. Small amounts of Wheat and Carapils round out the malt bill. Brewed to satisfy the hop lover, this pale ale has an immediate floral-citrus flavor that pervades the overall character of this hoppy, quenching microbrew.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ba3f1c77daa2416db5d437438697b2ad', '8a0066befe3b4c94a0da0a9f5b639f6e', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Double Simcoe IPA', 9, 0, 0, 0, '', 'Double Simcoe IPA, 9.0% abv, is our incredible reward for Hopheads seeking over the top flavor in a Double IPA, without the harshness. Brewed  with Simcoe hops, developed and trademarked by Select Botanicals Group, LLC, in the year 2000. This hybrid hops was created to allow maximum aromatic oils, along with low cohumulone(harshness) levels, so that brewers can really load up a lot of ''em in a beer and not have any harshness. The piney, citrusy notes are all here, and in a very clean (non-harsh) way, as well as having an aroma with impact. Introduced by Weyerbacher in 2005 originally as a seasonal, this brew has garnered numbers so high on Beer Advocate, and been in such high demand by consumers,  we decided to add it to our year-round line-up in March 2007. Check it out, and you''ll soon see why everyone''s talking about it.');
