INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ba6882564347461d850f90d0005d1c4d', '52a95674252c4c3780cbba8631bf2efb', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Voodoo Vator', 9, 0, 0, 0, '', 'This one is black and sweet!  Its malty character is derived from two carmel malts along with Munich malt to create the smoothest high gravity beer this side of the \"pond\".');
