INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bb64a6f84b3240afa868d93fa54b7e5f', '20db57ff2ecf445c81511160d57e84c9', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Live Oak Pilz', 0, 0, 0, 0, '', 'Crisp, clean, and refreshing, this pilsner is styled after the original Bohemian classic from the town of Pizen, Czech Republic, Pilz is a golden-colored brew that balances a pleasant hoppiness with its smooth malt flavor. It finishes dry with a moderate bitterness that is a hallmark of the style.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bb67f795b3a044e2869e28c259c4eaf9', '048f9156b40a469781e7e19d6321d6b5', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Sam Adams Light', 0, 0, 0, 0, '', 'Great tasting yet drinkable, with a clean smooth finish.  Sam Adams Light® is not just a lighter version of our Samuel Adams Boston Lager® but rather the culmination of over two years of tireless research and brewing trials to create a flavorful Light beer. And it has proved to be worth the wait. Brewed using only the finest two row malt and German Noble hops it has a smooth, complex roasted malt character that is superbly balanced with the subtle orange fruit notes of the Noble hops. Sam Adams Light® finishes crisp and smooth without any lingering bitterness, leaving you yearning for more.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bb8727419d394386868486ba8b7bede4', '8788e692080745fb8e823bb61ca74a1e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Schlafly Wheat Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bb93067dcd6f49f3a06c37096dedf6a5', 'a9584f0278e545c4810c2d7bfe3a5c8b', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Railyard Ale', 5, 0, 0, 0, '', 'Our flagship brew is a smooth, amber beer that combines the malty goodness of an Octoberfest lager with the slight fruitiness of an ale. Hearty but refreshing.');
