INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bbb7036372fc47ea92cb6b6335d3eaa8', '6c7ee6a97d974d23b4033858ffa948ad', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Sculpin India Pale Ale', 7, 0, 0, 0, '', 'The Sculpin IPA is a testament to our humble beginnings as Home Brew Mart. Founded in 1992, the Mart continues to be a catalyst for the San Diego brewing scene, setting the trend for handcrafted ales. Inspired by our customers, employees and brewers, the Sculpin IPA is bright with aromas of apricot, peach, mango and lemon. Its lighter body also brings out the crispness of the hops. This delicious Ballast Point Ale took a Bronze Medal at the 2007 Great American Beer Festival in the Pro Am category. The Sculpin fish has poisonous spikes on its fins that can give a strong sting. Ironically, the meat from a Sculpin is considered some of the most tasty. Something that has a sting but tastes great, sounds like a Ballast Point India Pale Ale.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bbbb8440d0d24ae1b72f4aa012a68cb4', 'd8c82baf6cf6470ea9c3a89a27f33cb9', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Pumpkinhead Ale', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bbc7634c238448b38934e7f66718105a', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Michelob Amber Bock', 5, 0, 0, 0, '', '\"Michelob AmerBock is American-style bock beer with a rich, malty and smooth taste that is hearty and full-bodied, yet finishes cleanly. Anheuser-Busch introduced this premium-plus beer nationally in 1995.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bc224afbc74d40e3b9e0f471e52fcd4b', 'a827e1c0aca446198a3f31fa1d53b6de', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bc2870b5ed6047018073cb57b349fbeb', '54f9b5f7f89f4078909d8bfdac095a2a', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Melting Pot Pale Ale', 5, 0, 0, 0, '', 'If you liked the Nobleman this one should blow you away! We took malt and hops from around the world to create this International Pale ale! This beer has an incredible amount of hop flavor and the perfect hop bite!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bc5a8b537d7440918e8cee971e3ccad5', '1427b56f0c6b43f9bf028afad2ae2bcd', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'John Barleycorn Barleywine Style Ale', 9, 0, 0, 0, '', 'Our Seasonal Offering. We honor the Harvest & Holidays each year by brewing a traditional Barleywine style ale, using a variety of ingredients. The Label, created by local artist Janis Taylor, is a folksy woodcut based on the tale of John Barleycorn in verse.\r\n\r\nBrewed in small 10-barrel batches with Certified Organic barley malt, this crimson hued ale has a sweet caramel nose with a zesty spicy, citrus taste. It has a slight hop finish and leaves a warm, tingling sensation on the tongue. A great winter warmer!\r\nStarting Gravity 	1.098\r\nFinish Gravity 	1.020\r\nABV 	9.5\r\nIBU 	96\r\n\r\n-http://www.madriverbrewing.com/pages/brews/john_barleycorn.html');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bc5e0d21bb5446b5928df8162ef78567', '92ecbfbe736e49378d8aae2062a441c0', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Miller Chill', 4, 0, 0, 0, '', 'Launched in 2007, Miller Chill is the only light beer brewed with a hint of lime and a pinch of salt to provide a truly refreshing beer experience. Through all of our marketing efforts, beer drinkers will see that Miller Chill is a celebration and fusion of the best of two cultures, great light beer from America and the chelada style from Mexico. It''s the new alternative in mainstream low-cal beers ... one that provides a crisper, smoother, more refreshing beer experience.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bc754635f73941619e34b5e1fdf4ae54', '3b1cefedca8e475c9e620feb0df34abe', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Buffalo Butt', 4, 0, 0, 0, '', 'Rahr''s Buffalo Butt is a smooth, medium-bodied amber lager. Notes of caramel with a sound malt character. Nice hop finish, it''s as smooth as a baby buffalo''s...!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bc7c4d086cd74bca82630bc87f90e817', '6373fec6e4d84db5ae7c64f6230502ce', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Pluto - Belgian-style Golden Strong Ale', 8, 0, 0, 0, '', 'P9 = 9th [non-] planet from The [Midnight] Sun\r\n\r\nNamed after the ruler of the underworld, PLUTO was re-classified as a non-planet in AUG 2006. Here we celebrate our â€œFallen Planetâ€ by creating a Belgian-style Golden Strong Ale, aged in French oak Chardonnay barrels with Brettanomyces. Appropriately, the devilâ€™s in the details. \r\n\r\nLOGISTICS LOG: \r\ndesigned to represent the \"Fallen Planet\" with a Belgian beer style that includes beers traditionally named after the devil. primary fermentation and aging in stainless steel. phenomenal funk flavors realized with aging in oak barrels affected with Brettanomyces. bottle-conditioning achieved with secondary fermentation. devil-may-care data continues to develop.\r\n\r\nAvailability:\r\nAK - draft and 22-oz bottles (limited release begins 08/29/2008)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bc7f92e300214c598001fc0033f8fa70', 'f6b4fa787e0a43418b88dcf6cf75b5ab', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Abbey Normal Ale', 0, 0, 0, 0, '', 'A Belgian Double Abbey.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bc9580511e474bbaa7d6aaf2a2ff79a2', '5521de2de8f14dd8a10f68f8186fa4d5', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Jupiler', 5, 0, 0, 0, '', 'Jupiler is the most famous and most popular beer in Belgium. This delicious lager is brewed with the finest ingredients (malt, maize, water, hop, yeast), using undisputed craftsmanship, ensuring an outstanding beer quality. Jupiler offers refreshment on a wide variety of occasions, thanks to its digestibility and accessible taste. Jupiler (5,2 % ABV) is ideally served at a temperature of 3Â°C. The low-alcoholic variant Jupiler N.A. (0.5%) should be served at 1-2Â°C.\r\n\r\nJupiler has an outspoken image of masculinity, courage and adventure. Furthermore, Jupiler understands men like no other brand and shares their best moments. This combination of male bonding, self-confidence and self-relativation, speaks to all men and makes Jupiler an ally on their road through life.\r\n\r\nJupiler is the official sponsor of the highest Belgian football division, the Jupiler League, and also supports the Belgian national football team. Just like football, Jupiler is all about competence and ruggedness, effort and effort reward, team spirit and... festivity!');
