INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bcfc68249d9740f2945186f03bd57d38', 'af55d658ed67460bb8a798eb56c85acb', '22710fa91bbf4454b94555720f6a33dd', '84bca21ce52244db83158e4971bd7866', 'Radeau Red Ale', 0, 0, 0, 0, '', 'Cooper''s Cave Ale Company''s flagship ale is an Irish Red Ale. Three English Malts and one Belgian Munich Malt make up the grain bill. It is a full bodied Red Ale packed with flavor, blended with American Nugget hops for bitterness and East Kent Golding for flavor and aroma. This ale has turned the heads of many \"dyed in the wool\" American lager drinkers.');
