INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('be872f750ebd491a83b190bd5a02bdb2', '3842531cdf184adf988126b606f62a5e', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Black H2O Oatmeal Stout', 6, 0, 0, 0, '', 'This is our darkest and most heavy regular offering. It is virtually black in color and features rich roasted malt flavor with a delicate caramel and vanilla finish. It is carbonated and served with the use of nitrogen gas, giving the Black Water a beautiful cascading pour and thick, creamy foam atop your glass. Made with only the freshest American malts and English hops.');
