INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('befc23f9280a4b2b8d9b15f77001905a', '470deed21c4a4e57b1eb4378dad85a76', '98b7246d5e1b4592b15adced83ab36d0', 'dde08a23bc764388a0571b10d486b6e7', 'Apache Trout Stout', 5, 0, 0, 0, '', 'From Arizonaâ€™s high country comes Apache Trout Stout, a robust, full bodied, top fermented ale.  Our brewers use mountain pure water, select roasted barley, hops and yeast to create this traditional style.  Savor the balanced, roasted malt flavor and the lingering sweetness that makes this dry stout a cool weather treat.');
