INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bf9e479bc6784cdeb9059cfbdcd0cda0', 'f773b893039e4b3894d2dc8e61a8beae', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Shantytown Doppelbock', 6, 0, 0, 0, '', 'The sun barely breaks the horizon, the arctic winds bite, and snow blankets the land. Itâ€™s winter in Wisconsin! Throughout the area, youâ€™ll find armies of fisherman, clad in blaze orange parkas and snowmobile suits, dragging their crudely built ice shanties onto the frozen lakes. While they vary in size, shape and color, each shanty contains an enthusiast braving the cold; spinning their tall tales; staring deeply into that hole in the ice; and, of course, enjoying a Legendary Wisconsin Beer. Brewed in the fall to help you survive our Wisconsin winters.\r\n\r\nShantytown Doppelbock is brewed in the style of a German Doppelbock. Brown in color with malty sweetness and a full body.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('bfc036ba294e4d499d14df6634dae3d7', '6373fec6e4d84db5ae7c64f6230502ce', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Cosmic Black Witbier', 6, 0, 0, 0, '', 'Close your eyes. The delicate aroma, flavor, texture of this beer whisper â€œwitbierâ€. Now open your eyes. The color is deceiving. You take another sip. Yes, witbier â€¦ but black as night. It is something quite peculiarâ€”BuT it is brilliantâ€”something shimmering and [not so] white.');
