INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c030e9aa7d8a4b61b820c6d4a0db56d5', '3bfccf92b0934a688877be8a75cd6f7d', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Abbaye de Saint-Martin Triple', 9, 0, 0, 0, '', 'Three varieties of malt and three of hops create the robust character of this St. Martin triple abbey ale.\r\nAbbye St. Martin Ales are pure Belgium.');
