INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c040ffb56a6a4440a07b7a2667ee5f4e', 'a532757c1bcf487fbace23ea102b6dc3', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Olde Buzzard Lager', 5, 0, 0, 0, '', 'Our Lager (Dortmund-style) is brewed with pale, Munich and Vienna malts and is moderately hopped with Hallertauer hops. Dortmund is an industrial, steel-making town and its lagers are hearty, easy drinking brewskies. The hops balance the malt but not overtly so. A great brew for the end of a hard day at work. Winner of the Gold Medal for Best European Style Pilsner at the 2000 Great American Beer Festival , Gold Medal at the 5th and 6th Great International Beer Festival, Silver Medals at the 7th Great International Beer Festival and 9th Great International Beer Festival, and Bronze Medal at the 8th Great International Beer Festival and 11th Great International Beer Festival!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c04a2eec764d4167a153773e8420dbd9', '68e6628fad914035b8fb6c470d4d75c2', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Dry Heat Hefeweizen', 0, 0, 0, 0, '', '70% Wheat Malt Makes This A Light & Refreshing Ale For A Hot Day!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c04e6e49d9a9429ea98166a1c281a304', '924f4d2594fe47a0a732a9e14bc24ad6', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Chicory Stout', 5, 0, 0, 0, '', 'A dark beer made with a touch of roasted chicory, organic Mexican coffee, St. John''s Wort, and licorice root. Brewed with whole-leaf Cascade and Fuggles hops, the grains include pale, roasted & oatmeal.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c08585a008924e079700e28905666140', 'a0ac7160e2a34b3f8b1e63862365ac0e', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Oktoberfest', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c091f0b776e14065b740910af4face00', '27f2fd76054546ab995143f1705971b9', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'HopFish IPA', 6, 0, 0, 0, '', 'At the request of you hopheads, we produced this I.P.A. with a deep golden color, plenty of hop bitterness balanced by malt sweetness. Because of the extensive dry hopping, there''s a floral and citrus hop finish. It''s then lightly filtered to maintain the appropriate body and flavor. The beer features a combination of American, English and German malts to balance the large amount of hops. The HopFish also uses three hop varieties at five different times and has been dry-hopped for two weeks with 22lbs of Nugget whole leaf hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c0ac6a5783954258b932cf505708448c', 'aa363aead2c24dc2b0a9553679a2fc70', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Darkness', 10, 0, 0, 0, '', 'This Russian Imperial Stout is a sipper. Problem is that you want to sip it all night. Look for this one to be released when the leaves change color and Halloween is approaching. Brewed with a blend of 8 different malts, oats and candi sugar. This huge stout reflects Surly''s commitment to brewing intensely flavored beers in small batches. Only 25 barrels of this beer were brewed.');
