INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c207143d70a644e8a366ef82dc8fbb11', 'c481fdf60728475aa7c22dec1c641acf', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Coors Light', 4, 0, 0, 0, '', 'Coors Light is Coors Brewing Company''s largest-selling brand and the fourth best-selling beer in the U.S. Introduced in 1978, Coors Light has been a favorite in delivering the ultimate in cold refreshment for more than 25 years. The simple, silver-toned can caught people''s attention and the brew became nicknamed the \"Silver Bullet\" as sales climbed.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c22cf83cb98743e7b889ba605c1dcbcb', 'e28a09d9c0e64999af410a252f11b39b', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Stateside Saison', 0, 0, 0, 0, '', 'An ''American Farmhouse Ale.'' It''s a Belgian-inspired brew that uses a combination of European malts, hops from New New Zealand and the United States.. and a classic farmhouse yeast to achieve a fruity, yet spicy, melange of flavors and aroma.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c233d8bcf03242929a67cc5710692b54', '94b2e7e841504f858034cf078e80a792', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Raspberry Wheat', 4, 0, 0, 0, '', 'A golden wheat beer brewed with the finest North American malted barley and wheat.  It''s then lightly hopped with the choicest European varieties.  The smooth, crisp golden wheat beer is then finished with a hint of rasberry.  Enjoy this beer any time of the year.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c247b1084ddd44269cc1d7dd8529ab65', '1c36c53e4ff54b87ae76a1fb17b90b6e', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Frostbite', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c25e3065fd94433e8f5ce8efbe706761', '20f5693ca80c4c74a422a9dfa988e9a6', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Shakespeare Stout', 6, 0, 0, 0, '', 'Stout was first introduced by Guinness in Ireland as \"Extra Stout\" (a stronger version of their Porter). Later, the stronger Imperial and Double Stouts emerged. Sweet, Milk, and Oatmeal Stouts are English adaptations with less alcohol and less bitter then the dry Irish Stouts. Victorian England recognized Oatmeal Stouts nutritional value and it is traditionally the drink of choice for nursing mothers and athletes. It is a beer equally at home with oysters as it is with a homemade pizza and freshly tossed green salad (or as a float over ice cream).\r\n\r\nRogues Shakespeare Stout received a 99, the highest score of the 309 beers in 44 categories at the 1994 World Beer Championships. The June/July 1998 issue of Mens Journal included Rogue Ales Shakespeare Stout as one of \"The 100 Best Things to Eat in America.\"Based on Stuart Kallens book, \"The 50 Best Beers in the World\", Shakespeare Stout was ranked the third best beer in the world and best American Beer--which makes it the Worlds Best Stout!\r\n\r\nRogues Shakespeare Stout is ebony in color, a rich creamy head and a mellow chocolate aftertaste. It is made from Northwest Harrington, Crystal, and Chocolate malts, roasted barley and rolled oats, along with Cascade hop. Shakespeare Stout is available in the classic 22-ounce bottle, a commemorative 3-litre bottle with ceramic swing-top, and on draft.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c25fa691fc294884874b512052caf6e2', '108a26f09ce942a9a22091824a6cc9e8', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Chimay DorÃ©e', 4, 0, 0, 0, '', 'Brewed from very similar ingredients as the Red, but paler and spiced differently. It is intended only to be drunk at the abbey or at the nearby inn Auberge de PoteauprÃ© which is associated with the abbey. The monks themselves drink this variety rather than the stronger three. The DorÃ©e is not sold commercially and the rare bottles which make their way out are through unofficial sources. Even the brewery''s own web site makes no mention of this variety.');
