INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c39566a0fb0c47cd9d9c2f1bb1574d24', '416ea173551e49e3a04d39a6a66394a9', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Wild Wacky Wit', 4, 0, 0, 0, '', 'Our Wit (white) beer is an old style Belgian wheat-ale, spiced with Curacao bitter orange peel and corriander. Light and exotic... A party in your mouth!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c396211c2f0b42a198b7ec16c41e74af', '66c50bffcdcd4bb7b80ef27966940cf1', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'River Horse Special Ale', 4, 0, 0, 0, '', 'It''s been with us from the start and hasn''t changed since that first brew way back in 1996. Ample quantities of caramel malt give this English ale a soft copper hue and the colorful addition of carapils malt adds a slight sweetness you might mistake for honey.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c39e49250e6a44c1b6facc5f65547925', 'b455d286281d43899bb39618c42d12c7', '98b7246d5e1b4592b15adced83ab36d0', 'dde08a23bc764388a0571b10d486b6e7', 'Tailgate Sweet Stout', 6, 0, 0, 0, '', 'Bronze medal award winner - Sweet Stout Category â€“ California State Fair 2008 Commercial Craft Brew Competition\r\n\r\nDonâ€™t be afraid of the dark. This Sweet Stout is a surprisingly charming, and yet extremely robust ale that spills a soothing bouquet of caramel, chocolate and lightly roasted oats.  As a truly unique foray into the world of stout ales, this sweet stout drinks so light you might be surprised at how apt you are to enjoy the darkest of TailGate Beerâ€™s. The flavors are so rich and smooth that this TGB Sweet Stout can cool you on the hottest of days and warm you in the worst that winter can bring. Here is heaven in a bottle. If it weren''t so wrong, this is what you wish mom could have given you in your baby bottle.  Treat yourself right and enjoy an experience that is the best dessert to pass through your lips since mom last made her best fruit pie for you.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c3b732fad1334c3395422bdca82d5c18', '2dc4ecd978944c7f87c9f8fdef8b798e', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Gold Ale', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c3cacad289144a4fa0e2a3036e6e6023', '1282ae91d4714281a1b5ec321ca571c4', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Ridgeline Amber', 5, 0, 0, 0, '', 'Ridgeline Amber stands out as a stellar, complex choice in a sea of over-simplified amber beers available today. A malty, copper-hued treat from start to finish, Ridgeline begins with a distinctive, estery aroma. Followed with a complex, nutty malt flavor true to its Scottish-style heritage, Ridgeline delivers unparalleled character and dimension. A touch of hops rounds out its silky, full body, highlighting Ridgelineâ€™s subtle but engrossing character. Show your friends that you care about their taste buds by turning them on to our imminently balanced and perfectly complex Ridgeline Amber. \r\n\r\nOf interest to Great Divide historians â€“ Ridgeline originally debuted at the brewery as Great Divideâ€™s first beer, Arapahoe Amber. It was renamed in 2004 to better reflect the Colorado lifestyle that Great Divideâ€™s beers perfectly complement.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c3d48a566e2b43ad8ba438cf13a9281f', '763793ca74884cb58e6ae19b2db29217', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Lionshead Light', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c3e2e43616d7448db157b6ddfc86f691', 'b3fd68004aef4806b7f4cb68e64a45d9', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Simcoe Single Hop IPA', 6, 0, 0, 0, '', 'The first in a new series of single hop IPA''s from Mikkeller. Brewed with Simcoe, known for many great US micro-brews. An extremely fresh-hopped IPA.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c3f573731e464f24b0140e26c1365312', 'dcd4da1940974cd0be053419e0a17aa0', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Fairweather IPA', 6, 0, 0, 0, '', 'A hop lover and beer connoisseur''s favorite, this ale is surprisingly drinkable and fully delights with its hoppy aromatics. Stick your nose in this one.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c3f953833e9a429a974fe3e80838d1be', '048f9156b40a469781e7e19d6321d6b5', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Samuel Adams Boston Ale', 4, 0, 0, 0, '', 'A smooth, refined version of a classic ale.\r\nSamuel AdamsÂ® Boston Ale was first brewed to celebrate the opening of our Boston Brewery. Like Samuel Adams Boston LagerÂ®, it was an old family recipe that was rescued by Jim Koch from his father''s attic. Samuel AdamsÂ® Boston Ale, a Stock Ale, has a complex, caramel malt character balanced with distinct spicy and herbal hop notes. Our proprietary ale yeast imparts a variety of fruit and ester notes in both the nose and flavor which are indicative of the style.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c4246f2b71b349499a7b483b54ef1407', '43387522a5c7466692e40ab0089414b3', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Wicked Ale', 0, 0, 0, 0, '', 'Pete''s Wicked Ale is an experience out of the ordinary. Our tantalizing ruby-brown ale with distinctive malts and aromatic Brewers Gold hops is sure to stir up an urge to get loose.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c4279b71b17f4d5b8557a2ac9acb14eb', '2ced7efcdb8c47e99356505adaa609b8', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Hefeweizen', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c42b57cab67f48c084a39d84eb3dcdd8', '3fe7aad2793a47e7ada190b5e83b1ae4', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Pale Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c42fd46cd91c421588585186a05adfe8', '13e46693ec384f9183b40ee3a0560780', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'Turbodog', 0, 0, 0, 0, '', 'Abita Turbodog is a dark brown ale brewed with Willamette hops and a combination of British pale, crystal and chocolate malts.\r\n\r\nThis combination gives Turbodog its rich body and color and a sweet chocolate-toffee like flavor. Turbodog began as a specialty ale but has gained a huge loyal following and has become one of our three flagship brews.\r\n\r\nJust a bit stronger than our other brews, so . . .beware of the dog!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c432a139352145549cb026c402c4e3e0', '0e5f672cf17849a7adcfec8a17b932fe', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Undercover Investigation Shut-Down Ale', 9, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c437d6cbfeae4009bea48d3449e645c6', 'c481fdf60728475aa7c22dec1c641acf', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Killian''s Irish Red', 4, 0, 0, 0, '', 'Killian''s Irish Red is a traditional lager with an authentic Irish heritage, based on the Killian family''s recipe created for the Killian''s brewery in Enniscorthy, Ireland in 1864. Coors acquired the rights to brew and market the product in America and Killian''s was introduced to the U.S. in 1981.\r\n\r\nKillian''s Irish Red derives its distinctive red-amber color and taste from a special caramel malt that has been roasted at a high temperature longer and more slowly than most malts. There are no coloring agents or artificial additives used in brewing Killian''s. The brew is known for its rich amber color and thick, creamy head.');
