INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c559217817554d9aac228fdfddfc2fb2', '3bfccf92b0934a688877be8a75cd6f7d', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Brasserie de Brunehaut Bio BiÃ¨re AmbrÃ©e (Organic)', 6, 0, 0, 0, '', 'Amber copper color with a beige head.\r\nCaramel malt aromas reminiscent of vanilla, along with toffee, butterscotch and ripe fruits. Top-fermented and bottle-conditioned, this is a clean, refreshing regional ''artisan'' beer.\r\nHazy amber to brown coloured beer, with a fluffy off-white head. Nice aroma of spices, yeast and oak.  The alcohol subtle. Flavour is moderately spicy and slightly fruity, with balanced hops. \r\nThis beer is certified organic.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c572747896da4fea83fd44567662635a', 'abe493cb583c405abfc022406c34cee4', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Apricot Weizen Ale', 5, 0, 0, 0, '', 'Brewed by the original Wheat Beer Pioneers, Pyramid Apricot Weizen Ale is left unfiltered for extra flavor and aroma.\r\n\r\nThe gold medalist of fruit beers, Pyramid Apricot Weizen is an adventurous wheat ale that offers the pleasing aroma and flavor of fresh apricots, and smooth and refreshing character for which our wheat beers are known.\r\n\r\nOriginal Gravity: 11.75\r\nAlcohol By Volume: 5.10%\r\nMalts: 2-Row Barley, Malted Wheat, Caramel\r\nHops: Nugget\r\nAvailability: Year Round\r\nBest Paired With: Appetizers, salads, and desserts such as pies and pastries.\r\n\r\nBest of the Northwest/Pacific in the \"Fruit Beer\" category at the 2000 United States Beer Tasting Championship, 2000\r\nGold Medal, GABF, \"Fruit and Vegetable Beers\", 1994');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c583b86465fd4225ae89e07f827f5b52', 'bef3198dea9243d09ed8b09b5f8cdf53', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Lone Star Light', 3, 0, 0, 0, '', '\"Lone Star Light mimics its full-bodied counterpart with an award winning premium light taste. This beer retains the complimentary ratio of barley, cereal grains, and hops of its parent brand.\"');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c5845f34c2d344dca8a3e0d074bc53a6', 'bfcb5792acea46178da58ab8e844869f', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Hefe Weiss', 4, 0, 0, 0, '', 'This coarse-filtered wheat ale is fermented with a German yeast culture for a refreshingly light spiciness and hints of citrus fruit. A cloudy appearance and an immense creamy head are characteristic of this lightly hopped Bavarian Brew.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c58ea8505bf742efbfd3d7a6c587dd28', 'd9ea99a78de74e5f990ac0ebc80a2cd0', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c5aa626a093a403fa46cc294d14946c2', 'fdbb35eddc244a79b420e3a127823805', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Nelson', 7, 0, 0, 0, '', 'A Golden Rye IPA.\r\nAn outstanding hop from New Zealand, Nelson Sauvin, is generously used throughout the brewing and dry-hopping of this unique beer. European rye is added for a smooth, malty addition to flavor. 1.065 OG 7%ABV');
