INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c612e0dbd745436fb27418ee63e0e3d0', 'c782d03399284649b1c691f9157eb1e5', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Route 113 IPA', 7, 0, 0, 0, '', 'A big, flavorful IPA for all the hopheads out there, brewed with British Pale and Crystal malts, and hopped with Centennial, Cascade, German Northern Brewer, & UK East Kent Goldings. Bold and spicy.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c66655f1b396423ca66803d462079570', 'fd2cd4c2ec3e4c59b7917eba87951c39', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Curmudgeon', 9, 0, 0, 0, '', 'This Old Ale conjures up thoughts of classic sea fairing ports, there local pubs and the weathered fisherman that frequent them. In traditional style Curmudgeon is brewed with an intense focus on the malt bill creating a very strong, rich, malty characteristic and a sweetness indicative of its cousin the barleywine. We are especially proud of the balance in this beer making it deceptively smooth and drinkable at 9.3% alcohol by volume.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c66e05d63c9d4b98af74ecc94e548555', 'eabf4f40165c48bd87da961394316153', 'e64b30f392b4437b82ec46e764453ac1', 'bbcfea982aa64195bd7b1addfbc9fbe2', 'Alta Gracia Coffee Porter', 0, 0, 0, 0, 'wolavers-altagracia.jpg', 'Brewed with organic roasted barley and chocolate malts for a rich, dark and robust flavor with an infusion of organic vanilla beans and coffee from the Dominican Republic farm community Alta Gracia. ');
