INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c6c70a373c4b4c1d96fde2c0a0f0b185', 'f773b893039e4b3894d2dc8e61a8beae', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Fighting Finches Bock', 0, 0, 0, 0, '', 'The Finches will get you if you donâ€™t watch out!\" In the early days of southern Wisconsin, falling into the clutches of the \"Fighting Finches\" was the ultimate threat. Moses Finch fathered 21 offspring whose most notable talents were stealing horses and robbing stagecoaches. From their stronghold in the impenetrable marshes west of Lake Mills, the Finches raided the farms of local settlers and held up the early travelers between Madison and Milwaukee.\r\n\r\nThe Finches are long gone, but their legend lives on. So enjoy a pint of our Fighting Finches Bockâ€¦ or you better watch out, â€˜cause the Finches are gonna get you!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c6f2f4a18c734b8587b1685de72b557d', 'd9df3ae7fdaa49d48d20d4c99ae4916e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Summer Brau', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c706429e427c4813a39093bbb33cd19d', 'f743f04357824c41994f695c5034da14', '98b7246d5e1b4592b15adced83ab36d0', '1c20aafad8964ed4a7626ef53934000a', 'Scratch #11 2008', 4, 0, 0, 0, '', 'Next up, we present Scratch Beer #11-2008, a Bitter. Back in the day, we used to brew a little number called TrÃ¶egs ESB. Even though this beer was retired almost six years ago, we still get numerous TrÃ¶egs old-schoolers (Martha) begging for its return.\r\n\r\nWell hang onto your boot straps because Scratch #11 is about as close as we can get to the original ESB without firing up the old brew kettle. The Scratch #11 recipe originates from Chrisâ€™ stint at Englandâ€™s University of Sunderland brewing program. After returning to Colorado the brothers drew on Chrisâ€™ experience and brewed pilot batches tweaking that recipe. The ESB production recipe has direct bloodlines to these pilot batches.\r\n\r\nThe Thames Valley ale yeast and the roasted barley create a biscuit flavor with nutty undertones. Combining these flavors with the earthiness of East Kent Golding hops creates one hell of a fine session beer. Take in the deep mahogany beauty of this beer and breathe in the full hoppy nose. Itâ€™s not the ESB, but itâ€™s damn special.');
