INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c78ae9483ef74e8fb861956f407c879c', '0d256205a6af4f539c441b513320853d', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Shakedown Nut Brown', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c7930bdeecb145b19b3423b015aceffd', 'f743f04357824c41994f695c5034da14', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Dead Reckoning Porter', 5, 0, 0, 0, '', 'In the 14th Century, Sailors would rely on sheer skill to get from a starting point to a final destination.  They called this Dead Reckoning.  We see our beer the same way.  We know where to begin and know where to go, but there are hundreds of ways to get there.\r\n\r\nDead Reckoning is unfiltered and weighs in at 5.8% abv and 53 IBUâ€™s. It features Pilsner, Caramel, Chocolate and Roasted malts along with Chinook and Vanguard hops. â€œThe outstanding taste and flavor of Dead Reckoning originates in the chocolate and roasted malts,â€ says John Trogner. \"There is a nice hoppiness in the front of the beer, but the rich, smooth mouth feel is what really stands out.\"');
