INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c7ab439eeff34f78909ab0c74763ad94', '343412b7c5de4ce5ac21dc63166abbdf', 'b7ee8858a0b549ddb2361e1ed313f6e1', '055775d81abb4aa0a4bde8bf8bcaff92', 'Nor'' Easter', 12, 0, 0, 0, '', 'This is a truly unique brew, combining some unusual elements to create a powerful, yet flavorful brew. I brewed a similar beer to this one back in 1998, while I was home brewing out in California. Only this time around I decided to age it in bourbon barrels to add a new element to the already rich sensory profile. The combination of dark malt, elderberries and bourbon barrels makes for an interesting tasting experience. This is a sippinâ€™ beer, so sit back by the fire and enjoy. 12% alcohol by volume.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c7af3fe2177548ee8c598116d4a3a792', 'b452dfcf8ed940cf8d6a6a662bf7c675', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Humidor Series Jai Alai Cedar Aged India Pale Ale', 7, 0, 0, 0, '', 'he Humidor Series is a rotating offering of Cigar City Brewing beer aged on cedar. Cedar has a more subtle effect on beer than more traditional woods like oak. But, we think that once you taste it youâ€™ll agree that cedar deserves a place alongside oak in the brewerâ€™s wood-aging toolbox.');
