INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c935e1bd0bca4f749316914ee762d4c1', '3be6b00a760647c7ba5d5de8c1bee825', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Celtic Copper Ale', 5, 0, 0, 0, '', 'Celtic Copper is a mahogany hued ale with rich malt flavor and subtle hop balance; an excellent choice for those who prefer amber ales.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('c947ac7ea89a49b7b66d45b62bbc85e8', 'f18a3e7ec2434ce58138b843994414b4', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Union Jack India Pale Ale', 7, 0, 0, 0, '', 'The newest member of the Firestone family, Union Jack is the aggressive IPA that youâ€™ve been searching for. Citrus, pineapple, and a full chewy malt profile finish clean on your palate. Over 70 IBUs and 7.5% alcohol by volume, Union Jack wonâ€™t have any problem competing with the big India Pale Ales. A beer true to its origins; deeply hopped and bolstered for a long voyage.');
