INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ca5ad3d7f075490fb9455f0f0e8966c0', 'e5627f2af1e641009e8f060cffedf636', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'Rochefort 6', 7, 0, 0, 0, '', 'eddish colour, almost like autumn leaves, very consistent texture with a slightly spicy aroma and an intense taste of caramel, fruit, and hints of raisins. It is only brewed about once per year, representing approximately 1% of total beer production, thus is quite difficult to obtain.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ca5e22743051401285756ef9fce5b10d', '354fa342062e4f46bcb73426bf200c7a', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Wheat', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ca5fcb27f54f4fc089143502a3f29982', '50b67c7f77bc4d0f8fdd34dbfc92de3b', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Little Scrapper IPA', 6, 0, 0, 0, '', 'To admit that the brewer at Half Pints is a bit of a hophead is an understatement. This India Pale Ale is unabashedly hoppy, not only from the Amarillo hops we add to the brew kettle, but also from the northwest U.S. variety called Cascade that we add directly to the final tank. A firm toasted malt presence forms the background for all of these hops, and we''re confident our Little Scrapper IPA could take other so-called IPA''s to the mat if called upon to do so. Try it with a curry or a basket of beer battered fish & chips. Serve in a glass at 8 degrees celcius. Unpasturized.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ca5fffbe88f743c78f2681b67fc207db', 'e19c281523bc4c09b667d2e0ff3a30ae', 'b7ee8858a0b549ddb2361e1ed313f6e1', '055775d81abb4aa0a4bde8bf8bcaff92', 'Tournay Black', 7, 0, 0, 0, '', 'Tournay Black is a bottle conditioned, Belgian stout brewed by Brasserie de Cazeau which is a farm-brewery located in the south of Belgium.  It was originally brewed as a winter ale under the name Tournay de Noel, but later became a year-round release.  They didn''t provide much specific detail about how it was brewed except to say that it is made with water, malts, candi-sugar, hops, and yeast.  It is 7.6% ABV with a recommended drinking temperature of +/- 50 degrees.  The brewer states that the tasting notes are of, \"roasted malts, coffee, bitter chocolate, earth, and cigar ash.\"  Well, I am a prodigious cigar smoker and I can''t say that I would want to consume the ash.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ca68cf8e47114305b3f10d5e074079cb', '2456f96c95854731afa129b1fd4af0be', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Lager', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ca7422c35fff4777b2257a2181c73291', '98d36e7582104cf2825e8fa80c55c6d6', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Old Faithful Ale', 0, 0, 0, 0, '', 'ur Old Faithful Ale is a Pale Golden Ale with a crisp body and light malt sweetness. We cold condition this ale to give it a pleasantly smooth character and dry palate. The Willamette and imported UK Goldings hops give this beer a light floral hop aroma, making it exceptionally easy to drink.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ca87c1af6aa940369b1d679eb00b3504', '41850dda0ffe494aa21397a0ed521569', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'IPA', 7, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ca938d47809b46ed841956d71de8c765', 'c5d43a6604a143b19cd221ba1979e3c7', 'b7ee8858a0b549ddb2361e1ed313f6e1', '055775d81abb4aa0a4bde8bf8bcaff92', 'The Beast Grand Cru', 14, 0, 0, 0, '', 'The Beast is a seducer - accommodating, complicated, powerful, dark and created to last the ages. With a deep burgundy color and aromas of honey, nutmeg, mandarin orange and pineapple, this massive and challenging brew has flavors akin to a beautiful Carribean rum. Dates, plums, raisins and molasses are dominant in a rich vinous texture. Cellarable for 10+ years.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cab3cba798b14d41b16ed135fa712229', '9afdf27a7c57483bbe140f42040aae13', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Back Road Ale', 5, 0, 0, 0, '', 'Back Road Brewery''s flagship beer, and first original recipe of 1997, is also our house beer.  This mildly hopped copper colored brew has a rich smooth taste.  Hop varieties such as Styrian Goldings and English Fuggles are used to balance the beers maltiness.  A technique called dry hopping is used after fermentation to add fresh herbal aroma.  It is a great session beer and was made to satisfy a wide variety of palates.  Drink and enjoy LaPorte County''s first production craft beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cabf3c10f29e4bd192fd16c89032d176', '32629f72e41245c7b98912e872917b62', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'Hell Hath No Fury Ale', 7, 0, 0, 0, '', 'A brew that gives you either sympathy for the devil or the courage to face him. Goes especially well with your favorite lost my girl/truck/dog/trailer song.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cacd0a8b67d74d3fb036399b885cbada', 'f6b4fa787e0a43418b88dcf6cf75b5ab', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Barrel-Aged Blind Date Ale', 7, 0, 0, 0, '', 'This is the old tried and true Blind Date Ale of old. It is based on an English Olde Ale but has an addition of 300 pounds of Arizona grown Medjool dates. The dates contribute a complexity and sweetness that the malt alone cannot. This Blind Date has been aged for three months in Jim Beam oak bourbon barrels. The oak and bourbon lend flavors of vanilla, wood, and of course, bourbon. These flavors layered with the dates created a big, multi-leveled ale. The alcohol content is about 7.5% alc/vol. You''ll have to get to Four Peaks quick since we only have a few kegs of this unique beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cadcff0f6b8541b2bb0d30cb5f1b8629', 'bb1b3fb78ea24b45997b54edd80aeb8c', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Flywheel Bright Lager', 5, 0, 0, 0, '', 'The kinetic beauty of spicy hops grabs you by the nose and lets you know: this is German-inspired beer. A mild, bready malt sweetness greets you at the lips, smoothing the crisp hop flavors. Flywheel is meant for bombastic celebrations of singing voices and clamoring mugs. But then, that first contented moment of happy hour is uniquely celebratory as well.\r\n\r\nFlywheel Bright Lager goes great with hot dogs, guitar jams, stir fry, bowling, taco salad, house warmings, baked potatoes, Saturday morning cartoons, tequila, gouda cheese, karaoke, bagel & schmear, Euchre, fresh berries, asparagus, 16-inch softball, sushi, darts, Pad Thai, family reunions, pb&j, flan, romantic weekend getaways, garlic bread, pay raises, nachos, baby showers, fondue, and Frisbee golf.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cae05e664f80465d9d37c0e73f6cc121', '315e41e96219473c864499efdf540db8', '98b7246d5e1b4592b15adced83ab36d0', '0b415ebb506c40848abff3554116e055', 'Legbiter Ale', 4, 0, 0, 0, '', 'Brilliant golden ale with an inviting citrus fragrance of late added Cascade and Glacier hops. The fine hop and light malt aromas carry through to the palate to give an ale that is full but refreshing, with a clean caramel malt bitter finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('caf09050d9754648a616943114997ca3', '4c67e5fe13d2482584a8d3e0b3d8836c', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Palace Porter', 0, 0, 0, 0, '', '');
