INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cafe1c5081034ce0884744394bc59ab9', '5f280fa883124fac82d2c6c769d0e45e', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Hoppin'' To Heaven IPA', 6, 0, 0, 0, '', 'Raise your glass to the heavens in a toast to HOPS â€“ the spice of beer! This classic American I.P.A. features the finest American hops to add a spicy, assertive, and citrusy character to its full-bodied, rich malt taste');
