INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cc58cc0d08404aa594edbdf53aa30b7a', '48212e7f302347fcacd32d883cbef4e3', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Colonel Paris Pale Ale', 4, 0, 0, 0, '', 'A classic American pale ale with a taste not unlike fresh citrus follwed by a crisp and spicy bitterness.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cc58fc4877d9448d804faa1d8007b82e', 'c0f3c4bc6d374a578874bfd84803ebc3', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Brown Ale', 5, 0, 0, 0, '', 'A mix of Northern and Southern English Brown Ales, blending 6 malts into an All-American beer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cc6da84faaa84a15889e7c72882f303a', '3a09f973aa9a4b6bbfd27b54374bc96e', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Beast Bitter', 5, 0, 0, 0, '', 'This special bitter displays the subtle coppery hue of \"Old Gold\". It''s depth of lingering hop flavor awakens the palate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cc88a7ea93484a14bc24870ab9112b74', '6ee3779d2b1345e0b7b5edf8f63caabc', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'North Star Red', 5, 0, 0, 0, '', 'Deep amber color. Subtle hop floral nose intertwined with sweet crystal malt aromas. Rich malt flavors supporting a slight bitterness finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cc88d86d3b5447198a57451e2ace18f1', 'df3cc6f9b0e34daea76b844af935a87c', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Maibark', 6, 0, 0, 0, '', 'Golden, easy drinking, traditional example of Maibock. All German grains, yeast and hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cc8dee7382c0484497c521eab13cef32', 'd53519e8b3d74f55a274d75472250426', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'IC Light', 4, 0, 0, 0, '', 'IC Light is an original, not a watered down copy, and brewed to be light from start to finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cc9d9c5015a04b4c83220f3505ae40af', 'c5bb8c84d73946c28befc136bf7963d4', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Harpoon Brown Session Ale', 4, 0, 0, 0, '', 'Harpoon Brown is brewed to accentuate the sweeter, rounder notes derived from six different malts, including a de-husked chocolate malt that adds a hint of chocolate. The blend of these malts produces a beer that is complex and delicious without being heavy. This drinkable beer is perfect as a session beer or paired with foods.\r\n\r\nThis is the first year-round Harpoon beer the brewery has released in almost a decade.  While the craft beer industry has seen a growing trend in \"extreme\" beers, the brewers of Harpoon wanted to create something they could sit down and enjoy over an extended period of time - a session beer.  At 4.3% alcohol by volume, the Harpoon Brown Ale has the lowest alcohol content of all Harpoon beers.\r\n\r\nHarpoon Brown Ale will be available in bottles and on draft beginning in March 2007.  An evening of celebrations to toast the beer''s release will be held at locations throughout New England on Thursday, March 8th, including tastings at Harpoon''s breweries in Boston, MA and Windsor, VT');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ccc7dcd85a264433b87524941fc736b7', '2a75362e72b940d19d15985f496b1ccc', '4fcd53c380e347edb1ca81489b03f902', '2a6b815eb1624f47b33d1c5a753e5bd6', 'Dark Satin', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ccc9d1f484ab4fe1ac937470ba792eae', 'd45c85fe110c4911b17c5203df2246f2', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Baltic Thunder', 8, 0, 0, 0, '', 'Truly a worldly beer. Baltic Thunder represents the Baltic Porter style admirably. Exhibiting the enticing, toffee roast of the British porter that originated the style in the 18th century, and the soothing, subtle fruit nuance of contemporary brews that flourish from Helsinki to Vilnius today, this dark lager honors the Baltic god of thunder.  Created by an inspired collaboration of brewers and tempered with a touch of turmoil, Baltic Thunder rolls on to bring you enchanting light as the darkness fades.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cd028459b7a14aad9b993599510d743c', 'f9693c8b159e4b4ebfa972ecbaba0a6a', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Rock River Lager Beer', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cd061d5ff4854e26993a47aa2e6dd0f1', '7a20514d64d549d6bdcdc3cea4cedbba', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Bohemian Dock Street Pilsner', 4, 0, 0, 0, '', 'Bohemian Dock Street Pilsner is brewed in the style of the original Pilsner beers of Bohemia, in what is now the Czech Republic, in a tradition that dates to 1842. We use costly Bohemian Saaz hops and pale imported malts to produce its rich golden color, and soft malty flavor using traditional techniques of the old world. True Pilsners are the most difficult to brew as there are no dark malts or flavorings used to mask flaws. Pilsner is the best known style of beer in the world. A good pilsner balances hops and malts to a refreshing, clean tasting, every-mood kind of beer. The Bohemian can stand alone or join a party easily.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cd15cc91632b4e3e9b4b9f480fc8cc56', '88c949e73761482bbd1f2badf91ec46c', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Fat Squirrel Nut Brown Ale', 5, 0, 0, 0, '', 'One deceptively spring like winter day, Brewmaster Dan walked home from the brewery, sat down to dinner and said, \"Boy, there are some fat squirrels out there. They''re running all over the place. I think I should brew a Fat Squirrel Nut Brown Ale.\" Deb agreed and so another beer legend was born. \r\n\r\n100% Wisconsin malt of six different varieties impart the natural toasted color to this bottle conditioned unfiltered ale. Clean hazelnut notes result from these carefully chosen barley malts. Hops from Slovenia, Bavaria and the Pacific Northwest give Fat Squirrel its backbone. \r\n\r\nWhen the going gets tough, remember to relax a moment and enjoy the \"Fat Squirrel\" in your neighborhood.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cd293b80e25d4b4cbd752b68b6b83b6d', '6533462e9e774e57b9f5732311d0b734', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Zoigl Star Lager', 5, 0, 0, 0, '', 'Zoigl is a golden, unfiltered lager beer which was originally brewed only in the region of Eastern Bavaria, between Franconia and the Czech Republic. For centuries, Zoigl was brewed in brewhouses owned by the town or an association of small brewers. \r\n\r\nThe Zoigl-Star, a six-angular star similar to the Star of David, was the sign of brewers in the middle ages. The star symbolizes the three elements (water, earth, and fire) and the three ingredients (water, malt, and hops) used for brewing. The importance of the yeast was not yet known in the 1400â€™s.');
