INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cde136c0b61244d1925e691561212bed', '5005ab643cd34519ae424f0326eb19a3', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Yards Love Stout', 4, 0, 0, 0, '', 'Straight from the heart of the City of Brotherly Love comes a dark and chocolatey seductive little stout dominated by roasted malt flavor. This is one Philly favorite that won''t break your heart and will always love you back.');
