INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cefa0d89473d4a7f8b16fff7d7146173', '3c1a29f6db284abda8d558a43582ba35', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'NÃ¸gne Ã˜ Wit', 4, 0, 0, 0, '', 'This Belgian Ale is what you could call a wit with an attitude.  We are generous with all our ingredients - including both orange peel and coriander.  This does not stop this ale from being a good companion with seafood dishes.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cf1095cf4084413e9625d013ed8b9a7d', '10c54b806b644b6997639b5b063c33f8', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Ise Kadoya Stout', 5, 0, 0, 0, '', 'A very yeasty beer with an earthy aroma. Rich flavors deepen the stout character.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cf29b1dba79a447e8db35cbcc4352ae6', 'e1c9d330e1e24a0c83ffa3b1461032d6', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'Modelo especial', 0, 0, 0, 0, '', 'Handcrafted with all-natural ingredients, Modelo Especial has built a solid reputation as a classic, thirst-quenching beer. The brand represents the can-package of Grupo Modelo''s portfolio and is also available in non-returnable bottles.\r\n\r\nModelo Especial is a must for those looking to capture the flavor of Mexico. Modelo Especial has 145 calories per 12 ounce serving.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cf2ff5d82eef4fab870fdfc3482fc680', '7323d51309bf4eaf91f8d87048ab90d9', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Scarlet Lady Ale', 5, 0, 0, 0, '', 'This English-style ale is brewed with Marris Otter and Caramel malts for a rich, reddish-copper color and smooth malty palate.  The use of bittering and aroma addition hops balances the regal, sweet maltiness and imparts a softly perfumed aroma');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cf59da8ed02c432199ce7e719856a375', '8a0066befe3b4c94a0da0a9f5b639f6e', 'bf3112301857461f82c7633c0a695896', '98950448f00e4eb7b81ed9628258d643', 'Weyerbacher Juliet', 8, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cf9539185f1c46868fd9b290925ee107', '8500bd208607465e9985b4afcd2b2530', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Schuylkill Punch', 6, 0, 0, 0, '', 'Ruby colored ale fermented with over 500 pounds of real black and red raspberries for a distinct berry aroma and a tart, sweet flavor. This beer is gently filtered to preserve its delicate profile and is made with both Belgian Ale Yeast and our Proprietary Lager Strain.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cf997141f9bd45a68d6d569ef0b3151a', 'fd2cd4c2ec3e4c59b7917eba87951c39', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Dirty Bastard Scotch Style Ale', 8, 0, 0, 0, '', 'Founders flagship beer. Dirty Bastard is an absolute beautiful beer to behold. Dark ruby in color and brewed with ten varieties of imported malts this beer continuously lives up to its reputation as a bold and powerful ale. Dirty Bastard is complex in the finish with hints of smoke and peat paired with a malty richness, finalized with a good bit of hop attitude.  This beer ain''t for the wee lads.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cfa046fc59a440668e63e2c25e187635', 'bfcb5792acea46178da58ab8e844869f', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Sprecher Oktoberfest', 5, 0, 0, 0, '', 'Traditionally brewed to celebrate the harvest season, this reddish-brown lager has a rich caramel character and a long flavorful finish. Its delicious malty sweetness is nicely accented by a slighty fruity bouquet and a mild hop flavor.');
