INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cfb779c40523466586743e2016269170', '288939680754498586ad7af631aeb73d', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'McChouffe', 8, 0, 0, 0, '', 'Description : Dark Ale, strong, spicy, lightly hoppy, with evoluting taste. Natural Beer, bottle refermented, unfiltered, not pasteurised and without any additives\r\n\r\nAlcohol : 8,5% alc./vol.\r\n\r\nOriginal gravity : 16 Â°Plato\r\n\r\nStorage : Store the bottles vertically in a cold place, sheltered from light. The yeast deposit can either be drunk or left according to taste\r\n\r\nServe at : 8 to 12Â°C (botlle)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('cfbe7e65e1e146bdb53dd70c9fd4ce55', '8a0066befe3b4c94a0da0a9f5b639f6e', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Old Heathen', 8, 0, 0, 0, '', 'Rich, velvety and deliciously complex, Old Heathen is a truly distinctive winter warmer. We use seven types of malt and two varieties of hops to bring forth this big brew. Quite robust and roasty on the palate, Old Heathen imperial stout has a wonderfully fruity nose and a moderately dry finish. The taste is highly complex- perhaps you''ll even discern notes of espresso or chocolate. \r\n\r\nOld Heathen imperial stout is our interpretation of a beer style that originated in the 18th century. Brewed in England and exported to Germany, Scandinavia and Russia, these beers became fashionable among the members of the Czar''s court. In order to survive long voyages they were brewed with high alcohol content to prevent spoilage. And at 8.0% ABV (alcohol by volume) Old Heathen definitely contains a warming belt. You may want to lay down a few bottles for future evaluation- this beer keeps well and will only get better with age.\r\n\r\nLike most of our beers, Weyerbacher Old Heathen is a perfect accompaniment to foods. Try it with rich stews, oysters, caviar or roasted meats. Old Heathen is also a perfect companion to chocolate desserts.\r\n\r\nOld Heathen is now available year-round.');
