INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d1f97df37e774877a43fdb7c7232b851', 'f4b481b5e94045ef96e5f836e2ff6a7b', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Bourbon Barrel Aged Cousin Jax', 0, 0, 0, 0, '', 'Way up in the Keewenaw Peninsula in Michigans UP, Mt. Bohemia ski area has a powder run hidden at the top called \"Cousin Jack\" (named after the Cornish miners)that winds its'' way steeply through the rocks and trees. AAAHHH WINTER!!! Double the Belgian Malt, double the Amarillo hops-a perfect way to end any day. Everyones'' favorite cousin!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d1fc1a5cfbb94a5d81e7bb11769d32b1', 'd26d5c24741740f89a8385fa0c199558', 'bf3112301857461f82c7633c0a695896', '98950448f00e4eb7b81ed9628258d643', 'Olde #8 Anniversary Ale', 6, 0, 0, 0, '', 'Brewed for August each year to celebrate our Anniversary this strong ales maltiness is balenced by a generous amount of hops');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d1ffe21ba0f14c879c961df7c7ec1fd9', '35cf0c70566b4e0eba938196e0355f45', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'CH-47 Pale Ale', 5, 0, 0, 0, '', 'This light copper, dry finishing American Pale Ale is an excellent addition to the Brew Works fleet of pale ales. A hefty sling load weight of Chinook hops gives this beer its distinctive bite. Chinook and Amarillo hops contribute to its almost citrus aroma. A hopheads delight!');
