INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d2763f3c2eb24ec8b16d43fc9f11d5b2', '0024fad54e5e46279818191654813d1b', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Hoppy Face Amber Ale', 5, 0, 0, 0, '', 'Is an award-winning, traditional, all-natural style of beer that falls under the category of a \"West Coast\" India Pale Ale (IPA). Characterized by its high hop content, high alcohol content and deep amber color, Hoppy Faceâ„¢ is brewed using water with a high mineral content. Using only the finest 2-row malted barley and great northwestern grown hops, this combination results in a clean, crisp, well-balanced beer. As usual, no artificial preservatives have been added to our beer during and/or after the brewing process...\r\nIt will put a smile on your face!!!');
