INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d47405ceb4d94db0a8bebbfcebc6aea9', '3a09f973aa9a4b6bbfd27b54374bc96e', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Grail Ale', 5, 0, 0, 0, '', 'An amber ale with a ruby hue, fresh hop aroma, rich malt body and a complex palate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d48e329f1e08420bac1499b004163934', 'e36fab1869c74ca0a9a0970da2b17d9f', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Sour Cherry Ale', 0, 0, 0, 0, '', 'An intriguing fruit beer brewed with fresh sour cherries.\r\n\r\nOur Sour Cherry Ale is inspired by the centuries old Belgian tradition of brewing beer with cherries. This high gravity brew undergoes a slow second fermentation with tons of fresh, whole Montmorency cherries from a local orchard in the Fraser Valley. The result is a most intriguing beer with an elegant cherry perfume, a tart, fruity flavour, and a subtle almondy finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d49245b0d1924141a1ae1ddbb9f83517', '32629f72e41245c7b98912e872917b62', 'e64b30f392b4437b82ec46e764453ac1', 'f0821cb45038450ea4d7fad8e5af7cf8', 'Bell''s Batch 9000', 12, 0, 0, 0, '', '\"Black, dense, and rich, this is a great ale for the cellar.\" This big brew is made with molasses and brewer''s licorice.');
