INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d4b1bbc79785424b915f10563323143b', 'e5627f2af1e641009e8f060cffedf636', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'd01c4741043a4547ae78c9f205ee8728', 'Rochefort 10', 11, 0, 0, 0, '', 'Reddish-brown colour, with a very compact head and an aroma of figs, feels like honey in the mouth. The alcohol profile is a major component in the flavour of this rich ale. It is very similar to 6 and 8, but has much more of everything. Some may find the high alcohol content to be disagreeable.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d4d4b23127064c03854269d4d3640c34', '52a95674252c4c3780cbba8631bf2efb', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Salvation', 6, 0, 0, 0, '', 'Our version of India Pale Ale. Brewed with European malts and Northwest hops and then generously Dry Hopped with Cascade Hops for a nice citrus finish. Truly a Salvation for all Hop Heads.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d4dbc49cebad49c38915d6f0a4368dbd', 'ffa064924f374feab499dc79dfe05328', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Old Glory American Pale Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d4f9197b79774ebcaa1358c7e04c617a', '4b0c089531be426a9c7a37b5ceba7154', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Wet Hop Requiem IPA', 5, 0, 0, 0, '', 'This beauty is a complete work of art! Bryan and I picked 22 lbs of fresh Cascade hops from 3 gigantic hop vines Bryan has at his house. Hops produce an overabundance of hop cones and we were there for the picking. Even after 22 lbs, we hardly put a dent in the yield! So...here we are 3 weeks later, the beer is on tap and it is the freshest...hoppiest...flavorful beer you can imagine! Needless to say, we are proud of this beauty from the ground, up! We wanted a full-flavored IPA, so Bryan suggested we use our Requiem IPA recipe, and calculate for fresh, whole hop cones. Worked beautifully!! We ended up with an IPA with so much up-front flavor you would think you are enjoying a high octane Imperial! Instead, this is a middle-of-the-road IPA, at 5.2% abv!! This just goes to show how a hugely flavorful IPA can be loaded-up with fresh ingredients and come out the other end, a tasty LOW octane, treat! Bryan and I hope you get to stop in soon to try this one out! We decorated Bube''s with some of the actual hop vines we pulled from. For the true hophead, you will be in heaven. And for the all-around beer enthusiasts, we hope you can appreciate the creativity in this beer. I know I''m proud to say I had a hand in this one!!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d4fdfb93e99f4aeebe84aa45d659c6df', 'ea4c78c86a144184ade4af610c94417a', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Apricot Ale', 5, 0, 0, 0, '', 'Unfiltered wheat beer brewed with apricots creating a smooth and thirst quenching full flavored fruit beer.');
