INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d66a9cca11534db5a6829941536a8381', 'd45c85fe110c4911b17c5203df2246f2', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Hop Wallop', 8, 0, 0, 0, '', 'We celebrate the pioneering spirit of old Horace ''Hop'' Wallop and those who dare mighty adventurous things in this vivid, robust ale. As our annual homage to the hop harvest, expect loads of aromatic splendor and bitter beauty.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d67d2b8d2ed045b7b607594b26122624', 'd45a8652ac9d41fea256ca52ce80215a', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Rust Belt Porter', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d68bf5edc195499ea158329b826ad362', 'b67c5d7317f84d76a2a3874cf45661bb', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Big Mac', 5, 0, 0, 0, '', 'Made popular in the 19th century in Dortmunder, Germany, these pale golden lagers exhibit a classic clean character with notes of biscuity malts. Bitterness is akin to a German Pilsner with an aromatic aroma. Mouthfeel is firm and even, with an overall dry tone.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d6901c1116c44bb8bf1b8c4b139a6081', '944cbc838d644592b1e2b5b997c0a2b2', '98b7246d5e1b4592b15adced83ab36d0', '722a236919264104b2bb85a0e24f9744', '90 Shilling', 5, 0, 0, 0, '', 'We introduced 90 Shilling, our flagship beer, at our opening party in 1989. For a while, we''d been wondering - what would happen if we lightened up the traditional Scottish ale? The result is an irresistibly smooth and delicious medium-bodied amber ale. The name 90 Shilling comes from the Scottish method of taxing beer. Only the highest quality beers were taxed 90 Shillings. A shilling was a British coin used from 1549 to 1982. We think you''ll find this original ale brilliantly refreshing, and worth every shilling.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d6baaaf4a1034cf38d4e17a24432b31e', '8ff1f4a55f93488784fc29db40b1afd5', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber Ale', 0, 0, 0, 0, '', '');
