INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d7197b6206f1489c874c3afda9d68cce', 'a9584f0278e545c4810c2d7bfe3a5c8b', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Light Rail Ale', 0, 0, 0, 0, '', 'This blonde beer has a very light body and mild flavors of hops and pale malts. A hint of caramel malt gives color to this popular choice for craft beer newcomers');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d72bf0c9f0284d0daffa961bd6ba7ff5', '5f1779dae1624f62baaef8bcd67e0d18', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Torrey Pines IPA', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d71edc069e834374ac97cedcb33a6b61', '901374adbdc4445a8443d15793d555b6', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Canary Wheat', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d78f8625b5bd4ed1b4127333652e88ed', 'e36fab1869c74ca0a9a0970da2b17d9f', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Signature Pale Ale', 0, 0, 0, 0, '', 'The term \"Pale Ale\" dates back to the 1800s when all beer was dark brown in colour. New malting techniques led to the development of pale malt, a barley malt kilned at low temperatures which contributed very little colour to the finished beer. Hence the birth of Pale Ale, an amber- to copper-coloured ale you could actually see through. Plenty of British Crystal malt in the grist lends this ale its rich colour, its caramel maltiness, and adds the occasional whiff of toffee to the nose. An addition of American and German hops to the kettle at the end of the boil is used to suffuse our Pale Ale with a gently spicy hop finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d79dbc715e9f4b3aa49bd31295b09843', '387f03355e29436597aee9e25a247c44', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Fuego del Otono', 6, 0, 0, 0, '', 'To catch a bit of soft radiance in each bottle, we wait for fall colors to begin their bright and fleeting glow before brewing this wonderful ale under their autumn fire. Gentle amber malt blend smooth caramel notes, gently lapping against a shore of distant forgotten spice. A beer to sip, contemplate and enjoy.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d7b758f8d63e4ea5bb570f1173fd0730', 'bef9879a815742129bf0170786802743', '4fcd53c380e347edb1ca81489b03f902', '9c1a2d4cc8c24098a491c7175afcb868', 'Dogtoberfest Octoberfest', 5, 0, 0, 0, '', 'Dogtoberfest are shrouded in mystery, but scholars think it has everything to do with an insane German king and a crazed Oompah band. You can read the full historical record of Dogtoberfest at FlyingDogAles.com. Dogtoberfest is deep mahogany in color with an intriguing caramel finish and brewed with 100% imported German ingredients for a true German flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d7c19dd5c383444480a7a573f50f19c3', 'f4b481b5e94045ef96e5f836e2ff6a7b', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Paris-Roubaix Pale Ale', 5, 0, 0, 0, '', 'Named after one of the longest running bicycle races in France and aptly nicknamed \"The Hell Of The North\", the Paris-Roubaix has been held every April since 1915. This Pale Ale is brewed with Belgian and German malts and bittered with 3 different American hops for a pleasing balance.');
