INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d8d5e557e2504e9ba1537923475635a9', '20f5693ca80c4c74a422a9dfa988e9a6', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Dry Hopped St. Rogue Red Ale', 5, 0, 0, 0, '', 'The Malt Advocate described Saint Rogue Red as \"An ale with great character and plenty of hops to satisfy. Full aromatic punch of caramel, citrus fruit and melon, with underlying fresh earth tones. Sweet caramel notes up front are quickly taken over by an array of fruit and hops bitterness that lingers into the night. A more adventurous ale than most.\"\r\n\r\nReddish copper in color, a roasty malt flavor with a hoppy sprucy finish. Saint Rogue Red is made with two-row Harrington, Klages and Munich malts, along with Hugh Baird 30-37, 13-17 Carastan, and Crystal 70-80 malts (44.4% speciality grains .39 lbs grain per bottle); Chinook and Centennial hops. Saint Rogue Red is available in a 22-ounce bottle, 12-ounce 6-pack (new for 2005), and on draft. Saint Rogue Red Dry Hopped-a draft only variation with raw Centennial hops added to the keg, giving the beer an increased hop finish and intense hop aroma.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d8dd79131d8048c48529dbff106821c7', 'faae7cb2a01e4181b1360b956fe12868', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Vivant Tripel', 9, 0, 0, 0, '', 'A classic golden ale, with subtle esters of banana and bubblegum. This beer pours with a creamy head and ends with a sweetness of light Belgian candi sugars. Our brewmaster aged this ale for an extended period to round out the flavors. A great traditional Belgian brew. ');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d8ef130cd68f4f90a3c5950bc1ae87fe', 'c5bb8c84d73946c28befc136bf7963d4', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Harpoon UFO Hefeweizen', 4, 0, 0, 0, '', 'From Harpoon''s site:\r\n\r\n\"UFO Hefeweizen is an American unfiltered wheat beer.  Perhaps UFOâ€™s initial sensory perception is also its most prominent: a cloudy golden color and a dense, frothy head.  The yeast, which has not been filtered out, accounts for the cloudiness of UFO.  Wheat malt tends to create a larger head than barley malt, the cereal grain most often used in brewing.  When served in a traditional wheat beer glass with a lemon, UFO presents an appealing and distinctive visual image.\r\n\r\nThe aroma has a faint but clear citrus-like character.  This is produced by the special yeast and accounts for the Bavarian tradition of serving hefeweizens with a lemon.  The lemon accentuates the yeastâ€™s fruity, tart fragrance.  UFO has a soft mouthfeel and a refreshing, light body.  The wheat malts and subtle hopping give the beer a mild, delicate flavor.  UFO has a clean finish.  Unlike some imported hefeweizens, UFO does not have the spicy, tropical flavors typical of European-brewed style.\r\n\r\nThe overall character is a cloudy appearance with a citrus-like aroma, light body, and clean finish.  Serve with a lemon.\"');
