INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d9012449a6b44434a40031aa665f75a0', '20f5693ca80c4c74a422a9dfa988e9a6', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '45f372212a6948b7ba624c5c474c4b9b', 'Honey Cream Ale', 5, 0, 0, 0, '', 'Honey Cream Ale is fermented warm like traditional cream ales but features an added twist--wildflower honey from Oregon. Honey imparts a dry, refreshing character to the beer because it ferments almost completely. The honey comes from a beekeeper in Blodgett, a tiny town 20 miles east of Newport.\r\n\r\nRogues Honey Cream Ale is a light, smooth, medium bodied ale, with a creamy head, hints of honey and a crisp light finish. Brewed with two-row Harrington, Klages and Munich malts and Crystal hops. Discontined for distribution in late 2005, available on tap only at Rogue Ales Public Houses.');
