INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d94049f0b4334d968980d546d149010e', '226bc87deeea4f1fb202a68ed4c2ac81', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Railbender Ale', 6, 0, 0, 0, '', 'Erie, Pennsylvania was an important railroad hub in the midâ€“nineteenth century, the city being the site where three sets of track gauges met. Railbender Ale, Erie Brewing Co.â€™s flagship ale, named after the laborers who laid the railroad tracks is brewed with pride, strength and purity symbolic of Erieâ€™s historic railroadâ€™s and railroad workers. Railbender, a strong Scottish style ale smooth malt flavor and astonishing drinkability will have you \"Hopping on the train and riding off the rails.\" All Aboard!');
