INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d9c60b5d17974f1bb394276919709979', '3e2414b5e9dd44eea38038e5087da8dd', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Gouden Carolus Hopsinjoor', 8, 0, 0, 0, '', 'Gouden Carolus Hopsinjoor completes the taste pallet of the gamma Carolus-beers.  \r\n\r\n\"Hopsinjoor\" is a wordplay to for one thing the several hops which were used, and on the other hand the typical character of Mechelen of Gouden Carolus: the figure \"opsinjoor\" is intertwined with the history of Mechelen.  \r\n\r\n4 types of hops are used: Golding, Spalt, Hallertau and Saaz. These hops were fractioned at several times in the cooking process in order to keep a maximum of aroma.\r\n\r\nRegarding to taste we can say that the beer has a gentle, but nevertheless bitter aftertaste. Gold-yellow colour. Hoppy aroma.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('d9f9adb47ee548478583e00111bf94cc', '52f3cefa14f54331ba262b22f476f52c', '22710fa91bbf4454b94555720f6a33dd', '84bca21ce52244db83158e4971bd7866', 'Crabby Larry''s Irish Red Ale', 6, 0, 0, 0, '', 'Rich and smooth on the pallate this ale is a near perfect \"Irish Red\". A variety of hops, Mt. Hood, Liberty & Fuggles combined with some roasted barley make an agreeable brew.');
