INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('daa5fef07ec742a29cf7eb5c94565703', 'a5197ed517514f8fa66e3ad03627c21a', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Ipswich Harvest', 6, 0, 0, 0, '', 'Highly regarded among hop-lovers, our Harvest Ale is a balanced and flavorful autumnal offering, to be enjoyed during the cool, crisp days of fall. We use a darker Caramunich malt and just a touch of chocolate malt along with a blend of Warrior, Ahtanum, and Columbus hops.');
