INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('db1e737923914e36ac9ccdf2fd5ba6b3', '048f9156b40a469781e7e19d6321d6b5', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Samuel Adams Coastal Wheat', 5, 0, 0, 0, '', 'For our take on the classic hefeweizen style our search for unique ingredients led us to the Eureka and Lisbon varieties of lemon grown in three different regions of California.  These particular lemons added the perfect balance of citrus tartness and sweetness to accent the taste of the beer.  The spiciness of the Hallertau Mittelfruh and Spalt Spalter hops balance out the slightly sweet character of our breweryâ€™s own signature wheat malt, resulting in a crisp and refreshing wheat beer with a subtle lemon aroma and flavor.');
