INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('dd744bb2da3b4b22a5dfe1da59a296bd', '5d67eae726e743a8b01e413716761c64', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'KClinger''s Brown Ale', 0, 0, 0, 0, '', 'A brown ale brewed by Otto''s for KClinger''s Tavern in Hanover Pennsylvania.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('dd79e4d3500c4c9189b87a566a92c263', 'f743f04357824c41994f695c5034da14', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Scratch #15 2008', 6, 0, 0, 0, '', 'Scratch #15-2008 is our first collaborative beer in the Scratch series. We teamed up with St. Thomas Roasters of Linglestown to create a Double Espresso Oatmeal Stout.\r\n\r\nThe double in the name refers to the espresso (not the alcohol). Scratch #15â€™s espresso blend is a medium city-type roast featuring beans from three continents. St. Thomas Roasters roasted and ground the beans; we used them in our hopback. At the end of the boil the hot wort passed through the espresso beans to give a lush coffee espresso nose and hints of coffee flavor.\r\n\r\nChocolate, roasted and caramel malt flavors stand out, while the addition of oats gives Scratch #15 a full, round mouth feel. Galena and Ken Goldings hops are added to balance the overall flavor and not drive up the bitterness. The head retention diminishes quickly because of the oils from the espresso beans.');
