INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('dddf62983b0a46cfa1350dbf2f54189e', 'cdafaf89b3d14193a41c9a2be4b2b29d', '98b7246d5e1b4592b15adced83ab36d0', '1c20aafad8964ed4a7626ef53934000a', 'Bachelor Bitter', 5, 0, 0, 0, '', '\"The Traditional British Pint\" lives on at Deschutes Brewery & Public House.  One of the original three packaged beers, it is still available year-round, but only at our pub.  Coppery in color and robust in flavor, Bachelor Bitter will leave your taste buds humming. Galena, Willamette and Kent Golding hops create fantastic hop bitterness, aroma and flavor.\r\n\r\nBachelor Bitter also kicked off the Bond Street Series that launched in April 2005.  The Bond Street Series is a specialty line of beers available in 22-ounce bottles.');
