INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('de551009e7dc464692e4da86b9803336', '8be478aaefc14c988bbd984ecccaf677', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Yuengling Bock Beer', 0, 0, 0, 0, '', 'In celebration of our 180th Anniversary year, the marketplace will see one of the first seasonal offerings from the Yuengling Brewery in many years. Yuengling has produced a Bock Beer in its long and storied past, and we have now reinvented that product for limited release in 2009. The new brew is dark brown in color and offers exceptional flavor that lives up to the quality Yuengling drinkers have grown to expect.\r\n\r\nYuengling Bock Beer will be offered in Â½ barrels only, beginning in late February and lasting for approximately 8-10 weeks. Letâ€™s all raise a pint of Yuengling Bock and celebrate the 180th Anniversary year!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('de5a9909a84f434f8fcf68191d5e151e', '315e41e96219473c864499efdf540db8', '98b7246d5e1b4592b15adced83ab36d0', '0b415ebb506c40848abff3554116e055', 'St Patrick''s Ale', 6, 0, 0, 0, '', 'A deep copper coloured traditional Irish Ale with highly developed and complex flavours. St Patrickâ€™s Ale/Dark is brewed with four malts and two hops, carefully married together to complement eachother producing a satisfying full flavour, ending with a Styrian late hop for a truly brilliant finish.');
