INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('deeb2cf0d1844418997cafd56c3b2135', '06f1c8a9bb74470981730c2969378ee8', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Stone IPA', 6, 0, 0, 0, '', 'An \"India Pale Ale\" by definition is highly hopped and high in alcohol (ours is 6.9% alc./vol.).\r\n\r\nMedium Bodied Refreshing Ale\r\nLight-medium malt character with a heavy dose of over the top hops! Two full weeks of \"dry hopping\" give this beer its abundant hop aroma and crisp hop flavor.');
