INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('df4dfcdeedad4691a838322d8a330046', '74edc26599b04f5a944a8b5acbd629ba', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Widmer W''08', 4, 0, 0, 0, '', '\"Our Brewmasters'' Release - The three different red, caramelized, and dark wheat malts give this beer an intense red color that runs as deep as the flavor. The toasted grain flavors blend perfectly with the subtle spiciness of the hops just as the entirety fades to a smooth quick finish. 2007 Great American Beer Festival Silver Medal Award Winner.\"\r\n-Widmer Brothers Brewing Company');
