INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('df85f12aa90f4782bdb6c18210cd0eab', '5262f32355ce45fc9066eb80e31b02af', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'b54082ab47e6498e9eebc1f15232fd53', 'Young''s Winter Warmer', 5, 0, 0, 0, '', 'The definitive winter beer and a longtime favourite, Winter Warmer has been making annual appearances on the bar every winter since the 1950s. A rich, ruby-coloured beer, luscious and fullbodied, with a splendid nutty flavour.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('df8b9a18db3a409caa5c8bf5e70300b8', 'e36fab1869c74ca0a9a0970da2b17d9f', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Frambozen', 0, 0, 0, 0, '', 'A ruby-red raspberry beer with a luscious, pink head\r\n\r\nOur Frambozen is inspired by the centuries old Belgian tradition of brewing beer with raspberries. This high gravity brew undergoes a slow second fermentation with tons of fresh, whole Fraser Valley raspberries. The result is a ruby-red fruit beer with a intense raspberry flavour, a nice tart finish and a luscious pink head.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('dfab48f034ce4866a236a6eb7d63f7b7', '0560596b78e94a608ef22b5781208781', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Staggering Elk', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('dfc8874cf49045158986c3c84823083f', '3ea52bb63339477f8f509a4e488938b0', '22710fa91bbf4454b94555720f6a33dd', '84bca21ce52244db83158e4971bd7866', 'Thomas Hooker Irish Red Ale', 5, 0, 0, 0, '', 'Thomas Hooker''s traditional Irish-Style Red Ale gets its warm, ruby color from an interesting blend of pale, caramel and roasted malts which promote a sweetness that''s balanced with crisp, authentic, English-style hops. A very unique and drinkable red ale that''s also favored by amber lovers.\r\nHooker Irish Red is drinks well year-round, not just on St. Paddy''s day.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('dfce5714564b4bf5b5ac16c5b488cc25', '7f68d4a34b094726b0846ba8197a0a85', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Henry Hudson IPA', 0, 0, 0, 0, '', '');
