INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('dfeee3b1af0440a4aca99022e288944a', '5d67eae726e743a8b01e413716761c64', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Otto''s Hefeweizen', 7, 0, 0, 0, '', 'A south German style wheat ale. This beer is served traditionally cloudy due to the suspended yeast (hefe=yeast). Strong spicy clove flavors and light banana esters are characteristics of a different yeast strain we are trying.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('dffc1e1e01a64b75a7aa43ddd2cc807e', 'f6b4fa787e0a43418b88dcf6cf75b5ab', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Hefeweizen', 5, 0, 0, 0, '', 'This is a Bavarian ale which uses 51% wheat malt in the recipe. Very low bitterness. It is unfiltered so the characteristic cloudiness is achieved. The haze comes from suspended yeast. Hefe-Weizen literally means \"yeast-wheat.\" The aroma is reminiscent of cloves and banana and is put out by the yeast. While some of this aroma carries over to the flavor, the dominant flavor is the malty wheat. \r\n\r\nAlcohol content approximately 5.0% by volume (ALWAYS ON TAP!!)');
