INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e174c83eb0824003bfa8e3b49d04889e', '591bfe5c4b0e4d5080899337cfc7a22b', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Old Rasputin Russian Imperial Stout', 9, 0, 0, 0, '', 'Produced in the tradition of 18th Century English brewers who supplied the court of Russia''s Catherine the Great, Old Rasputin seems to develop a cult following wherever it goes. It''s a rich, intense brew with big complex flavors and a warming finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e17a5c7ada7346949c9734e7812d65ce', '4b0c089531be426a9c7a37b5ceba7154', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Bube''s Brown Ale', 0, 0, 0, 0, '', 'Another one of our first recipes, which we have improved with experience. This ale is pleasantly malty with nutty and toffee like undertones. East Kent Golding hops were used to compliment this English style ale.');
