INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e23c165b9aae4d8180190a4decbce00c', '8d00850620d14a638c75e5979a64ffed', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Susquehanna Oatmeal Stout', 6, 0, 0, 0, '', 'A big, burly Oatmeal Stout full of chocolate, caramelized malt and coffee flavors. This stout has a rich mouthfeel and a smooth, roasty finish.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e244b42e12b1448e9d4812dce8df005e', '20f5693ca80c4c74a422a9dfa988e9a6', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Issaquah Bullfrog Ale', 0, 0, 0, 0, '', 'An American style wheat beer and an Issaquah Brewhouse origina. Light in color and body and served with a lemon, Bullfrog is crisp, refreshing and goes down easy. Take a flying leap!\r\n\r\nBullfrog Ale took the Silver Medal at the 2004 Great American Beer Festival in the American Wheat category.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e24b568d46604c2a9d37ed82e9b66bfa', 'a01e65ccdcb747ef8232727ac0878bc1', '4fcd53c380e347edb1ca81489b03f902', '2a6b815eb1624f47b33d1c5a753e5bd6', 'Baron Schwarzbier', 4, 0, 0, 0, '', 'The Baron Schwarzbier is a classic German black lager, deep black with ruby and brown highlights. At first the Schwarzbier starts with a slight roasty nose and taste, followed by a faint chocolate-malty body with a very crisp, clean, lagered finish. Lagered for an average of 10-12 weeks to provide a very smooth, easy drinking Schwarzbier with full flavor provided by the dark malts. \r\n\r\nAll ingredients for the beer are imported from Germany. Brewed in accordance to the German Beer Purity Law (Reinheitsgebot) of 1516.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e258d8f6741f47cab6db5a6915593114', 'ddf86b22ce3149be9fff402436ad70d0', 'b7ee8858a0b549ddb2361e1ed313f6e1', '2747adf8980546318186100ea198dbcb', 'Pater 6', 6, 0, 0, 0, '', 'This name became a reference. This beer is mostly pointed out with its product name: â€œa Paterkeâ€. \r\n\r\nThis â€œPaterkeâ€ is a chestnut coloured dark beer with a high fermentation (6.7 alcohol content) and a full taste.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e258e7f14ee844ebb12b7fa678607b46', 'acab7f058e4240c48cc2af1c33bc4aff', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Miss Liberty Lager', 0, 0, 0, 0, '', 'This beer is an all-malt lager, brewed with a subtle blend of German hops. Cool fermentation, followed by extended aging, produces a delicate and mild flavor.');
