INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e25d64ed5f9a4551a5e502fd81e62660', '20f5693ca80c4c74a422a9dfa988e9a6', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Youngers Special Bitter', 0, 0, 0, 0, '', 'Our original Rogue Ale, Youngers Special Bitter (affectionately nicknamed YSB) is a classic English Special Bitter named after Bill Younger of the infamous Horse Brass Pub in Portland, Oregon. The Malt Advocate described Youngers Special Bitter as \"rich and flavorful. A triad of caramel maltiness, fruitiness (apricots?), and hop bitterness in aroma and flavor. A fuller malt foundation than some other pale ales, with some background spiciness. Dry, hoppy finish.\" In the SouthWest Brewing News, Feb/March 1994 issue, George Fix wrote \"A strong case could be made for Rogue Ale being included among the top 5 ales brewed in the US.\"\r\n\r\nYSB is amber in color with a mild hoppy finish. Brewed with a blend of 2-row Harrington and Crystal malts, Willamette and East Kent Golding hops. YSB is available in the classic 22-ounce seriograph bottle (the 12-ounce 6-pack was phased out in early 2005), and on draft.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e26a84aa8d2d44608262e9e34475ca43', '8fe138cfca1a434ca239e2a92a982432', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Doubledecker Doppelbock', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e271d8ef75924108b50a1ceef7583657', 'a80536799be04ad3b3db00f8dbd95335', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Big Dick''s Olde Ale', 8, 0, 0, 0, '', 'Somewhat of a cousin to Barleywine, Big Dickâ€™s is a classic English-style Olde Ale.  Sweet and full-bodied malt flavors are complemented by a fragrant but mild hop bitterness.  Sweet, bready malt aromas combine with rich flavors of dark fruit, brown sugar, caramel, and sweet nuts. A beer for keeping, Big Dickâ€™s Olde Ale will age gracefully, while fruity flavors continue to develop and bitterness will subside.\r\n\r\nThis is not only a BIG beer, it is a Well-Endowed Ale!  We took a traditional English-style Ale and made it our own.  Delightful on its own or as a digestif with a full-bodied cigar, Big Dickâ€™s is also big enough to stand up to many boldly-flavored foods.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e288da9c7e3d441abb8569a1b7864e33', '226bc87deeea4f1fb202a68ed4c2ac81', 'bf3112301857461f82c7633c0a695896', '98950448f00e4eb7b81ed9628258d643', 'Heritage Alt Beer', 5, 0, 0, 0, '', 'Erie Brewing Co. Heritage Alt Beer - a classic, old style dark German ale possessing a subtle hint of roasted and chocolate malt flavor, with a smooth balanced finish. Erie Brewing first brewed this annually for the Erie German Heritage Festival. Erie Brewingâ€™s Heritage Alt Beer popularity lead this beer from a commemorative beer for the festival to a complete packaged seasonal release for all to enjoy, whether you are of German Heritage or not. Prost!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e28aeb99c6c74f74b4a30c929accd713', 'c9341a5d916d4b2c8b9cf8de2bc825c0', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Hop Daddy IPA', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e28d96d8f9a14e098d3ddc318cdeb2fa', 'b2f2a876df4b4a0685b89d50828c8ff7', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Big Hop IPA', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e2b03690d5174ee3ad6d8a81834a1159', '8ebc7c91e7814fc6aa6a1eeb1b53ccdd', '98b7246d5e1b4592b15adced83ab36d0', '1c20aafad8964ed4a7626ef53934000a', '2008 Culture Beer', 5, 0, 0, 0, '', 'A full, clean and refreshing pale coloured bitter with an abundance of citrus hop character created by the blend of dry and late hopping techniques.\n\nIt also has subtle hints of malt and fruit on aroma and palate which gives the beer a well rounded balance.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e2b73e71f6b5420dad405f989158295f', '7c70d976efd54727964d3a376509823a', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Highland Scottish Ale', 0, 0, 0, 0, '', 'While hugely popular in Scotland, this style of beer escapes most North Americans. Designed and brewed by the Scottish punk rocker David â€œMaltyâ€ Macanulty, this creamy, nutty, malty, dark ale is true to its origins. David drives James crazy over this beer, insisting on rigid fermentation temperatures, traditional mild hops for bittering, and even some weird caramelizing ritual as the kettle is being filled. The beer continues to undergo subtle evolutionary changes because the stubborn Scottish bastard will never be satisfied.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e2c0355a8d7745e9bd203ca7f1c7b10e', '09b2422ece59461c8358d35fd64b79ed', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Blind Side Pale Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e2d35386a05040b7a1ed9d5ceb90fd5f', '32629f72e41245c7b98912e872917b62', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Lager Beer', 5, 0, 0, 0, '', 'As refreshingly crisp as a morning swim in a Great Lake, this brew is crafted with Pils and Munich malts. The pronounced hop character of this golden lager sparks thoughts of sandy beaches and rocky islands.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e2ffb6b5afba48179c54dd2d97ad11f2', '05223694cd774914a6c590a31e748ea7', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Krystal Weizen', 4, 0, 0, 0, '', '');
