INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e30e3f64ff50449db6c422b9ccca559b', '3bfccf92b0934a688877be8a75cd6f7d', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Brasserie de Brunehaut Bio BiÃ¨re Blanche (Organic)', 5, 0, 0, 0, '', 'A classic Belgian ''white beer'' from the Hainaut region in the southwest Belgium, near the French border. Top-fermented and bottle-conditioned, this is a clean, refreshing regional ''artisan'' beer.\r\nPresents a light hazy yellow colour with citrus and coriander aromas and fairly subtle malt and hops on the palate. The finish is dry and satisfying. Hazy yellow golden colour. Lemon custard, lime zest, and delicate spice melange aromas. Well-balanced, a frothy entry leads to a dryish medium body of nuts, baked oranges, and slightly phenolic mineral flavors. Finishes with a metallic ore dust, salt, and dried lemon fade. This beer is certified as organic.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e312614a90c04dd6bddbadeebe3c91fb', 'fd2cd4c2ec3e4c59b7917eba87951c39', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'e2617cdeed8f4eb69e01c49f84dd8000', 'Founders Black Rye', 6, 0, 0, 0, '', 'This beer will surprise you with a big hop flavor and a toasty sweet aroma. Pours black from the chocolate and de-bitterized black rye malts. This ale is medium bodied and is well flavored with hints of toffee, nutty undertones and a dry crisp finish.');
