INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e382294b14d9456f8322763ccdec8f4c', '315e41e96219473c864499efdf540db8', '98b7246d5e1b4592b15adced83ab36d0', '0b415ebb506c40848abff3554116e055', 'Barelegs Brew', 4, 0, 0, 0, '', 'Golden with a hint of red (towards sunset). Barelegs tastes of fresh fruit, especially red current and malt fragrance. Full drinking with a subtle hoppy finish. Refreshing for a beer of this strength.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e38a81102be44bc5bb6cf6b85369c00a', 'abe493cb583c405abfc022406c34cee4', '98b7246d5e1b4592b15adced83ab36d0', 'c3e1d5ab0a8a49989877e8de89189cfd', 'Snow Cap', 6, 0, 0, 0, '', 'A rich, full-bodied winter warmer crafted in the British tradition of holiday beers. This deep mahogany colored brew balances complex fruit flavors with a refreshingly smooth texture, making Snow Cap a highly drinkable and desirable cold weather companion.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e39b6d40535d4f03888f16ce20094341', '7ed9d852e7ad4389b0a373f11297e9b9', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Oatmeal Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e3abf3e869504f5d824c2ca6d973770c', '2dc4ecd978944c7f87c9f8fdef8b798e', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Red Sky at Night', 7, 0, 0, 0, '', 'This beer is brewed in the Belgian Saison style (country farm house ale). A potent yet delicate ale, brewed with a unique Belgian yeast which develops a spicy, fruity flavor. Enormously complex. Available from May to around August.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e3befdc3ce784fb08be29b7821c2b737', '894593f13916499cb1c6f6f3a5fb3e69', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Russian River IPA', 6, 0, 0, 0, '', 'An abundance of hops and malt are added to our IPA to create and preserve its distinctive flavors. Not only do we use generous portions of hops in the kettle, but we also dry hop this ale for one week after fermentation. The dry hopping process adds to this beer''s floral and citrus aroma. This is truly a tasty adult beverage!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e3ca481ad4b6459eb176ece00dcbb31f', 'df3cc6f9b0e34daea76b844af935a87c', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'a9041ef23ff14bb79f45686f562bb2c6', 'Spiced Pumpkin Ale', 5, 0, 0, 0, '', 'Brewed with summer''s harvest of pumpkin, squash, honey, ginger, and love of great beers.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e3ece61aadbf4d14bf3832830afa725d', 'd45c85fe110c4911b17c5203df2246f2', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'St. Boisterous Hellerbock', 7, 0, 0, 0, '', 'A full-bodied lager beer of exuberant and robust character. Itâ€™s muscle-man body comes from decocted German malts and noble German hops. Lagered long and cold to refine its strong temperament, St. Boisterous emerges smooth and seductive, with a malty sweet charm. This classic rendition of the German â€˜maibock'' style will warm your heart.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e3f9956e19c04da1bcecbcc8972c7503', '77ae58bf8cde4f85ab8b274e3a51f6a9', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Sticke', 6, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e42b7e7320c148a2b9e49a70caf6ee13', '839540dd5a234b39ad853696dc027d8d', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'Geist Bock', 6, 0, 0, 0, '', 'This is one of our rare lagers brewed in the style of the German Heiliges Geist Bock, or Holy Ghost Bock. The name refers to the lighter nature of the beer as opposed to the darker and heavier Doppel Bock and Mai Bock also brewed during the spring in Germany. There is a rich malt flavor, a firm German style lager head, and a clean lagered finish to this beer.  Available on draft or in 12 oz. bottles.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e4469cbf10de4802b1a9fd8ee8ee105d', '7123fd66e4d449398b852c3bdaf84fb4', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber Daze', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e466ee639c684be79f3f4a012825b77f', 'f53af8f6384749bc968e80afacff7ef7', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '45f372212a6948b7ba624c5c474c4b9b', 'Sweet Action', 5, 0, 0, 0, '', 'Our most basic interpretation of what makes beer great -- sweetness from the barley malt and active spice from the hops. It is hazy golden in color, with a sweet honey aroma, and a dry, crisp flavor');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e4701f54d34d43e48022e535247b5a36', 'db2ec8868ac049959975ee3322bc38a9', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', '77 Lager', 4, 0, 0, 0, '', 'A Lager that actually tastes of something?\r\n\r\nYou have to be kidding, right?\r\n\r\n77 lager is made with 100% malt and whole leaf hops.\r\n\r\nIt contains no preservatives, additives, cheap substitutes or any other junk.\r\n\r\nMaybe we are crazy. So what?\r\n\r\nTaste 77 Lager and we are pretty sure you will agree that the fine line between genius and insanity has just become a little more blurred.');
