INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e52e276c305040938a494bbe1ee24d11', 'd5b27251496640ba84e3b912888dd0fa', '98b7246d5e1b4592b15adced83ab36d0', '0a4bb7119e2f41faa7b40acf63b2e0c6', 'Coopers Mild Ale', 3, 0, 0, 0, '', 'This ale is the product of brewing with a selection of barley and wheat malt, and with no added sugar. This traditional brewing approach provides the smooth malt character which is balanced by a triple hopping of the brew with Pride of Ringwood and Saaz hops. The brew has fermented similarly to its stablemates Pale and Sparkling Ale, with the customary secondary fermentation in the bottle and can.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e54035fced0c408f8cac6f977fa0601b', '6373fec6e4d84db5ae7c64f6230502ce', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', '3767 Belgian-style IPA with Brett', 8, 0, 0, 0, '', 'The extensive distance between two breweries on the West Coast â€“ 3767 miles â€“ is bridged by this collaboration beer. Brewers Gabe Fletcher of Midnight Sun Brewing Company [Anchorage, AK] and Colby Chandler of Ballast Point Brewing Company [San Diego, CA] designed and brewed an exciting representation of their passions: hops, Belgian yeast, oak aging and Brettanomyces. \r\n\r\nJust prior to the Great Alaska Beer & Barley Wine Fest in JAN 2009, Gabe and Colby brewed a West Coast-worthy IPA at Midnight Sun Brewing Company. This hop-centric beer became the jumping-off point for other intense flavors. During its course to completion, 3767 was affected by three different yeast strains--including Brettanomyces, aged for several months in French oak Cabernet Sauvignon barrels, and then bottle- and keg-conditioned. \r\nThe plan is for 3767 to hit Anchorage, Seattle, Portland, San Francisco and San Diego in NOV 2009 for a West Coast Toast. Hereâ€™s to the collaborative spirit readily found in our brewing industry. Clink!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e5542ec299d54065a27bab795e29d0b8', 'b452dfcf8ed940cf8d6a6a662bf7c675', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Marshal Zhukov''s Imperial Stout', 11, 0, 0, 0, '', 'This Russian Imperial Stout is dedicated to Gregory Zhukov. Arguably one of World War II''s finest generals and a man bold enough to appreciate the rich, complex flavors of a beer brewed to fortify a body through the Russian winter. Like military geniuses, Russian Imperial Stouts reach their peak with a little age on them, so we release Marshal Zhukov''s Russian Imperial Stout in sweltering August so that it will be at peak flavor come January or February.\r\n\r\nOpaque black in color, the aroma has notes of espresso, chocolate, dark sweet toffee with hints of black strap molasses. The flavor starts with an unsweetened chocolate character and supporting notes of herbal dryness from English hop varietals. It then moves into dark toffee sweetness and closes with a slap of roasty espresso. Zhukov''s Imperial Stout pairs well with Mushroom Solyanka, dark chocolate, cherries and ground wars in Russia.  Enjoy, comrade.');
