INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e59049b9831147528046254aaf8bb015', '04ddc6e0bc4b4a7eb1140b3b1c7286be', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Richbrau Oatmeal Stout', 5, 0, 0, 0, '', 'If you donâ€™t do dark beers, do yourself a favor and cancel that policy for this Oatmeal Stout. Keywords: Sweet Lusciousness; Roasty chocolate. Served on a nitro tap.');
