INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e5ac98cb01414e0e9daa3888ffd37bb3', '8d3514a76812429cbe44de5ab7e26dfe', 'e315bd61d4f94ab3a67b28feec8a5343', '4a3785e947ef4c4d9f8d972ce28b428c', 'King Lager', 5, 0, 0, 0, '', 'King Lager is brewed to an all Australian full strength formula in Germany, by the Giessener Brauhaus who have over 100 years of brewing knowledge. Made 100% naturally, King Lager complies with the strict German Purity Law of 1516 resulting in a superior tasting lager of world standing.\r\n\r\nOnly the highest quality barley malt, hops, water and yeast, have been combined to give King Lager its unique malt character and crisp, distinctive taste.\r\n\r\nThe sophisticated King Lager packaging reflects the quality of this exceptional, full flavoured beer. The sleek, contoured bottle, stylish 4 pack design and premium labelling makes this lager stand out amongst the best in any environment. \r\n\r\nKing Lager is full strength with 5.2% alc/vol, 20 beers to a case and 375ml of classic, crisp, clean beer in every bottle.\r\n\r\nMake your move now to King Lager â€“ itâ€™s world class');
