INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e6918d0b5eb948aaafcafc2ec8d2bac2', '6533462e9e774e57b9f5732311d0b734', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Pennypacker Porter', 5, 0, 0, 0, '', 'This full-bodied dry cousin of the stout has a slight roast flavor and is dark brown in color with a red hue. This is Londonâ€™s classic beer style named for the baggage carriers that appreciated it so much.\r\nGovernor Pennypacker was one of Pennsylvaniaâ€™s more notable politicians. He oversaw the construction and held the lavish ceremonies designating the opening of the Commonwealthâ€™s beautiful Capitol Building');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e69193f2bf144147a3fce079dd8d00b3', '9564cd9b51624e26886fcd971c2402c9', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Pau Hana Porter', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e699296d396c4514bf0342ef4f78af5c', 'f743f04357824c41994f695c5034da14', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Sunshine Pils', 5, 0, 0, 0, '', 'Hop fans rejoice! Sunshine Pils combines the crisp taste of European style pilsners with a kicked-up hop character to create a balanced, refreshing seasonal beer. Golden in color with a fluffy white head, Sunshine Pils is the perfect beer for Summer.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e69ce9e89f6a4dcdaaf575999124842e', '5bafddb45bee47eda6da50325994331d', 'e64b30f392b4437b82ec46e764453ac1', '422232dfe5f7475cb4568f35a3b2c5e8', 'Fat City Ale', 4, 0, 0, 0, '', 'Fat City Ale is the newest release from Valley Brewing Company. Fat City Ale is produced using only the finest 2-Row Barley and fresh Hops resulting in a crisp and refreshing flavor.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e6a09eecbf64424281f1bd696b961510', 'aa363aead2c24dc2b0a9553679a2fc70', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Furious Beer', 6, 0, 0, 0, '', 'Like Hops? You''ll like this fire-hued beer. This is the beer I have always dreamed of making. This is the beer that would come to mind while spending the last two years tearing down walls, hanging sheetrock, moving kegs, power washing the ceilings, arguing with various agencies, and cutting the water main. \r\n\r\nWithout Golden Promise malt, made by family-owned Simpsons Malt, Furious would just be pissed off-ed. From Scotland, this malt is still produced in the tradition of turning over the barley by hand, resulting in a malt that is unsurpassed in its quality. Golden Promise is also used extensively by premium whisky distilleries such as The Macallan. This malt provides the backbone for the intense hop character. Four American hop varieties are used at a rate of over three pounds per barrel. The result is a rich malt sweetness infused with bright hop flavor and aroma from beginning to end. Oh yeah, it''s about 6% alcohol and around 100 IBUs.');
