INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e8beaa99867740eda711516ea81a754e', '3c1a29f6db284abda8d558a43582ba35', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'NÃ¸gne Ã˜ Saison', 6, 0, 0, 0, '', 'One of our most refreshing brews, made for those hot summer days, but satisfying year ''round. Recommended serving temperature 8Â°C/45Â°F. Goes well with seafood, particularly oysters.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e8c1f9288b984037a8a120fe42d097ef', 'b0306323e98a4a9da9a8f0bc539a2072', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Wilderness Wheat', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e8c6884068fc4d6a9bf367c5fca64c4d', 'fe8b93522d9648bda4e0a9e3d05a1cf2', '98b7246d5e1b4592b15adced83ab36d0', 'd2c18f9327c84b65b20dd57ceb6e7211', 'Iron Horse Oatmeal Stout', 0, 0, 0, 0, '', 'One of these beers is available all of the time. Our heartiest beers emphasize roasted malts and the generous use of hops. Creamy, smooth and always nitrogenated, these beers are nearly a meal or a dessert in themselves.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e8d048c9df134e6f83332e80af271115', '245e62fe2e37417ead2510318f1ae758', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Fuller''s ESB', 4, 0, 0, 0, '', 'ESB was launched into the Fuller''s family in 1971, as a winter brew to replace a beer named Old Burton Extra. The potential of the beer was soon realised and ESB was installed as a permanent fixture, creating an immediate impact. \r\n\r\nNot only was it one of the strongest regularly brewed draught beers in the country (at 5.5% ABV), it was also one of the tastiest, and as the awareness of the beer grew, so did its popularity. ESB''s reputation was soon enhanced after being named CAMRA''s (Campaign for Real Ale) Beer of the Year in 1978, and the beer has not stopped winning since! \r\n\r\nWith three CAMRA Beer of the Year awards, two World Champion Beer awards, and numerous other gold medals to speak of, ESB is, quite simply, the Champion Ale.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('e8da91fc6b444fc19cafc13329d0461c', 'b0306323e98a4a9da9a8f0bc539a2072', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Smoke Jump Stout', 0, 0, 0, 0, '', '');
