INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eaf5dd75d003450e9ff42ba575c18e9e', '83cf32c1ec0e46659fae84410474bd9b', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Special Amber Lager', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eb21d15267df401e97e151cf8c922bc1', 'ea4c78c86a144184ade4af610c94417a', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Hop Explosion', 7, 0, 0, 0, '', 'Hoppiest Brew Works beer ever? The smell of grapefruit, a sweet malt flavor, and oh by the way, lots of hop bitterness. Brewed in the tradition of West Coast ales, we have put loads of malt and hops in our kettle to come up with this sensational ale. Brewed with pale, and crystal malts, hopped with Tomahawks for Yakima Valley, WA. This beer styled has made many a microbrewery famous and this one is sure to please all those who love hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eaf9e0fc32b64957a274f72935b418a0', '41e6981906da452f81ca52289fc44dd0', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'Downtown Brown', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eafe3029753e4c5ebd1a22f55318c0d0', 'cdafaf89b3d14193a41c9a2be4b2b29d', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Black Butte Porter', 5, 0, 0, 0, '', 'Towering high above Central Oregon, jetting into clear blue skies, Black Butte can be seen for miles.  From its base flows the legendary Metolius River--with its source hidden deep beneath ancient lava flows. \r\n\r\nBlack Butte Porter, crafted from chocolate and crystal malts, is Deschutes Breweryâ€™s flagship brand.  With a rich and distinctive flavor, this porter has enjoyed a loyal and passionate following since its first pint in 1988.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eb00706ee87c4e8a939d2f3238ee4217', '8788e692080745fb8e823bb61ca74a1e', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Schlafly Oatmeal Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eb1a4448a61e45a5aa6b22c899b65353', '20449aa8dd9543378d3ec6db20bce7de', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', '1916 Irish Stout', 3, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eb26d1691e264214a5c3ec081d256539', '343412b7c5de4ce5ac21dc63166abbdf', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Captin Lawrence Pale Ale', 5, 0, 0, 0, '', 'One of the first beers I brewed after moving out to California to begin my brewing education was a Pale Ale. This version is a true testament to the influences the Wild West had on my early brewing. My Pale Ale is loaded with US-grown Cascade, Crystal, and Columbus hops, so be sure to take a good sniff to enjoy their robust aromas before taking your first sip.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eb2ab57e1d324e6a9f12eb731e4b4f1f', '27f2fd76054546ab995143f1705971b9', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '6acfdaabfaa94edd8240114d1c382d92', 'Exit 11 - Hoppy American Wheat', 6, 0, 0, 0, '', 'Exit 11 Hoppy American Wheat Ale is the second in their wildly popular Exit Series of Big Bottle Beers. Exit 11 is a confluence of styles and ingredients, just as Exit 11 is the point in New Jersey where the Garden State Parkway, the New Jersey Turnpike and several other highways come together.\r\n\r\nâ€œExit 11 is the point on the Turnpike where the Garden State Parkway branches off and takes hundreds of thousands of travelers to the renowned Jersey Shore,â€ says Flying Fish Founder Gene Muller.  â€œOur Exit 11 Wheat Ale is a fresh, citrus-y summer beer perfect for beachgoers and those who only wish they were headed â€˜downa shoreâ€™.â€\r\n\r\nExit 11 is an American-style wheat beer brewed with English ale yeast and three Pacific Northwest hops, Columbus, Palisade and Amarillo.  It is brewed with 50% Belgian pale malt and 50% white wheat, and is an ideal summer thirst quencher, with its bouquet of tangerines and apricots. Exit 11 is available only during this one-time release, and only until it sells out across New Jersey, Pennsylvania and Delaware.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eb4a024a4a084575a0017b06a2c301a9', '8a85a603f9754f4e99d70cfc7667389e', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Leinenkugel''s Sunset Wheat', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eba039371fdf4121a72a97b68a7fa13b', 'f0223b15ed9745829d8afefbb5989f25', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Pale Ale', 4, 25, 13, 0, 'image-side-beer-pale.png', 'APPEARANCE: Amber red, bright\nPROCESS: Classic English\nHOPS: East Kent Goldings (UK), Northdown (UK), Pilgrim (UK)\nMALTS: 2-Row and Caramel Malted Barley\nYEAST: London Ale\nOG: 11.2\nSRM: 13.5');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eba8b6a7f5e84b8ca7d4c64ab5133f2c', 'd45c85fe110c4911b17c5203df2246f2', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'V-Saison', 7, 0, 0, 0, '', 'Our latest release in the V Series of bottle conditioned, Belgian-inspired ales is heady with an earthy, aromatic hop start. Involving hops from the Czech Republic, Germany and England, this flavorful ale slides into flavors of honey and mildly tart fruit. Leaving a refreshing impression of  dryness, this is a quenching, invigorating ale, despite it substantial strength  at 7.5% abv.');
