INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ebfd8068b23348c5b996fbdb9d38a9eb', 'c4a7bf25df7f4f6ebdcde5cac3e77e2e', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'b54082ab47e6498e9eebc1f15232fd53', 'Michelob Winter''s Bourbon Cask Ale', 6, 0, 0, 0, '', 'During even the coldest of weather, warm up to the smooth, robust taste of our Winter''s Bourbon Cask Ale. Full of rich aromas that you find in the winter months, hints of vanilla and flavorful hops, this is a beer that is great for pouring into a large tulip glass and enjoying with friends around a fireplace.');
