INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ec2a6e971f1b4b288c266c1eceed8c3b', 'df3cc6f9b0e34daea76b844af935a87c', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Siberian Night Imperial Stout', 7, 0, 0, 0, '', 'Imperial Stouts are by far the \"GRAND - DADDY\" of all stouts. For those who demand flavor, this is the perfect libation.');
