INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ec3c8cad5ca246e097da9f4156885008', '11db376808e64df8bbcb94b3b4440a9d', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Chicken Killer Barley Wine', 10, 0, 0, 0, '', 'Chicken Killer Barley Wine is the revolutionary beer that will someday define America''s unique Barley Wine style. It is brewed with twice the ingredients of the Santa Fe Brewing Company''s other beers, and only half the usual amount of liquid is extracted from these ingredients. This makes one substantial beer. At over ten percent alcohol, Chicken Killer is actually as substantial as wine, but this is not to say that it is difficult to drink. On the contrary; be careful with this one. The flavors of the beer are at first as overwhelming as the intense Santa Fe sun. But in the same way our sun gives us the unrivaled brilliant colors of Santa Fe, the potency of Chicken Killer gives us the remarkable spectrum of flavors that can be found in no other beer, in no other city. If you did not have the opportunity to try last year''s vintage, come try this year''s!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ec4dab67c654490cb75b25dfd310eb65', 'c1be1b338f444aeb9f2cc0a55465773d', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'd01c4741043a4547ae78c9f205ee8728', 'Trappist Westvleteren 12', 11, 0, 0, 0, '', 'This Belgian beer has an everlasting tast.  It has been choosen as the best beer in the world for several years!');
