INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ec9d627845974188800b94b8ee28784a', '498f96a6317944739b07d0ae1870762b', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Lectio Divina', 0, 0, 0, 0, '', 'Brewed in the spirit of the abbey ales of Belgium. Brewed with the same care and attention to the Art of Brewing that is practiced in the monastic breweries of Belgium.\r\n\r\nA Belgian inspired amber. This beer gets itâ€™s color from the candi sugar, as it is made without dark or crystal malts.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ecb829df7644497f957c054de99ed8fe', '5f280fa883124fac82d2c6c769d0e45e', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Wild Frog Wheat', 6, 0, 0, 0, '', 'Traditional German-style, unfiltered wheat beer, with a lively balanced flavor. Although no fruit or spices were used in the brewing, these flavors are created by fermentation with special yeast from the oldest brewery in the world. Try Wild Frog Wheat with a slice of orange for a crisp, refreshing experience');
