INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ecf5c0623e03419cb96a32173cf6b8bb', '3a09f973aa9a4b6bbfd27b54374bc96e', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Black Heart Stout', 6, 0, 0, 0, '', 'Generous portions of roasted barley, black and chocolate malts which leave \"coffee\" overtones lingering on the palate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ed025c2137d745b792e1d9d2085495be', '4f59d5e4604c4ea2ba6af9921ea40dc0', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Peacemaker Porter', 5, 0, 0, 0, '', 'A robust porter in style, a dark and full bodied ale with hints of roasted barley and flavors of coffee and bitter sweet chocolate on the palate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ed11416fcdf742589038f8774f7880b2', 'f516da86004b43d9a091d3186eeed1d5', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ed26ab43549e45d5b54e316d8fbccedb', 'f743f04357824c41994f695c5034da14', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Scratch #12 2008', 6, 0, 0, 0, '', 'In our never-ending pursuit of answering the burning question of whatâ€™s new, we present Scratch #12-2008, an IPA.\r\n \r\nThe IPA is a fickle beast; too much malt and you veer into a high-octane hopbomb, while too little hops can question a beerâ€™s virility. In these chaotic days of shrinking hop harvests, balance is key to a proper IPA. Scratch #12-2008 delivers an intense pine nose married with a subtle wildflower aroma. The Thames Valley yeast adds an earthy nod to traditional English IPAs, while the American hops provide a bold contrasting bitterness.\r\n \r\nBreath deep, relax, enjoy.');
