INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ed79cd155234488b9703dd273b72a68f', 'b452dfcf8ed940cf8d6a6a662bf7c675', 'b7ee8858a0b549ddb2361e1ed313f6e1', '31da65b6ec89487283b7110fcde7409f', 'Guava Grove Ale', 8, 0, 0, 0, '', 'Guava Grove is a Saison which is fermented with guava. The guava adds sweetness and acidity to the prodigious fruity esters imparted by the warm fermentation temperatures  of the Belgian yeast strain.');
