INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ee59c03888ac433598265753259fd7dc', '731b7a49baee4cccbe5db6c8e212c421', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Foggy Goggle Belgian White', 5, 0, 0, 0, '', 'FiftyFifty''s \"Wit\" beer, Foggy Goggle is a Belgian Style Wheat Beer, cousin of the German Hefeweizen. An unfiltered beer, Foggy Goggle is brewed true to style, using a yeast strain that originated in Belgium, with just a hint of orange peel, lemon peel, and chamomile. The appearance is an opaque yellow with a wonderfully fluffy head. The predominant aroma is citrus with a hint of coriander, and a unique spicy note. With citrus playing a big part of the flavor, Foggy Goggle is a very refreshing choice.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ee7cf3f56b874e0b830a8d42e196e871', 'da59c137d8cd45d88ce9bd667e25ad25', 'e64b30f392b4437b82ec46e764453ac1', 'f4d33f0818e94b35ab1a8de5937d1d45', 'Dank', 9, 0, 0, 0, '', 'Anniversary offering, Imperial Red. Heavily hopped and oak aged, very balanced. 12 oz. bottles; 4 pack. ABV: 9.2%');
