INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eef1de85895f410980f24bf0432ef974', '0024fad54e5e46279818191654813d1b', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'b54082ab47e6498e9eebc1f15232fd53', 'Hoppy Claus Holiday Ale', 7, 0, 0, 0, '', 'Our Holiday Ale is a â€œspecialâ€ version of our flagship product - Hoppy Faceâ„¢ Amber Ale; only bigger for you to enjoy during this holiday season!!! Characterized by its distinctive hop aroma and rich, ruby color, Hoppy Claus redefines the way you think about a holiday ale. Hoppy Claus uses only the finest two row malted barley, hops grown in the great Pacific Northwest, and some secret spices that we would love to tell you about; but are unable to do so. This combination results in a clean, crisp, and refreshingly unique hand-crafted experience. Hoppy Brewing Company has never used any artificial preservatives, flavors, or colors in any of its ales. The Hoppy label is your guarantee of purity.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eef5cda7295b432797540fc427a261ab', 'ddf86b22ce3149be9fff402436ad70d0', 'b7ee8858a0b549ddb2361e1ed313f6e1', '675420eca62b45ed949e91060a4b4891', 'Grotten Flemish Ale', 7, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eef5f3a01bfe4822978c32caee050f62', '048f9156b40a469781e7e19d6321d6b5', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Samuel Adams Hefeweizen', 0, 0, 0, 0, '', 'Unfiltered wheat ale, fruity, bright, with a crisp flavor of wheat.  Samuel Adams® Hefeweizen beer is a traditional spin on a classic American craft brewing style. The brewers of Samuel Adams® used both malted and unmalted wheat, and two row Pale barley for a clean malty, cereal note. This bright, fruity wheat ale is unfiltered, retaining a natural haze from malt proteins, crisp, bright flavors of wheat, and fresh, fruity ester complexity from our proprietary ale yeast. Accentuated with Noble Spalt-Spalter hops, Samuel Adams® Hefeweizen has an elegant and pleasant bitterness, finishing smooth and clean.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('eefa5266499c45a6a318654c56550fd7', '1f2e9a9f74864ea1988198606b3f6e85', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'King''s Peak Porter', 4, 0, 0, 0, '', 'King''s Peak Porter is deep mahogany in color and has a full-bodied malty flavor. Hints of chocolate malt are easily detectable.\r\n\r\nTopped with a tan creamy head, this beer has a definite hop character that nicely balances its mild bitterness. \r\n\r\nKing''s Peak is the highest point in the state of Utah at 13,528 feet, located in northeastern Utah in the Uinta Mountains.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ef0729718f3649eca13be4c3ce838fdb', '944cbc838d644592b1e2b5b997c0a2b2', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Odell Red Ale', 6, 0, 0, 0, '', 'The Rocky Mountain Goat is no ordinary goat. Just like Odell Red is no ordinary red. \r\n\r\nWe took the American-style red to a whole new level by adding a variety of aggressive American hopsâ€”giving this ale a distinctive fresh hop aroma and flavor. \r\n\r\nWe think you''ll agree this red has some serious kick.');
