INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ef47a7c076f042c4b3bc42e37d845db0', 'cfca1af4f3824c479d6ef72e06b1b2f2', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Hefeweizen', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ef4ae8de35b14c5186c0b12bc00af356', '470deed21c4a4e57b1eb4378dad85a76', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Wapiti Amber Ale', 5, 0, 0, 0, '', 'This is our flagship ale.  The label for this beer is adorned with the majestic Wapiti (aka elk).  Wapiti are abundant in northern Arizona.  They are large and beautiful creatures, which is why we chose this animal to represent this beer.  Wapiti Amber Ale is hand crafted with mountain pure water, two row malted barley, yeast and Yakima Valley hops.  Our brewers use traditional methods to create this full-bodied amber ale with a distinct hoppy aroma.  Wapiti Amber Ale should be enjoyed cool, not cold, to best experience the complex character and flowery aroma.  Serve at 43-47 deg F.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ef59edaf37eb4ada8fb6bcbb904ccbf2', '6373fec6e4d84db5ae7c64f6230502ce', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Fahrwasser Fairway Pilsner', 5, 0, 0, 0, '', 'Reid is our onsite go-to beer guy who handles the bulk of our to-go beer sales. Reid is a full-time UAA student who manages to sell beer at MSBC, run a side welding business, keep the golf discs flying all year-round & create music with his band, Bushwood. He wrote and performed his song \"No 9 to 5\", which resonates his idea of a fairway to heaven.\r\n\r\nFAHRWASSER means \"fair water\" or \"fairway\". This inspired pilsner breaks par with every sip.\r\n\r\nAvailability:\r\nAK - draft and 22-oz bottles (limited release begins 05/15/2009)');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ef8f1df19f9f4b99b0d2dd7245d6de96', '586b36c006c048efb522f39ed80bc6bd', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Rye Squared', 9, 0, 0, 0, '', 'Double the malt, double the hops, and double the flavor of the original Rye Pale Ale recipe. (Hence the name Rye Squared.) With its mammoth hop aroma, bitterness and flavor, this beer is not for the faint at heart. The Rye Squared clocks in at a hefty 9.5% ABV so double your pleasure and double your fun because Terrapin went a little crazy with this one!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ef938a13fddb48f399a2a59b4110badc', 'f5b9ebafbed64d7d8dbc9643e9eef7a9', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'e2617cdeed8f4eb69e01c49f84dd8000', 'Full Moon Pale Rye Ale', 5, 0, 0, 0, '', 'Tawny red and full of malt and hops, Full Moon''s unique flavor truly satisfies. The smooth sweetness of malted rye and barley is complemented by generous helpings of Willamette and Cascade hops, resulting in an assertive American amber ale.');
