INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f103fa08cf7c4e25a2b5c31e158fac97', '20db57ff2ecf445c81511160d57e84c9', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Liberation Ale', 6, 0, 0, 0, '', 'With about 6.0% ABV, this one will surely warm the ol'' gullet during a cold central Texas winter - both days! Our India Pale Ale (IPA) is light in color and strong in hop character. Dry hopping with Cascade hops, gives this winter favorite a delicious citrus note reminiscent of a Texas Ruby Red. Yes, it''s warming but you don''t need to be huddled around the furnace to enjoy this one! IPA fans really love this ale during a beautiful Texas winter on the porch or indoors. Available December - April');
