INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f115f1ddbfe441a584a802676593723d', 'b4724c113f634dd7a21151d616392a60', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Hefeweizen', 5, 0, 0, 0, '', 'Paulaner Hefe-WeiÃŸbier is the best-selling beer by the Paulaner Brewery. Specially produced top-fermented yeast is what gives it its unmistakeable character: sparkling light, fruity, and just a tiny bit bitter. Because it is not filtered during the brewing process, it retains its originality and the many vitamins, minerals and trace elements.\r\n\r\nHefe Weissbier NaturtrÃ¼b:\r\n12.5% original wort; 5.5% alcohol; 44 kcal/100 ml');
