INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f19010cb834f4b28b4d57c7b0a20baba', 'f773b893039e4b3894d2dc8e61a8beae', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Bitter Woman IPA', 5, 0, 0, 0, '', 'Lest we forget Aunt Cal, an early resident of Lake Mills.  Local history remembers her for blindly running into a hitching post and saying, \"Excuse me, Dr. Dodge!\"  It was said that she was an old sweetheart of the famous American poet, Henry Wadsworth Longfellow.  And she still had the love letters to prove it!  Sadly, Aunt Cal never wed.  We brewed our Bitter Woman IPA the way we imagine Aunt Cal may have been, very fruity and intensely bitter.  So lift up a pint of Bitter Woman IPA and toast Aunt Cal and the bitter woman you know.  Cheers!\r\n\r\nBitter Woman IPA is our Wisconsin variation of an India Pale Ale.  This beer is intensely bitter with a mighty hop flavor and aroma.');
