INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f1cc9c0cb2ae4d7daad98aa6490f78db', '457b2dbd441b4eee9e5881835ad40b94', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Venom', 5, 0, 0, 0, '', 'This American-Style Pale Ale is aggressively hopped giving it a citrusy flavor and aroma. No antidote needed. This beer is dark-golden, medium-bodied and very â€œhoppy.â€ It is American-style because American-grown hops are used rather that European.');
