INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f2f13c1a648b45d096ffcc29add960c7', '243b8f4ff3b74c7dba16bd88933ee0cd', 'bf3112301857461f82c7633c0a695896', 'a9b5c37e0933470888b2ccf703af580e', 'Heavenly Hefeweizen', 4, 0, 0, 0, '', 'Iâ€™m sure everyone here knows, Pittsburgh has some humid summers.  What can you do to escape the heat and enjoy yourself?  Well Iâ€™ve got the answer.  How about a light thirst quenching Hefe Weizen (pronounced hefa Vite zen) in the cool environment of our Hop Garden patio.  I can hear you wondering, what is a hefe weizen?  Allay your fears my friends because Iâ€™m going to tell you.  A hefe weizen is a special style of beer made with malted wheat and malted barley.  Hefe weizens are from Germany.  This beer is top fermented (an ale) with a very special yeast.  The Hop levels are kept deliberately low in order to bring out the character of the yeast.  If you notice the nose of the beer, it has a clove-like or fruity aroma.  The grain bill includes 50% wheat malt and 50% barley malt.  It is served very carbonated and a touch cloudy.  It is cloudy because it is served unfiltered.  The remaining yeast contributes flavor, adds B vitamins, and improves the beer as it ages.');
