INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f488f5a9a19343a5a57bc654628e8b12', '975a06569d444c38a7c7b3cd9ee4a2b0', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Strike Out Stout', 4, 0, 0, 0, '', '\"Strike Out\" is brewed with 6 malts including a balanced portion of chocolate and crystal malts. It is also brewed with 5% flaked oats for a velvet-like mouth feel. English pale, Munich and black malt, plus roasted barley round out the malt bill. Considerably lower in alcohol than both Benchwarmer Porter and Old Slugger Pale Ale, \"Strike Out\" is a well-rounded stout, opaque black in color with a roasted palate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f48b5b2454194975bbcc63477a2a3f02', '44c2771197204d889aaed7f6cd1658a0', '22710fa91bbf4454b94555720f6a33dd', '84bca21ce52244db83158e4971bd7866', 'McCafferty''s Ale', 0, 0, 0, 0, '', 'This is a true Celtic Red ale thatâ€™s as faithful as its namesake. With a smooth balance between malt and hops, itâ€™s sure to become a pubhouse favorite');
