INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f55142b80e9b4b77aa27500cb7c4a910', 'be7d66fc42624f0484cd29faf5c3b4d9', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Chico Estate Harvest Ale', 6, 0, 0, 0, '', 'We wanted to see if we could grow hops at our brewery in Chico, California so we planted our own hop field selecting our prized Cascade and Centennial varieties along with some specialty hop varieties to experiment with. To our surprise, we not only could grow hops, we were also able to harvest them in late summer due to Chicoâ€™s ideal climate. \r\n\r\nChico Estate Harvest Ale is one of the very few estate harvest ales produced anywhere in the world today. All the hops in the beer are grown naturally on the premises of our brewery in Chico. We pick the hops ourselves and then take them directly to the brew kettle, without being dried, just after picking so they retain nearly all of their natural oils and resins. It is made with Cascade, Centennial and Chinook hops. Until now, this beer has only been available in draft. Starting this year, we will be bottling it on a very limited basis, with plans to expand its availability as we expand our Chico hop field in the coming years.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f55885aaee754421b8d57f17f3c53269', 'f743f04357824c41994f695c5034da14', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Troegenator Double Bock', 8, 0, 0, 0, '', 'The Troegenator Double Bock, is a dark, strong lager (8.2% abv). It pours into a glass with a bronze to brown color, fluffy white head and bready malt aroma. The Troegenator leaves a rich, warming feeling and subtle spicy flavors. The style, Double Bock, dates back a century or so ago. During periods of fasting without solid foods, the Monastic brewers relied on the double bock; a stronger, richer beer to fulfill their basic nutritional needs. Known to them as \"liquid bread,\" a double bock has a strong malt aroma and chewy rich body. Traditionally these brewers ended the name of their double bock with the suffix \"ator\", ex. Celabrator, Illuminator, Subliminator... In the spirit of the tradition we give you the Troegenator to provide warmth and richness through the early spring months. A double bock of epic proportions, beware,\r\nthe Troegenator is deceiving smooth and delicious.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f562c79a378640fe9314ef7f8d22700e', 'eec73194c4d941d99cd2a2b83d060893', '4fcd53c380e347edb1ca81489b03f902', '2a6b815eb1624f47b33d1c5a753e5bd6', 'Black Lava Lager', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f563dc11b3ac45019b9e08f0895cbaff', 'cd26da96e91f45dfa01d2f3b721c6728', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Fox Light', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f56aa365b0b24632b0729fb28249f333', '048f9156b40a469781e7e19d6321d6b5', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Samuel Adams Pale Ale', 5, 0, 0, 0, '', 'Samuel Adams® Pale Ale is a delicious, lighter bodied beer with a delightfully fresh taste. Its unique blend of two row malts add a rich harmony of sweet flavors that are complimented by the traditional earthy hop character imparted by authentic British hops. The fermentation character of the ale yeast adds a rich bouquet of fruit and ester notes that add another layer of complexity to this popular style');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f5979f484ae649a1a118aecf271de409', '1cd8f27644384428bb7bf05cfd5c20bb', '98b7246d5e1b4592b15adced83ab36d0', 'e3b348b5cd8a45d3bcd2054ff11fdeb7', 'Scotch Ale', 7, 0, 0, 0, '', 'Originally brewed exclusively for beer shows, this award-winning ale has always been a Brau Brothers favorite! This is not your typical Scotch Ale. Combined with traditional malt\r\nsweetness is a distinct smoke flavor derived from authentic peat-smoked malt. This beer will change your opinion about Scottish ales due to its drinkability. Hop flavor and bitterness are minor, yet balance out this malty beer.\r\n\r\nBrau Scotch Ale is copper to amber in color with an off-white head of tightly laced bubbles. Wide-bowled glassware will allow the sweet and smoky aroma to escape. This ale can be served from 34- 50 degrees Fahrenheit. Lower temps will make it easier to drink while higher temps will enhance both malt and hop flavor. Portion control is important as this beer.');
