INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f5eb6cc8d671428f87235752c71377e8', '81cb183e7edf438998bd8652c9b33c6f', '98b7246d5e1b4592b15adced83ab36d0', '4dc8b652ba0446238942f5b0340754d0', 'Piston Bitter', 5, 0, 0, 0, '', 'A full bodied special bitter brewed with British malt and American hops');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f600dca082e24efab50863b7c97c850d', 'b75f8b99bf384c25a4b7013902fc6e25', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Hop Juice Double IPA', 9, 0, 0, 0, '', 'Here at Left Coast Brewing Co. we pride ourselves on being one of the first breweries to pioneer a Double IPA style beer. In 2003, we brewed our first Double IPA, and haven''t looked back since. This hop monster uses Premium American 2- Row and a touch of light crystal malt to create a solid malt foundation. The recipe calls for hops to be used in every step of the brewing process; in the mash, in a hop back, in the fermenter, and in the bright tanks. We use hop extract, hop pellets and hop flowers, hence the name Hop Juice. Hop Juice spends more than 4 weeks dry hopping in the fermenter and the bright beer tank. It is approximately 9.4% abv and has massive IBUs. Hop usage is over 4lbs per barrel. Hopeheads, step up to the plate!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f6327594f88d478b96f572ff0bcb8ca2', '2c8176e3b6964d889f0b62b1a196bf64', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Cream Stout', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f66cfca51e1d4390902fdff705e85aeb', '06f1c8a9bb74470981730c2969378ee8', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Stone Pale Ale', 5, 0, 0, 0, '', 'Our flagship ale, Stone Pale Ale is our Southern California interpretation of the classic British pale ale style. Deep amber in color, Stone Pale Ale is robust and full flavored. A delicate hop aroma is complemented by a rich maltiness. This is an ale for those who have learned to appreciate distinctive flavor. Stone Pale Ale is great by itself, or with food that requires a beer of character.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f6737cdd276549688235c80598fd8cdc', '226bc87deeea4f1fb202a68ed4c2ac81', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Misery Bay IPA', 6, 0, 0, 0, '', 'The view from Oliver Perry Monument across Lake Erieâ€™s historic Misery Bay provides a constant reminder of the hardships endured during the Battle of Lake Erie. Misery Bay IPA is brewed as a tribute to Misery Bay and Graveyard Pond, final resting place for many brave sailors and soldiers. Misery Bay IPA offers a complex malt profile loaded with American hops at 75 IBUâ€™s, and finishes at 6.5 % alcohol by volume.');
