INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f6bb62c7db8f4828bddfa7388d1a200a', 'f4b481b5e94045ef96e5f836e2ff6a7b', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Thoms Special Ale', 6, 0, 0, 0, '', 'This deep copper colored Ale is named after Steve''s homebrew buddy Thom Phillips, who has had a part in helping to formulate some of the final Ale recipes at the Livery. Hints of caramel make their way through the aromatic bitterness of Centennial hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f6d2fccd160d44bda1c0731bf16e5513', '9c3ee95b24104dfd9b624cf02a81b1df', 'b7ee8858a0b549ddb2361e1ed313f6e1', '96c00ea9e2344860bf6d7140b5377d08', 'Bouldevard ZÅŒ', 4, 0, 0, 0, '', 'Boulevardâ€™s summer seasonal is our interpretation of a classic Belgian witbier. ZÅŒN (Flemish for â€œsunâ€) combines the subtle flavors of coriander and orange peel with other traditional ingredients to create a delightful, refreshing summertime brew. Available from May through August, in bottles and draught.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f6d30c7494db4a759c56a1f5b65cd08c', 'f743f04357824c41994f695c5034da14', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Scratch #17 2009', 5, 0, 0, 0, '', 'O.G.: 12.7 Plato\r\nA.B.V.: 5.6%\r\nIBU: 43\r\nMalt: Pils\r\nYeast: Augustiner\r\nHops: Select, Tradition, Spalt, Glacier');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f6e6db2229e54b43a3bba007d13720b3', 'b65808eb74e74797ad9375fc1a220b9b', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Shoals Pale Ale', 4, 0, 0, 0, '', 'Our interpretation of a classic English beer style is copper-colored, medium-bodied and highly hopped. Its flavor is delightfully complex: tangy fruit at the start, with an assertive hop crispness and a long malty palate that one well-known beer writer has compared to the flavor of freshly-baked bread.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f74a0300ae4645799aee869c544965c3', 'b567c1573e1d4d3c91447a30b7e08f02', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Fire Rock Pale Ale', 5, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f74e77449b044bfe8e7847e71ebc3e65', 'b67c5d7317f84d76a2a3874cf45661bb', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'High Seas IPA', 7, 0, 0, 0, '', 'Our interpretation of a legendary style ale is not for the timid. Assertively hoppy and dangerously seductive. A skillful blend of three premium barley malts with generous amounts of Northern Brewer and Cascade Hops creates a special ale to satisfy even the most demanding palate.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f75bb0fc70d84d38ae218dfedf19c814', '9afdf27a7c57483bbe140f42040aae13', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Midwest IPA', 7, 0, 0, 0, '', 'It means India Pale Ale.  It''s all about the hops on this one.  Brewers use hops to add bitterness and aroma to their beers.  If not for hops your beer would be too sweet.  Our IPA uses plenty of Chinook and Columbus hops from the Pacific Northwest.  The flavor can best be described as strong resiny grapefruit.  The long drawn out hop flavor is essential to the character of the beer.  So smack your buds on this one all you HOP HEADS.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f75ce8c83b55491bb79ebd026de1b640', '81cb183e7edf438998bd8652c9b33c6f', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Donovan''s Red', 5, 0, 0, 0, '', 'Named after Donovan''s, a 19th century Irish restaurant in downtown Waterbury. This medium-bodied, red-colored ale has a nice hop flavor and aroma.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f7851cdd068d477d8c531c0d190fd56b', '226bc87deeea4f1fb202a68ed4c2ac81', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Golden Fleece Maibock', 8, 0, 0, 0, '', 'As spring emerges, Golden Fleece Maibock captures center stage. This fine lager is a pleasurable reward for enduring the doldrums of Erie Pennsylvaniaâ€™s harsh Lake-Effect ice and snowstorms. Celebrate the transition into spring! Golden Fleece Maibockâ€™s deep golden color leads into a sweet malty flavor with a light hop finish. Maibock says, â€œRAM ITâ€ to winter with 8.5% alcohol by volume â€“ just enough to take the chill off your day.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f78f20bc6ace456f9aa5053cf06a208b', '282d2200cabb4923a97daab4af52f023', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Black Magick', 15, 0, 0, 0, '', 'This is an Imperial Stout that is Brewed to great strength and complexity. We then gently age that beer in Elaigh Craig 13 1/2 year old Bourbon Barrels for 1 yr. and then primed and bottled to bottle condition for continued aging and celler life. Black Magick should be able to be aged up to about 5 years, to heighten the complexity and smooth nature of this beer. This beer should be opened to breath, pour into snifter and enjoy at 55-60 F. \r\n\r\nThis is a truly Barrel aged ale and is not to have a large carbonation. We bottle condition it to achieve cask like characteristics.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f798e7c8ba31415dbab5a11de614988b', '416ea173551e49e3a04d39a6a66394a9', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '530ed3c1d9724d82be1b7d6a5b4f6380', 'Road Trip Hard Cider', 6, 0, 0, 0, '', 'This hard cider is fresh-pressed with delicious, sweet-tart \"Pink Lady\" apples from the Mercier Orchards in the North Georgia mountains.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f7a2911e07db48e49fea0cc426e4e46b', 'f172eb6b9b2545a4b3118b6749328433', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Double Mountain Pale Ale', 5, 0, 0, 0, '', 'Itâ€™s easy to forget just how dynamite a well-made pale ale can treat you. Our Pale combines softness from our Pilsner malt,  a touch of sweetness from English crystal malt, and plenty of fruity, resinous Northwest hop flavor. The finish is dry, clean and refreshing.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f7c7c46ad4234e3bb91fe8f866a6048f', '0a1253249af8497c8e07bcc7866d2f95', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Pilsner', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f7e79edb6a764fdcb9b7ff1366130756', 'b9ace7f19e4649b5acd88a89eb934ab9', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Amber', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f7f0739921a4477694a261c76249d2df', '586b36c006c048efb522f39ed80bc6bd', '98b7246d5e1b4592b15adced83ab36d0', 'dde08a23bc764388a0571b10d486b6e7', 'Terrapin Midnight Project Depth Charge Espresso Milk Stout', 8, 0, 0, 0, '', 'Terrapin Midnight Project Brew Two 2009. Sometime around midnight in a city nobody can agree on, the idea for Terrapin and Left Hand to brew a collaboration beer was born. Depth Charge is the second in the series of one-time releases between the two breweries. Be wary of the calm before the storm. This creamy, deeply delicious milk stout will seduce you into submission while the explosion of hand roasted gourmet espresso will blow you into next week. We Shall Drink in the breweries. We Shall Drink in the pubs, We Shall Drink the the comfort of our homes. We Shall Never Surrender.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f8178cdca6164c9a84b19c4548408768', 'f14dbbd7386d4480918d70bf1bfe3efa', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Kitsilano Maple Cream Ale', 5, 0, 0, 0, '', '');
