INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f81b1052c654454db44607075856f5a4', '3842531cdf184adf988126b606f62a5e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Smoked Porter', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f8258e79558e47bb8d2edfc48d0f036e', '44c2771197204d889aaed7f6cd1658a0', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Double Vision IPA', 0, 0, 0, 0, '', 'Double your fun, double your pleasure and try and stay out of double trouble with this hopped up I.P.A.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f877dfec3263417699f46f51a17806ba', '5f280fa883124fac82d2c6c769d0e45e', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'Barrel-Aged B.O.R.I.S. Imperial Stout', 9, 0, 0, 0, '', 'Made from our B.O.R.I.S. Imperial Stout, that was rated one of the Worldâ€™s 50 Best Beers, and won the Gold Medal at the GABF in 2008. BARREL-AGED B.O.R.I.S. has picked up rich characters of vanilla, dark fruit, oak, and spice. Itâ€™s unbelievably complex and savory');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f8980d98752d4e489e1d64bd1ca576b0', 'a01e65ccdcb747ef8232727ac0878bc1', '4fcd53c380e347edb1ca81489b03f902', '9f01f1c4b452454d8a93ba2eb5c476de', 'Baron Helles Bock', 6, 0, 0, 0, '', 'The Helles-Bock is similar to a traditional Maibock. Bocks are traditionally brewed in the winter / early spring months and are served during the spring / early summer months. The Helles Bock has a copper golden color with a brilliant white head. The body showcases a clean sweet maltiness that is offset by just enough hops to balance it. Very smooth and easy, drinkable yet deceptive at 6.4%.\r\n\r\nAll ingredients for the beer are imported from Germany. Brewed in accordance to the German Beer Purity Law (Reinheitsgebot) of 1516.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f8983081c2aa49fb8191daca3ab71528', '416ea173551e49e3a04d39a6a66394a9', 'b7ee8858a0b549ddb2361e1ed313f6e1', 'de2b21a28d8b4ec4ba129c4d7865655d', 'Dixie Crystal', 10, 0, 0, 0, '', 'The Belgian Trippel tradition calls for a moderately heavy grist of golden pilsner malt and \"Candy\" sugar that sends the yeast into overdrive. We used local Dixie Crystal.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f8a80e07be054ad2a1153b63f60da8a5', 'ba8c3a00983942e3a1e95c60dbba90b1', '98b7246d5e1b4592b15adced83ab36d0', 'd4e5211c1aa74e4592bc9899fd3659c7', 'Hitachino Nest Japanese Classic Ale', 7, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f8abd35b34aa47488d30ca7a60e72b95', '7137c9cb29c54115b553ab53272b7bc0', 'e64b30f392b4437b82ec46e764453ac1', '8d8bee5695fc44cba4e1cdaa9968f058', 'Gordon', 8, 0, 0, 0, '', 'Gordon is a hybrid version of strong ale, somewhere between an Imperial Red and a Double IPA. We make it with six different malts and three types of hops, then dry-hop it with a mutha lode of Amarillo hops. It is 8.7% alcohol by volume, and has 85 International Bittering Units. \r\n\r\nIt features a gooey, resiny aroma and a luscious mouthfeel. Gordon is brewed with dash of chocolate malt in it, to round out its load of hops and balance the beer. The result is an assertive yet exceptionally smooth version of strong beer.\r\n\r\nWe brew Gordon in tribute to the late Gordon Knight. In addition to opening some of Coloradoâ€™s first microbreweries, Knight was a Vietnam vet, grade-A citizen, and huge promoter of craft beer. He lost his life in 2002 while fighting a wild fire outside of Lyons, Colorado.\r\n\r\nOriginally our winter seasonal beer, it has become a cult favorite of extreme-beer lovers, so we now brew occasional batches of Gordon throughout the year. Released in bottles in 2003 and 2004, Gordon is now sold in four packs of hand-labeled cans and on draft in select markets.\r\n\r\n--http://www.oskarblues.com/brew/');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('f8b7094a48614839b41c4b16df3cbb5a', '12584311798345eea2fa9614f8f03c57', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Flying Aces Ale', 0, 0, 0, 0, '', '');
