INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fa171dc3460e4979ab473728ecd7ef12', '11db376808e64df8bbcb94b3b4440a9d', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Freestyle Pilsner', 5, 0, 0, 0, '', 'As its name suggests, this Pilsner does not like to be categorized. Inquiring whether it is a German, Czech, Bavarian, American, or any other style pilsner will result in an impatient sigh and the explanation that the whole philosophy behind this pilsner is that it does not fall into any categories. True, it is brewed with traditional ingredients (soft water, pilsner malt, saaz hops, and German yeast), but it is the way that these ingredients interact, and the characteristics of the yeast, that cause this particular pilsner to defiantly stand alone. The assertively hopped Freestyle pils exudes the flavor and the aroma of the classic Saaz hop (a tribute to â€œthe originalâ€ pilsner), while maintaining enough body to balance but not overpower this hopâ€™s pleasant, spicy tone. An unhurried lagering process so frequently overlooked by American craft brewers is strictly adhered to in the production of Freestyle, which makes this beer by far the most light, clean, and quenching beer in the Santa Fe Brewing Companyâ€™s line up.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fa1c5b2cc3ec4a84939d77f72904024d', '5f280fa883124fac82d2c6c769d0e45e', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Fresh Frog Raw Hop Imperial Pale Ale', 7, 0, 0, 0, '', 'Special hoppy flavors and aromas are captured by adding freshly picked, undired hops during the harvest.\r\n\r\nThese wet hops impart a character unlike other brews, that is quite unique and satisfying for those who love hops â€“ the spice of beer. Smell the hop fields, smell the freshness.');
