INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fb6fcbb25e1d4a38a26086ae0ae106db', '47f5674e1c6f4bc18a03d78958f76f22', '0ff7f60954ba46ebbad15b9f5d0a5b8e', '0efc79b43f194933857739c6141a570b', 'Monteith''s Summer Ale', 5, 0, 0, 0, '', 'Monteithâ€™s Summer Ale is a refreshingly different beer. The opportunity to rediscover some flavour highlights of beer styles enjoyed on summer days past, and bring them back to life.\r\n\r\nAt the end of last century, in England, Europe and the Americas and in New Zealand, there was still an adherence to brew with barley, wholesome grains, hops and other traditional brewing spices.\r\n\r\nMonteithâ€™s Summer Ale is a bright gold beer with great body from four different malts. Spiced with a single hop variety and a touch of history - a little Rata honey. Subtle, but enough to make all the difference. The result is a truly refreshing herbal spiced beer brewed for the Summer Season â€” a splendid thirst quencher.\r\n\r\nMonteithâ€™s Summer Ale enjoyed ice-cold with a simple range of fruits, perhaps refreshing wedge of orange or lime. Alternatively, match with summer salads and stir-frys to complement the light flavours.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fb7031a7c78d455ca5233fd77905a335', '13e46693ec384f9183b40ee3a0560780', '4fcd53c380e347edb1ca81489b03f902', '479b8eebba71419aba1132540a002a91', 'Andygator', 8, 0, 0, 0, '', 'The Andygator is a fearsome beast...much too big for any little bottle. Don''t let his toothy grin, slightly sweet flavor and subtle fruit aroma fool you: this cold-blooded creature is a Helles Doppelbock that can sneak up on you. Sip, don''t gulp and taste the wild of Abita Andygator');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fb7cd50b75e6497f9dad9655594de3c0', '3be6b00a760647c7ba5d5de8c1bee825', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Ring Tail Pale Ale', 4, 0, 0, 0, '', 'Ring Tail Pale is light in body and straw-gold in color, with a crisp hop finish. This beer is a great choice for domestic lager drinkers.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fb82248537994277bad2a67f110baeb0', '81cb183e7edf438998bd8652c9b33c6f', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'e2617cdeed8f4eb69e01c49f84dd8000', 'Revitalization Rye', 6, 0, 0, 0, '', 'This IPA is brewed with 35% rye malt. The crisp malt character is layered with Warrior hops. Dry-hopped with Warrior and Simcoe.');
