INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fd58bcfb474a4721b3d831ae30abcb30', '839540dd5a234b39ad853696dc027d8d', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Dundee Porter', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fd60da753af24c209801e0123b66d79b', 'f773b893039e4b3894d2dc8e61a8beae', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Chief Blackhawk Porter', 5, 0, 0, 0, '', 'In 1767 a great Sauk leader was born.  His name meant \"the black sparrow hawk.\"  He came to be known as Black Hawk.  Strong beliefs, independent thinking and an unwavering commitment to his family and his people earned him a reputation as a man of integrity and courage.  In 1832, along with 1,200 of his people, Black Hawk was driven from his ancestral home during a war that bears his name.  We celebrate this Sauk leader and his courage with our BlackHawk Porter, the kind of beer that make you say, Ma-ka-tai-she-kia-kiak!\r\n\r\nChief BlackHawk Porter is a robust black and sharply bittersweet ale.  This style was traditionally the session beer consumed by the porters in London.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fd85e009010744779ac62772d5a43e60', 'cdafaf89b3d14193a41c9a2be4b2b29d', 'e64b30f392b4437b82ec46e764453ac1', 'f65acca09e8d4389afc6a86dda0eb7d3', 'The Abyss', 11, 0, 0, 0, '', 'The Abyss has immeasurable depth inviting you to explore and discover its rich, complex profile. Hints of molasses, licorice and other alluring flavors draw you in further and further with each sip. And at 11% alcohol by volume, you will want to slowly savor each and every ounce. \r\n\r\nNovember 2008 marks the third release of this dark and mysterious imperial stout. Limited availability in wax-dipped 22-ounce bottles and on draft at a few select establishments. \r\n\r\nâ€œThe Abyss was one of those beers I didnâ€™t want to end. I was totally blown away - this is precious stuff.â€ Christian DeBenedetti, beer writer and Menâ€™s Journal contributor');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fd872db81f734b0d9a98e991bba9f9f4', '2a374a4f09cf462aadaeab8b3ff45a8e', 'e315bd61d4f94ab3a67b28feec8a5343', '958c442add4742fbaba4dd585d951403', 'Pilsner', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fd9020a571b24712a36c2b0f3b7fe3e9', '52a95674252c4c3780cbba8631bf2efb', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Vanilla Java Porter', 6, 0, 0, 0, '', 'A robust porter made with chocolate malt.  We blend it with Vanilla and Java beans, and balance it with U.S. Golding Hops.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fd9af1811b7442cd9129b6c2e8bb02c4', '0024fad54e5e46279818191654813d1b', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Total Eclipse Black Ale', 5, 0, 0, 0, '', 'Total Eclipse Black Ale has been described as similar to a light, dry stout. Characterized by its distinctive hop aroma and rich, black color, Total Eclipse redefines the way you think about a dark ale. Brewed at a low temperature to create a refreshingly dry finish, Total Eclipse uses only the finest two row malted barley and hops grown in the great Pacific Northwest. This combination results in a clean, crisp, hand-crafted experience. Hoppy Brewing Company has never used any artificial preservatives, flavors, or colors in any of its ales. The Hoppy label is your guarantee of purity. \r\nItâ€™s â€œtotallyâ€ out of this world delicious!!!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fdd06089c754417c969083ef129fb141', '7bd3c9e042314a65aa752dbd60807b0e', '22710fa91bbf4454b94555720f6a33dd', '6a473da459ad4f39aefcc40ff5092b19', 'Alpha Klaus Xmas Porter', 7, 0, 0, 0, '', '');
