INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fdd47a71cce64d5ab3d24e298ffae0f8', '763793ca74884cb58e6ae19b2db29217', '4fcd53c380e347edb1ca81489b03f902', '2fd1aaa653d64bc68d5d304d86ed3f8c', 'Lionshead', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fde8c13672594885972cfe9f9cb85f42', '7a20514d64d549d6bdcdc3cea4cedbba', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Dock Street Amber', 6, 0, 0, 0, '', 'Dock Street Amber is a classic, top fermented ale and is the company flagship beer. \r\n\r\nIt is brewed with American Cascade hops and two row imported pale and caramel malts and then dry hopped. Our traditional brewing process gives this beer its subtle, complex and fruity character and its distinctive hop \"nose.\" The result is an exceptionally balanced premium full bodied ale that finishes clean and smooth on the palate. It appeals to gourmets and beer aficionados.\r\n\r\nOur goal in brewing the Dock Street Amber was to produce a phenomenal tasting American beer. At the time it was created, most all full-bodied beers were imports.\"');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fe01746d36344a22acd1c74e31d08622', '47a3de1b57274a59b0ff59c5d112c6d5', 'e64b30f392b4437b82ec46e764453ac1', '5aebc21dcb62473f8bbd96b0f199afbe', 'Saranac India Pale Ale', 5, 0, 0, 0, '', 'A hop lover''s delight. In the India Pale Ale tradition this brew is very hoppy in both aroma and flavor from the generous amounts of cascade hops used in brewing. Look for a medium to full body and golden straw color.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fe08e79bf58b46a190e347428bb802e2', 'c0f52fdcf9a94e39a0ada8d337d89d09', 'e64b30f392b4437b82ec46e764453ac1', '6f227f04c366464992a1518b36ac651a', 'Duck-Rabbit Amber Ale', 5, 0, 0, 0, '', 'Duck-Rabbit Amber Ale is a medium bodied beer with a lovely tawny copper or bronze color. This brew emphasizes malt complexity with layered caramel malt flavors. We put a lot of effort into getting this amber ale just right and we''re extremely proud of the result!');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fe0bff721252436bb2db150d3cb680f4', '924f4d2594fe47a0a732a9e14bc24ad6', 'e64b30f392b4437b82ec46e764453ac1', 'e29d61097ffb49dca3de0c5fffb40ece', 'Raison D''Etre', 8, 0, 0, 0, '', 'A deep, mahogany ale brewed with beet sugar, green raisins, and Belgian-style yeast. As complex as a fine, red wine. Voted \"American Beer of the Year\" in January 2000 by Malt Advocate Magazine.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fe0de64277df43b19f53ba34e876ace3', '77ae58bf8cde4f85ab8b274e3a51f6a9', '4fcd53c380e347edb1ca81489b03f902', '8f194f14f95d49b7b7de2c49819e4033', 'DoppelSticke', 8, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fe1f7644a94b4df29fa468947bb7f07f', '3c1a29f6db284abda8d558a43582ba35', 'e64b30f392b4437b82ec46e764453ac1', '4109d1313e64436aabd0a8d42e77221f', 'NÃ¸gne Ã˜ Brown Ale', 4, 0, 0, 0, '', 'A dark brown English ale, in which classic English malts meet the spicy hoppiness of the new world.  Recommended serving temperature 8Â°C/45Â°F. Goes very well with â€˜pub grub.â€™');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fe1fe943d8e543fba7ae842d99fbd3fa', '5f1779dae1624f62baaef8bcd67e0d18', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Paradise Pale Ale', 4, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fe45f2f5e72949669138d14f5b0614b3', 'f6b4fa787e0a43418b88dcf6cf75b5ab', '0ff7f60954ba46ebbad15b9f5d0a5b8e', 'e2617cdeed8f4eb69e01c49f84dd8000', 'Caulfield''s Rye', 4, 0, 0, 0, '', 'Our rye beer is made with 20% flaked rye and rye malt. The addition of rye creates a dry, spicy flavor with a crisp, grainy aroma. We went with a lighter color and lower bitterness to compliment these flavors. It has an alcohol content of around 4.9%.');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fe4c77b4330646d889d1d4ddf9e72442', '6cb44a9608c34fab85bdc0945cc5c418', 'e64b30f392b4437b82ec46e764453ac1', 'c2ec57bc40024e8fb41c864c4ee998d1', 'Plank Road Pale Ale', 0, 0, 0, 0, '', '');
INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('fe69dfbda02c4c8fa5858f88700df260', 'd5b27251496640ba84e3b912888dd0fa', 'e64b30f392b4437b82ec46e764453ac1', '336a0c2bcdfe4dec8856073a93ce5fca', 'Coopers Best Extra Stout', 6, 0, 0, 0, '', 'Now here''s a beer with punch! \r\n\r\nCoopers Best Extra Stout is a beacon for lovers of a hearty brew. With its robust flavour it is everything a stout should be. \r\n\r\nBrewed naturally using a top fermentation method, Coopers Stout''s unique rich, dark texture comes from specially roasted black malt. \r\n\r\nCoopers Best Extra Stout contains no additives and no preservatives.');
