INSERT OR IGNORE INTO Beers (Id, Brewery_Id, Category_Id, Style_Id, Name, AlcoholByVolume, InternationalBitternessUnits, StandardReferenceMethod, UniversalProductCode, Filepath, Description) VALUES ('ffcb2c1b731d40e5a7fd5e11ac9163f7', 'be7d66fc42624f0484cd29faf5c3b4d9', 'e64b30f392b4437b82ec46e764453ac1', '5caf018e53b74616b6ecb9a38af440b9', 'Bigfoot', 9, 0, 0, 0, '', 'From the Sierra Nevada Brewing Co. website:\r\nThis year marks the 25th release of Bigfoot®. Our award-winning barleywine boasts a dense, fruity bouquet, an intense flavor palate and a deep reddish-brown color. Its big maltiness is superbly balanced by a wonderfully bittersweet hoppiness. \r\n\r\n');
